INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_EinerVonEuchWerden_15_00', 'Jak mogę zostać członkiem waszego obozu?', 1, 37, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_EinerVonEuchWerden_01_01', 'To proste. Złap jakiś kilof i złaź do kopalni. Pół wydobytej przez ciebie rudy pójdzie na ochronę, drugie pół powinno ci wystarczyć na przetrwanie.', 1, 37, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_EinerVonEuchWerden_01_02', 'Cena, którą Gomez każe sobie płacić za jego dostawy to zdzierstwo, ale chyba lepsze to niż ryżowa dieta, serwowana wszystkim w Nowym Obozie.', 1, 37, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_WichtigePersonen_15_00', 'Kto tu dowodzi?', 1, 37, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_WichtigePersonen_01_01', 'Magnaci. To oni organizują wymianę rudy z królem. Im jesteś ważniejszy, tym większą dostajesz dolę.', 1, 37, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_DasLager_15_00', 'Jest tu coś ciekawszego do oglądania niż te chaty?', 1, 37, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_DasLager_01_01', 'Cóż, wieczorem można zajrzeć na arenę, popatrzeć, jak Strażnicy gruchoczą sobie kości.', 1, 37, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_DasLager_01_02', 'Piękny widok. Wart każdej ceny.', 1, 37, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_DieLage_15_00', 'Jak leci?', 1, 37, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_1_DieLage_01_01', 'Spędziłem ostatnie dwa tygodnie pracując w kopalni. Teraz chcę wreszcie odpocząć, więc zejdź mi z oczu.', 1, 37, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_EinerVonEuchWerden_15_00', 'Chcę do was dołączyć.', 1, 10, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_EinerVonEuchWerden_02_01', 'Nie bardzo wiem, czemu miałbyś chcieć na ochotnika pracować w kopalni. Ludzi takich jak ty spodziewałbym się raczej w zamkowej straży.', 1, 10, 2, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 10, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_WichtigePersonen_02_01', 'Fletcher, Bloodwyn i Szakal zbierają w Zewnętrznym Pierścieniu pieniądze za ochronę. Każdy z nich ma swój rewir.', 1, 10, 2, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_WichtigePersonen_02_02', 'Tak długo jak są po twojej stronie - jesteś bezpieczny.', 1, 10, 2, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_DasLager_15_00', 'Chciałbym dowiedzieć się czegoś więcej o waszym Obozie.', 1, 10, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_DasLager_02_01', 'Powinieneś pogadać z Cieniami. Oni będą mogli powiedzieć ci więcej niż ja. Tylko uważaj na siebie. Większości z nich nie można ufać do końca.', 1, 10, 2, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_DieLage_15_00', 'Jak wygląda życie tutaj?', 1, 10, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_DieLage_02_01', 'Jeśli przysłali cię Magnaci, powiedz im, że nie szukam kłopotów. Ode mnie nikt się niczego nie dowie.', 1, 10, 2, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_DieLage_02_02', 'Wystarcza mi to, co nam dają.', 1, 10, 2, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_DieLage_15_03', 'Nikt mnie nie przysyła! Dopiero co tu przybyłem!', 1, 10, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_2_DieLage_02_04', 'Żółtodziób, tak? Nowi zawsze pakują się w jakieś paskudne kłopoty. Nie chcę mieć z tobą nic wspólnego, jasne?', 1, 10, 2, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_EinerVonEuchWerden_15_00', 'Co mam zrobić, żeby do was dołączyć?', 1, 35, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_EinerVonEuchWerden_03_01', 'Jestem zwykłym Kopaczem. Moje zdanie się nie liczy. Powinieneś porozmawiać ze Strażnikami, albo z Cieniami.', 1, 35, 3, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 35, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_WichtigePersonen_03_01', 'Gomez. Mieszka w zamku. Ale my - Kopacze - mamy dość kłopotów z jego Strażnikami.', 1, 35, 3, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_WichtigePersonen_03_02', 'Lepiej trzymać się od nich z daleka. Jeśli wejdziesz im w drogę - masz kłopoty.', 1, 35, 3, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_DasLager_15_00', 'Co warto tutaj obejrzeć?', 1, 35, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_DasLager_03_01', 'Cóż, jeśli lubisz hazard, powinieneś zajrzeć wieczorem na arenę. Jeśli chcesz coś kupić, idź na targowisko.', 1, 35, 3, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_DasLager_03_02', 'Sprzedają tam prawie wszystko. Jeśli potrzebujesz mapy - porozmawiaj z Grahamem. Jego chata leży niemal dokładnie naprzeciw zamkowej bramy.', 1, 35, 3, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_DieLage_15_00', 'Co się dzieje?', 1, 35, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_DieLage_03_01', 'Sam się dowiesz w swoim czasie. Miej oczy szeroko otwarte. Pilnuj się zwłaszcza w nocy.', 1, 35, 3, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_3_DieLage_03_02', 'Od kilku dni nie wyspałem się porządnie. A w tej kolonii kto nie śpi, ten pracuje na dwie zmiany!', 1, 35, 3, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_EinerVonEuchWerden_15_00', 'Dzięki! Trzymaj się!', 1, 15, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_EinerVonEuchWerden_04_01', 'Uważaj na siebie, chłopcze.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_EinerVonEuchWerden_15_01', 'Co mam zrobić, żeby dołączyć do tego obozu?', 1, 15, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_EinerVonEuchWerden_04_04', 'To znaczy jako Strażnik, albo Cień? To nie takie proste, kolego. Czeka cię kilka sprawdzianów zanim stary Thorus pozwoli ci spotkać się z Gomezem.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_EinerVonEuchWerden_04_02', 'No i musisz przekonać do siebie tutejszych tuzów. Ale dopóki nie będziesz należał do obozu, ludzie nie będą traktowali cię poważnie.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_EinerVonEuchWerden_04_03', 'Na twoim miejscu zamieniłbym słowo z kilkoma Cieniami. Może któryś z nich zechce ci pomóc. Oczywiście, jeśli dasz mu coś w zamian.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_WichtigePersonen_15_00', 'Kogo warto tutaj poznać?', 1, 15, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_WichtigePersonen_04_01', 'Jako nowy powinieneś dbać o dobre stosunki z Gravo. Może się wydawać zwykłym Kopaczem, ale potrafi sobie radzić nawet z Magnatami.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_WichtigePersonen_04_02', 'Jak podpadniesz kiedyś ludziom Gomeza, on może cię wyciągnąć z kłopotów.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_DasLager_15_00', 'Co warto tutaj zobaczyć?', 1, 15, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_DasLager_04_01', 'Jeśli nie masz ochoty harować w kopalni, trzymaj się terenu pomiędzy północną bramą a bramą zamkową.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_DasLager_04_02', 'Jak będziesz miał szczęście, Thorus lub Diego mogą cię o coś poprosić. Wyrobienie sobie chodów u zaufanych ludzi Gomeza może ci tylko wyjść na dobre.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_DasLager_04_03', 'Albo może wpadniesz na jakiegoś maga. Czasem proszą ludzi o różne drobiazgi. I dobrze płacą.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_DasLager_15_04', 'Magowie opuszczają czasem zamek? Kiedy?', 1, 15, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_DasLager_04_05', 'Skąd mam wiedzieć? Spytaj ludzi, którzy tam mieszkają.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_DieLage_15_00', 'Co słychać?', 1, 15, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Vlk_4_DieLage_04_01', 'To samo, co 20 lat temu. Nic się nie zmieniło od tej pory.', 1, 15, 4, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_EinerVonEuchWerden_15_00', 'Nie przydałby się wam dodatkowy człowiek?', 1, 7, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_EinerVonEuchWerden_06_01', 'Jesteś tu nowy, co? Jeśli chcesz szybko dołączyć do jakiegoś Obozu, spróbuj u tych świrów z sekty. Nie są zbyt wybredni, jeśli chodzi o nowych członków.', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_EinerVonEuchWerden_06_02', 'Nie przyjmujemy byle kogo. No, chyba że chcesz pracować w Starej Kopalni!', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 7, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_WichtigePersonen_06_01', 'Thorus dba tu o względny porządek. Nad nim jest już tylko Gomez.', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_15_00', 'Jestem tu nowy.', 1, 7, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_06_01', 'Właśnie widzę.', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_15_02', 'Co słychać?', 1, 7, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_06_03', 'Jak będziesz sprawiał kłopoty, dostaniesz w ucho.', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_Verstehe_15_00', 'Rozumiem.', 1, 7, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_WasIstAerger_15_00', 'Co masz na myśli mówiąc "kłopoty"?', 1, 7, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_WasIstAerger_06_01', 'Większość Kopaczy płaci nam za ochronę.', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_WasIstAerger_06_02', 'Jak zaczepisz któregoś z nich, będziesz miał do czynienia z nami.', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_WasIstAerger_06_03', 'Jeśli złapię cię na grzebaniu w cudzych chatach...', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_WasIstAerger_15_04', 'Dobrze, dobrze. Zrozumiałem aluzję.', 1, 7, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DieLage_15_00', 'Jak leci?', 1, 7, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DieLage_06_01', 'Szukasz kłopotów?', 1, 7, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_EinerVonEuchWerden_15_00', 'Co mam zrobić, żeby zostać jednym ze strażników Gomeza?', 1, 26, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_EinerVonEuchWerden_07_01', 'Ty?! Chyba żartujesz. Myślisz, że możesz tu przyjść i tak od razu dostać się na sam szczyt?', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_EinerVonEuchWerden_07_02', 'Strażnicy Gomeza to najlepsi z najlepszych.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_EinerVonEuchWerden_07_03', 'Będziesz musiał powoli piąć się do góry, i udowodnić swoją lojalność jako Cień.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 26, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_WichtigePersonen_07_01', 'Thorus trzyma rękę na pulsie. Diego jest jego porucznikiem.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_WichtigePersonen_07_02', 'Jeśli naprawdę chcesz do czegoś dojść, powinieneś porozmawiać właśnie z nimi.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_15_00', 'Wszyscy tutaj pracują dla Gomeza?', 1, 26, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_07_01', 'Nie. Większość z tych ludzi to zwykli Kopacze.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_07_02', 'Dla Gomeza pracują tylko Cienie... No i my - Strażnicy.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_WasIstAerger_15_00', 'Czym się zajmują Strażnicy?', 1, 26, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_WasIstAerger_07_01', 'Pilnujemy porządku w Obozie i dbamy o bezpieczeństwo Kopaczy.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_WasIstAerger_07_02', 'Gomez wypłaca nam żołd. Dodatkowo, Kopacze płacą za ochronę. To całkiem lukratywne zajęcie!', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Schatten_15_00', 'Jaką funkcję pełnią Cienie?', 1, 26, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Schatten_07_01', 'Cienie dbają o to, żeby ludzie wypełniali polecenia Gomeza.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Schatten_07_02', 'Większość z nich to zwykłe lizusy, próbujące piąć się do góry. Jeśli chcesz dojść do czegoś w tej kolonii, powinieneś zacząć jako Cień.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Schatten_07_03', 'Jak odsłużysz swoje bez żadnej wpadki, kto wie? Może zostaniesz jednym z nas.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Schatten_07_04', 'Jak już będziesz u Gomeza, nikt z kolonii nie będzie ci uprzykrzał życia.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Buddler_15_00', 'Co robią Kopacze?', 1, 26, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Buddler_07_01', 'Dobre pytanie! Te krety nie powinny być nigdy wypuszczane z kopalni.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Buddler_07_02', 'Po jakimś czasie spędzonym pod ziemią, Kopacze wychodzą na górę, żeby przepuścić swój urobek.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Buddler_07_03', 'Jak już wszystko wydadzą - wracają do kopalni. I tak przez całe życie.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DasLager_Buddler_07_04', 'Wyglądasz mi na kogoś stworzonego do czegoś więcej niż machanie kilofem. Pogadaj z Thorusem, jeśli jeszcze tego nie zrobiłeś.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DieLage_15_00', 'Co słychać?', 1, 26, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_7_DieLage_07_01', 'O tobie? Nic. Dopóki nie dołączysz do któregoś z obozów, ludzie będą cię ignorowali, chłopcze.', 1, 26, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_EinerVonEuchWerden_15_00', 'Chciałbym zostać strażnikiem.', 1, 24, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_EinerVonEuchWerden_13_01', 'Zatem długa droga przed tobą, chłopcze!', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 24, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_WichtigePersonen_13_01', 'Ja. I dobrze ci radzę: uważaj na to, co mówisz, chłopcze!', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_15_00', 'Jak mogę się dostać do zamku?', 1, 24, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_13_01', 'Nie możesz. Prawo wstępu mają tylko ludzie Gomeza.', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_Verstehe_15_00', 'Rozumiem.', 1, 24, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_WachenBestechen_15_00', 'A gdybym tak... przekupił strażników?', 1, 24, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_WachenBestechen_13_01', 'Masz tupet, chłopcze! Cóż, myślę, że za odpowiednią ilość rudy mógłbyś ich przekonać by przez chwilę... patrzyli w inną stronę.', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_WachenBestechen_13_02', 'Ale jeśli Gomez dowie się, że ktoś taki jak ty dostał się za mury, każe ich migiem wtrącić do lochu.', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_WachenBestechen_13_03', 'A to oczywiście podnosi cenę...', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_WachenBestechen_13_04', 'Zresztą, nawet gdybyś dostał się do środka, co byś tam robił? Wszystkie budynki są pilnie strzeżone.', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_WachenBestechen_15_05', 'Tak tylko pytam...', 1, 24, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_GomezSprechen_15_00', 'Co muszę zrobić, żeby porozmawiać z Gomezem?', 1, 24, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_GomezSprechen_13_01', 'Gomez nie zwraca uwagi na nowych. Musisz się najpierw czymś wykazać.', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DasLager_GomezSprechen_13_02', 'Jeśli myślisz o tym poważnie, zamień słowo z Thorusem.', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DieLage_15_00', 'Jak leci?', 1, 24, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DieLage_13_01', 'Cisza i spokój. Od czasu do czasu jakaś rozróba z Nowym Obozem albo paru świrów z Sekty, ot i wszystko!', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_grd_13_DieLage_13_02', 'Tak długo, jak jesteś tu nowy, to nie ma znaczenia. Ale jak już zdecydujesz, do którego obozu chcesz należeć, utkwisz w tym po szyję!', 1, 24, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_EinerVonEuchWerden_15_00', 'Chciałbym zostać Cieniem.', 1, 31, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_EinerVonEuchWerden_10_01', 'Czyżby? Rozmawiałeś już z Diego?', 1, 31, 10, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_EinerVonEuchWerden_Nein_15_00', 'Jeszcze nie.', 1, 31, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_EinerVonEuchWerden_Nein_10_01', 'Więc zrób to czym prędzej. Znajdziesz go przy wejściu do zamku.', 1, 31, 10, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_EinerVonEuchWerden_Ja_15_00', 'Tak, rozmawiałem.', 1, 31, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_EinerVonEuchWerden_Ja_10_01', 'To świetnie. Słuchaj go we wszystkim. Mi to nie zaszkodziło... w każdym razie - poważnie.', 1, 31, 10, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_WichtigePersonen_15_00', 'Kogo warto tutaj poznać?', 1, 31, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_WichtigePersonen_10_01', 'Jak podpadniesz strażnikom, porozmawiaj z Gravo. Znajdziesz go na kąpielisku, obok bramy do zamku. On zajmuje się ludźmi, którzy wplątali się w kłopoty. Zwłaszcza nowym zdarza się to niezwykle często.', 1, 31, 10, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_DasLager_15_00', 'Co możesz mi powiedzieć o Obozie?', 1, 31, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_DasLager_10_01', 'Chyba najciekawszą częścią Starego Obozu jest targowisko. Jeśli chcesz coś kupić, wal tam jak w dym.', 1, 31, 10, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_DasLager_10_02', 'Znajdziesz je pod tym wielkim zadaszeniem, w południowej części Zewnętrznego Pierścienia.', 1, 31, 10, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_DieLage_15_00', 'Cześć!', 1, 31, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_10_DieLage_10_01', 'Czego chcesz? ', 1, 31, 10, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_EinerVonEuchWerden_15_00', 'Chciałbym przyłączyć się do Cieni.', 1, 8, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_EinerVonEuchWerden_12_01', 'Och. W takim razie powinieneś wiedzieć, że Gomez nie toleruje błędów. Jeśli chcesz zostać jednym z nas, musisz być gotów pójść za nim choćby w ogień.', 1, 8, 12, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_EinerVonEuchWerden_12_02', 'Tylko niecała połowa z tych, którzy próbowali, została przyjęta.', 1, 8, 12, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_EinerVonEuchWerden_15_03', 'A co się stało z resztą?', 1, 8, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_EinerVonEuchWerden_12_04', 'Pewnie siedzą w Nowym Obozie i pałaszują ryż. He he he.', 1, 8, 12, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 8, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_WichtigePersonen_12_01', 'Diego jest... jakby to powiedzieć - szefem Cieni, ale to Thorus decyduje, kto może się spotkać z Gomezem.', 1, 8, 12, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_DasLager_15_00', 'Chciałbym wiedzieć, co ten obóz ma do zaoferowania.', 1, 8, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_DasLager_12_01', 'O to najlepiej zapytać Kopaczy. Oni i tak nie mają nic do roboty.', 1, 8, 12, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_DieLage_15_00', 'Cześć. Jak leci?', 1, 8, 15, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Stt_12_DieLage_12_01', 'Czego chcesz?', 1, 8, 12, 3, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_EinerVonEuchWerden_15_00', 'W jaki sposób mogę dołączyć do Kretów?', 1, 3, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_EinerVonEuchWerden_01_01', 'Dołączyć do nas? Tylko sobie nie myśl, że skoro nikt nas nie pilnuje, nie musimy tutaj harować w pocie czoła.', 1, 3, 1, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_EinerVonEuchWerden_01_02', 'Jeśli wyobrażasz sobie, że będziesz tu zbijał bąki, to grubo się mylisz, przyjacielu.', 1, 3, 1, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_EinerVonEuchWerden_01_03', 'No, ale jeśli wciąż uważasz, że to praca w sam raz dla ciebie, porozmawiaj ze Swineyem. Łatwo go poznasz - pali na okrągło.', 1, 3, 1, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_WichtigePersonen_15_00', 'Kto tu dowodzi?', 1, 3, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_WichtigePersonen_01_01', 'Kto dowodzi? Rozejrzyj się! Na pewno nie ci, którzy tyrają cały dzień przy zbieraniu rudy! Ha!', 1, 3, 1, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_DasLager_15_00', 'Co to jest?', 1, 3, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_DasLager_01_01', 'A na co ci to wygląda? Królewski pałac?', 1, 3, 1, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_DasLager_01_02', 'Jeśli naprawdę chcesz pracować w Wolnej Kopalni, musisz najpierw pokazać ludziom w Kotle, na co cię stać.', 1, 3, 1, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_DieLage_15_00', 'Co słychać?', 1, 3, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_DieLage_01_01', 'A jak myślisz? Fatalnie, jak zwykle zresztą. Nic do jedzenia a mnóstwo do zrobienia! Psia mać!', 1, 3, 1, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_DieLage_01_02', 'Jedyną osobą, która się tu nie przepracowuje jest Swiney. Okyl awansował go na oficjalnego przedstawiciela Kretów. Teraz facet kręci się tu przez cały dzień, uważając żeby nie pobrudzić sobie rączek.', 1, 3, 1, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_EinerVonEuchWerden_02_00', 'Czego chcesz? Nie chcę mieć przez ciebie jakichś kłopotów.', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_EinerVonEuchWerden_15_00', 'Co mam zrobić, żeby do was dołączyć?', 1, 25, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_EinerVonEuchWerden_02_01', 'Tu ci nie pomogę. Jestem tylko drobną płotką. Porozmawiaj ze Swineyem.', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_WichtigePersonen_15_00', 'Kto tu dowodzi?', 1, 25, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_WichtigePersonen_02_01', 'Całym Kotłem trzęsą Najemnicy, ale w Nowym Obozie sprawy mają się nieco inaczej.', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_WichtigePersonen_02_02', 'Dlatego lepiej uważaj, z kim zadzierasz.', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_DasLager_15_00', 'Chciałbym dowiedzieć się czegoś więcej o waszym Obozie.', 1, 25, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_DasLager_02_01', 'Nie wiem, czy mogę ci z tym jakoś pomóc. Porozmawiaj lepiej ze Swineyem albo z najemnikami.', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_DieLage_15_00', 'Jak wygląda życie tutaj?', 1, 25, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_DieLage_02_01', 'Nie mogę narzekać. Każdy musi odpracować swoje i tyle.', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_DieLage_02_02', 'Ale i tak jest tu lepiej niż w Starym Obozie.', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_DieLage_02_03', 'Przybywasz ze Starego Obozu?', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_2_DieLage_02_04', 'Jeśli jesteś ze Starego Obozu, wiedz, że ja nie szukam żadnych kłopotów!', 1, 25, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_EinerVonEuchWerden_02_00', 'Witaj!', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_EinerVonEuchWerden_15_00', 'A gdybym chciał do was dołączyć?', 1, 20, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_EinerVonEuchWerden_02_01', 'Do nas? Jako kto? Nosiwoda?', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_EinerVonEuchWerden_15_02', 'Nie, jako Kret.', 1, 20, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_EinerVonEuchWerden_02_03', 'Posłuchaj mnie uważnie: nikt nie zostaje Kretem NA OCHOTNIKA!', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_EinerVonEuchWerden_02_04', 'No, ale jeśli się upierasz... Porozmawiaj ze Swineyem. Może... ulituje się nad tobą i da ci jakiś Kilof.', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_WichtigePersonen_15_00', 'Kto tu jest szychą?', 1, 20, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_WichtigePersonen_02_01', 'Kto jest szychą? Ja, oczywiście.', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_WichtigePersonen_02_02', 'Ale pewnie chcesz wiedzieć kto tu rozkazuje.', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_WichtigePersonen_02_03', 'Powinieneś porozmawiać w Najemnikami albo Szkodnikami. W pobliże Magów Wody raczej się nie dostaniesz.', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_WichtigePersonen_02_04', 'Ten wieprz, Swiney, stanowczo za wysoko zadziera nosa. Nic, tylko rozdziela kilofy i całuje tyłek Okyla.', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_DasLager_15_00', 'Co ten Obóz ma do zaoferowania?', 1, 20, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_DasLager_02_01', 'To zależy, co ci się uda wyrwać dla siebie. Dla niektórych jest tu tylko harówa bez końca, ale inni potrafią się nieźle bawić.', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_DieLage_15_00', 'Jak wygląda życie tutaj?', 1, 20, 15, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_DieLage_02_01', 'Wspaniale!', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_DieLage_02_02', 'Tak wspaniale, że mamy już dość tej wiecznej szczęśliwości i próbujemy stąd zwiać.', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_5_DieLage_02_03', 'A co sobie myślałeś?! To jest więzienie! Nikt nie lubi siedzieć w więzieniu!', 1, 20, 2, 10, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_EinerVonEuchWerden_15_00', 'Chcę do was dołączyć.', 1, 28, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_EinerVonEuchWerden_02_01', 'Chcesz powiedzieć, że postanowiłeś służyć Śniącemu? Otwiera się przed tobą droga wiecznej szczęśliwości!', 1, 28, 2, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_EinerVonEuchWerden_02_02', 'Idź! Porozmawiaj z Cor Kalomem. On oceni, w jakich zadaniach najlepiej się sprawdzisz.', 1, 28, 2, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_WichtigePersonen_15_00', 'Kto wami dowodzi?', 1, 28, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_WichtigePersonen_02_01', 'Y''Berion, Cor Kalom i Cor Agnar są naszymi duchowymi przywódcami.', 1, 28, 2, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_WichtigePersonen_02_02', 'Dzięki nim możemy nawiązywać kontakt ze Śniącym. W trakcie inwokacji to właśnie oni stają przed jego obliczem.', 1, 28, 2, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_DasLager_15_00', 'Co powinienem wiedzieć o tym miejscu?', 1, 28, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_DasLager_02_01', 'To miejsce wiary, bracie. Nie posiadamy wiele, ale chętnie dzielimy się ze wszystkimi, którzy chcą słuchać nauk Śniącego.', 1, 28, 2, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_DasLager_02_02', 'Porozmawiaj z którymś z Guru. Niech jego słowa wzbogacą twoją duszę.', 1, 28, 2, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_DieLage_15_00', 'Co słychać?', 1, 28, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_2_DieLage_02_01', 'Nie mam czasu. Mam jeszcze mnóstwo pracy.', 1, 28, 2, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_EinerVonEuchWerden_15_00', 'Jak mogę do was dołączyć?', 1, 21, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_EinerVonEuchWerden_03_01', 'To proste. Musisz się po prostu otworzyć.', 1, 21, 3, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_EinerVonEuchWerden_03_02', 'Porozmawiaj z Guru, oni wskażą ci drogę!', 1, 21, 3, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 21, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_WichtigePersonen_03_01', 'Y''Berion! Chwała Śniącemu! To właśnie on sprowadził nas do tego wspaniałego miejsca.', 1, 21, 3, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_WichtigePersonen_03_02', 'Wszystko tutaj powstało w rezultacie jego świętych objawień.', 1, 21, 3, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_DasLager_15_00', 'Jakie miejsca warto tu odwiedzić?', 1, 21, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_DasLager_03_01', 'Hmm... może Fortuno? On wydziela darmowe racje bagiennego ziela wszystkim członkom Sekty.', 1, 21, 3, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_DasLager_03_02', 'Znajdziesz go pod laboratorium alchemicznym Cor Kaloma.', 1, 21, 3, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_DieLage_15_00', 'Jak się masz?', 1, 21, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_3_DieLage_03_01', 'Znakomicie... fantastycznie... wspaniale...', 1, 21, 3, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_EinerVonEuchWerden_15_00', 'W jaki sposób mogę do was dołączyć?', 1, 19, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_EinerVonEuchWerden_05_01', 'Nic prostszego. Porozmawiaj z młodszymi Guru. Oni ci chętnie pomogą.', 1, 19, 5, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_EinerVonEuchWerden_05_02', 'Spodoba ci się tutaj, uwierz mi.', 1, 19, 5, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 19, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_WichtigePersonen_05_01', 'Guru sprawują kontrolę nad całym obozem, ale jeśli nie będziesz się wychylał, zostawią cię w spokoju.', 1, 19, 5, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_DasLager_15_00', 'Co możesz mi powiedzieć o tym obozie?', 1, 19, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_DasLager_05_01', 'To najwspanialsze miejsce w całej cholernej kolonii.', 1, 19, 5, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_DasLager_05_02', 'Nawet jeśli nie wierzysz w nauki Śniącego, dostaniesz dzienną rację jedzenia i ziela. Wystarczy tylko zgłosić się do Fortuno.', 1, 19, 5, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_DasLager_15_03', 'Gdzie go znajdę?', 1, 19, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_DasLager_05_04', 'Pod laboratorium Cor Kaloma, w pobliżu dziedzińca wielkiej świątyni.', 1, 19, 5, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_DieLage_15_00', 'Co słychać?', 1, 19, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_DieLage_05_01', 'Nie mogę narzekać. Jesteś tu nowy, prawda?', 1, 19, 5, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nov_5_DieLage_15_02', 'Dopiero co przybyłem.', 1, 19, 15, 12, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_EinerVonEuchWerden_15_00', 'Nie przydałby się wam dodatkowy człowiek?', 1, 29, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_EinerVonEuchWerden_08_01', 'Zawsze chętnie przyjmujemy nowych ludzi, ale czeka cię jeszcze wiele pracy. Tylko najlepsi Nowicjusze mogą zostać Strażnikami Świątynnymi.', 1, 29, 8, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_EinerVonEuchWerden_08_02', 'To najwyższe wyróżnienie, jakie może spotkać członka Bractwa Śniącego.', 1, 29, 8, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_WichtigePersonen_15_00', 'Kto tu dowodzi?', 1, 29, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_WichtigePersonen_08_01', 'Naszym świętym obowiązkiem jest wypełnianie poleceń Guru.', 1, 29, 8, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_WichtigePersonen_15_02', 'Kim są ci Guru?', 1, 29, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_WichtigePersonen_08_03', 'Najwyższym z Guru jest jaśnie oświecony Y''Berion. Oprócz niego są jeszcze Cor Kalom, Cor Angar oraz kilku innych.', 1, 29, 8, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_DasLager_15_00', 'Co możesz mi powiedzieć o tym obozie?', 1, 29, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_DasLager_08_01', 'Chociaż jesteś tu nowy, możesz bezpiecznie poruszać się niemal po całym obozie. Wyjątkiem jest jedynie świątynia Śniącego.', 1, 29, 8, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_DasLager_08_02', 'Dlatego staraj się nie chadzać tam, gdzie ci nie wolno, oraz nie przeszkadzaj naszym mistrzom w medytacji.', 1, 29, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_DieLage_15_00', 'Jak się masz?', 1, 29, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_8_DieLage_08_01', 'Ostrzegam cię! Okaż nieco więcej szacunku. Rozmawiasz z jednym z obrońców świętych proroków.', 1, 29, 8, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_EinerVonEuchWerden_15_00', 'Chcę zostać Świątynnym Strażnikiem, tak jak ty!', 1, 18, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_EinerVonEuchWerden_13_01', 'Czy masz pojęcie, jakich wyrzeczeń wymagała ode mnie służba wybrańcom Śniącego w Świątynnej Straży?', 1, 18, 13, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_EinerVonEuchWerden_13_02', 'Chyba nie myślisz, że przyjdziesz tu i tak po prostu otrzymasz najwyższe wyróżnienie?!', 1, 18, 13, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_EinerVonEuchWerden_13_03', 'Zanim choćby zaczniesz o tym myśleć, powinieneś lepiej poznać najważniejsze nauki Śniącego.', 1, 18, 13, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_EinerVonEuchWerden_13_04', 'To powinno zająć ci trochę czasu i przywrócić odrobinę zdrowego rozsądku.', 1, 18, 13, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 18, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_WichtigePersonen_13_01', 'Nasi Guru są wybrańcami Śniącego! Śniący posiada władzę nad życiem każdego z nas, a Guru objawiają nam jego wolę.', 1, 18, 13, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_DasLager_15_00', 'Chciałbym rozejrzeć się wewnątrz świątyni Śniącego...', 1, 18, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_DasLager_13_01', 'To nie do pomyślenia! Niewierny w świątyni! Dopóki nie przysięgniesz wypełniać wolę Śniącego, nie będzie ci wolno wejść do jego domu modlitwy!', 1, 18, 13, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_DieLage_15_00', 'Jak leci?', 1, 18, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_DieLage_13_01', 'Odkąd zostałem jednym z wybranych obrońców wiary czuję się tak wspaniale, jak nigdy dotąd w moim życiu!', 1, 18, 13, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_DieLage_15_02', 'To chyba bardzo odpowiedzialna funkcja?', 1, 18, 15, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Tpl_13_DieLage_13_03', 'Jako niewierny nie jesteś w stanie tego zrozumieć...', 1, 18, 13, 13, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_WichtigePersonen_15_00', 'Pracujesz na polach ryżowych z własnej woli?', 1, 6, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_WichtigePersonen_02_01', 'Jasne! Lepsze to, niż zostać ZMUSZONYM do pracy przez oprychów Ryżowego Księcia!', 1, 6, 2, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_WichtigePersonen_15_02', 'Rozumiem...', 1, 6, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_DasLager_15_00', 'Co możesz mi powiedzieć o Obozie?', 1, 6, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_DasLager_02_01', 'Niełatwo się tu żyje. Najemnicy Lee i magowie są w porządku, ale Szkodniki dają się wszystkim we znaki!', 1, 6, 2, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_DieLage_15_00', 'Co słychać?', 1, 6, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_DieLage_02_01', 'Czego chcesz? Przysłał cię Ryżowy Książe? Pracuję najlepiej jak potrafię!', 1, 6, 2, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_DieLage_15_02', 'Nikt mnie nie przysłał! Chcę po prostu porozmawiać!', 1, 6, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_Wasser_15_00', 'Przysyła mnie Lewus. Przyniosłem ci wodę.', 1, 6, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_Wasser_02_01', 'O, dzięki. Umieram z pragnienia!', 1, 6, 2, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_2_Wasser_NOWATER_02_00', 'Woda! Hej, człowieku! Nic nie zostało! Tylko mi nie mów, że znowu wszyscy się napili, oprócz mnie!', 1, 6, 2, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_WichtigePersonen_15_00', 'Macie jakiegoś przywódcę?', 1, 13, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_WichtigePersonen_04_01', 'Cóż, teoretycznie naszym szefem jest Ryżowy Książe, ale większość z nas pracuje dla niego tylko ze strachu przed jego siepaczami.', 1, 13, 4, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_WichtigePersonen_04_02', 'Ja jestem wyjątkiem. Jestem tu od kilku lat i zdążyłem już parę razy oberwać od Szkodników. Na polach ryżowych jest przynajmniej spokojnie.', 1, 13, 4, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_DasLager_15_00', 'Co powinienem wiedzieć o tym miejscu?', 1, 13, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_DasLager_04_01', 'Uważaj na siebie, chłopcze! W Obozie roi się od morderców i rabusiów. Oni tylko czekają na przybycie kogoś takiego jak ty.', 1, 13, 4, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_DieLage_15_00', 'Co słychać?', 1, 13, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_DieLage_04_01', 'Mamy mnóstwo pracy. Do wykarmienia tylu ludzi potrzeba mnóstwa ryżu.', 1, 13, 4, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_Wasser_15_00', 'Przysyła mnie Lewus. Przyniosłem ci wodę.', 1, 13, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_Wasser_04_01', 'Dzięki, chłopcze. Piękne dzięki.', 1, 13, 4, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_4_Wasser_NOWATER_04_00', 'Ale nic ci nie zostało! No trudno, poszukam u innych.', 1, 13, 4, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_WichtigePersonen_15_00', 'Kto pilnuje, by praca w polu przebiegała bez przeszkód?', 1, 9, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_WichtigePersonen_09_01', 'Wszyscy! W zasadzie powinien się tym zajmować Ryżowy Książe, ale moim zdaniem ten człowiek umie tylko siedzieć w swojej norze i liczyć worki.', 1, 9, 9, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_WichtigePersonen_09_02', 'W każdym razie to on i Homer zapoczątkowali to wszystko...', 1, 9, 9, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_DasLager_15_00', 'Opowiedz mi o tym obozie.', 1, 9, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_DasLager_09_01', 'Obóz? Jest wypełniony po brzegi najgorszymi szumowinami. Moim zdaniem Najemnicy powinni już dawno oczyścić to miejsce ze Szkodników.', 1, 9, 9, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_DasLager_09_02', 'Nie ma z nich żadnego pożytku, tylko same kłopoty.', 1, 9, 9, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_DieLage_15_00', 'Jak się masz?', 1, 9, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_DieLage_09_01', 'Harujemy tu do upadłego, żeby reszta miała co włożyć do garnka.', 1, 9, 9, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_Wasser_15_00', 'Przysyła mnie Lewus. Przyniosłem ci wodę.', 1, 9, 15, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_Wasser_09_01', 'Piękne dzięki! Jeszcze trochę, a zacząłbym pić z kałuży.', 1, 9, 9, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bau_9_Wasser_NOWATER_09_00', 'Chyba ci się skończyła. Trudno, wezmę trochę od innych.', 1, 9, 9, 9, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_EinerVonEuchWerden_15_00', 'Chcę do was dołączyć.', 1, 32, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_EinerVonEuchWerden_06_01', 'Lares decyduje, kto się nadaje do bandy.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_EinerVonEuchWerden_06_02', 'Ale żeby się z nim spotkać, musisz mieć nie lada powód.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_EinerVonEuchWerden_15_03', 'Na przykład jaki?', 1, 32, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_EinerVonEuchWerden_06_04', 'Na przykład ktoś mógłby cię do niego wysłać.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_WichtigePersonen_15_00', 'Kto tu jest przywódcą?', 1, 32, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_WichtigePersonen_06_01', 'Przybywasz prosto ze Starego Obozu, co?', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_WichtigePersonen_06_02', 'Tutaj nie ma przywódcy! Cholerny Lee próbuje nas trzymać na smyczy, ale i tak robimy, co się nam żywnie podoba.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_WichtigePersonen_06_03', 'Gdybyśmy mieli jakiegoś szefa, byłby nim pewnie Lares. No, ale on MA dość rozumu, żeby nie mieszać się do cudzych spraw.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_DasLager_15_00', 'Co powinienem wiedzieć o tym miejscu?', 1, 32, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_DasLager_06_01', 'Na środku jaskini znajduje się wielka dziura wypełniona rudą. Ale jeśli ostrzysz sobie na nią zęby, radzę ci o tym zapomnieć.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_DasLager_06_02', 'Sam kiedyś spróbowałem szczęścia, ale Najemnicy trzymają przy niej straż dniem i nocą.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_DieLage_15_00', 'Jak się masz?', 1, 32, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_DieLage_06_01', 'A jak się mogę mieć jedząc ryż całymi dniami i czekając na dogodną chwilę, żeby zdobyć trochę rudy?!', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_DieLage_06_02', 'Potem można pójść do baru i schlać się do nieprzytomności ryżówką!', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_Krautprobe_15_00', 'Mam przy sobie trochę bagiennego ziela? Może chcesz je kupić?', 1, 32, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_Krautprobe_06_01', 'Jasne. Masz tu 10 bryłek rudy.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_Krautprobe_06_02', 'Zajrzyj do mnie jeszcze, jak będziesz miał tego więcej, dobra?', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_6_Krautprobe_No_Joint_06_00', 'Gdzie? Nie widzę żadnego ziela.', 1, 32, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_EinerVonEuchWerden_15_00', 'W jaki sposób mogę dołączyć do Obozu?', 1, 38, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_EinerVonEuchWerden_07_01', 'Możesz się przyłączyć do naszej bandy. Ale najpierw musisz udowodnić, że nie trzymasz z Gomezem.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_EinerVonEuchWerden_15_02', 'Jak mam to zrobić?', 1, 38, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_EinerVonEuchWerden_07_03', 'Na twoim miejscu spróbowałbym zabrać coś bardzo ważnego ze Starego Obozu albo ze Starej Kopalni, i przyniósłbym to Laresowi.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_WichtigePersonen_15_00', 'Kto wami dowodzi?', 1, 38, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_WichtigePersonen_07_01', 'Hersztem bandy jest Lares. Większość z nas uznaje jego zwierzchność.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_WichtigePersonen_07_02', 'Ale on nie mówi nam, co mamy robić.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DasLager_15_00', 'Co możesz mi opowiedzieć o tym obozie?', 1, 38, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DasLager_07_01', 'To taka "społeczność z przymusu", jeśli wiesz, co mam na myśli. Każdy robi tu to, co chce, ale jest nas na tyle dużo, że Gomez boi się wydać nam walną bitwę.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DasLager_07_02', 'Chociaż głowę dam, że bardzo by chciał.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DasLager_15_03', 'Jak wyglądają wasze stosunki z Gomezem?', 1, 38, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DasLager_07_04', 'Okradamy go!', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DieLage_15_00', 'Co się tutaj dzieje?', 1, 38, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DieLage_07_01', 'Jesteś tu od niedawna, co?', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DieLage_07_02', 'Magowie od dłuższego czasu przygotowywali się do wysadzenia kopca rudy w powietrze. Teraz mówią, że są już prawie gotowi.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_DieLage_07_03', 'Sądząc po wielkiej hałdzie, którą usypały Krety, wygląda na to, że tym razem nie żartują.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_Krautprobe_15_00', 'Chcesz trochę bagiennego ziela?', 1, 38, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_Krautprobe_07_01', 'Dam ci za nie 10 bryłek rudy - proszę.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_Krautprobe_07_02', 'Jak będziesz miał jeszcze trochę na zbyciu, zajrzyj do mnie koniecznie.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_7_Krautprobe_No_Joint_07_00', 'Gdzie? Nie widzę żadnego ziela.', 1, 38, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_EinerVonEuchWerden_15_00', 'Co muszę zrobić, żeby dołączyć do waszego Obozu?', 1, 16, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_EinerVonEuchWerden_13_01', 'Wyjdź na pole i pomóż przy zbieraniu ryżu.', 1, 16, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_WichtigePersonen_15_00', 'Kto tu dowodzi?', 1, 16, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_WichtigePersonen_13_01', 'Lee jest szefem Najemników, jeśli o to ci chodzi. Ale JA nie jestem Najemnikiem, więc niech mnie szlag, jeśli pozwolę mu sobą pomiatać!', 1, 16, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_DasLager_15_00', 'Chciałbym się dowiedzieć czegoś więcej o waszym Obozie.', 1, 16, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_DasLager_13_01', 'Najlepiej wejdź do środka i po prostu rozejrzyj się! Tak długo jak nie jesteś jednym z ludzi Gomeza, nikt cię nie będzie zaczepiał.', 1, 16, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_DieLage_15_00', 'Co słychać?', 1, 16, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_DieLage_13_01', 'A czego chcesz?', 1, 16, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_Krautprobe_15_00', 'Wyglądasz mi na kogoś, komu przydałoby się trochę bagiennego ziela.', 1, 16, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_Krautprobe_13_01', 'A masz je przy sobie? Dam ci 10 bryłek rudy!', 1, 16, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_Krautprobe_13_02', 'Wracaj, kiedy tylko zechcesz, Bracie!', 1, 16, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_13_Krautprobe_No_Joint_13_00', 'Ale ty wcale nie masz ziela! Przestań mnie wkurzać!', 1, 16, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_EinerVonEuchWerden_15_00', 'Nie przydałby się wam dodatkowy człowiek?', 1, 23, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_EinerVonEuchWerden_08_01', 'Lee nie przyjmuje ludzi, którzy nie spędzili tu kilku lat i nie maja dużego doświadczenia.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_EinerVonEuchWerden_08_02', 'Jeśli chcesz zostać w Obozie musisz najpierw postawić się Szkodnikom.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_WichtigePersonen_15_00', 'Kto tu dowodzi?', 1, 23, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_WichtigePersonen_08_01', 'Wszyscy Najemnicy słuchają Lee. Szef zawarł umowę z Magami - my ich ochraniamy, a oni pomogą nam stąd zwiać!', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_WichtigePersonen_15_02', 'A więc w rzeczywistości rządzą tu Magowie?', 1, 23, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_WichtigePersonen_08_03', 'Nie, obozem NIKT tak naprawdę nie rządzi. Większość z mieszkających tu ludzi nie chciała bądź nie mogła mieszkać w Starym Obozie.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_WichtigePersonen_08_04', 'Każdy dba tu o własny interes. Zgadzamy się tylko co do jednego: lepiej już usypać z rudy wielki kopiec i wysadzić go w powietrze, niż wchodzić w układy z królem, niech mu ziemia ciężką będzie.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_DasLager_15_00', 'Co możesz mi opowiedzieć o tym obozie?', 1, 23, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_DasLager_08_01', 'Uważaj na siebie! W Obozie aż roi się od morderców i rabusiów!', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_DasLager_08_02', 'Mamy tutaj kilka niepisanych praw. Pierwsze: tylko Najemnicy mogą wchodzić do strefy Magów.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_DasLager_08_03', 'Drugie: zanim zbliżysz się do kopca rudy, wykop sobie wygodny grób. Trzecie: nie pokazuj się w knajpie na jeziorze.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_DasLager_08_04', 'Widzisz, to jest lokal Szkodników, a oni nie lubią jak pokazują się tam żółtodzioby takie jak ty.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_DieLage_15_00', 'Jak leci?', 1, 23, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_DieLage_08_01', 'Jak zwykle. Pilnujemy, żeby nikt nie zbliżył się do Magów ani do rudy.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_Krautprobe_15_00', 'Mam przy sobie trochę bagiennego ziela? Może chcesz je kupić?', 1, 23, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_Krautprobe_08_01', 'Czemu nie? Dam ci za nie 10 bryłek rudy.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_Krautprobe_08_02', 'Pogadaj jeszcze z resztą chłopaków. Oni pewnie też będą zainteresowani.', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_8_Krautprobe_No_Joint_08_00', 'Nie tak szybko. Najpierw pokaż ziele! Nie masz, co?!', 1, 23, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_EinerVonEuchWerden_15_00', 'Chciałbym zostać Najemnikiem i pracować dla Magów.', 1, 12, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_EinerVonEuchWerden_11_01', 'To nie takie trudne. Jeśli jesteś gotów do walki za naszą sprawę, Lee na pewno cię przyjmie.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_EinerVonEuchWerden_11_02', 'Ale szanse na zostanie Najemnikiem mają tylko ludzie biegli w posługiwaniu się mieczem. Jak z tym u ciebie?', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_EinerVonEuchWerden_15_03', 'Cóż...', 1, 12, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_EinerVonEuchWerden_11_04', 'Tak właśnie myślałem. Jeśli myślisz o tym poważnie, porozmawiaj z Gornem. On kiedyś szkolił nowoprzybyłych.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_EinerVonEuchWerden_11_05', 'Może ci się poszczęści, i Gorn zechce cię uczyć.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 12, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_WichtigePersonen_11_01', 'Wypełniamy polecenia magów, choć ci rzadko mają jakieś konkretne żądania. Siedzą tylko przy kopcu rudy i czytają te swoje księgi.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_WichtigePersonen_11_02', 'W sumie rządzi tu Lee. To nasz szef.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_DasLager_15_00', 'Czy w obozie dochodzi do jakichś spięć?', 1, 12, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_DasLager_11_01', 'Chłopie, co chwila są jakieś problemy! Szkodniki robią co się im żywnie podoba, a my musimy pilnować Magów i całego Obozu.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_DieLage_15_00', 'Wszystko w porządku?', 1, 12, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_DieLage_11_01', 'Jeszcze jest cicho...', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_DieLage_15_02', 'Jeszcze?', 1, 12, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_DieLage_11_03', 'Jeśli Szkodniki nie przestaną atakować konwojów ze Starego Obozu, Gomez w końcu się wścieknie i zapuka do naszych bram.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_DieLage_11_04', 'I będzie niezła zabawa!', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_Krautprobe_15_00', 'Chcesz trochę bagiennego ziela?', 1, 12, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_Krautprobe_11_01', 'Jasne. Masz tu 10 bryłek rudy.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_Krautprobe_11_02', 'Jakbyś miał jeszcze kiedyś trochę ziela, no wiesz...', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Sld_11_Krautprobe_No_Joint_11_00', 'Najpierw je przynieś, wtedy pogadamy.', 1, 12, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_Mine_15_00', 'Opowiedz mi o kopalni.', 1, 1, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_Mine_01_01', 'W jaskiniach rosną różne grzyby i zioła. Da się to przełknąć, ale nie ma to jak soczysty kawał mięsa.', 1, 1, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_Mine_01_02', 'Pełzacze też nie należą do przysmaków. Cholerna nora!', 1, 1, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_WichtigePersonen_15_00', 'Kto wami dowodzi?', 1, 1, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_WichtigePersonen_01_01', 'Ian organizuje siłę roboczą i wymianę dóbr z obozem. Jeśli szukasz czegoś konkretnego, najlepiej pogadaj z nim.', 1, 1, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_Minecrawler_15_00', 'Co możesz mi powiedzieć o pełzaczach?', 1, 1, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_Minecrawler_01_01', 'Strażnicy Świątynni zawarli układ z Gomezem. Zabijają pełzacze, w zamian za co mogą zatrzymać ich wnętrzności.', 1, 1, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_DieLage_15_00', 'Jak leci?', 1, 1, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_1_DieLage_01_01', 'Mnóstwo pracy, niewiele odpoczynku. Dlatego jeśli chcesz czegoś ode mnie, lepiej się streszczaj.', 1, 1, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_Mine_15_00', 'Opowiedz mi o kopalni.', 1, 34, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_Mine_01_01', 'Jest jeszcze wiele jaskiń, gdzie zostało trochę rudy, ale pełzacze nie pozwalają nam w nich pracować.', 1, 34, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_Mine_01_02', 'Zbyt wiele napadów, zbyt poważne straty.', 1, 34, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_WichtigePersonen_15_00', 'Kto może mieć tu coś do powiedzenia?', 1, 34, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_WichtigePersonen_01_01', 'Wąż, jest hutnikiem. Wie wszystko o wytapianiu rudy. Zresztą chyba sam jest z żelaza - cały dzień spędza przed piecem. Nie mam pojęcia jak wytrzymuje ten żar.', 1, 34, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_Minecrawler_15_00', 'Co możesz mi powiedzieć o pełzaczach?', 1, 34, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_Minecrawler_01_01', 'Musieliśmy zamknąć wielki szyb na dole. Aż roi się w nim od pełzaczy.', 1, 34, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_Minecrawler_01_02', 'Pełzacze są tu wszędzie. Nie słyszysz ich? Bo ja słyszę.', 1, 34, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_DieLage_15_00', 'Jak się masz?', 1, 34, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_2_DieLage_01_01', 'Muszę pracować. Jak strażnicy zobaczą, że z tobą rozmawiam, obetną mi racje.', 1, 34, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_Mine_15_00', 'Opowiedz mi o kopalni.', 1, 5, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_Mine_01_01', 'Musimy pracować bez końca, nigdy nie oglądając światła dziennego. Stąd nie ma ucieczki innej niż śmierć.', 1, 5, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 5, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_WichtigePersonen_01_01', 'Ian pilnuje kopalni a Asghan jest dowódcą strażników.', 1, 5, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_Minecrawler_15_00', 'Co możesz mi powiedzieć o pełzaczach?', 1, 5, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_Minecrawler_01_01', 'Chcesz wiedzieć, co robić w przypadku spotkania z pełzaczem? Uciekaj. Uciekaj ile tylko sił w nogach!', 1, 5, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_Minecrawler_01_02', 'Jak zaginiesz, będziesz martwy. Tutaj nikt nie będzie po tobie płakał.', 1, 5, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_DieLage_15_00', 'Jak leci?', 1, 5, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_DieLage_01_01', 'Pomyślmy: bolą mnie plecy, ręce mi odpadają, język przysycha mi do podniebienia i padam z wyczerpania.', 1, 5, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_3_DieLage_01_02', 'A od tego ciągłego łoskotu powoli dostaję świra.', 1, 5, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_Mine_15_00', 'Opowiedz mi o kopalni.', 1, 14, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_Mine_01_01', 'Kilofy i pot. To wszystko, co zapamiętasz po wyjściu na powierzchnię.', 1, 14, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_Mine_01_02', 'Ale jeszcze długo po twoim wyjściu ja wciąż będę tutaj, wyrywając okruchy rudy z kamiennych ścian. Taka moja praca.', 1, 14, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_WichtigePersonen_15_00', 'Kto tu dowodzi?', 1, 14, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_WichtigePersonen_01_01', 'Santino i Alberto wymieniają wydobytą przez nas rudę na różne rzeczy. Oni wydzielają nam racje żywnościowe.', 1, 14, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_Minecrawler_15_00', 'Co wiesz o pełzaczach?', 1, 14, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_Minecrawler_01_01', 'Jak zobaczysz któregoś z tych sukinsynów, przywal mu między ślepia kilofem. Tylko dobrze wyceluj - bo drugiej szansy już nie będziesz miał.', 1, 14, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_DieLage_15_00', 'Jak się masz?', 1, 14, 15, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Vlk_4_DieLage_01_01', 'Bywało lepiej.', 1, 14, 1, 5, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_6_Mine_15_00', 'Jak wygląda praca w kopalni?', 1, 36, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_6_Mine_06_01', 'Kopacze wydobywają tu rudę. A jak nie wydobywają, to dostają porządne baty.', 1, 36, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_6_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 36, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_6_WichtigePersonen_06_01', 'Szefem jest Asghan, ale to Ian organizuje takie rzeczy, jak ruda i Kopacze.', 1, 36, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_6_Minecrawler_15_00', 'Opowiedz mi o pełzaczach.', 1, 36, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_6_Minecrawler_06_01', 'Same kłopoty z tymi bestiami. Sam już nie wiem, z czym jest więcej roboty - z nimi czy z Kopaczami.', 1, 36, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_6_DieLage_15_00', 'Jak leci?', 1, 36, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_6_DieLage_06_01', 'A jak myślisz?', 1, 36, 6, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_7_Mine_15_00', 'Opowiedz mi o kopalni.', 1, 39, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_7_Mine_07_01', 'Kopacze wydobywają tu rudę, a my bronimy ich przed pełzaczami.', 1, 39, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_7_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 39, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_7_WichtigePersonen_07_01', 'Ian i Asghan. Jeśli szukasz czegoś konkretnego - lepiej pogadaj z nimi.', 1, 39, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_7_Minecrawler_15_00', 'Wiesz coś więcej o tych pełzaczach?', 1, 39, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_7_Minecrawler_07_01', 'Po mojemu, cały ten zwierzyniec należałoby wytępić raz a dobrze.', 1, 39, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_7_DieLage_15_00', 'Jak się masz?', 1, 39, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_7_DieLage_07_01', 'Zaczynasz mnie denerwować, chłopcze.', 1, 39, 7, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_13_Mine_15_00', 'Co się dzieje w kopalni?', 1, 40, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_13_Mine_13_01', 'Kopalnia to serce Starego Obozu. Bez kopalni nie ma rudy. Bez rudy nie ma towarów od króla. Kapujesz?', 1, 40, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_13_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 40, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_13_WichtigePersonen_13_01', 'Asghan jest tu szefem, ale lepiej nie zawracaj mu głowy. Takimi jak ty zajmuje się Ian.', 1, 40, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_13_DasLager_15_00', 'Opowiedz mi o pełzaczach.', 1, 40, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_13_DasLager_13_01', 'Bractwo płaci Staremu Obozowi bagiennym zielem za prawo do polowania na pełzacze w kopalni.', 1, 40, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_13_DieLage_15_00', 'Jak leci?', 1, 40, 15, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Grd_13_DieLage_13_01', 'Ach... Od wieków nie brałem udziału w żadnej rozróbie.', 1, 40, 13, 2, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_EinerVonEuchWerden_15_00', 'Co mam zrobić, żeby do was dołączyć?', 1, 2, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_EinerVonEuchWerden_08_01', 'Jeśli chcesz pracować w Kotle musisz najpierw wyrobić sobie znajomości w Nowym Obozie.', 1, 2, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_EinerVonEuchWerden_08_02', 'Po prostu idź tam i pogadaj z ludźmi.', 1, 2, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 2, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_WichtigePersonen_08_01', 'Okyl rozkazuje w Kotle, Lee rządzi w Obozie.', 1, 2, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_WichtigePersonen_08_02', 'Najlepiej porozmawiaj z obydwoma.', 1, 2, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_DasLager_15_00', 'Co słychać w obozie?', 1, 2, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_DasLager_08_01', 'Pilnujemy wejścia do kopalni.', 1, 2, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_DasLager_08_02', 'Tylko nasi ludzie mogą wejść do środka.', 1, 2, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_DieLage_15_00', 'Wszystko w porządku?', 1, 2, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_8_DieLage_08_01', 'Co się głupio pytasz? Wszystko pod kontrolą.', 1, 2, 8, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_EinerVonEuchWerden_15_00', 'Jak mogę do was dołączyć?', 1, 11, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_EinerVonEuchWerden_011_01', 'Jeśli chcesz być jednym z nas, musisz najpierw zasłużyć na odpowiednią reputację.', 1, 11, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_EinerVonEuchWerden_011_02', 'Idź i udowodnij, co potrafisz, a może będziesz mógł pracować w Kotle.', 1, 11, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_WichtigePersonen_15_00', 'Kto tu wydaje rozkazy?', 1, 11, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_WichtigePersonen_011_01', 'W Kotle rządzi Okyl. Ma kontakty ze wszystkimi szychami w Obozie.', 1, 11, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_WichtigePersonen_011_02', 'A jak zaczniesz sprawiać kłopoty, zajmą się tobą Magowie Wody z Nowego Obozu.', 1, 11, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_DasLager_15_00', 'Dzieje się tu coś szczególnie interesującego?', 1, 11, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_DasLager_011_01', 'Nic, ale jak spróbujesz czegoś głupiego będziesz miał poważne kłopoty.', 1, 11, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_DasLager_011_02', 'Zwłaszcza, jeśli spróbujesz dostać się do kopalni albo stróżówki bez pozwolenia.', 1, 11, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_DieLage_15_00', 'Co słychać?', 1, 11, 15, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Sld_11_DieLage_011_01', 'Na razie cicho. Za cicho jak na mój gust.', 1, 11, 11, 7, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_Mine_15_00', 'Co się dzieje w kopalni?', 1, 22, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_Mine_06_01', 'W kopalni? Kto tam siedzi - już nie wyjdzie. Kto nie siedzi - nie wejdzie.', 1, 22, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_Mine_06_02', 'Ciesz się, że cię tam nie ma.', 1, 22, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_WichtigePersonen_15_00', 'Kto tu dowodzi?', 1, 22, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_WichtigePersonen_06_01', 'Mi nikt nie rozkazuje, ale trzeba wiedzieć, jak do tego dojść.', 1, 22, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_WichtigePersonen_15_01', 'A ja ty to osiągnąłeś?', 1, 22, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_WichtigePersonen_06_02', 'Tajemnica zawodowa. Ale między nami mówiąc - dla Szkodnika to żaden problem.', 1, 22, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_DieLage_15_00', 'Nie wyglądasz mi na kogoś, kto by się przepracowywał.', 1, 22, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_6_DieLage_06_01', 'Ja, pracować? Jakby mi się chciało pracować, nie trafiłbym pod Barierę, kapujesz?', 1, 22, 6, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_7_Mine_15_00', 'Opowiedz mi o tym obozie.', 1, 30, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_7_Mine_07_01', 'Obóz? Masz na myśli Kocioł? Nie jest tu tak źle jak mówią. Krety wydobywają rudę, Najemnicy ich pilnują a my - Szkodniki - patrzymy im wszystkim na ręce.', 1, 30, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_7_WichtigePersonen_15_00', 'W takim razie kto tu rządzi?', 1, 30, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_7_WichtigePersonen_07_01', 'To zależy, od kogo przyjmujesz rozkazy.', 1, 30, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_7_WichtigePersonen_07_02', 'W każdym razie jak Okyl sobie czegoś zażyczy, lepiej mu nie odmawiać. Gdy się wkurzy, potrafi być bardzo nieprzyjemny.', 1, 30, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_7_DieLage_15_00', 'Co słychać?', 1, 30, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_7_DieLage_07_01', 'Zaczynasz mnie denerwować, chłopcze.', 1, 30, 7, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_13_Mine_15_00', 'Opowiedz mi coś o tym obozie.', 1, 33, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_13_Mine_13_01', 'Ta dziura w ziemi pomoże nam się stąd wydostać. Jak tylko uzbieramy dość rudy, będziemy mieli gdzieś Stary Obóz.', 1, 33, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_13_WichtigePersonen_15_00', 'Kto tu rządzi?', 1, 33, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_13_WichtigePersonen_13_01', 'Okyl jest tu szefem.', 1, 33, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_13_WichtigePersonen_13_02', 'Ale zwykle zostawia Szkodniki w spokoju.', 1, 33, 13, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_13_DieLage_15_00', 'Dobrze się czujesz?', 1, 33, 15, 8, null, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mine_Org_13_DieLage_13_01', 'Nie gorzej niż wczoraj.', 1, 33, 13, 8, null, null);
