INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_Hello_15_00', 'Troszczysz się o pola ryżowe, czyż nie?', 1, 114, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_Hello_12_01', 'Czemu pytasz? Szukasz pracy?', 1, 114, 12, null, 900, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_Arbeit_15_00', 'A masz dla mnie jakieś zajęcie?', 1, 114, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_Arbeit_12_01', 'Porozmawiaj z Lewusem. Kręci się zwykle na prawo od szopy.', 1, 114, 12, null, 900, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_TRADE_15_00', 'Może się dogadamy...', 1, 114, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_TRADE_12_01', 'A co możesz mi zaoferować?', 1, 114, 12, null, 900, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_LeftySentMe_15_00', 'Przysyła mnie Lewus.', 1, 114, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_LeftySentMe_12_01', 'Tak? I co powiedział?', 1, 114, 12, null, 900, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_GetWater_15_00', 'Mam zanieść wodę zbieraczom ryżu!', 1, 114, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_GetWater_12_01', 'Dobra. Masz tu tuzin butelek.', 1, 114, 12, null, 900, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_GetWater_12_02', 'To jakieś dwa razy więcej niż liczba zbieraczy, więc postaraj się rozdzielić je sprawiedliwie.', 1, 114, 12, null, 900, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_GetWater_TooLate_12_00', 'To było wczoraj, chłopcze. Lepiej zajrzyj znowu do Lewusa. Chyba ma ci coś do powiedzenia.', 1, 114, 12, null, 900, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_GetWater_TooLate_12_01', 'To było parę dni temu, chłopcze. Lepiej zajrzyj znowu do Lewusa. Chyba ma ci coś do powiedzenia.', 1, 114, 12, null, 900, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Horatio_Wasser_15_00', 'Przysyła mnie Lewus. Przyniosłem wam wodę.', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Horatio_Wasser_09_01', 'Dzięki, kolego. Jeszcze trochę, a zacząłbym pić z kałuży!', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Horatio_Wasser_NOWATER_09_00', 'Chyba ci się skończyła! Trudno, wezmę trochę od innych.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Hello_09_00', 'Co tu robisz? Szukasz kłopotów?', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Hello_BeCool_15_00', 'Spokojnie! Jestem tu nowy.', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Hello_BeCool_09_01', 'Hmmm... Wyglądasz w porządku. Chociaż nigdy nie wiadomo - zawsze znajdzie się jakiś nowy, który wyobraża sobie niewiadomo co.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Hello_PissOff_15_00', 'Kłopotów? A co - grozisz mi, robolu?!', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Hello_PissOff_09_01', 'Tylko dlatego, że pracuję w polu, myślisz, że nie dam sobie rady z kimś takim jak ty?', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Hello_PissOff_09_02', 'No, jeśli szukasz guza, to chodź!', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_SORRY_15_00', 'Przepraszam, nie chciałem być złośliwy.', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_SORRY_09_01', 'Trzeba było pomyśleć o tym wcześniej, chłopcze.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Story_15_00', 'Co ktoś taki jak ty robi w towarzystwie zbieraczy?', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Story_09_01', 'Lee też mnie o to pytał. Nie chce już walczyć, no chyba że w obronie własnej.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Story_09_02', 'Raz zabiłem człowieka i jak dla mnie to było o jeden raz za dużo. Zresztą dlatego właśnie trafiłem do tej zapchlonej kolonii.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Story_15_03', 'Jak to się stało?', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Story_09_04', 'Zwykła bójka w karczmie. Nie chciałem zabić faceta - chyba po prostu za mocno go walnąłem.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Story_09_05', 'Byłem wtedy kowalem. Najwyraźniej nie doceniłem własnej siły.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_WhyHere_15_00', 'Dlaczego dołączyłeś właśnie do TEGO obozu?', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_WhyHere_09_01', 'Już ci mówię: do wyboru miałem tylko tych świrów z Sekty, a nie uśmiechało mi się pranie mózgu, któremu chcieli mnie poddać.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_WhyHere_09_02', 'W Starym Obozie miałbym za dużo kłopotów ze Strażnikami, a tutaj Najemnicy i Szkodniki traktują mnie z szacunkiem.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_WhyHere_15_03', 'To znaczy - boją się ciebie...', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_WhyHere_09_04', 'Może. Tak, czy inaczej - tutaj znalazłem spokój. Radzę ci pójść w moje ślady.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_15_00', 'Możesz mnie wyszkolić tak bym był równie silny jak ty?', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_09_01', 'Nawet gdybym mógł - po co ci to?', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_Attack_15_00', 'Żeby pokazać tym sukinsynom, że nie można mną pomiatać.', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_Attack_09_01', 'I zanim byś się obejrzał, sam stałbyś się jednym z tych sukinsynów... Nie, drogi panie, to nie jest właściwa motywacja.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_Defend_15_00', 'Co samoobrony!', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_Defend_09_01', 'Do tego potrzeba szybkości, a nie siły. Myślisz, że gruchotanie kości pomoże ci wieść spokojne życie?', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_BACK_15_00', 'Dobre pytanie. Przemyślę to sobie.', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_Ricelord_15_00', 'Chcę wykończyć Ryżowego Księcia i jego zbirów!', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_PleaseTeachSTR_Ricelord_09_01', 'Hmmm... Wielu już próbowało przed tobą.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_ThoughtSTR_15_00', 'Przemyślałem sobie to wszystko jeszcze raz...', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_ThoughtSTR_09_01', 'No i? Wymyśliłeś coś lepszego?', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_ThoughtSTR_NoIdea_15_00', 'Nie.', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_ThoughtSTR_NoIdea_09_01', 'Tak myślałem.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_ThoughtSTR_Ricelord_15_00', 'Tak. Chciałbym przeciwstawić się Ryżowemu Księciu i jego zbirom!', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_ThoughtSTR_Ricelord_09_01', 'Hmmm... Wielu już próbowało przed tobą.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_HelpSTR_LEARN_NOW_09_00', 'Jeśli chcesz mocno uderzyć, musisz najpierw popracować nad odpowiednią techniką. To pierwsza zasada dobrego kowala.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_HelpSTR_LEARN_NOW_09_01', 'Naucz się uderzać całą ręką - od ramienia po nadgarstek.', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_HelpSTR_LEARN_NOW_09_02', 'Im lepiej sobie z tym poradzisz, tym silniejszy będzie twój cios. Sam się wkrótce przekonasz...', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_HelpSTR_15_00', 'MOGĘ pokonać Ryżowego Księcia i jego bandytów - jeśli mi pomożesz!', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_HelpSTR_09_01', 'Dobrze! Przysięgłem, że nigdy nie zaatakuję innego człowieka, ale nie powiedziałem, że nie pokażę komuś jak to zrobić!', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_HelpSTR_15_02', 'Zamieniam się w słuch.', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Thanks_15_00', 'Dzięki za pomoc!', 1, 109, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Horatio_Thanks_09_01', 'Wykorzystaj tę wiedzę wyłącznie w słusznej sprawie!', 1, 109, 9, null, 901, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pock_Wasser_15_00', 'Przysyła mnie Lewus. Mam dla ciebie trochę wody.', 1, 156, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pock_Wasser_04_01', 'Dzięki, chłopcze. Piękne dzięki.', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pock_Wasser_NOWATER_04_00', 'Ale nic ci już nie zostało! Trudno, wezmę trochę od pozostałych.', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_Hello_15_00', 'Cześć! Jestem tu nowy.', 1, 156, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_Hello_04_01', 'Miło zobaczyć nową twarz.', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_Hello_15_02', 'Pewnie jesteś tu już od dawna?', 1, 156, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_Hello_04_03', 'Święta racja, chłopcze. Byłem jednym z pierwszych, którzy tu trafili.', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_KnowMuch_15_00', 'W takim razie na pewno dużo wiesz o tym miejscu?', 1, 156, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_KnowMuch_04_01', 'Co nieco. Większość czasu spędzam tutaj - na polu.', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_KnowMuch_04_02', 'Pewnie dlatego udało mi się tak długo przeżyć. Dostajemy sporo ryżu i trochę gorzałki. Może nie jest to wiele, ale mi wystarczy.', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_WhyJail_15_00', 'Dlaczego tu trafiłeś?', 1, 156, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_WhyJail_04_01', 'Podatki, chłopcze. Podatki! Moja chata była równie pusta jak mój żołądek i po prostu nie mogłem dłużej płacić!', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_WhyJail_04_02', 'No i pewnego dnia schwytali mnie królewscy żołnierze i przywlekli mnie tutaj. Prawdę mówiąc, na zewnątrz wcale nie było mi lepiej. Tutaj przynajmniej nie głoduję.', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_WhyJail_04_03', 'Wcześniej zawsze płaciłem podatki - przez całe życie! Ale dla tego sukinsyna w koronie to nie był żaden argument!', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_ForgotAll_15_00', 'Wszystko w porządku?', 1, 156, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_ForgotAll_04_01', 'Miło zobaczyć nową twarz.', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_ForgotAll_15_02', 'Czekaj! My już kiedyś rozmawialiśmy!', 1, 156, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_ForgotAll_04_03', 'Nie! To niemożliwe. Widzę cię pierwszy raz w życiu!', 1, 156, 4, null, 902, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Pock_ForgotAll_15_04', 'Jasne...', 1, 156, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Rufus_Wasser_15_00', 'Przysyła mnie Lewus. Przynoszę ci wodę.', 1, 15, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Rufus_Wasser_02_01', 'Dzięki, stary. W gębie mi już zaschło.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Rufus_Wasser_NOWATER_02_00', 'Woda?! Hej, kolego! Nic ci już nie zostało. Tylko mi nie mów, że znowu wszyscy zdążyli się napić oprócz mnie!', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Hello_15_00', 'Cześć! Jestem tu nowy. Chciałbym się dowiedzieć, co się tu dzieje.', 1, 15, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Hello_02_01', 'Zapytaj kogoś innego, dobra? Ja tu tylko uprawiam ryż. Na innych rzeczach się nie znam.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Hello_02_02', 'Najchętniej powiedziałbym Ryżowemu Księciuniowi, żeby sam odwalał swoją brudną robotę!', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_15_00', 'Skoro tak ci to nie odpowiada, dlaczego tu pracujesz?', 1, 15, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_02_01', 'To się zdarzyło pierwszego dnia po moim przybyciu. Lewus, jeden z oprychów pracujących dla Ryżowego Księcia, podszedł do mnie i spytał czy nie mógłbym im pomóc na polu.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_02_02', 'Powiedziałem "jasne". W końcu byłem tu nowy i zależało mi na znalezieniu sobie przyjaciół.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_02_03', 'Następnego dnia, kiedy ucinałem sobie drzemkę, facet znowu się zjawił.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_02_04', 'Powiedział: "Chyba nie chcesz, żeby twoi koledzy odwalali za ciebie całą robotę, co?".', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_02_05', 'Powiedziałem mu, że jestem wyczerpany wczorajszą pracą, i że potrzebuję odpoczynku. Ale on miał to gdzieś.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_02_06', 'Złapał mnie za kołnierz i ZACIĄGNĄŁ z powrotem na pole.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_02_07', 'Od tamtej pory codziennie czekał na mnie na progu mojej chaty - dopóki nie nauczyłem się sam wychodzić w pole. Nie chciałem, żeby mnie poturbowali.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Why_02_08', 'To banda morderców. Lepiej trzymaj się od nich z daleka.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Ricelord_15_00', 'Kim jest Ryżowy Książe?', 1, 15, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Ricelord_02_01', 'Był jednym z pierwszych ludzi, którzy tutaj trafili. Pomagał w zakładaniu Obozu i rozpoczął uprawę ryżu.', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rufus_Ricelord_02_02', 'Dziś jedyne, co robi, to obnosi swoje brzuszysko po magazynie. Tłusty wieprz!', 1, 15, 2, null, 903, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_Hallo_15_00', 'Co robisz?', 1, 129, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_Hallo_04_01', 'Przygotowuję ryżówkę, chłopcze.', 1, 129, 4, null, 912, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_Hallo_04_02', 'Proszę - weź sobie jedną butelkę. Tylko nie mów Silasowi.', 1, 129, 4, null, 912, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_PERM_15_00', 'Jak idzie destylacja?', 1, 129, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_PERM_04_01', 'Przy tych facetach ledwie nadążam z zamówieniami. Ci to potrafią wypić!', 1, 129, 4, null, 912, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_PERM_04_02', 'I nawet mi to na rękę. Przynajmniej psy Ryżowego Księcia zostawiają mnie w spokoju.', 1, 129, 4, null, 912, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_Horatio_15_00', 'Co możesz mi powiedzieć o Ryżowym Księciu?', 1, 129, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_Horatio_04_01', 'To zapchlony wieprz! Jego siepacze zmuszają słabszych do pracy na polach.', 1, 129, 4, null, 912, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_Horatio_04_02', 'Jedyna osoba, która mogłaby się mu przeciwstawić to Horacy. Ale on nie lubi przemocy.', 1, 129, 4, null, 912, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_Horatio_04_03', 'Słyszałem, jak kiedyś powiedział, że ma ochotę pogruchotać Księciu kości, ale tak naprawdę nigdy by tego nie zrobił.', 1, 129, 4, null, 912, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jeremiah_Horatio_04_04', 'To by było wbrew jego zasadom.', 1, 129, 4, null, 912, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Hello_15_00', 'Szukasz czegoś?', 1, 127, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Hello_02_01', 'Szukam pęknięć w tamie. Chyba jakiś topielec podgryza jej fundamenty.', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Hello_02_02', 'Paskuda uszkadza zębami i pazurami kamienie i drewniane pale pod wodą.', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Hello_02_03', 'Jeśli nie przestanie, całą tamę trafi szlag!', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_BuiltDam_15_00', 'Czy to TY zbudowałeś tę tamę?', 1, 127, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_BuiltDam_02_01', 'Tak. Zbudowałem ją dawno temu, gdy Nowy Obóz dopiero powstawał.', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_BuiltDam_02_02', 'Oczywiście wszyscy pomagali, ale to ja nadzorowałem budowę.', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_WannaHelp_15_00', 'Może mogę ci jakoś pomóc?', 1, 127, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_WannaHelp_02_01', 'Jasne. Spraw, żeby ta bestia przestała podżerać moją tamę.', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Running_15_00', 'Gdzie mogę ją znaleźć?', 1, 127, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Running_02_01', 'Rozejrzyj się po drugiej stronie jeziora. Nikt tam nigdy nie zagląda. Założę się, że tam ma swoje leże!', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Success_15_00', 'Zabiłem bestię!', 1, 127, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Success_02_01', 'Świetnie! Ściągnąłem tu kilku ludzi Ryżowego Księcia, którzy pomogli mi naprawić uszkodzenia.', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_Success_02_02', 'Nareszcie mogę się porządnie wyspać.', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_PERM_15_00', 'Z tamą wszystko w porządku?', 1, 127, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Homer_PERM_02_01', 'Mocna jak skała. Nic jej nie zaszkodzi!', 1, 127, 2, null, 935, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Fault_15_00', 'Przychodzę zaoferować swoje usługi.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Fault_11_01', 'Śmiesz tak po prostu tutaj wmaszerować i zawracać mi głowę? Ty gnido! STRAŻ!', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_15_00', 'Przychodzę zaoferować swoje usługi.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_11_01', 'A dlaczego myślisz, że potrzebuję twoich usług?', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_ThorusSays_15_00', 'Przeszedłem test zaufania, a Thorus twierdzi, że się nadaję.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_ThorusSays_11_01', 'Gdyby tak nie było, nie dostałbyś się tutaj żywy. Mam nadzieję, że stać cię jeszcze na więcej.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_15_00', 'Przemierzyłem sporą część kolonii i mam kontakty we wszystkich obozach.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_11_01', 'No! To się może przydać. Z kim konkretnie utrzymujesz kontakty?', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Spinner_15_00', 'Bo większość z twoich ludzi to leniwe bałwany czyhające na jakiegoś żółtodzioba, który odwali za nich czarną robotę.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Spinner_11_01', 'Tak jest, poza pewnymi chlubnymi wyjątkami. Ale to jeszcze nie powód, żeby zatrudnić kolejnego leniwego bałwana.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_KopfAb_15_00', 'Mam nadzieję, że nie będę musiał odrąbać ci głowy, żeby udowodnić, że potrafię posługiwać się bronią.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_KopfAb_11_01', 'Pomiędzy odwagą a głupotą jest tylko cienka linia...', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_YBerion_15_00', 'Z Y''Berionem.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_YBerion_11_01', 'Y''Berion nie traci czasu na rozmowy z ludźmi twojego pokroju.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_YBerion_11_02', 'Z twoich kłamstw wnoszę, że masz mnie za idiotę!', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_YBerion_11_03', 'Przykro mi, że masz mnie za takiego głupca.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_YBerion_11_04', 'Nie lubię, kiedy ktoś sprawia mi przykrość.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_Kalom_15_00', 'Z Cor Kalomem', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_Kalom_11_01', 'I?', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_Baals_15_00', 'Z kilkoma Baalami w obozie Bractwa.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_Baals_11_01', 'I?', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_Lares_15_00', 'Z Laresem.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_Lares_11_01', 'I?', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_NLHehler_15_00', 'Z kilkoma łobuzami z Nowego Obozu.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_NLHehler_11_01', 'I?', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_ThatsAll_15_00', 'To już wszyscy, z tych ważniejszych.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_ThatsAll_11_01', 'Nieźle - jak na żółtodzioba.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_ThatsAll_11_02', 'Dostaniesz swoją szansę.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Hello_Kontakte_ThatsAll_INSUFF_11_00', 'I co? Mam być pod wrażeniem?! Znam Kopaczy, którzy mają lepsze kontakty od ciebie!', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Dabei_15_00', 'To znaczy, że jestem jednym z was?', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Dabei_11_01', 'Właśnie tak. Witaj w drużynie, chłopcze.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_Dabei_11_02', 'Kruk wprowadzi cię w szczegóły.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_NurSo_15_00', 'Pomyślałem, że zdam ci raport...', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gomez_NurSo_11_00', 'Idź porozmawiać z Krukiem. I nigdy więcej nie odzywaj się do mnie bez pozwolenia!', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_EBR_100_Gomez_Wait4SC_11_01', 'Jak się tu dostałeś?', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_EBR_100_Gomez_Wait4SC_11_02', 'Czekaj no? Czy to nie ty walczyłeś z naszymi ludźmi w Wolnej Kopalni?', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_EBR_100_Gomez_Wait4SC_15_03', 'Twoi ludzie nie mieli prawa jej atakować. Musiałem zapobiec twoim szalonym zapędom.', 1, 40, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_EBR_100_Gomez_Wait4SC_11_04', 'Rozmowa ze mną takim tonem wymaga pewnej odwagi. Ale zjawianie się tutaj tak po prostu to już zwykła głupota.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_EBR_100_Gomez_Wait4SC_11_05', 'Osobiście dopilnuję, żebyś już nigdy nie wszedł mi w drogę.', 1, 40, 11, null, 100, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_Hello_15_00', 'Kim jesteś?', 1, 84, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_Hello_08_01', 'Mówią na mnie Blizna.', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_What_15_00', 'Czym się zajmujesz?', 1, 84, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_What_08_01', 'Ja i Arto zapewniamy Gomezowi spokój przed nieproszonymi gośćmi.', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_What_08_02', 'Oprócz tego, do moich obowiązków należy poskramianie co zadziorniejszych kobiet.', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_Frau_15_00', 'Kiedy mnie tu zrzucano, widziałem kobietę opuszczaną na dół wraz z ładunkiem.', 1, 84, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_Frau_08_01', 'I co z tego?', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_Frau_15_02', 'Jest tutaj?', 1, 84, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_Frau_08_03', 'Słuchaj, jeśli wiążesz z nią jakieś nadzieje, dam ci dobrą radę: Zapomnij o niej.', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_Frau_08_04', 'Dopiero co ją dostarczono i Gomez kazał ją zamknąć w swojej komnacie.', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_Frau_08_05', 'Jak już mu się znudzi, może przyśle ją tu, na dół. Ale póki co, ona należy DO NIEGO, więc lepiej nie zawracaj sobie nią głowy.', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_PERM_15_00', 'Co możesz mi powiedzieć o Gomezie?', 1, 84, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_PERM_08_01', 'To najpotężniejszy człowiek w całej kolonii. To ci powinno wystarczyć.', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SCAR_PERM_08_02', 'Dostaje wszystko, czego zapragnie, choć tak naprawdę zależy mu tylko na władzy.', 1, 84, 8, null, 101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ARTO_Hello_15_00', 'Kim jesteś?', 1, 70, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ARTO_Hello_13_01', 'Jestem Arto.', 1, 70, 13, null, 102, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ARTO_What_15_00', 'Czym się tutaj zajmujesz?', 1, 70, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ARTO_What_13_01', 'Jestem strażnikiem Gomeza.', 1, 70, 13, null, 102, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ARTO_PERM_15_00', 'Nie lubisz dużo gadać, co?', 1, 70, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ARTO_PERM_13_01', 'Nie.', 1, 70, 13, null, 102, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_FirstIn_10_00', 'Co mogę dla ciebie zrobić?', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Who_15_00', 'Kim jesteś?', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Who_10_01', 'Nazywam się Kruk. Jestem prawą ręką Gomeza. Każdy, kto chce się spotkać z szefem, musi najpierw porozmawiać ze mną.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Krautbote_15_00', 'Mam trochę bagiennego ziela dla Gomeza od Cor Kaloma.', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Krautbote_10_01', 'Gomez nie zajmuje się takimi rzeczami osobiście. To działka Bartholo.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Krautbote_10_02', 'Znajdziesz go w komnacie na prawo od wejścia, albo w kuchni w dużej wieży.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Krautbote_10_03', 'Oczywiście w nocy pewnie śpi. Na twoim miejscu nie przeszkadzałbym mu do rana.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Aufnahme_15_00', 'Chcę się zobaczyć z Gomezem. Thorus powiedział, że mogę zostać Cieniem.', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Aufnahme_10_01', 'Dobrych ludzi nigdy nie za wielu. Chyba masz wystarczająco równo pod sufitem. Możesz się nam przydać.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Aufnahme_10_02', 'Zabiorę cię do Gomeza. Chodź za mną, tylko niczego nie dotykaj!', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_There_10_01', 'Gomez jest tam. Jeśli nie okażesz mu należnego szacunku, osobiście nauczę cię dobrych manier. Zrozumiano?', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_PERM_15_00', 'Jak idzie handel rudą?', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_PERM_10_01', 'Stara Kopalnia jakoś radzi sobie z wydobyciem. Ostatni transport do zewnętrznego świata był bardzo duży.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_BinDabei_15_00', 'Gomez powiedział, że się nadaję.', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_BinDabei_10_01', 'Świetnie! Tak się składa, że możesz od razu udowodnić, na co cię stać. Jest dla ciebie robota.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_BinDabei_10_02', 'To nie powinno być zbyt trudne, jeśli rzeczywiście masz kontakty, o jakich mówiłeś.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpySect_15_00', 'Co mam zrobić?', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpySect_10_01', 'Prowadzimy intensywną wymianę handlową z Bractwem, co nie znaczy, że im do końca ufamy.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpySect_10_02', 'Idź na bagna.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpySect_10_03', 'Kiedy dotrzesz do Obozu Bractwa, miej uszy i oczy szeroko otwarte. Każdy strzępek informacji może się okazać niezwykle cenny.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpySect_10_04', 'Im więcej wywęszysz, tym lepiej. Ta misja wymaga odrobiny taktu, jeśli wiesz, co mam na myśli.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpySect_15_05', 'Bez obaw. Postaram się ich nie rozzłościć.', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpySect_10_06', 'Wiedziałem, że się zrozumiemy.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Equipment_15_00', 'Gdzie mogę dostać lepsze wyposażenie?', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Equipment_10_01', 'Porozmawiaj z Diego, on da ci jakąś zbroję. Ten pancerz nie tylko uchroni cię przed śmiercią, ale będzie również służył jako znak rozpoznawczy.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Equipment_10_02', 'Dzięki niemu zyskasz dostęp do wszystkich ważniejszych miejsc.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_Equipment_10_03', 'Gdybyś potrzebował broni, porozmawiaj ze Skipem. Znajdziesz go w tej wielkiej szopie, w lewym tylnym rogu zamkowego dziedzińca.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpyBericht_15_00', 'Pomyślałem, że zdam ci raport...', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpyBericht_10_01', 'To dobrze. Lubię być informowany na bieżąco.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_15_04', 'Odbyło się wielkie przywołanie.', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpyBericht_10_04', 'Dobrze się spisałeś.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpyBericht_15_02', 'Teraz Bractwo potrzebuje jaj królowej pełzaczy. Przygotują z nich napój, który umożliwi im nawiązanie kontaktu ze Śniącym. Mam te jaja przy sobie.', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpyBericht_10_03', 'Hmm, interesujące. Ciekawe czy to zadziała. Zanieś jaja do świątyni.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpyBericht_10_04', 'Dobrze się spisałeś.', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpyBericht_15_05', 'Niestety, jeszcze nie wiem, co planują ludzie z Bractwa.', 1, 58, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Raven_SpyBericht_10_06', 'To dlaczego zawracasz mi głowę?', 1, 58, 10, null, 105, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_HAllo_15_00', 'Kim jesteś?', 1, 126, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_HAllo_12_01', 'Nazywam się Bartholo. Zajmuję się zaopatrywaniem Magnatów.', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_HAllo_12_02', 'Dostarczam im wszystkiego - od ziela, przez żywność, aż po kobiety.', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_HAllo_12_03', 'Oprócz tego pilnuję tych imbecyli z kuchni.', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_HAllo_12_04', 'Te błazny powinny mi być wdzięczne. Gomez nie toleruje partactwa, nawet w kuchni. Poprzednich dwóch kucharzy skarmił topielcom w rzece.', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_PERM_15_00', 'Chcę dobić z tobą targu.', 1, 126, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_PERM_12_01', 'Mam sporo ciekawych rzeczy - jeśli masz wystarczająco dużo rudy.', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_Krautbote_15_00', 'Mam tu trochę ziela dla Gomeza. Przysyła je Cor Kalom.', 1, 126, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_Krautbote_12_01', 'Pokaż!', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_Krautbote_12_02', 'Hmmmmmm...', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_Krautbote_12_03', 'Świetnie! Gomez zaczął się już niecierpliwić. Masz szczęście, że przyniosłeś je jeszcze dzisiaj!', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_Krautbote_15_04', 'A co z moją zapłatą?', 1, 126, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_Krautbote_12_05', 'Spokojnie... Masz tu 500 bryłek rudy. Taka była umowa.', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_Krautbote_NoKraut_12_00', 'Jak na posłańca masz przy sobie trochę za mało ziela! Mam nadzieję, że nie sprzedałeś go komuś innemu! Wróć, jak będziesz miał całą partię.', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_12_01', 'Podejrzewałem, że prędzej czy później ktoś spróbuje użyć pentagramu.', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_12_02', 'Ale w odróżnieniu od tego zdradzieckiego kowala, Stone''a, CIEBIE już nie potrzebujemy!', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_15_03', 'Gdzie jest Stone?', 1, 126, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_12_04', 'Za kratkami! Ale ciebie czeka miły, przytulny GRÓB!', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bartholo_12_05', 'Brać go, chłopcy! Posiekać go!', 1, 126, 12, null, 106, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EXIT_15_01', 'Muszę już iść!', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EXIT_17_02', 'Obcy wrócić znowu!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EXIT_15_03', 'Dziękuję. Muszę już ruszać w dalszą drogę.', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EXIT_17_04', 'Obcy mieć dobra podróż!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_INTRO_17_01', 'Tarrok chcieć pomocy! Tarrok ranny!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASPASSIERT_15_01', 'Co się tu stało?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASPASSIERT_17_02', 'Tarrok tu złapany przez niebieski żołnierze. Nagle czerwony żołnierze wszędzie.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASPASSIERT_17_03', 'Czerwony żołnierze zabijać... wszystko.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASPASSIERT_17_04', 'Tarrok uciec tu. Czerwony żołnierze nie tu. Oni boją GACH LUG.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASPASSIERT_17_05', 'Ty pomóc, Tarrok boli.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASTUN_15_01', 'Co mogę dla ciebie zrobić?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASTUN_17_02', 'Tarrok chcieć mocny lek, albo Tarrok umrzeć.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASTUN_15_03', 'O jakim lekarstwie mówisz?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASTUN_17_04', 'GACH LUG otruć Tarrok. Tarrok chcieć lek!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_WASTUN_17_05', 'Głupi, głupi Tarrok. Zgubić lek! Nie znaleźć!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_OFFER_15_01', 'Odzyskam twoje lekarstwo!', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_OFFER_17_02', 'Tarrok słaby. Obcy wrócić szybko, albo Tarrok umrzeć!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_CRAWLER_15_01', 'Co to jest GACH LUG?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_CRAWLER_17_02', 'Duży zwierz, dużo nóg ma.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_CRAWLER_17_03', 'GACH LUG groźny! Zjadać Ork - zjadać człowiek!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_CRAWLER_15_04', 'Ach, masz na myśli pełzacze!', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_TONGUE_15_01', 'Potrafisz porozumiewać się w naszym języku?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_TONGUE_17_02', 'Tarrok u ludzi długi czas. Tarrok dobrze słuchać.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SEARCHPOTION_15_01', 'Nie mogę znaleźć twojego lekarstwa!', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SEARCHPOTION_17_02', 'Obcy szukać więcej! Lek gdzieś tu!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SEARCHPOTION_17_03', 'Tarrok uciekać od GACH LUG! Tarrok chować się i uciekać!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SEARCHPOTION_17_04', 'Obcy przeszukać nisze też!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SUCHEULUMULU_15_01', 'Jesteś przyjacielem Ur-Shaka, tego szamana?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SUCHEULUMULU_17_02', 'Ur-Shak niewolnik, jak Tarrok. Ur-Shak uciec! Dawno, dawno temu!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SUCHEULUMULU_15_03', 'Twój przyjaciel powiedział mi, że mógłbyś dla mnie zrobić Ulu-Mulu.', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SUCHEULUMULU_17_04', 'Ty pomóc mi, ja pomóc ty!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SUCHEULUMULU_17_05', 'Tarrok bardzo słaby. Nie ma lek, Tarrok umierać.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SUCHEULUMULU_17_06', 'Obcy przynieść lek, wtedy Tarrok pomóc!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_GIVEPOTION_15_01', 'Proszę, znalazłem twoje lekarstwo!', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_GIVEPOTION_17_02', 'Obcy nie jak inny ludzie! Obcy dobry!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_GIVEPOTION_17_03', 'Tarrok dziękować!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_GIVEPOTION_15_04', 'Możesz już zrobić dla mnie Ulu-Mulu?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_GIVEPOTION_17_05', 'Obcy pomóc Tarrok, teraz Tarrok pomóc Obcy!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_GIVEPOTION_17_06', 'Obcy potrzebować KROTAHK, KHAZ-TAK, DWACHKARR i ORTH-ANTAK.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_GIVEPOTION_17_07', 'Obcy przynieść, Tarrok zrobić Ulu-Mulu!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_FIREWARAN_15_01', 'Co to jest KROTAHK?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_FIREWARAN_17_02', 'Być język ognia. Język smoka!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_FIREWARAN2_15_01', 'Gdzie mogę znaleźć takiego smoka?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_FIREWARAN2_17_02', 'Smok mieszka w domu Tarroka. Obcy musi szukać!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_FIREWARAN2_17_03', 'Smok mieszka też na piasku, przy morzu.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SHADOWBEAST_Info_15_01', 'Co to jest KHAZ-TAK?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SHADOWBEAST_Info_17_02', 'Być róg cieniostwór. Róg ostry jak nóż, twardy jak kamień.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SHADOWBEAST2_Info_15_01', 'Gdzie mogę znaleźć tego cieniostwora?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SHADOWBEAST2_Info_17_02', 'On w lesie albo w jaskini. Nie lubi słońce.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SHADOWBEAST2_Info_17_03', 'Bardzo zły. Obcy uważać!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SWAMPSHARK_15_01', 'DWACHKARR? A cóż to takiego?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SWAMPSHARK_17_02', 'Ząb błotnego węża. Jak wąż ugryźć, nikt nie móc uciec.', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SWAMPSHARK2_15_01', 'Gdzie mogę znaleźć te błotne węże?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_SWAMPSHARK2_17_02', 'Dużo wąż błotny w obóz ludzi. Obóz na bagnie to jest!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_TROLL_15_01', 'Co to jest ORTH-ANTAK?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_TROLL_17_02', 'Być ząb wielki Troll! Robić duża dziura w ofiara!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_TROLL2_15_01', 'Gdzie mogę znaleźć Trolle?', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_TROLL2_17_02', 'Troll siedzieć w góry. Troll lubi dużo miejsca!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_TROLL2_17_03', 'Obcy szukać w górach na północ. Ale uważać na Trolla łapy!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_TROLL2_17_04', 'Troll walnąć - Obcy spaść w dół!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_LOOKINGULUMULU_15_01', 'Nie mam jeszcze wszystkich czterech przedmiotów.', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_LOOKINGULUMULU_17_02', 'Obcy szukać dalej! Tarrok tu czekać!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EVERYULUMULU_15_01', 'Mam już wszystkie przedmioty potrzebne do sporządzenia Ulu-Mulu!', 1, 179, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EVERYULUMULU_17_02', 'Obcy być silny wojownik! Dać rzeczy! Tarrok zrobić ULU-MULU!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EVERYULUMULU_17_03', 'Gotowe! Obcy nosić ULU-MULU, być dumny! Tarrok teraz spać!', 1, 179, 17, null, 2101, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_EnterCastle_15_00', 'Pewnie nie będziesz chciał wpuścić mnie do zamku?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_EnterCastle_09_01', 'Tylko ludzie Gomeza mają prawo wstępu.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_WorkForGomez_15_00', 'Chcę pracować dla Gomeza.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_WorkForGomez_09_01', 'Czyżby? A czemu myślisz, że Gomez chciałby, żeby ktoś taki jak ty dla niego pracował?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_DiegoSentMe_15_00', 'Diego powiedział, że to TY podejmujesz takie decyzje.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_DiegoSentMe_09_01', 'Huh... Jeśli Diego uważa, że jesteś w porządku, to czemu SAM się tobą nie zajmie?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_DiegoSentMe_09_02', 'Słuchaj uważnie: Diego podda cię najpierw testowi. Jeśli ON uzna, że się nadajesz, ja wpuszczę cię do zamku na spotkanie z Gomezem.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_DiegoSentMe_09_03', 'To, co będzie później, zależy już tylko od ciebie, jasne?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_DiegoSentMe_15_04', 'Porozmawiam z Diego.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMe_15_00', 'Dlaczego sam nie poddasz mnie próbie?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMe_09_01', 'To nie takie proste, chłopcze. Nowy, który chce tu do czegoś dojść, potrzebuje opiekuna.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMe_09_02', 'Tym opiekunem musi być jeden z ludzi Gomeza. I to właśnie on podda cię próbie.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMe_09_03', 'A jeśli narobisz kłopotów to on poniesie za nie odpowiedzialność. Takie są tutaj zasady.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMeAgain_15_00', 'Na pewno znajdzie się dla mnie jakieś zadanie...', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMeAgain_09_01', 'Nie. Rzeczy, którymi zajmują się Strażnicy przerastają twoje możliwości, chłopcze.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMeAgain_09_02', 'Trzymaj się poleceń swojego opiekuna.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMeICanDoIt_15_00', 'Potrafię sprostać każdemu zadaniu, które mi powierzysz.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMeICanDoIt_09_01', 'Och? Aż tak ci zależy na wpadce? Hmm. Jest jedna rzecz, którą może się zająć wyłącznie człowiek nie będący w służbie Gomeza.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_TryMeICanDoIt_09_02', 'Ale uprzedzam cię: jak to schrzanisz, będziesz miał nie lada kłopoty.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Offer_15_00', 'Jestem gotów.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Offer_09_01', 'To, co ci za chwilę powiem, musi pozostać między nami, rozumiemy się?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Offer_15_02', 'Jasne.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Offer_09_03', 'Pewien człowiek z Nowego Obozu sprawia nam problemy. Nazywa się Mordrag i przywłaszczył sobie kilka rzeczy należących do Magnatów.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Offer_09_04', 'Oczywiście to samo można powiedzieć o wielu Szkodnikach z Nowego Obozu, ale Mordrag ma czelność zjawiać się w NASZYM obozie i odsprzedawać NASZE rzeczy NASZYM chłopcom!', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Offer_09_05', 'A to już za wiele. Niestety, łajdak wie, że nie mogę z tym nic zrobić.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Offer_15_06', 'Dlaczego?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Offer_09_07', 'Bo jest pod opieką Magów.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_OFFER_BACK_15_00', 'Zajmę się tym.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_KillHim_15_00', 'Chcesz, żebym go zabił, tak?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_KillHim_09_01', 'Chcę mieć pewność, że już nigdy więcej się tu nie pojawi. Jak to osiągniesz - to już twoja sprawa.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Where_15_00', 'Gdzie znajdę Mordraga?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_Where_09_01', 'Kręci się przy południowej bramie, po przeciwnej stronie zamku, tuż za wejściem. Sukinsyn boi się pojawiać bliżej centrum.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MagesProtect_15_00', 'Dlaczego Magowie bronią Mordraga?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MagesProtect_09_01', 'Bo służy im za posłańca. Nasi magowie utrzymują kontakty z czarodziejami z Nowego Obozu. Często wymieniają informacje za pośrednictwem gońców.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MagesProtect_09_02', 'Podejrzewam, że nieźle się wkurzą na wieść, że coś przydarzyło się ich kurierowi.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MagesProtect_15_03', 'A co ze mną? Co Magowie mogą mi zrobić?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MagesProtect_09_04', 'Jesteś tu nowy, nic ci nie będzie. Ale ja odpowiadam za wszystko, co robią moi ludzie. Dlatego musisz trzymać język za zębami.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MageProblem_15_00', 'Widzę, że masz trochę problemów z Magami...', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MageProblem_09_01', 'Tak. I to problemów, które nie łatwo rozwiązać. Kilka lat temu jeden z Cieni próbował zasztyletować we śnie Arcymistrza Magów Ognia.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MageProblem_09_02', 'Faceta znaleziono potem w Zewnętrznym Pierścieniu. Jeśli chodzi o ścisłość - rozsmarowanego PO CAŁYM Zewnętrznym Pierścieniu.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_ANALYZE_BACK_15_00', 'Zajmę się tym.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MordragDead_15_00', 'Mordrag już nigdy nikogo nie okradnie!', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MordragDead_09_01', 'Chcesz powiedzieć, że go pokonałeś? Nieźle, chłopcze.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MordragGone_15_00', 'Facet już nigdy się tu nie pokaże!', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragKo_MordragGone_09_01', 'Wolałbym, żebyś go zabił.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragFailed_09_00', 'Ty ofiaro! Kazałem ci TRZYMAĆ JĘZYK ZA ZĘBAMI!!!', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_MordragFailed_09_01', 'Spartaczyłeś sprawę! Zapomnij o wszystkim, co ci powiedziałem. Nie próbuj już nic więcej zdziałać w tej sprawie!', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_BribeGuard_15_00', 'Czy za odpowiednią sumkę mógłbyś mnie wpuścić do zamku?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_BribeGuard_09_01', 'Za odpowiednią sumkę...', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_BribeGuard_15_02', 'Ile?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_BribeGuard_09_02', 'No cóż - liczenie rudy musi potrwać odpowiednio długo. Dość długo, żeby całkowicie pochłonąć uwagę moją i moich chłopców. Korzystając z naszej nieuwagi, mógłbyś przemknąć się do środka...', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_BribeGuard_15_03', 'Czyli ile konkretnie?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_BribeGuard_09_03', 'Myślę, że przeliczenie 1000 bryłek zajmie nam wystarczająco dużo czasu.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_BribeGuard_15_04', '1000 bryłek?!', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_BribeGuard_09_04', 'Cóż, gdybyś dołączył do Gomeza, mógłbyś wejść do zamku za darmo.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_Give1000Ore_15_00', 'Masz tu swoje 1000 bryłek rudy, a teraz pozwól mi przejść.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_Give1000Ore_09_01', 'W porządku, idź. Tylko jak już będziesz w środku, nie wywiń czegoś głupiego, dobra?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_Give1000Ore_09_02', 'Próbujesz mnie okpić, chłopcze? Nie masz 1000 bryłek rudy!', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_LetterForMages_15_00', 'Muszę się dostać do zamku. Mam list do Arcymistrza Magów Ognia.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_LetterForMages_09_01', 'I myślisz, że wpuszczę cię tak po prostu do środka, żebyś oddał list i zgarnął nagrodę?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_LetterForMages_15_02', 'Tak.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_LetterForMages_09_03', 'Dobra, pokaż ten list.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_LetterForMages_15_04', 'Nie ma mowy. Zapomnij o tym!', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_LetterForMages_09_05', 'W porządku. Już zapomniałem.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_ReadyForGomez_15_00', 'Diego powiedział, że jestem już gotów, by spotkać się z Gomezem.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_ReadyForGomez_09_01', 'To ja o tym zadecyduję!', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_ReadyForGomez_15_02', 'I co zdecydowałeś?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_ReadyForGomez_09_03', 'Hmmm...', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_ReadyForGomez_09_04', 'Muszę przyznać, że całkiem nieźle sobie poradziłeś.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_ReadyForGomez_09_05', 'Niech będzie! Możesz stanąć przed Gomezem. On podejmie ostateczną decyzję co do twojego przyjęcia.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_ReadyForGomez_09_06', 'Od tej pory musisz radzić sobie sam, chłopcze.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_Krautbote_15_00', 'Mam tu partię bagiennego ziela dla Gomeza, od Cor Kaloma.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_Krautbote_09_01', 'Pokaż!', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_Krautbote_09_02', 'Hmmmmmm...', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_Krautbote_09_03', 'W porządku, możesz iść. Udaj się prosto do siedziby Magnatów i porozmawiaj z Bartholo.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_Krautbote_09_04', 'Jak na posłańca masz przy sobie trochę za mało ziela! Mam nadzieję, że nie sprzedałeś go komuś innemu! Wróć, jak będziesz miał całą partię.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_KdWSiegel_15_00', 'Jestem posłańcem Magów Wody. Muszę się dostać do zamku.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_KdWSiegel_09_01', 'Masz przy sobie amulet kuriera. Strażnicy nie będą cię zatrzymywali.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_KdWSiegel_09_02', 'Nie chcę mieć nic wspólnego z magami! Przestań mi wreszcie zawracać głowę, dobrze?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_KdWSiegel_09_03', 'No jaaasne... A amulet pewnie zgubiłeś, co? Albo ci ukradli, hę?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_SttGeschafft_15_00', 'Udało mi się. Zostałem przyjęty do Obozu!', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_SttGeschafft_09_01', 'Gratuluję, chłopcze. Dobrze ci radzę, trzymaj się blisko Diego.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_SttGeschafft_09_02', 'Do Gomeza lub Kruka idź, tylko jeśli masz coś NAPRAWDĘ ważnego do powiedzenia.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_PERM2_15_00', 'Jak się masz?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Thorus_PERM2_09_01', 'Nowy Obóz nie sprawia nam zbyt wielu kłopotów. Bardziej martwią mnie te świry z Sekty.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_GARDIST_Info_15_01', 'Chciałeś mi coś powiedzieć?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_GARDIST_Info_09_02', 'Tak. To, co pokazałeś w kopalni, świadczy nie tylko o twojej odwadze, ale również o niepospolitej sile i umiejętnościach.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_GARDIST_Info_09_03', 'Chętnie bym cię widział w szeregach straży.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_GARDIST_Info_09_04', 'Ale zanim to nastąpi musisz jeszcze trochę popracować nad swoimi umiejętnościami. Tylko najlepsi mogą zostać strażnikami.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_GARDIST_Info_09_05', 'Daję ci niepowtarzalną szansę. Co ty na to?', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_15_01', 'Chcę zostać Strażnikiem!', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_02', 'Miło mi to słyszeć, ale najpierw muszę ci powiedzieć to, co mówię wszystkim nowym rekrutom. Słuchaj uważnie, bo nie będę się powtarzał.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_03', 'Do tej pory żyłeś na własny rachunek, ale to się od dziś zmieni. Moi ludzie trzymają się razem. Do Strażników należy dbanie o bezpieczeństwo Magnatów, rudy, obozu i kopalni.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_04', 'Ruda wydobywana jest przez Kopaczy, ale to my pilnujemy, żeby nie pożarły ich pełzacze. Pertraktacje z królem prowadzą Magnaci, ale to my dbamy o ich bezpieczeństwo.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_05', 'Dniem i nocą strzeżemy korytarzy kopalni. Dniem i nocą pilnujemy bram Obozu i pozwalamy jego mieszkańcom wieść spokojne życie.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_06', 'Na początku byliśmy tylko bezładną zgrają, ale staliśmy się siłą, z którą każdy musi się liczyć. Ciężko pracowaliśmy, by zasłużyć na tę reputację.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_07', 'Od moich ludzi oczekuję więc wyłącznie jednego: lojalności. Tylko stojąc ramię w ramię będziemy w stanie obronić to, co należy do nas...', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_08', '...i przetrwać.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_09', 'Pozostałych rzeczy dowiesz się w swoim czasie. Bądź gotów do pomocy każdemu, kto jej potrzebuje, nieważne jak trudne i niebezpieczne to zadanie.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_10', 'Idź do Stone''a i poproś go o zbroję i miecz.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_AUFNAHME_Info_09_11', 'Znajdziesz go w kuźni, w Wewnętrznym Pierścieniu.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_NOCHWAS_Info_09_01', 'A, i jeszcze coś...', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_NOCHWAS_Info_09_02', 'Witamy w Straży...', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_WANNABEMAGE_Info_15_01', 'Interesuje mnie ścieżka magii...', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_WANNABEMAGE_Info_09_02', 'W takim razie powinieneś porozmawiać z Corristo. To on uczył Miltena. Chyba nie powinno być żadnych przeciwwskazań.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_Teach_15_00', 'Możesz mnie czegoś nauczyć?', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_Teach_09_01', 'Mogę ci pomóc w rozwinięciu twoich umiejętności i siły.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND1_Info_15_01', 'Chciałbym nauczyć się posługiwać dwuręcznym mieczem.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND1_Info_09_02', 'Dobrze, najpierw zajmiemy się podstawami.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND1_Info_09_03', 'Wyciągnij miecz przed siebie. Aby zaatakować wroga tak ciężką bronią, musisz mocniej się zamachnąć.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND1_Info_09_04', 'Unieś ramię i zdecydowanie opuść miecz. To powinno wystarczyć, żeby powalić przeciwnika na ziemię.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND1_Info_09_05', 'Wykorzystaj bezwładność broni, by unieść ją ponownie do góry.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND1_Info_09_06', 'Dwuręczne miecze świetnie sprawdzają się przy zadawaniu ciosów z boku. W ten sposób możesz trzymać przeciwnika na dystans.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND1_Info_09_07', 'To ci powinno wystarczyć na początek. Teraz trochę poćwicz.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_15_01', 'Chciałbym dowiedzieć się czegoś więcej o walce dwuręcznym mieczem.', 1, 18, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_09_02', 'Musisz się nauczyć płynnie przenosić środek ciężkości. Trzymaj miecz pionowo. Obie dłonie mocno zaciśnij na jego rękojeści i przesuń go nieco w bok.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_09_03', 'Teraz uderz szybko od góry, i pozwól klindze powędrować nad twoje ramię. Teraz możesz wyprowadzić szybkie cięcie na prawo.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_09_04', 'Twój przeciwnik nie będzie miał okazji podejść bliżej.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_09_05', 'Albo spróbuj wyprowadzić z lewej strony cios do przodu, aby odrzucić od siebie rywala. ', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_09_06', 'Teraz obrót, żeby kolejny cios nabrał odpowiedniej mocy. Przy odrobinie szczęścia wróg nie przeżyje tego uderzenia.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_09_07', 'A jeśli i to nie wystarczy, wykorzystaj resztę siły zamachowej, by ponownie unieść miecz do góry.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_09_08', 'Po skończonym ataku wykonaj zasłonę i wypatruj luki w obronie przeciwnika.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_200_Thorus_ZWEIHAND2_Info_09_09', 'Kluczem do sukcesu jest ciągła zmiana pozycji i umiejętne wykorzystanie bezwładności broni.', 1, 18, 9, null, 200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_07_00', 'Ach! Nowa twarz!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_15_01', 'Czego chcesz?', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_07_02', 'Chcę ci zaoferować pomoc. Jesteś tu nowy, a nowi zawsze pakują się w kłopoty... Możesz sobie zaoszczędzić nieprzyjemności ofiarując mi... drobny datek.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_07_03', 'Marne 10 bryłek rudy. Toż to grosze...', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_Pay_15_00', 'Masz tu 10 bryłek. Ale pomożesz mi, w razie potrzeby?', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_Pay_07_01', 'Jeśli tylko będę w pobliżu, możesz na mnie liczyć. Znajdziesz mnie pomiędzy targowiskiem a południową bramą.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_Pay_07_02', 'Resztę obozu obstawiają Fletcher i Bloodwyn.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Schutz_NoOre_07_00', 'Hej, masz mnie za idiotę?! Wróć, jak będziesz miał dość rudy!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatDoIGet_15_00', 'A co będę z tego miał?', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatDoIGet_07_01', 'Dopilnuję, żeby nic złego ci się nie przydarzyło na moim terenie.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatDoIGet_07_02', 'Jak goście z Nowego Obozu nadepną ci na odcisk albo wkurzy cię jakiś świr z Sekty, możesz na mnie liczyć.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatDoIGet_07_03', 'Jeśli weźmiesz się za łby z jakimś Kopaczem, pomożemy temu z was, który zapłacił podatek - proste, nie?', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatDoIGet_15_04', 'A jeśli okaże się, że obydwaj zapłaciliśmy?', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatDoIGet_07_05', 'Wtedy będziemy spokojnie patrzeć, jak się zarzynacie. Ale to się nie zdarza zbyt często.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatIf_15_00', 'A jeśli nie zapłacę?', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatIf_07_01', 'Człowieku, nie narażaj się na niepotrzebny stres! Jesteś tu nowy - rozejrzyj się dookoła. Zbierz trochę rudy, a jak będziesz miał już dość - zapłać. Tak jest bezpieczniej.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_WhatIf_07_02', 'Możesz to zrobić teraz, albo później. Tylko nie licz na moją pomoc, dopóki nie dostanę rudy. Mam nadzieję, że się rozumiemy?', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_Later_15_00', 'Do zobaczenia.', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Hello_Later_07_01', 'Miej oczy szeroko otwarte.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Schutz_15_00', 'Przemyślałem sobie to, co powiedziałeś. Oto 10 bryłek rudy.', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Schutz_07_01', 'Mądra decyzja, kolego. Od tej pory możesz liczyć na moją pomoc.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_Schutz_07_02', 'Nie widzę u ciebie żadnych 10 bryłek. Wróć, jak będziesz miał całą kwotę.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PermPaid_15_00', 'No i, jak leci?', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PermPaid_07_01', 'Możesz na mnie liczyć, chłopcze!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_201_Jackal_WELCOME_Info_07_01', 'Widzę, że szybko pniesz się do góry. Dobra robota, stary!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_01', 'Patrzcie państwo. Toż to nasz arcy-zdrajca!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_02', 'Gdybyś nie zadawał się z tymi fajtłapami, mógłbyś nadal być jednym z nas!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_03', 'Hej, patrzcie! To ten facet z Nowego Obozu, przez którego mamy tyle kłopotów.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_04', 'Gdybyś wykazał wtedy choć odrobinę rozsądku, mógłbyś teraz być po stronie zwycięzców... po NASZEJ stronie!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_05', 'Patrzcie no! To ten gość z obozu na bagnie.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_06', 'Za długo zadawałeś się z tymi świrami z Sekty. Zdążyli ci zrobić wodę z mózgu.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_07', 'Teraz nie uratują cię nawet pieniądze, które zapłaciłeś mi za ochronę!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_08', 'Trzeba mi było zapłacić kiedy miałeś okazję.', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_15_09', 'Posunęliście się za daleko. Atak na kopalnię był poważnym błędem.', 1, 38, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_10', 'Ale wygląda na to, że się udało. A tobie już nic do tego!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Jackal_PAYDAY_07_11', 'DALEJ, CHŁOPCY! WYKOŃCZMY GO!!!', 1, 38, 7, null, 201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Bullit_First_06_00', 'Kogo my tu mamy? Czy to nie ta ofiara, którą ochrzciłem wcześniej? Czego chcesz? Przyszedłeś po repetę?', 1, 105, 6, null, 203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Bullit_AufsMAul_15_00', 'Przyszedłem pogruchotać ci szczękę.', 1, 105, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Bullit_AufsMAul_06_01', 'Ha! No to chodź tutaj i spróbuj szczęścia, synku!', 1, 105, 6, null, 203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_203_Bullit_Wait4SC_06_01', 'Znowu ty?! Powinienem cię utopić w jeziorze podczas naszego pierwszego spotkania!', 1, 105, 6, null, 203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_203_Bullit_Wait4SC_15_02', 'Wtedy nie miałem szans - teraz karta się odwróciła.', 1, 105, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_203_Bullit_Wait4SC_06_03', 'Ty gnido! Mam tylko nadzieję, że będziesz trudniejszym przeciwnikiem niż ostatnio!', 1, 105, 6, null, 203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_13_00', 'Kto cię tu wpuścił?', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_15_01', 'Thorus.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_13_02', 'I czego tu szukasz?', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_JustLooking_15_00', 'Chciałem się tylko trochę rozejrzeć.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_JustLooking_13_01', 'Bardzo śmieszne.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_Mages_15_00', 'Mam wiadomość dla magów.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_Mages_13_01', 'Pracujesz dla magów? Nie chcę mieć z nimi nic do czynienia!', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_Kraut_15_00', 'Przyniosłem bagienne ziele dla Gomeza.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_Kraut_13_01', 'To zanieś je do tego domu, którego wejścia broni dwóch strażników.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_Join_15_00', 'Idę zobaczyć się z Gomezem. Zamierzam do was dołączyć.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_Join_13_01', 'Ty? A co z ciebie będzie za pożytek?', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_Join_15_02', 'Cienie na mnie nie narzekały.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_Hello_Join_13_03', 'Ale my nie chcemy nawet słyszeć o Cieniach! To MY trzymamy rękę na pulsie.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_REFUSETRAIN_15_00', 'Możesz mnie nauczyć lepiej walczyć?', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scorpio_REFUSETRAIN_13_01', 'Szkolę tylko Strażników, więc dopóki Thorus nie przyjmie cię w nasze szeregi, musisz poszukać sobie innego nauczyciela.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_WELCOME_Info_13_01', 'Przejście do nas było najmądrzejszą decyzją twojego życia!', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_Info_15_01', 'Możesz mnie czegoś nauczyć?', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_Info_13_02', 'Jeśli masz dość rudy, pokażę ci jak posługiwać się kuszą. To cię będzie kosztować jakieś 200 bryłek.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_OK_15_01', 'Umowa stoi. Pokaż mi jak obchodzić się z kuszą.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_OK_13_02', 'Dobra. Bierzmy się do roboty.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_OK_13_03', 'Złap kuszę mocno i oprzyj ją o ramię. To powinno zwiększyć celność strzału.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_OK_13_04', 'Przez kilka pierwszych dni twoje ramię da ci się nieźle we znaki, ale z czasem przywykniesz.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_OK_13_05', 'Po jakimś tygodniu będziesz miał ręce ze stali!', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_OK_13_06', 'Wyceluj spokojnie i powoli ściągnij spust. Bełt niesie ze sobą więcej siły niż strzała, dlatego powoduje większe zniszczenia.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW_OK_13_07', 'DWIEŚCIE BRYŁEK RUDY, płatne do ręki i to od razu! Inaczej nie mamy o czym rozmawiać!', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_Info_15_01', 'Chciałbym dowiedzieć się czegoś więcej o strzelaniu z kuszy.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_Info_13_02', 'To cię będzie kosztować 300 bryłek rudy.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_OK_15_01', 'Zaczynajmy.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_OK_13_02', 'Dobra. Twoje strzały będą celniejsze, jeśli przed ściągnięciem spustu ugniesz nieco nogi w kolanach.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_OK_13_03', 'Naucz się poprawnie oceniać prędkość z jaką porusza się twój cel.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_OK_13_04', 'Wystrzel pocisk tak, by w odpowiednim miejscu i czasie przeciął ścieżkę, którą porusza się cel.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_OK_13_05', 'Jeśli atakujesz więcej niż jeden cel, nie trać czasu: musisz możliwie szybko przygwoździć jeden za drugim dobrze wymierzonymi strzałami.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_OK_13_06', 'To by było na tyle. ', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_CROSSBOW2_OK_13_07', 'Najpierw postaraj się zdobyć te TRZYSTA BRYŁEK RUDY!', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_HeyPC_Info_13_01', 'Nie bój się, człowieku! Chodź no tutaj!', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_BANISHED_Info_15_01', 'Wszystko w porządku?', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_BANISHED_Info_13_02', 'Ukrywam się. Mam już dość machlojek strażników.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_BANISHED_Info_13_03', 'Ale zabrałem kilka niezłych cacek ze zbrojowni. Gdybyś potrzebował broni - zgłoś się do mnie.', 1, 87, 13, null, 205, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_205_Scorpio_TRADE_Info_15_01', 'Pokaż, co tam masz.', 1, 87, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Hello_15_00', 'Wasz zamek jest bardzo duży.', 1, 124, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Hello_08_01', 'Chyba cię jeszcze tutaj nie widziałem. Kim jesteś?', 1, 124, 8, null, 208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Hello_15_02', 'Jestem tu nowy. Chciałem się trochę rozejrzeć.', 1, 124, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Burg_15_00', 'Możesz mi opowiedzieć o tym zamku?', 1, 124, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Burg_08_01', 'Co tu dużo mówić: Gomez i jego ludzie zajęli go po wielkim buncie.', 1, 124, 8, null, 208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Burg_08_02', 'Od początku wiedziałem, że warto będzie stanąć po jego stronie.', 1, 124, 8, null, 208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Burg_08_03', 'Wielu z nas, jeszcze jako więźniowie zamknięci w lochach lub zmuszani do pracy w kopalni, uznawało zwierzchnictwo Gomeza.', 1, 124, 8, null, 208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Burg_15_04', 'Czy te lochy znajdują się pod zamkiem?', 1, 124, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_Burg_08_05', 'Tak, ale teraz świecą pustką. Nikt tam nie schodził od czasu wielkiego buntu.', 1, 124, 8, null, 208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_PERM_15_00', 'Jak wygląda życie strażnika?', 1, 124, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_PERM_08_01', 'Jest spokojne. Jesteśmy największym i najsilniejszym obozem w kolonii. Nikt nie śmie nas zaczepiać.', 1, 124, 8, null, 208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cutter_PERM_15_02', 'Rozumiem.', 1, 124, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_208_Cutter_WELCOME_Info_08_01', 'Dokonałeś właściwego wyboru. Spodoba ci się bycie Strażnikiem!', 1, 124, 8, null, 208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_WhatDoYouDo_15_00', 'Czym się tutaj zajmujesz?', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_WhatDoYouDo_01_01', 'Organizuję walki na arenie. Przyjmuję zakłady, pozyskuję nowych wojowników... No wiesz.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_JoinOC_15_00', 'Chcę dołączyć do waszego obozu. Możesz mi pomóc?', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_JoinOC_01_01', 'Pomogę ci, jeśli zrobisz na mnie odpowiednio dobre wrażenie.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_JoinOC_01_02', 'Najlepsi wojownicy z wszystkich obozów przybywają tutaj, by stanąć w szranki na mojej arenie.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_JoinOC_01_03', 'Wyzwij któregoś z nich na pojedynek. Zobaczę, co potrafisz, i jeśli mi się spodoba, może szepnę słówko w twoim imieniu.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KirgoSuccess_15_00', 'Walczyłem z Kirgo!', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KirgoSuccess_01_01', 'Tak, ale przegrałeś!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KirgoSuccess_01_02', 'Chyba nie myślisz, że będę pod wrażeniem takiego popisu...', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KirgoSuccess_01_03', 'I pokonałeś go! Całkiem nieźle jak na takiego żółtodzioba! Jestem pod wrażeniem!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KHARIMSuccess_15_00', 'Wyzwałem Kharima na pojedynek!', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KHARIMSuccess_01_01', 'I spuścił ci niezłe baty!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KHARIMSuccess_01_02', 'Ale muszę przyznać, że wybrałeś sobie dobrego przeciwnika. Nie znoszę tych sukinsynów z Nowego Obozu.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KHARIMSuccess_01_03', 'Widzę, że myślimy podobnie. Przyda się nam ktoś taki jak ty!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KHARIMSuccess_01_04', 'I pokonałeś go! Muszę przyznać, że świetnie sobie poradziłeś. Kharim od dawna uchodził za jednego z najlepszych wojowników w kolonii.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_KHARIMSuccess_01_05', 'Jestem pod wrażeniem!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_OtherCamps_15_00', 'Myślałem, że Stary i Nowy Obóz nie dogadują się najlepiej. Dlaczego pozwalacie obcym walczyć na waszej arenie?', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_OtherCamps_01_01', 'To proste. Raz w tygodniu organizujemy walki, a Kopacze lubią patrzeć, jak Szkodniki z Nowego Obozu dostają po głowie.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_OtherCamps_01_02', 'Gdy walczy któryś z nich przyjmuję więcej zakładów, a to dobrze wpływa na interes!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_OtherCamps_01_03', 'Osobiście nienawidzę tych wieprzy z Nowego Obozu, ale w tych trudnych czasach żaden pieniądz nie śmierdzi...', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_WannaBet_15_00', 'Chciałbym obstawić walkę.', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_WannaBet_01_01', 'Przecież teraz nikt nie walczy!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_WannaBet_01_02', 'Najbliższa walka odbędzie się dopiero za kilka dni. Będzie ogłoszenie!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_WannaFight_15_00', 'Chciałbym stoczyć walkę na arenie.', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_WannaFight_01_01', 'Nie mogę ci pozwolić walczyć, póki nie dołączysz do któregoś z obozów.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_WannaFight_01_02', 'Ludzi nie interesują niezależni wojownicy.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_15_00', 'Zajmujesz się również szkoleniem wojowników?', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_01_01', 'Tak, ale nie za darmo. Jak chcesz, żebym cię czegoś nauczył, musisz zapłacić.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_15_00', 'Chciałbym nauczyć się walki jednoręcznym orężem.', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_01_01', 'Mądra decyzja. Jednak zanim poznasz bardziej zaawansowane techniki, powinieneś nauczyć się prawidłowo trzymać oręż w ręku.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_01_02', 'Początkujący często łapią zwykły miecz obydwoma rękami. Radziłbym ci się do tego nie przyzwyczajać, to fatalny nawyk. ', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_01_03', 'Trzymaj broń jedną ręką, ostrzem do góry, i zacznij nią machać.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_01_04', 'Musisz się nauczyć, jak zgrać twoje ruchy z bezwładnością oręża. Dzięki temu twoje ataki będą szybsze i bardziej zaskakujące.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_01_05', 'Zapamiętaj sobie dobrze, co ci powiedziałem, a twój styl walki stanie się o wiele bardziej elegancki i skuteczny.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_01_06', 'A, i jeszcze coś! Niektóre ciosy powodują większe obrażenia niż zwykle. Oczywiście, jako początkujący masz raczej niewielkie szanse na zadanie krytycznego uderzenia.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_01_07', 'Ale to się zmieni w miarę czynienia przez ciebie postępów.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_1h_NoOre_01_00', 'Nie masz wystarczającej ilości rudy!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_2h_15_01', 'Naucz mnie sprawniej posługiwać się jednoręczną bronią.', 1, 31, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_2h_Info_01_02', 'Dobrze, podstawy już znasz. Nieznaczne opuszczenie broni zwiększy siłę twojego pierwszego ciosu.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_2h_Info_01_03', 'Musisz wykorzystać siłę bezwładności, pamiętasz? Świetnie. Teraz nauczysz się lepiej balansować ciałem. Po zadaniu dwóch ciosów wykonaj obrót. To powinno zmylić twojego przeciwnika i pozwolić ci wyjść na dobrą pozycję do następnego ataku.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_2h_Info_01_04', 'Wtedy wyprowadź następne cięcie z prawej strony...', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_2h_Info_01_05', 'I znowu do przodu. Pamiętaj - trening czyni mistrza, więc najlepiej weź się od razu do roboty!', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Scatty_TRAIN_2h_NoOre_01_00', 'Wróć, gdy będziesz miał wystarczająco dużo rudy.', 1, 31, 1, null, 210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_15_00', 'Czym się tutaj zajmujesz?', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_12_01', 'Dbam o broń strażników.', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_15_02', 'Sprzedajesz oręż?', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_12_03', 'Też, ale tylko Gomezowi i jego ludziom.', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Gomez_15_00', 'Przysyła mnie Gomez. Podobno masz dla mnie jakieś wyposażenie.', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Gomez_12_01', 'To co zwykle, tak? Nowy pancerz i najlepsza broń, jaką mam na składzie.', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Gomez_12_02', 'Wynoś się, albo cię stąd wyniosą!', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_15_00', 'Przysyła mnie Thorus. Kazał mi wybrać sobie jakąś broń.', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_12_01', 'Czyżby?', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_BACK_15_00', 'Rozumiem. Do zobaczenia.', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_Stranger_15_00', 'Widzisz, mam zrobić dla niego coś, czego nie może zrobić żaden z ludzi Gomeza.', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_Stranger_12_01', 'Tak? I pewnie stary Thorus nie ma nic lepszego do roboty niż przysyłać cię do mnie, co?', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_KickAss_15_00', 'Powiedział, że mam ci dać porządnego kopa w dupę jeśli będziesz sprawiał kłopoty.', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_KickAss_12_01', 'Naprawdę? Wiesz co? Zrobimy inaczej: jeśli nie wyjdziesz stąd w tej chwili, to TY dostaniesz kopa w dupę!', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_AskHim_15_00', 'Jeśli mi nie wierzysz, idź i sam go zapytaj.', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_AskHim_12_01', 'Oczywiście, że zapytam! Ale nie teraz. Założę się, że zainteresują go historie, które o nim opowiadasz.', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_AskHim_12_02', 'Nie wiem kto cię tu wpuścił, ale radziłbym ci wynosić się stąd, póki jeszcze możesz.', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_KickAssAGAIN_15_00', 'Powiedział, że mam ci dać porządnego kopa w dupę jeśli będziesz sprawiał kłopoty.', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_First_Thorus_KickAssAGAIN_12_01', 'Dobra, stary, czego potrzebujesz?', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_VERPATZT_15_00', 'Pomyślałem, że zajrzę do ciebie i zapytam o to wyposażenie...', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Skip_VERPATZT_12_01', 'Spadaj!', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_211_Skip_TRADE_Info_15_01', 'Przydałoby mi się kilka drobiazgów.', 1, 83, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_211_Skip_TRADE_Info_12_02', 'Mam kilka drobiazgów na sprzedaż.', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_211_Skip_WELCOME_Info_12_01', 'Hej, daleko zaszedłeś, jak na kogoś, kto jest tu tak krótko.', 1, 83, 12, null, 211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_FirstWarn_Info_13_01', 'STÓJ!', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_FirstWarn_Info_15_02', 'Co się dzieje?', 1, 75, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_FirstWarn_Info_13_03', 'Nie wolno ci wejść do zamku bez pozwolenia. Wynoś się stąd!', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_LastWarn_13_01', 'Ogłuchłeś? Jeszcze jeden krok a nakarmię tobą robaki!', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_Abblitzen_15_00', 'Muszę się dostać do zamku.', 1, 75, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_Abblitzen_13_01', 'A to ciekawe! Bo ja MUSZĘ się wydostać z tej przeklętej kolonii!', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_Abblitzen_13_02', 'Mam ciekawsze rzeczy do roboty niż pilnowanie, żeby tacy jak ty nie włóczyli się, gdzie ich nie proszono.', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_Abblitzen_15_03', 'Mógłbyś mnie po prostu wpuścić...', 1, 75, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_Abblitzen_13_04', 'Nie, nie mógłbym. To działka Thorusa.', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_FirstIn_13_00', 'STÓJ!', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_FirstIn_15_01', 'Spokojnie, rozmawiałem z Thorusem. Powiedział, że mogę wejść.', 1, 75, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_FirstIn_13_02', 'Zapamiętam sobie twoją twarz, koleś. Jak zaczniesz rozrabiać, szybko się z tobą rozprawię.', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_Passgate_15_00', 'Ale wciąż mogę wejść do środka?', 1, 75, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_212_Passgate_13_01', 'Pod warunkiem, że przestaniesz zadawać głupie pytania.', 1, 75, 13, null, 212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_213_FirstWarn_Info_07_01', 'STÓJ!', 1, 3, 7, null, 213, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_213_FirstWarn_Info_15_02', 'Co się dzieje?', 1, 3, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_213_FirstWarn_Info_07_03', 'Nie wolno ci wejść do zamku. Spadaj!', 1, 3, 7, null, 213, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_213_LastWarn_07_01', 'Ogłuchłeś? Jeszcze jeden krok a nakarmię tobą robaki!', 1, 3, 7, null, 213, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_213_Torwache_WELCOME_Info_07_01', 'Podobno jesteś teraz jednym z nas? Nieźle jak na kogoś, kto jest tu od niedawna.', 1, 3, 7, null, 213, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_213_Abblitzen_15_00', 'Mógłbyś od czasu do czasu zrobić coś bardziej ekscytującego. Na przykład wpuścić kogoś potajemnie do zamku.', 1, 3, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_213_Abblitzen_07_01', 'Bardziej ekscytującego, powiadasz? To całkiem dobry pomysł - już od dawna nie obiłem nikomu twarzy.', 1, 3, 7, null, 213, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_213_Passgate_15_00', 'Hej, wszystko w porządku?', 1, 3, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_213_Passgate_07_01', 'Przestań się tu kręcić. Właź do środka.', 1, 3, 7, null, 213, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_214_Torwache_job_15_00', 'Co tu robisz przez cały dzień?', 1, 110, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_214_Torwache_job_07_01', 'Dbam o to, by nikt nieproszony nie dostał się do zamku.', 1, 110, 7, null, 214, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_214_Torwache_job_07_02', 'Dlatego nawet nie próbuj rozrabiać, bo zrobię ci krzywdę.', 1, 110, 7, null, 214, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_214_Torwache_SEETHORUS_Info_07_01', 'Hej, dobrze że jesteś. Thorus chce się z tobą widzieć!', 1, 110, 7, null, 214, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_214_Torwache_SEETHORUS_Info_15_02', 'A czego chce?', 1, 110, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_214_Torwache_SEETHORUS_Info_07_03', 'Sam ci powie w swoim czasie.', 1, 110, 7, null, 214, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_214_Torwache_NODUSTY_Info_07_01', 'HEJ, TY!!! Chyba nie próbujesz przemycić Dusty''ego na zewnątrz, co?', 1, 110, 7, null, 214, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_214_Torwache_NODUSTY_Info_15_02', 'Chcieliśmy tylko...', 1, 110, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_214_Torwache_NODUSTY_Info_07_03', 'To się wam zaraz odechce!', 1, 110, 7, null, 214, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_06_00', 'A ty dokąd się wybierasz?', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_15_01', 'To Obozu.', 1, 21, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_06_02', 'Chyba nie przyszedłeś tu, żeby sprawiać kłopoty, co?', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_Trouble_15_00', 'Jasne, zamierzam przejąć kontrolę nad całym obozem!', 1, 21, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_Trouble_06_01', 'Hej, facet jest całkiem zabawny... Nie lubię zabawnych facetów.', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_JustLooking_15_00', 'Chciałem się tylko trochę rozejrzeć.', 1, 21, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_JustLooking_06_01', 'To cię będzie kosztować 10 bryłek rudy.', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_Diego_15_00', 'Diego powiedział, że mam się z nim spotkać w obozie.', 1, 21, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_Diego_06_01', 'W takim razie - właź.', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_NoPay_15_00', 'Nieważne.', 1, 21, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_NoPay_06_01', 'W takim razie - spadaj.', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_Pay_15_00', 'Dobrze, masz tu swoje 10 bryłek.', 1, 21, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_Pay_06_01', 'Dobra. Zapraszam do środka.', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_Pay_NoOre_15_00', 'Nie mam tyle przy sobie.', 1, 21, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_First_Pay_NoOre_06_01', 'Cóż. Tym razem zrobię wyjątek, bo jesteś tu nowy.', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_PERM_15_00', 'Coś nowego?', 1, 21, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_215_Torwache_PERM_06_01', 'Nie. Wszystko po staremu.', 1, 21, 6, null, 215, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_First_13_00', 'Hej, ty! Chyba cię tu wcześniej nie widziałem!', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_First_15_01', 'Nic dziwnego. Dopiero co tutaj trafiłem.', 1, 171, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_First_13_02', 'To lepiej uważaj! Poza murami jest bardzo niebezpiecznie. Tylko w obozie możesz spać spokojnie.', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_Dusty_Zoll_13_00', 'Stój! Dokąd zabierasz naszego drogiego przyjaciela?', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_Dusty_Zoll_PissOff_15_00', 'Nie twój interes!', 1, 171, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_Dusty_Zoll_PIssOff_13_00', 'Mam na ten temat nieco inne zdanie!', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_Dusty_Zoll_ToPsi_15_00', 'Udajemy się do obozu Bractwa.', 1, 171, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_Dusty_Zoll_ToPsi_13_00', 'Gdzie nigdy nie dotrzecie...', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_Dusty_Zoll_LittleWalk_15_00', 'Idziemy się przespacerować. A oto 100 bryłek rudy.', 1, 171, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_Dusty_Zoll_LittleWalk_13_00', 'Nic nie widziałem.', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_216_Dusty_Zoll_LittleWalk_13_02', 'Myślisz, że jestem taki głupi? Tak łatwo ci nie pójdzie, mały!', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_216_Torwache_SEETHORUS_Info_13_01', 'Cieszę się, że cię widzę. Thorus chce z tobą porozmawiać.', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_216_Torwache_SEETHORUS_Info_15_02', 'A czego ode mnie chce?', 1, 171, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_216_Torwache_SEETHORUS_Info_13_03', 'Porozmawiaj z nim, to się dowiesz.', 1, 171, 13, null, 216, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_217_First_15_00', 'Cześć!', 1, 13, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_217_First_06_01', 'Rusz swoje cztery litery! Wchodź albo wychodź - mam to gdzieś. Tylko zejdź mi wreszcie z oczu!', 1, 13, 6, null, 217, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_218_FirstIn_07_00', 'Czekaj! Czego tu szukasz?', 1, 57, 7, null, 218, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_218_FirstIn_15_01', 'Chcę wejść do środka.', 1, 57, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_218_FirstIn_07_02', 'Kpisz sobie ze mnie, czy co?', 1, 57, 7, null, 218, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_218_FirstIn_15_03', 'Może zapytasz Thorusa?', 1, 57, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_218_FirstIn_07_04', 'Zapytam. Jeśli łżesz, już po tobie!', 1, 57, 7, null, 218, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_218_FirstIn_15_05', 'Czy to znaczy, że mogę wejść?', 1, 57, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_218_FirstIn_07_06', 'Tak! Rusz się wreszcie!', 1, 57, 7, null, 218, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_218_FirstWarn_Info_07_01', 'STÓJ! Ani kroku dalej!', 1, 57, 7, null, 218, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_218_FirstWarn_Info_15_02', 'Dlaczego?', 1, 57, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_218_FirstWarn_Info_07_03', 'Takie łachudry jak ty nie mają wstępu do siedziby Magnatów!', 1, 57, 7, null, 218, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Stone_Hello_15_00', 'Jesteś kowalem, czyż nie?', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Stone_Hello_06_01', 'Racja.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Stone_NotSelling_15_00', 'Sprzedajesz oręż i zbroje?', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Stone_NotSelling_06_01', 'Handlem bronią para się Skip. Ja zajmuję się tylko pancerzami.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Stone_NotSelling_15_02', 'Masz może coś ciekawego na sprzedaż?', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Stone_NotSelling_06_03', 'Tylko pancerze dla Strażników, a ty nie jesteś jednym z nich. Dlatego będziesz musiał poszukać gdzie indziej.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_GETSTUFF_Info_15_01', 'Potrzebuję zbroi.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_GETSTUFF_Info_06_02', 'A więc Thorus jednak cię przyjął, co? Gratuluję!', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_GETSTUFF_Info_06_03', 'Jeszcze jeden, któremu spieszno przelać krew za Gomeza. A zresztą - co mnie to obchodzi?', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_GETSTUFF_Info_06_04', 'Masz - weź tę broń i miecz. Witamy w straży.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_15_01', 'Chciałbym dostać lepszy pancerz.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_06_02', 'Dostaniesz go, jak przyjdzie czas, i będziesz miał wystarczającą ilość rudy...', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_M_15_01', 'Chciałbym dostać zwykły pancerz strażnika.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_M_06_02', 'Thorus powiedział, że musisz się sprawdzić jako Strażnik zanim dostaniesz lepszy pancerz!', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_M_06_03', 'Mam na składzie odpowiednią zbroję, ale nie masz dość rudy. Wróć, kiedy będzie cię na nią stać!', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_M_06_04', 'Dobra, masz tu swoją nową zbroję. Tylko nie pozwól, żeby Najemnicy ją porysowali. Ha ha ha!', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_H_15_01', 'Chciałbym dostać ciężką zbroję Strażnika.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_H_06_02', 'Tylko najlepsi Strażnicy mogą je nosić, a obawiam się, że minie jeszcze trochę czasu zanim zostaniesz jednym z nich.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_BACK_15_01', 'Rozmyśliłem się.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_219_Stone_BETTERARMOR_Info_BACK_06_02', 'Jak uważasz. Wiesz, gdzie mnie znaleźć!', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_EXIT_06_02', 'Do zobaczenia.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_EXIT_06_03', 'Do zobaczenia.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone_06_01', 'Czego chcesz? Nie wyglądasz mi na jednego z siepaczy Gomeza.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_15_01', 'Masz rację, nie pracuję dla Gomeza.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_06_02', 'Więc jak się tutaj dostałeś? Tylko Gomez ma klucz do lochów...', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_15_03', 'Dostałem go od niego.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_06_04', 'Chcesz powiedzieć, że to ty załatwiłeś Gomeza?', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_15_05', 'Dokładnie.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_06_06', 'Stary, nie wiedziałem, że stać cię na coś takiego. Ale cieszę się, że ten przeklęty bandzior dostał wreszcie co mu się należało.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_06_07', 'Ale dlaczego mnie uwolniłeś?', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_15_08', 'Usłyszałem, że siedzisz tu zamknięty i pomyślałem, że mógłbym załatwić Gomeza i zwrócić ci wolność.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_06_09', 'Cóż, wielkie dzięki...', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone1_06_10', '...Jestem ci niezmiernie wdzięczny. Wpadnij kiedyś do mojej kuźni, to pogadamy.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone3_06_01', 'Ach, jesteś. Mam u ciebie dług wdzięczności za wypuszczenie mnie z lochu!', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone3_06_02', 'Wiesz, tak sobie myślę: nie mam nic cennego, co mógłbym ci dać, więc może zamiast tego wykuję dla ciebie coś specjalnego.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone3_06_03', 'Może jakiś pierścień, albo coś w tym stylu...', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone2_15_01', 'Dlaczego Gomez kazał zamknąć cię w lochu?', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone2_06_02', 'Ten sukinsyn ubzdurał sobie, że spiskuje potajemnie z Magami Ognia. Nie zabił mnie tylko dlatego, że jestem najlepszym kowalem w całym Starym Obozie.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone2_06_03', 'No i wrzucił mnie do tej zapluskwionej celi i wypuszczał tylko wtedy, gdy była dla mnie jakaś robota.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone4_15_01', 'Możesz dla mnie wzmocnić tę magiczną zbroję?', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone4_06_02', 'Jasne! Daj mi ją i zaczekaj chwilę.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone4_06_03', 'Oto twoja wzmocniona zbroja. Teraz jesteśmy kwita.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone5_15_01', 'Przydał by mi się pierścień wzmacniający witalność.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone5_06_02', 'To nie powinno być zbyt trudne. Zaczekaj.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone5_06_03', 'Ten pierścień zwiększy twoje siły witalne. Myślę, że po takim prezencie jesteśmy kwita.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone6_15_01', 'Chciałbym, żebyś wykuł dla mnie pierścień ochronny.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone6_06_02', 'Pierścień ochronny? Nie ma sprawy! Od razu wezmę się do roboty. Zaczekaj chwilę.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone6_06_03', 'Chciałeś pierścień ochronny? Oto on! Teraz jesteśmy kwita.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone7_15_01', 'Potrzebuję czegoś, co zwiększy moje umiejętności magiczne.', 1, 62, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone7_06_02', '...Zwiększy umiejętności magiczne, powiadasz? Może jakiś amulet! Tak, zrobię dla ciebie magiczny amulet. To nie potrwa długo.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_219_Stone7_06_03', 'Dobra, amulet gotowy. Muszę przyznać, że wyszedł całkiem nieźle. Proszę, teraz jesteśmy kwita.', 1, 62, 6, null, 219, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_13_01', 'Hej, ty!', 1, 45, 13, null, 224, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_15_02', 'Kto? Ja?', 1, 45, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_13_03', 'Nie, twoja babcia... Jasne, że ty!!!', 1, 45, 13, null, 224, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_13_04', 'Na twoim miejscu nie szedłbym dalej!', 1, 45, 13, null, 224, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_15_05', 'Dlaczego?', 1, 45, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_13_06', 'Widzę, że jesteś tu nowy, co?', 1, 45, 13, null, 224, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_13_07', 'Stary, ta droga prowadzi na ziemie Orków...', 1, 45, 13, null, 224, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_13_08', 'Zrobią z ciebie kotlety!', 1, 45, 13, null, 224, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_15_09', 'Och!', 1, 45, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Pacho_STOP_13_10', 'Nie ma za co!', 1, 45, 13, null, 224, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_EXIT_Schutzgeld_15_00', 'Do zobaczenia.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_EXIT_Schutzgeld_08_01', 'Trzymaj się, kolego.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_EXIT_Schutzgeld_08_02', 'W Obozie nie musisz się niczego obawiać. Będziemy mieli na ciebie oko.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_08_00', 'Hej, ty!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_15_01', 'Mówisz do mnie?', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_08_02', 'Ostrzegam cię! Tacy jak ty łatwo mogą napytać sobie biedy!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_08_03', 'W końcu większość z tutejszych ludzi to straszne zbiry!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_08_04', 'Wydaje się im, że mogą tu robić, co im się żywnie podoba. No, ale my im na to nie pozwalamy.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_08_05', 'Gomezowi zależy na spokoju w Obozie, a do nas - Strażników - należy dbanie o porządek. Oczywiście jest to bardzo wyczerpujące... i KOSZTOWNE zajęcie.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_08_06', 'Dlatego właśnie chcę cię prosić o drobne wsparcie finansowe... Na znak przyjaźni. Ty pomożesz nam, a my pomożemy tobie. Jeśli będziesz miał kłopoty - możesz na nas liczyć.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_ForgetIt_15_00', 'To znaczy, że mam ci zapłacić za ochronę? Dzięki, ale nie! Sam sobie dam radę!', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_ForgetIt_08_01', 'Jak sobie chcesz, chłopcze. Ale wkrótce pożałujesz, że odrzuciłeś tę przyjacielską propozycję!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_SollDrohungSein_15_00', 'Grozisz mi?', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_SollDrohungSein_08_01', 'Wręcz przeciwnie! Oferuję ci pomoc!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_HowMuch_15_01', 'Czemu by nie? Ile mam ci zapłacić?', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_HowMuch_08_02', 'Niewiele. 10 bryłek rudy, to wszystko.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_OkTakeIt_15_00', 'Proszę, oto ruda. Przyjaciół nigdy nie za wielu.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_OkTakeIt_08_01', 'Widzę, że mądry z ciebie gość. Od tej pory będziemy cię mieli na oku.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_OkTakeIt_08_02', 'Ale to nie znaczy, że możesz tu robić, co ci się żywnie podoba, jasne?', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_NotNow_15_00', 'Nie mam tyle przy sobie.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_NotNow_08_01', 'Trudno. Wezmę co masz. Resztę dopłacisz przy następnym spotkaniu.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_NotNow_08_02', 'Zobaczmy...', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_NotNow_TenOreMore_08_00', 'No patrzcie państwo! Ktoś tu nie umie liczyć do 10, co?', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_NotNow_TenOreMore_08_01', 'Wezmę wszystko co masz. To mi pomoże zapomnieć, że próbowałeś mnie wykiwać.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_NotNow_LessThanTen_08_00', 'O, przyjmuję również mniejsze datki. W końcu liczy się pamięć! Dzięki za rudę, chłopcze!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_NotNow_LessThanTen_08_01', 'Od tej pory będę miał na ciebie oko. W Obozie nic ci już nie grozi.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Hello_NotNow_NoOre_08_00', 'Hmmm, naprawdę jesteś spłukany, co? Trudno. Może innym razem...', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_08_00', 'Miło cię widzieć, przyjacielu!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_08_01', 'No i jak tam z twoim wsparciem finansowym? Wciąż zalegasz z 10 bryłkami rudy!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_Den_08_00', 'Hej, ty!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_Den_15_01', 'Czego znowu?', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_Den_08_02', 'Pora udowodnić, że jesteś prawdziwym przyjacielem.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_Den_08_03', 'Marne 10 bryłek rudy, i wszystko będzie w porządku. Co ty na to?', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_PayAgain_15_00', 'Proszę. Czym jest 10 bryłek rudy wobec prawdziwej przyjaźni.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_PayAgain_08_01', 'Czytasz w moich myślach!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_PayNoMore_15_00', 'Nie będę ci więcej płacił. Dość już ode mnie dostałeś!', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_PayNoMore_08_01', 'Zawiodłem się na tobie! Taki z ciebie przyjaciel? Dobrze, jak sobie chcesz! Od tej pory sam dbaj o siebie. Ja umywam ręce.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_PayNoMore_15_02', 'Bez obawy. Jakoś sobie poradzę bez twojej pomocy.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayDay_PayNoMore_08_03', 'To się dopiero okaże...', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Doch_15_00', 'Zmieniłem zdanie. Postanowiłem jednak zapłacić ci te 10 bryłek rudy.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Doch_08_01', 'Trzeba tak było od razu! Mądry z ciebie gość.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Doch_08_02', 'Ale od tej pory będziesz płacił swoją dzienną składkę, co?', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_Doch_NoOre_08_00', 'To wróć, jak będziesz miał trochę rudy.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayForJesse_15_00', 'Jesse przysyła mnie, żebym zapłacił jego 10 bryłek.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayForJesse_08_01', 'Powinieneś raczej zapłacić SWOJE 10 bryłek.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayForJesse_08_02', 'Zapomnij o tym facecie: Jesse i tak długo nie pociągnie.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayForJesse_15_03', 'Nie - zapłacę za niego. Masz tu jego 10 bryłek i zostaw go w spokoju.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayForJesse_08_04', 'Dobra, jak sobie chcesz.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayForJesse_15_05', 'Hmmm... Właśnie sobie przypomniałem, że nie mam teraz tyle rudy.', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_PayForJesse_08_06', 'To znak, człowieku! Przemyśl to sobie. Płacąc za tego gościa wyrzucasz rudę w błoto!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_233_Bloodwyn_WELCOME_Info_08_01', 'Teraz jesteś jednym z nas! Dobra robota! Straży przyda się ktoś taki jak ty!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_01', 'No proszę, toż to nasz zdrajca! A my cię uważaliśmy za jednego z nas.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_02', 'Widzę, że przeoczyliśmy jednego z Magów Ognia!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_03', 'To ten Cień, który nas zdradził!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_15_04', 'Zaraz! O czym ty mówisz, Bloodwyn?', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_05', 'Spiknąłeś się z Nowym Obozem, tak?', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_15_06', 'Nie, czekaj! Ja dalej...', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_07', 'Co, myślałeś, że damy się tak łatwo wykiwać, hę?', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_15_08', 'Przestań gadać od rzeczy...', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_09', 'Zdrajcy tacy jak ty zasługują tylko na śmierć.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_10', 'GIŃ!!!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_11', 'Postanowiłeś zobaczyć, jak wygląda świat na zewnątrz Nowego Obozu, co? To był błąd!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_12', 'No proszę, znudził ci się twój nowy dom na bagnach? Popełniłeś błąd przychodząc tutaj.', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_15_13', 'Co? O co ci chodzi?!', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_14', 'Nie słyszałeś o ataku na waszą kopalnię?', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_15_15', 'Chwileczkę...', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_16', 'Przykro mi, ale nie możemy pozwolić, żebyś o tym komuś powiedział!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_15_17', 'Hej, nie chcę żadnych kłopotów...', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_18', 'Trzeba było o tym pomyśleć trochę wcześniej!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_15_19', 'Słuchaj, mam tego serdecznie dość...', 1, 54, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Bloodwyn_DIE_08_20', 'Ja też! ZABIĆ GO!!!', 1, 54, 8, null, 233, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_07_01', 'Lepiej stąd zmykaj. Za tą barykadą zaczynają się ziemie Orków!', 1, 177, 7, null, 237, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_15_02', 'Jest tu niebezpiecznie?', 1, 177, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_07_03', 'Ujmę to tak: możesz równie dobrze oddać mi całą swoją rudę. Za kilka minut i tak nie będzie ci potrzebna, bo będziesz gryzł ziemię!', 1, 177, 7, null, 237, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_15_04', 'Chyba lepiej będzie, jeśli zawrócę.', 1, 177, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_07_05', 'Szkoda, bardzo chętnie zająłbym się twoją rudą.', 1, 177, 7, null, 237, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_15_06', 'Jasne, oto moja ruda!', 1, 177, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_07_07', 'Ojej, jakie to szlachetne. Zaraz się rozpłaczę.', 1, 177, 7, null, 237, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_15_08', 'Chyba wolałbym tego nie robić.', 1, 177, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_FirstWarn_07_09', 'W takim razie ani kroku dalej!', 1, 177, 7, null, 237, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_237_LastWarn_07_01', 'Ogłuchłeś? Jeszcze jeden krok a nakarmię tobą robaki!', 1, 177, 7, null, 237, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_245_Hello_15_00', 'Co to za dom?', 1, 34, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GRD_245_Hello_13_01', 'To siedziba Magnatów. Jeśli chcesz tam wejść, radzę ci należycie się zachowywać!', 1, 34, 13, null, 245, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_What_15_00', 'Cześć! Jestem tu nowy.', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_What_05_01', 'Naprawdę? Opowiedz mi coś o zewnętrznym świecie! Już od miesiąca nie miałem żadnych wieści z zewnątrz.', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_What_05_02', 'Jestem Kirgo. Walczę na arenie.', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Good_15_00', 'Jesteś dobry?', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Good_05_01', 'W walce? Nie zajmuję się tym zbyt długo, ale wygrałem już swoją pierwszą walkę!', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_15_00', 'Chciałbym cię wyzwać na pojedynek na arenie!', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_05_01', 'Co? Ale ja nie chcę z tobą walczyć! Może napijemy się po prostu piwa i pogadamy o zewnętrznym świecie?', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_NOW_15_00', 'Nie! Chcę się bić! Natychmiast!', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_NOW_05_01', 'W takim razie... Możemy zaczynać, jak tylko będziesz gotów.', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_15_00', 'Dobra, daj mi piwo!', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_05_01', 'Proszę bardzo!', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_15_02', 'Dzięki! Obawiam się, że nie mogę ci zbyt wiele powiedzieć o wydarzeniach na zewnątrz. Prawie dwa miesiące przesiedziałem w ciemnicy. Zaraz potem trafiłem tutaj.', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_05_03', 'Wielka szkoda... Cóż, trudno... Całkiem nieźle się trzymasz, jak na kogoś, kto przesiedział w celi dwa miesiące.', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_15_04', 'I zamierzam się postarać, żeby tak zostało.', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_05_05', 'To dlaczego tak ci zależy na walce z jednym z nas?', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_15_06', 'Chcę zasłużyć na szacunek w Obozie.', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_05_07', 'To znaczy, że chcesz przekonać do siebie Scatty''ego, tak? To jeden z bardziej wpływowych ludzi w Zewnętrznym Pierścieniu... Może będzie pod wrażeniem, jeśli uda ci się mnie pokonać...', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_05_08', 'Ale jeśli naprawdę chcesz go do siebie przekonać, powinieneś stawić czoła Kharimowi. Tylko obawiam się, że on może być dla ciebie za dobry!', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_Charge_Beer_05_09', 'Jeśli nadal chcesz ze mną walczyć, daj mi znać! Chociaż nie chciałbym ci robić krzywdy.', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_ChargeREAL_15_00', 'Chcę z tobą walczyć - jesteś gotów?', 1, 132, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_ChargeREAL_05_01', 'Chodź za mną!', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kirgo_InArena_05_00', 'Dobra, zaczynajmy! Niech wygra najlepszy!', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_5_LetsForgetOurLittleFight', 'Może zapomnijmy o naszej małej sprzeczce, dobra?', 1, 132, 5, null, 251, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_PreExit_06_00', 'Postaraj się dotrzeć do Starego Obozu w jednym kawałku!', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_15_00', 'Czym się tutaj zajmujesz?', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_06_01', 'Dbam o to, by nikt niepowołany nie dostał się w pobliże miejsca wymiany. Zwłaszcza ci bandyci z Nowego Obozu.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_06_02', 'Hej, to ciebie dziś zrzucili tutaj, co?', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_15_03', 'Zgadza się.', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_06_04', 'W takim razie uważaj na ludzi z Nowego Obozu!', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_06_05', 'Ja jestem ze Starego Obozu, tak jak wszyscy, których widziałeś na miejscu wymiany.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_06_06', 'Zakładam, że rozmawiałeś już z Diego?', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_No_15_00', 'Nie.', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_No_06_01', 'Więc zrób to! On zajmuje się wszystkimi nowoprzybyłymi.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_No_06_02', 'Od niego dowiesz się wszystkiego co żółtodziób wiedzieć powinien.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_Yes_15_00', 'Tak, rozmawiałem.', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_GuardGate_Yes_06_01', 'To dobrze. Zatem wiesz już mniej więcej co i jak.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_NewCamp_15_00', 'Dlaczego mam uważać na ludzi z Nowego Obozu?', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_NewCamp_06_01', 'W porównaniu z Nowym Obozem, Stary Obóz to ciche i przytulne miejsce!', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_NewCamp_06_02', 'Nowy Obóz nie otrzymuje żadnych przesyłek z zewnątrz. Te szkodniki po prostu kradną wszystko, czego potrzebują.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_OldCamp_15_00', 'A Stary Obóz?', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_OldCamp_06_01', 'Tutaj wszystkim rządzą Magnaci, handlujący rudą. Pod nimi są Strażnicy, a następnie Cienie. Najniższą kastę stanowią Kopacze.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_OldCamp_06_02', 'Każdy, kto tu trafi, zaczyna jako Kopacz. Jeśli masz większe ambicje, musisz zostać przyjęty do Cieni.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Shore_15_00', 'Kiedy tutaj wylądowałem, jeden z waszych uderzył mnie w twarz.', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Shore_06_01', 'Robią tak z wszystkimi nowymi. Mówią na to "Chrzest Wody".', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Shore_15_02', 'Rozumiem. Czy w Starym Obozie jest wielu takich zawadiaków?', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Shore_06_03', 'Jest kilka czarnych owiec. Ale nie zrobią ci krzywdy, jeśli zapłacisz im za ochronę.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Woman_15_00', 'Widziałem, jak spuszczano tutaj jakąś kobietę.', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Woman_06_01', 'Cóż, Magnaci dostają wszystko, czego zapragną.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Woman_15_02', 'Chcesz powiedzieć, że król wymienia kobiety na rudę?', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Woman_06_03', 'Naturalnie one też trafiają tutaj prosto z więzienia. Gdyby Gomez nie ściągnął ich tutaj, dalej gniłyby w jakimś lochu.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Woman_06_04', 'Sam już nie wiem, co jest dla nich gorsze...', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Waffe_15_00', 'Potrzebuję broni...', 1, 138, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Waffe_06_01', 'Rozejrzyj się trochę przy zamkniętej kopalni, w głębi kanionu. Na pewno coś tam znajdziesz.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Waffe_06_02', 'Tylko nie wdawaj się w poważne bójki uzbrojony w głupi kilof. To bardzo ciężka i nieporęczna broń.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Orry_Waffe_06_03', 'Niedoświadczony wojownik powinien posługiwać się nim tylko w ostateczności.', 1, 138, 6, null, 254, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_First_06_00', 'Hej, ty!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_First_15_01', 'Kto? Ja?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_First_06_02', 'Wiesz dobrze, do kogo mówię, synku!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_First_06_03', 'Coś ci powiem: to mój rejon. I nie chcę tutaj żadnych kłopotów!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_First_06_04', 'Ale nowi, tacy jak ty, zawsze sprawiają kłopoty. Zwłaszcza, kiedy buszują tutaj w nocy.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_First_06_05', 'Lepiej będzie jeśli pójdziesz sobie już do domu i nie pokażesz się tutaj zbyt prędko. Przy arenie jest jedna pusta chata, ma daszek nad wejściem. Idź spać!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_First_06_06', 'Ale jeśli złapię cię na grzebaniu w cudzych chatach, osobiście postaram się, żebyś już nigdy więcej tego nie zrobił!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_15_00', 'Hej, ty!', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_06_01', 'Jeśli chcesz się pozbyć swoich pieniędzy za ochronę, wybrałeś zły dzień.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_15_02', 'Tak? A dlaczego?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_06_03', 'Bo mnie tu nie ma.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_WhereElse_15_00', 'Czyżby? A gdzie jesteś?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_WhereElse_06_01', 'W tej chwili siedzę w zamku, przy ognisku i popijam piwo.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_WhyTalk_15_00', 'To jakim cudem z tobą rozmawiam?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_WhyTalk_06_01', 'Nek gdzieś zniknął. Zwykle to on patroluje ten rejon.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_WhyTalk_06_02', 'A dopóki nie raczy się tutaj zjawić, Thorus kazał MI mieć oko na wszystko.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Hello_ISee_15_00', 'Rozumiem.', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WoNek_15_00', 'Wiesz, gdzie się podziewa Nek?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WoNek_06_01', 'Nie, i raczej się tego nie dowiem.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WoNek_06_02', 'Jeśli komuś coś o tym wiadomo, to pewnie tutejszym Kopaczom. Ale oni nie rozmawiają ze Strażnikami.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WoNek_06_03', 'A zwłaszcza ze mną, bo wiedzą, że brzydzę się ich robotą. Założę się, że podśmiewają się ze mnie za moimi plecami.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_TroSchu_15_00', 'Ale dlaczego nie zbierasz pieniędzy za ochronę?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_TroSchu_06_01', 'Nek zebrał już, co było do zebrania. Więcej z nich nie wycisnę.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_15_00', 'Chodzi o Neka.', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_06_01', 'Tak?', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_15_02', 'Chyba go znalazłem.', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_06_03', 'Co? Gdzie on jest?', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_15_04', 'W innym, lepszym świecie...', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_06_05', 'O cholera! To znaczy, że będę tutaj tkwił do końca życia. Miałem nadzieję, że ten bęcwał jednak wróci.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_06_06', 'Teraz mam kłopot.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_15_07', 'Żadnych wieści.', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_WegenNek_06_08', 'Informuj mnie na bieżąco.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Problem_15_00', 'Jaki problem?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fletcher_Problem_06_01', 'Jestem winien Scatty''emu nie lada sumkę. Kiedy dowie się, że przejąłem działkę Neka, będzie mnie nachodził codziennie...', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_255_Fletcher_WELCOME_Info_06_01', 'Widzę, że szybko nauczyłeś się dbać o swoje interesy. Witamy w Straży!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_01', 'Zdrajco! I pomyśleć, że uważaliśmy cię za jednego z nas!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_02', 'To jeden z tych zdradzieckich Magów Ognia!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_03', 'Witaj, ZDRAJCO! Teraz nie pomogą ci nawet znajomości wśród Cieni!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_15_04', 'O czym ty do diabła mówisz, Fletcher?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_05', 'Zadajesz się z tymi bandziorami z Nowego Obozu! A może nie?!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_15_06', 'Zaczekaj...', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_07', 'Myślałeś, że się nie domyślimy, co? CO?!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_15_08', 'Hej... Postradałeś zmysły?!', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_09', 'Ja? Ależ skąd. Za to TY za chwilę stracisz GŁOWĘ, kolego.', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_10', 'GIŃ, ZDRAJCO!!!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_11', 'No proszę. To gość z Nowego Obozu!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_12', 'Patrzcie no. To gość z Sekty!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_15_13', 'I co z tego? Masz z tym jakiś problem?', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_14', 'Mieć, to ja będę waszą małą kopalnię!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_15_15', 'Czyżby? Chyba śnisz!', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_16', 'Przykro mi, ale nie możemy pozwolić, żebyś o tym komuś powiedział!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_15_17', 'Zaczekaj, nie szukam kłopotów.', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_18', 'Trzeba było o tym pomyśleć zanim tutaj przyszedłeś!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_15_19', 'Hej, co u...', 1, 22, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Fletcher_DIE_06_20', 'Dalej chłopcy! Na niego!', 1, 22, 6, null, 255, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Exit_Info_15_01', 'Do zobaczenia!', 1, 118, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Gefahr_Info_15_01', 'Na co powinienem uważać w kopalni?', 1, 118, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Gefahr_Info_11_02', 'Przede wszystkim na pełzacze. Groźne bestie.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Gefahr_Info_11_03', 'To przez nie musieliśmy zrezygnować z wydobycia w paru jaskiniach. Niestety, pożarły nam już sporą grupę Kopaczy.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Gefahr_Info_15_04', 'Opowiedz mi o pełzaczach.', 1, 118, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Gefahr_Info_11_05', 'Wiesz, zaschło mi w ustach...', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Gefahr_Info_11_06', 'Przynieś mi piwo, to ci opowiem o pełzaczach.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Crawler_Okay_15_01', 'Proszę, wypij moje zdrowie!', 1, 118, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Crawler_Okay_11_02', 'Dzięki. A co do pełzaczy - żyją w dużych stadach, głównie w bocznych jaskiniach.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Crawler_Okay_11_03', 'Jeszcze nigdy nie widziano ich tutaj, w głównym szybie. Gdybyś spotkał kiedyś pełzacza, wiej ile sił w nogach!', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Crawler_Okay_11_04', 'Albo stań plecami do ściany. W ten sposób będziesz miał jakąś szansę!', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Crawler_Okay_11_06', 'Żartujesz sobie ze mnie? Wróć, jak będziesz miał dla mnie piwo.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Mine_Info_15_01', 'Możesz mi opowiedzieć o tej kopalni?', 1, 118, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Mine_Info_11_02', 'Stoimy teraz w głównym szybie. Na dół można zejść po rusztowaniach.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Mine_Info_11_03', 'Wszędzie dookoła Kopacze wydobywają rudę. Musisz bardzo uważać na pełzacze. One też są wszędzie dookoła!', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Mine_Info_11_04', 'Na samym dole, część wydobytej rudy przeznaczona do wykorzystania tutaj jest od razu przetapiana. ', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Mine_Mehr_Info_15_01', 'Opowiedz mi o tym coś więcej!', 1, 118, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Mine_Mehr_Info_11_02', 'Jeśli chcesz wiedzieć więcej, pogadaj z Wężem. On zajmuje się wytopem.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Mine_Mehr_Info_11_03', 'Albo zapytaj Iana. On tu rządzi. Odpowiada za organizację pracy w całej kopalni.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Ian_Info_15_01', 'Gdzie mogę znaleźć Iana?', 1, 118, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Ian_Info_11_02', 'Poszukaj go na środku głównego szybu, obok składowiska.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Ian_Info_11_03', 'Ach, i jeszcze coś: znasz Thorusa, prawda? Zapomnij o nim!', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Ian_Info_11_04', 'W kopalni rządzi tylko jedna osoba i jest nią Ian. To nasz szef.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_Ian_Info_11_05', 'Jak podpadniesz jemu - podpadniesz nam wszystkim. Zrozumiano?', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_GARDEAUFNAHME_Info_11_01', 'Hej, nieźle sobie poradziłeś z tymi pełzaczami! Zasłużyłeś sobie na przyjęcie w poczet Strażników.', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_260_Drake_GARDEAUFNAHME_Info_11_02', 'Idź do Starego Obozu i porozmawiaj z Thorusem!', 1, 118, 11, null, 260, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_261_Brandick_ALEPH_Info_15_01', 'Słuchaj, za każdym razem, kiedy się odwracasz, Aleph siedzi bezczynnie i zbija bąki.', 1, 27, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_261_Brandick_ALEPH_Info_06_02', 'Czyżby?', 1, 27, 6, null, 261, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_261_Brandick_ALEPH_Info_06_03', 'Wiesz jakich ludzi nienawidzę jeszcze bardziej od obiboków? Donosicieli! Zejdź mi z oczu!', 1, 27, 6, null, 261, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_CHEST_Info_15_01', 'Czym się tutaj zajmujesz?', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_CHEST_Info_09_02', 'Pilnuję, żeby Kopacze, tacy jak nasz drogi Snipes, trzymali łapy z dala od mojej skrzyni.', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_ORE_15_01', 'Kopacze znaleźli ogromną bryłę rudy!', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_ORE_09_02', 'I co z tego?', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_ORE_15_03', 'Powinieneś na nią rzucić okiem.', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_ORE_09_04', 'Nie ma mowy.', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_BANDIT_15_01', 'Podobno w waszej kopalni są jacyś rabusie. Zamierzają ukraść ładunek rudy!', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_BANDIT_09_02', 'Masz mnie za głupca? Nie odważyliby się na coś takiego!', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_IAN_15_01', 'Przysyła mnie Ian. Masz się do niego natychmiast zgłosić!', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_IAN_09_02', 'A czego ode mnie chce?', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_GOOD_15_01', 'Ma ci wręczyć nagrodę za przykładną pracę.', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_GOOD_09_02', 'Czyżby? Wiesz co? Lepiej już stąd idź.', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_BAD_15_01', 'Ma już dość twojego lenistwa.', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_BAD_09_02', 'Phi. To nic nowego. Spadaj!', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_UGLY_15_01', 'Nie wiem. Pewnie sam ci to powie. Inaczej po co by cię wzywał?', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_262_Aaron_BLUFF_UGLY_09_02', 'Ach, trudno. W takim razie zajrzę do niego.', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Aaron_PISSED_09_01', 'HEJ, TY! Jeśli jeszcze raz spróbujesz wystrychnąć mnie na dudka, pogadamy inaczej. Zrozumiano?!', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Aaron_SELL_15_01', 'Nie zgubiłeś przypadkiem klucza do swojej skrzyni?', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Aaron_SELL_09_02', 'W rzeczy samej. Nawet nie chcę wiedzieć skąd wiesz o jego istnieniu.', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Aaron_SELL_09_03', 'Ale dam ci 20 bryłek rudy, jeśli mi go oddasz.', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Aaron_SELLNOW_15_01', 'Oto twój klucz.', 1, 37, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Aaron_SELLNOW_09_02', 'Tak, to ten. Masz tu swoje 20 bryłek, zgodnie z umową.', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Aaron_SELLNOW_09_03', 'Ale w przyszłości radzę ci uważać! Od tej pory będę cię miał na oku!', 1, 37, 9, null, 262, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_NEST_Info_15_01', 'Gdzieś tutaj musi być gniazdo pełzaczy.', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_NEST_Info_06_02', 'Cała ta przeklęta góra jest jednym wielkim gniazdem pełzaczy!', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_NEST_Info_15_03', 'Dlaczego zamknięto ten szyb?', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_NEST_Info_06_04', 'Nieważne ile pełzaczy zabijaliśmy, kolejne zastępy wyrastały jak spod ziemi.', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_NEST_Info_15_05', 'Wygląda na to, że gdzieś w pobliżu jest ich gniazdo. Pozwól mi otworzyć drzwi!', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_NEST_Info_06_06', 'Nie! To przejście można otworzyć tylko za pozwoleniem Iana! Bez tego nie ma o czym mówić!', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_OPEN_Info_15_01', 'Hej, Asghan! Możesz już otworzyć te drzwi!', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_OPEN_Info_06_02', 'Mówiłem ci już: tylko jeśli Ian.', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_OPEN_Info_15_03', 'Asghan... Wszystko będzie w porządku... Pozdrowienia od Iana.', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_OPEN_Info_06_04', 'Cóż, jeśli Ian bierze na siebie odpowiedzialność... Ale tylko pod jednym warunkiem!', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_OPEN_Info_15_05', 'Jakim warunkiem?', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_OPEN_Info_06_06', 'Sprowadź mi tu najpierw dwóch albo trzech Strażników Świątynnych. Nie chcę tu siedzieć sam, gdy cały szyb zaroi się od pełzaczy!', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_OPEN_NOW_Info_15_01', 'Przygotowania skończone. Można już otworzyć drzwi!', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_OPEN_NOW_Info_06_02', 'Dobra, otwieramy szyb. Będzie niezły bal!', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_LAIRFOUND_Info_15_01', 'Pełzacze nie będą wam już zagrażały!', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_LAIRFOUND_Info_06_02', 'To wspaniała wiadomość! Wyślę gońca do Thorusa z dobrymi nowinami!', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_SMALLTALK_Info_15_01', 'Jak leci?', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_SMALLTALK_Info_06_02', 'Ujdzie... Tak długo jak nikt nie będzie próbował otworzyć tych drzwi, nie będę musiał wdawać się w bójki.', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_SMALLTALK_Info_15_03', 'A co jest takiego szczególnego za tymi drzwiami?', 1, 139, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_263_Asghan_SMALLTALK_Info_06_04', 'Pełzacze. Wielkie, paskudne pełzacze. Całe mnóstwo wielkich, paskudnych pełzaczy!', 1, 139, 6, null, 263, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_264_Gardist_GARDEAUFNAHME_Info_07_01', 'Hej, nieźle sobie poradziłeś z tymi pełzaczami! Zasłużyłeś na przyjęcie w poczet Strażników.', 1, 42, 7, null, 264, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_264_Gardist_GARDEAUFNAHME_Info_07_02', 'Idź do Starego Obozu i porozmawiaj z Thorusem!', 1, 42, 7, null, 264, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_KEY_Info_15_01', 'Co się znajduje w składowisku?', 1, 140, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_KEY_Info_07_02', 'Nie twój interes!', 1, 140, 7, null, 271, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_TRICK_Info_15_01', 'Założę się, że zaschło ci w ustach od tej ciężkiej pracy.', 1, 140, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_TRICK_Info_07_02', 'Jeszcze jak! Chętnie bym się czegoś napił. Może mógłbyś mnie czymś poczęstować, co?', 1, 140, 7, null, 271, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_DRINK_Info_15_01', 'Proszę bardzo, na zdrowie!', 1, 140, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_DRINK_Info_07_02', 'Dzięki.', 1, 140, 7, null, 271, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_DRUNK_Info_15_01', 'To jak z tym składowiskiem? Jest tam coś ciekawego?', 1, 140, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_DRUNK_Info_07_02', 'Kilka skrzyń, w których przechowujemy zapasy. Niestety, gdzieś się nam zapodział klucz.', 1, 140, 7, null, 271, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_DRUNK_Info_15_03', 'Zapodział?', 1, 140, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_DRUNK_Info_07_04', 'Założę się, że to sprawka Alepha. Temu człowiekowi nie można ufać.', 1, 140, 7, null, 271, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_LOCK_Info_15_01', 'Słuchaj, Ian i pozostali siedzą teraz na dole i zajadają się pieczonym mięsem.', 1, 140, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_LOCK_Info_07_02', 'Co? Beze mnie? No nie! Już ja im pokażę!', 1, 140, 7, null, 271, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_ANGRY_Info_07_01', 'Hej, ty! Tam nie było żadnego pieczonego mięsa!', 1, 140, 7, null, 271, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GRD_271_ULBERT_ANGRY_Info_15_02', 'Eee... Cóż, widocznie się pomyliłem. Życzę miłego dnia!', 1, 140, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_275_PreExit_06_01', 'Idź jak najszybciej do Starego Obozu! Tam już czekają na ciebie z nowiuteńkim kilofem. Hi hi hi!', 1, 66, 6, null, 275, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_275_WasMachtIhrHier_15_00', 'Czym się tutaj zajmujecie?', 1, 66, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_275_WasMachtIhrHier_06_01', 'A na co ci to wygląda? Pilnujemy mostu!', 1, 66, 6, null, 275, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_275_WasMachtIhrHier_06_02', 'Pilnujemy, żeby żadne paskudztwa nie przedostały się na drugą stronę.', 1, 66, 6, null, 275, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_275_Tips_15_00', 'Masz dla mnie jakieś dobre rady?', 1, 66, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_275_Tips_06_01', 'Tak. Nie zapuszczaj się do lasu w pojedynkę.', 1, 66, 6, null, 275, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_275_Tips_06_02', 'Chyba, że jesteś wystarczająco silny, żeby dać sobie radę ze zwierzakami.', 1, 66, 6, null, 275, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_276_Tips_15_00', 'Cześć, jestem tu nowy.', 1, 6, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_276_Tips_07_01', 'To świetnie.', 1, 6, 7, null, 276, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_276_Bla_15_00', 'Czy to jest Stary Obóz?', 1, 6, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GRD_276_Bla_07_01', 'Nie, Nowy! Stary Obóz leży pod mostem.', 1, 6, 7, null, 276, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_277_Gardist_SITTINGORK_Info_15_01', 'Co to za Ork?', 1, 33, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_277_Gardist_SITTINGORK_Info_06_02', 'To nasz jeniec. Ma sukinsyn szczęście, że pękło koło zębate w młocarni. Dlatego może sobie trochę odpocząć.', 1, 33, 6, null, 277, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_277_Gardist_SITTINGORK_Info_06_03', 'Ale jak tylko naprawimy młocarnię, skończą się łajdakowi wakacje!', 1, 33, 6, null, 277, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_277_Gardist_WORKINGORK_Info_15_01', 'Widzę, że młocarnia jest już sprawna.', 1, 33, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Grd_277_Gardist_WORKINGORK_Info_06_02', 'Tak, staramy się, żeby ludzie nie narzekali tutaj na brak zajęcia.', 1, 33, 6, null, 277, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_281_GuardGate_15_00', 'Co słychać?', 1, 43, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grd_281_GuardGate_07_01', 'Wszystko w porządku. Jak okiem sięgnąć - żadnego bandyty z Nowego Obozu!', 1, 43, 7, null, 281, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_YBerion_Wache_12_00', 'Co tu robisz? Kto cię tu wpuścił? Straż!', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_YBerion_Kennen_15_00', 'Witaj, Mistrzu Y''Berionie.', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_YBerion_Kennen_12_01', 'Ach! Przypominam sobie twoją twarz.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_YBerion_Kennen_15_02', 'To niemożliwe. Nigdy wcześniej się nie spotkaliśmy.', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_YBerion_Kennen_12_03', 'Ale myślałem... Ach, czego sobie życzysz?', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_Info_15_01', 'Słyszałem, że czegoś szukasz.', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_Info_12_02', 'Zgadza się. Potrzebujemy magicznego kamienia ogniskującego.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_Info_12_03', 'Miał go dostarczyć jeden z Nowicjuszy, niejaki Nyras, ale do tej pory nie wrócił.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_Info_12_04', 'Mógłbyś dowiedzieć się co się z nim dzieje!', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_OK_15_01', 'Przyniosę ci ten kamień ogniskujący!', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_OK_12_02', 'Weź tę mapę. Zaznaczono na niej położenie kamienia.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_WO_15_01', 'Gdzie powinienem zacząć poszukiwania?', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_WO_12_02', 'Po wyjściu z Obozu skręć w prawo i wejdź na strome zbocze. Idź przez las, dopóki nie dojdziesz nad brzeg morza. Tam znajdziesz kamień ogniskujący.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_FOKUS_15_01', 'Dlaczego ten kamień jest taki ważny?', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_FOKUS_12_02', 'Ten magiczny artefakt zogniskuje duchową siłę naszych braci.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_FOKUS_12_03', 'To jeden z pięciu kamieni ogniskujących, które posłużyły magom do utworzenia Bariery.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_FOKUS_12_04', 'Jedna z moich wizji objawiła mi zastosowanie kamienia.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_FOKUS_15_05', 'To musiała być niezwykle ciekawa wizja.', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_FOKUS_12_06', 'Zesłał mi ją sam Śniący! Dzięki kamieniowi ogniskującemu będziemy mogli nawiązać z nim kontakt!', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_BringFocus_RUNNING_15_01', 'Jeszcze nie znalazłem kamienia ogniskującego.', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_BringFocus_RUNNING_12_02', 'Więc szukaj dalej. Śniący wskaże ci drogę.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_BringFocus_Success_15_01', 'Znalazłem kamień.', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_BringFocus_Success_12_02', 'Świetnie. Oddałeś nam ogromną przysługę.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_BringFocus_Success_12_03', 'Teraz zanieś kamień Cor Kalomowi. On będzie wiedział, co z nim zrobić.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_BringFocus_Success_15_04', 'Gdzie znajdę tego Cor Kaloma?', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_BringFocus_Success_12_05', 'Większość czasu spędza w laboratorium alchemicznym na wyższym poziomie Obozu.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_BringFocus_Success_12_06', 'Porozmawiaj z Lesterem. Znajdziesz go przy wejściu do Obozu. On wskaże ci drogę.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_NYRAS_15_01', 'Nyras postradał zmysły!', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_NYRAS_15_02', 'Twierdził, że Śniący objawił się mu w wizji i wybrał go na swojego jedynego sługę!', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_NYRAS_15_03', 'Potem rzucił się na mnie i próbował mnie zabić!', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_NYRAS_12_04', 'Potęga Śniącego jest tak ogromna, że może przywieść nieprzygotowane dusze do szaleństwa.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_YBerion_NYRAS_12_05', 'Tylko my - Guru, po długich latach medytacji, posiadamy wystarczającą siłę duchową, by móc sprostać wyzwaniu, jakim jest wysłuchanie głosu Śniącego!', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1200_Yberion_EARN_Info_15_01', 'Chyba należy mi się jakaś nagroda?', 1, 94, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1200_Yberion_EARN_Info_12_02', 'Jako że nie należysz do Bractwa, postanowiłem cię wynagrodzić.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1200_Yberion_EARN_Info_12_03', 'Przyjmij ten amulet jako wyraz mojej wdzięczności.', 1, 94, 12, null, 1200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_FIRST_10_00', 'Czego chcesz?', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_WannaJoin_15_00', 'Chciałbym przyłączyć się do Bractwa.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_WannaJoin_15_01', 'Podobno jesteś zwierzchnikiem Nowicjuszy i to ty decydujesz kto zostanie przyjęty.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_WannaJoin_10_02', 'Nie mam teraz czasu! Moje eksperymenty są zbyt ważne, bym mógł zawracać sobie głowę nowoprzybyłymi!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_WannaJoin_10_03', 'Zdam się na osąd Baalów. Jeśli oni uznają, że jesteś gotów, by do nas dołączyć zgłoś się do mnie ponownie.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Recipe_15_00', 'Jeden z kupców ze Starego Obozu jest zainteresowany twoją recepturą na napój uzdrawiający.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Recipe_10_01', 'Moje receptury nie są na sprzedaż!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Experimente_15_00', 'Jakie eksperymenty przeprowadzasz?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Experimente_10_01', 'Moje badania dotyczą spraw, o których nie masz najmniejszego pojęcia, chłopcze, więc przestań zawracać mi głowę!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_BRINGWEED_15_00', 'Przynoszę codzienną porcję ziela!', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_BRINGWEED_10_01', 'TO ma być WSZYSTKO? Masz mi przynieść przynajmniej 100 sztuk!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_BRINGWEED_10_02', 'Ach, daj mi to. A teraz zejdź mi z oczu!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Crawlerzangen_15_00', 'Przyniosłem ci wnętrzności pełzaczy.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Crawlerzangen_10_01', 'Wspaniale. W nagrodę możesz sobie wziąć jeden z moich najlepszych wywarów.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Crawlerzangen_10_02', 'Świetnie. Weź sobie w nagrodę kilka moich wywarów.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Crawlerzangen_10_03', 'Hm. Tylko tyle? Masz tu napój mana i zejdź mi z oczu.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_15_00', 'Chyba udało mi się przekonać Baalów!', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_15_01', 'Baal Orun uważa, że jestem godnym sługą Śniącego.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_10_02', 'Mów dalej...', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_15_03', 'Baal Cadar ma mnie za pojętnego ucznia.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_15_04', 'Baal Namib jest przekonany co do szczerości mojej wiary.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_15_05', 'Dzięki mnie, Baal Tyon przeżył objawienie.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_10_06', 'I?', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_15_07', 'Baal Tondral uważa, że powinienem zostać przyjęty. Przyprowadziłem mu nowego ucznia.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_10_08', 'Dobrze. Jeśli Baalowie przemawiają za tobą, to mi wystarczy.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_10_09', 'Masz. Załóż to. A teraz idź robić coś pożytecznego.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_NOT_10_00', 'I?', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_NOT_15_01', 'To już wszystko.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_NOT_10_02', 'Marnujesz tylko mój cenny czas. Wróć kiedy uda ci się przekonać do siebie co najmniej czterech Baalów!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_15_10', 'Tylko tyle? Żadnego powitania, ani nic?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_10_11', 'Witamy.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_15_12', 'O wiele lepiej.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_10_13', 'Przestań się tu kręcić. Zrób coś pożytecznego. Zanieś to ziele do Starego Obozu i daj je Gomezowi.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_10_14', 'Gdyby jego siepacze stwarzali ci jakieś problemy, powiedz, że przysyła cię Cor Kalom.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_JoinPSI_10_15', 'Jeszcze tu jesteś?!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_DrugMonopol_15_00', 'Masz dla mnie jeszcze jakieś zadania?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_DrugMonopol_10_01', 'W Nowym Obozie kilku ludzi zaczęło uprawę ziela na własną rękę.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_DrugMonopol_10_03', 'Chcę, żebyś położył temu kres.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_DrugMonopol_15_04', 'Jak...', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_DrugMonopol_10_05', 'To już nie moja sprawa!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_DrugMonopol_10_06', 'Ich obozowisko musi znajdować się gdzieś w pobliżu Nowego Obozu. Wiesz, co masz zrobić...', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_Success_15_00', 'Wracając do produkcji ziela w Nowym Obozie...', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_Success_10_01', 'Tak?', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_Success_15_02', 'Nie mogę znaleźć tych ludzi.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_Success_10_03', 'Cóż, mogłem się tego po tobie spodziewać.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_Success_15_04', 'Już po kłopocie.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_Success_10_05', 'Zaskakujesz mnie. Chyba cię trochę niedoceniałem. Może jednak będzie z ciebie jakiś pożytek.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_KrautboteBACK_15_00', 'Dostarczyłem przesyłkę.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_KrautboteBACK_10_01', 'To dobrze. Poszukaj sobie jakiegoś nowego zajęcia.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_1_Psi_Kalom_KrautboteBACK_10_02', 'Gdzie jest 500 bryłek rudy, chłopcze? Lepiej się pospiesz. Nie będę długo czekał.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_Info3_15_01', 'Przysyła mnie Y''Berion. Mam kamień ogniskujący.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_Info3_10_02', 'Ach, kamień ogniskujący... Nareszcie mogę zbadać magiczną naturę tego artefaktu. ', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BringFocus_Info3_10_03', 'Gdybym tylko miał dość wydzieliny... Niech to piekło pochłonie!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BLUFF_Info3_15_01', 'Y''Berion powiedział, że wynagrodzisz mnie za dostarczenie kamienia!', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sit_2_PSI_Yberion_BLUFF_Info3_10_02', 'Czyżby? Tak powiedział? No tak. 50 bryłek rudy chyba wystarczy?', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_Info_15_01', 'Wydzieliny?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_Info_10_02', 'Tak. Jak zapewne wiesz, przygotowuję magiczne wywary, które pozwolą nam nawiązać kontakt ze Śniącym. Jednak do tego celu potrzebuję dużych ilości wydzieliny z wnętrzności pełzaczy.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_Info_10_03', 'Wiesz, co to są pełzacze, prawda?', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_NEIN_15_01', 'Nie.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_NEIN_10_02', 'To bardzo groźne istoty zamieszkujące mroczne korytarze kopalni. Pełzacze często atakują pracujących tam górników.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_NEIN_10_03', 'Ich wnętrzności zawierają szczególną wydzielinę.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_NEIN_10_04', 'Wykorzystuję ją do wytwarzania napoju, który otwiera przed nami duchową ścieżkę do Śniącego.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_JA_15_01', 'Tak.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_SACHE_JA_10_02', 'To świetnie!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_15_01', 'Mów dalej...', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_10_02', 'Cóż, jakiś czas temu Śniący objawił mi się osobiście i dał mi znak.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_10_03', 'Dał mi do zrozumienia, że istnieje inny sposób, nie wymagający wydzieliny z wnętrzności pełzaczy.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_10_04', 'I wybrał mnie, bym przekazał komuś jego zalecenia. Nie wypełniasz tego zadania dla mnie! To polecenie samego Śniącego!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_15_05', 'To niemożliwe!', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_10_06', 'Milcz, głupcze!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_10_07', 'Dał mi do zrozumienia, że wybraliśmy właściwą drogę, ale dysponujemy niewystarczającymi środkami.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_10_08', 'Oznacza to, że WŁAŚCIWE środki znajdziemy u pełzaczy, ale sama wydzielina z wnętrzności to za mało.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_VISION_Info_10_09', 'Musi być coś jeszcze.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_NEST_Info_15_01', 'Nie przeprowadzaliście żadnych badań na pełzaczach? Może jakaś część ich ciała zawiera większe ilości wydzieliny od innych?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_NEST_Info_10_02', 'Oczywiście, zbadaliśmy kilka martwych pełzaczy, ale wydzielina zdaje się być gromadzona wyłącznie w ich gruczołach jadowych.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_NEST_Info_10_03', 'To musi być coś innego. Znajdź ich gniazdo, a poznasz odpowiedź!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_WEG_Info_15_01', 'To ci dopiero będzie mroczna wyprawa.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_WEG_Info_10_02', 'Weź te zwoje. Znajdziesz na nich magiczne formuły zaklęcia Światła. Przydadzą ci się w nieoświetlonych szybach.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_WEG_Info_10_03', 'Świątynni Strażnicy z kopalni będą ci służyć pomocą.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_WEG_Info_10_04', 'Oby Śniący dodał ci sił. Niech jego blask rozświetla twą drogę, gdziekolwiek się udajesz!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_RAT_Info_15_01', 'Widzę, że nie obejdzie się bez rozlewu krwi.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_RAT_Info_10_02', 'Weź ze sobą te wywary.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_RAT_Info_10_03', 'Nie dostajesz ich ode mnie dlatego, że zależy mi na twoim życiu, tylko ze względu na rangę zadania.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_RUN_Info_15_01', 'Gdzie znajdę te pełzacze?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_RUN_Info_10_02', 'W Starej Kopalni.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_RUN_Info_15_03', 'A gdzie leży Stara Kopalnia?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_RUN_Info_10_04', 'Weź tę mapę. Zaznaczono na niej wszystkie ważniejsze miejsca wewnątrz Bariery.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_CRAWLER_Info_15_01', 'Jak należy walczyć z pełzaczami?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_CRAWLER_Info_10_02', 'W kopalni spotkasz kilku naszych Strażników polujących na pełzacze dla ich wydzieliny. Porozmawiaj z Gor Na Videm, on ci pomoże.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_FIND_Info_15_01', 'Jak mam odnaleźć gniazdo pełzaczy?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_FIND_Info_10_02', 'To najtrudniejsza część zadania. Nie wiem, gdzie powinieneś szukać, ani czego. Ale Śniący wskaże ci drogę w odpowiednim momencie.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_FIND_Info_15_03', 'To ci dopiero pocieszenie.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_15_01', 'Znalazłem jaja złożone przez królową pełzaczy.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_10_02', 'Wiedziałem! Moja wizja była znakiem od Śniącego! Te jaja z pewnością zawierają silną wydzielinę!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_10_03', 'Świetnie. Dzięki nim przygotuję napój, który pozwoli nam nawiązać kontakt ze Śniącym!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_15_04', 'A co z moją nagrodą?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_10_05', 'A, tak... Dziękuję.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_15_06', 'Wolałbym jakąś NAMACALNĄ nagrodę!', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_10_07', 'Dobrze już! Czego chcesz?', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_RUNE_15_01', 'Daj mi jakąś runę.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_RUNE_10_02', 'Niech ta runa rozświetla twą drogę!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_WAFFE_15_01', 'Daj mi jakiś oręż.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_WAFFE_10_02', 'Niech ten oręż sieje śmierć w szeregach twoich wrogów!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_HEAL_15_01', 'Daj mi napój uzdrawiający.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_HEAL_10_02', 'Niech ten napój przedłuży twoje życie.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_ORE_15_01', 'Wystarczy mi ruda.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_ORE_10_02', 'Przyjmij tę rudę jako oznakę wdzięczności całego Bractwa!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_MANA_15_01', 'Może być mana.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_2_PSI_Kalom_BringMCQEggs_Success_MANA_10_02', 'Niech ten napój wzmocni drzemiącą w tobie magię.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_15_01', 'Czy możemy teraz przystąpić do przywołania Śniącego?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_10_02', 'Nie! Nie udało mi się jeszcze znaleźć sposobu na naładowanie kamienia ogniskującego.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_10_03', 'Niestety, nie dysponujemy starożytną wiedzą na temat tych artefaktów.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_15_04', 'Chcesz powiedzieć, że zdobyłem te jaja na próżno?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_10_05', 'Nie. Posłuchaj: istnieje prastary almanach zawierający potrzebne nam informacje.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_10_06', 'Odkupiliśmy go od Corristo, jednego z Magów Ognia ze Starego Obozu.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_10_07', 'Niestety, został nam skradziony w drodze ze Starego Obozu.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_10_08', 'Kazałem Talasowi, jednemu z Nowicjuszy, dostarczyć mi tę księgę, ale ten głupiec pozwolił się okraść.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_10_09', 'Zawiódł mnie, ale postanowiłem dać mu drugą szansę. Ma odzyskać almanach.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Info_10_10', 'Porozmawiaj z nim. Przyda mu się każda pomoc.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Where_15_01', 'Gdzie znajdę Talasa?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Where_10_02', 'Powinien być u stóp świątyni. Próbuje zjednać sobie kogoś do pomocy.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Who_15_01', 'Kto ukradł tę księgę?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Who_10_02', 'Talas twierdzi, że został obrabowany przez Czarne Gobliny. Brzmi nieprawdopodobnie, ale mogło się tak zdarzyć...', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Earn_15_01', 'Co dostanę w zamian?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Earn_10_02', 'Czyż nie przekonałem cię już o mojej hojności? Otrzymasz nagrodę odpowiednią do rangi zadania.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Success_15_01', 'Znalazłem twoją księgę.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Success_10_02', 'Dobra robota. Teraz mamy wszystkie potrzebne składniki.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Success_10_03', 'Zajmę się teraz przygotowaniami.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Success_15_04', 'Kiedy odbędzie się wielkie przywołanie?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_BringBook_Success_10_05', 'Zaczekaj do wieczora, wtedy przyjdź na dziedziniec świątyni. Tam się zbierzemy i spróbujemy przywołać Śniącego.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_Belohnung_15_00', 'Co z moją zapłatą?', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_Belohnung_10_01', 'A czego chcesz?', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_Belohnung_SCROLL_15_00', 'Daj mi te zwoje z zaklęciami.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_Belohnung_SCROLL_10_01', 'Wykorzystaj je mądrze.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_Belohnung_ORE_15_00', 'Wystarczy mi ruda.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_Belohnung_ORE_10_01', 'To powinno zaspokoić twoją chciwość.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_Belohnung_MANA_15_00', 'Daj mi napoje mana.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorKalom_Belohnung_MANA_10_01', 'Niech te napoje dodadzą ci sił!', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Exit_15_01', 'Do zobaczenia.', 1, 78, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1201_CorKalom_Exit_10_02', 'Oby Śniący wskazał ci właściwą drogę.', 1, 78, 10, null, 1201, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_LaterTrainer_15_00', 'Możesz mnie czegoś nauczyć?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_LaterTrainer_08_01', 'Chcesz zostać silnym wojownikiem, więc szukasz mistrza, który wskaże ci drogę.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_LaterTrainer_08_02', 'To chwalebne, ale ja nie mogę ci pomóc.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_LaterTrainer_08_03', 'Poświęcam mój czas tylko członkom Wielkiego Kręgu Straży Świątynnej.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WieTempler_15_00', 'Co mam zrobić, żeby zostać Świątynnym Strażnikiem?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WieTempler_08_01', 'Najpierw musisz odsłużyć swoje jako Nowicjusz, dopóki nie przekonamy się, że jesteś oddanym sługą Śniącego.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WieTempler_08_02', 'Dopiero wtedy możesz do mnie wrócić, a ja udzielę ci lekcji.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_Teach_15_00', 'Pokażesz mi, jak poprawić moją siłę i zręczność?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_Teach_08_01', 'Siła i zręczność to cechy wielkiego wojownika.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WANNABETPL_Info_15_01', 'Chcę zostać Świątynnym Strażnikiem!', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WANNABETPL_Info_08_02', 'Nie jesteś jeszcze gotowy. Możesz do nas dołączyć, kiedy zdobędziesz nieco więcej doświadczenia.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WANNABETPL_Info_08_03', 'Nadszedł dzień, w którym dane ci będzie do nas dołączyć.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WANNABETPL_Info_08_04', 'Pamiętaj, że Świątynny Strażnik to coś więcej niż wojownik strzegący obozu Bractwa. Jesteśmy wybranymi strażnikami wyznawców Śniącego. Bronimy duchowej aury tego miejsca.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WANNABETPL_Info_08_05', 'Wykorzystujemy zarówno naszą siłę fizyczną jak i duchową. Prawdziwym Strażnikiem Świątynnym może zostać tylko ten, którego ciało i duch funkcjonują w idealnej harmonii.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WANNABETPL_Info_08_06', 'Cieszę się, że udało ci się osiągnąć tak wiele w tak krótkim czasie.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WANNABETPL_Info_08_07', 'Pamiętaj: Duchowa koncentracja i zdrowe ciało sprostają każdemu wyzwaniu.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WANNABETPL_Info_08_08', 'Idź teraz do Gor Na Totha. Znajdziesz go na placu treningowym. On da ci nowy pancerz.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND1_Info_15_01', 'Chciałbym potrafić posługiwać się dwuręcznym mieczem.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND1_Info_08_02', 'Walka dwuręcznym orężem stanowi poważne wyzwanie dla twojej siły i zręczności.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND1_Info_08_03', 'Aby móc sprawnie posługiwać się dwuręczna bronią musisz nie tylko rozwijać swoje ciało, ale również i umysł.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND1_Info_08_04', 'Tylko pełna kontrola nad ciałem i umysłem pozwoli ci rozwijać swoje umiejętności.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND1_Info_08_05', 'Koncentracja to podstawa. To ona jednoczy ciało i umysł.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND2_Info_15_01', 'Chciałbym dowiedzieć się czegoś więcej o walce dwuręcznym orężem.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND2_Info_08_02', 'Wiesz już jak zmusić ostrze swego miecza do tańca śmierci. Teraz pokażę ci jak wykorzystać twoje umiejętności w walce.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND2_Info_08_03', 'Oczyma duszy spróbuj przewidzieć następny ruch twojego przeciwnika.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND2_Info_08_04', 'Poznanie sposobu walki nieprzyjaciela to już połowa sukcesu.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND2_Info_08_05', 'Bądź szybki, twoja ruchliwość i płynność twoich ruchów powinny iść w parze z siłą i precyzją twoich ciosów.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND2_Info_08_06', 'Naucz się ignorować ból. To twoja siła ducha zadecyduje o ostatecznym wyniku starcia.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND2_Info_08_07', 'Zachowaj spokój. Zachowanie czystości umysłu i niezachwianej koncentracji przypieczętuje twoje zwycięstwo.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_ZWEIHAND2_Info_08_08', 'Rozsądnie wykorzystuj swoje umiejętności, i pamiętaj: kto prowokuje walkę - ginie w walce. ', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_15_01', 'Co się stanie teraz?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_08_02', 'Wizja była bardzo mglista. Zamiast odpowiedzi dała nam jeszcze więcej pytań.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_08_03', 'Ale jedna rzecz nie ulega wątpliwości: widziałem Orka w jaskini. W pobliżu znajduje się opuszczone miejsce orkowego kultu.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_08_04', 'Orkowie chowali tam swoich zmarłych, dlatego nazywamy ten labirynt jaskiń Cmentarzyskiem Orków.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_08_05', 'Nasz Guru, Baal Lukor udał się tam z oddziałem Strażników Świątynnych. Może znajdą coś, co pozwoli nam wyjaśnić znaczenie wizji.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_08_06', 'Przydałby mi się ktoś, kto rozejrzy się tam trochę i zda mi raport z sytuacji.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_15_07', 'Dlaczego nie pójdziesz tam sam? W końcu jesteś przywódcą Straży Świątynnej!', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_08_08', 'Moim zadaniem jest ochrona Jaśnie Oświeconego. Muszę zostać na miejscu, żeby strzec Y''Beriona.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_08_09', 'Oddałeś Obozowi nieocenione usługi. Tylko na tobie mogę polegać.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_Info_08_10', 'Proszę, udaj się na Cmentarzysko Orków i dostarcz mi informacji na temat odkryć poczynionych przez Strażników.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_EARN_Info_15_01', 'A co dostanę w zamian?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_EARN_Info_08_02', 'Chcesz rudy? Chyba jednak źle cię oceniłem. Ale potrzebuję twojej pomocy. Proszę, oto 100 bryłek rudy. Więcej ode mnie nie dostaniesz!', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_KNOW_Info_15_01', 'Natychmiast ruszę w drogę!', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_SENDS_KNOW_Info_08_02', 'Zanim pójdziesz, weź ten pierścień. Niech cię chroni w walce.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WHERE_Info_15_01', 'Gdzie jest to Cmentarzysko Orków?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_WHERE_Info_08_02', 'Niedaleko stąd. Nowicjusz Talas wskaże ci drogę. Znajdziesz go na świątynnym dziedzińcu. On będzie twoim przewodnikiem.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_15_01', 'Byłem na Cmentarzysku Orków. Tam NIC NIE MA. Ani Śniącego, ani znaku... Nic!', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_08_02', 'A co z Baalem Lukorem i Strażnikami?', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_15_03', 'Wszyscy zginęli.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_08_04', 'Zginęli? Ale dlaczego, co się stało?', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_15_05', 'W jaskiniach aż roiło się od Orków. Wybili Straż Świątynną do nogi.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_15_06', 'Tylko ja i Baal Lukor wyszliśmy z tego cało, ale nagle Baal postradał zmysły.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_15_07', 'Wrzeszczał, że Śniący kazał mu mnie zabić i zamierzał wykonać to polecenie.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_08_08', 'Najwyraźniej nie mógł się pogodzić z niepowodzeniem swojej misji.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_08_09', 'Nie wierzę, żeby błogosławiony wpływ Śniącego mógł go popchnąć do tak brutalnego działania.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_08_10', 'To nie może... Nie może... NIEWAŻNE!!!', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_08_11', 'Najważniejsze, że zamiar Baala Lukora się nie powiódł.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_AFTER_Info_08_12', 'Teraz naszą jedyną nadzieją jest Y''Berion.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_3_NC_CorAngar_FindHerb_15_01', 'Co słychać u Jaśnie Oświeconego?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_3_NC_CorAngar_FindHerb_08_02', 'Nie budzi się. I z godziny na godzinę jest co raz słabszy. Wiem, jak można go zbudzić, ale potrzebuję twojej pomocy.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_3_NC_CorAngar_FindHerb_15_03', 'Co mam zrobić?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_3_NC_CorAngar_FindHerb_08_04', 'Przynieś mi pięć najmocniejszych ziół uzdrawiających jakie można znaleźć na bagnach!', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Mis_3_NC_CorAngar_FindHerb_08_05', 'Spiesz się!', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_WHERE_15_01', 'Gdzie mogę znaleźć te zioła?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_WHERE_08_02', 'Poszukaj na bagnach za Obozem. Musisz się zapuścić dość daleko, więc uważaj na błotne węże!', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_WHERE_08_03', 'I nie trać ani chwili. Idź już!', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_LOOK_15_01', 'Jak rozpoznam te zioła?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_LOOK_08_02', 'Przypominają gwiazdę z ośmioma zielonymi i pomarańczowymi liśćmi.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_LOOK_08_03', 'Ruszaj w drogę.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_Running_15_01', 'Nie znalazłem jeszcze potrzebnej ilości ziół.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_Running_08_02', 'Może Fortuno, handlarz ziołami, ma trochę w swoich zapasach.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_Running_08_03', 'Pospiesz się. Potrzebuję pięciu ziół. Y''Berionowi nie zostało już zbyt wiele czasu.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_Success_15_01', 'Mam już wszystkie uzdrawiające zioła dla Y''Beriona.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_Success_08_02', 'Dobra robota. Y''Berion zbudził się na chwilę tuż przed twoim przybyciem.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_Success_15_03', 'Powiedział coś?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_Success_08_04', 'Tak. Powiedział, że Śniący nie jest tym, za co go uważamy. Pod żadnym pozorem nie wolno nam go zbudzić. ', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_FindHerb_Success_08_05', 'Pozostaje nam tylko mieć nadzieję, że dla biednego Y''Beriona nie jest jeszcze za późno.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_08_00', 'Y''BERION NIE ŻYJE. Nasz duchowy przywódca odszedł w zaświaty!', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_08_01', 'Nawet twoja błyskawiczna pomoc nie mogła zapobiec jego śmierci.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_15_02', 'I co teraz będzie?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_08_03', 'Zawsze ufałem Y''Berionowi. Tuż przed śmiercią kazał nam upatrywać nadziei ocalenia w planie ucieczki opracowanym przez Magów Wody.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_15_04', 'Dlatego powinniśmy wesprzeć Magów Wody w ich dążeniach.', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_08_05', 'Przyda się im kamień ogniskujący i almanach. Ale te są wciąż w rękach Cor Kaloma.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_15_06', 'A gdzie jest Cor Kalom?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_08_07', 'W gniewie zebrał oddział Strażników Świątynnych i wyruszył na poszukiwanie Śniącego.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_15_08', 'Niech to szlag! I jak teraz odzyskamy kamień ogniskujący?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1202_CorAngar_DEATH_Info_08_09', 'Zdaję się, że kamień i księga są wciąż w jego laboratorium. Masz tu klucz do skrzyni.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_TELEPORT_08_01', 'Jeszcze coś!', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_TELEPORT_15_02', 'Tak?', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_TELEPORT_08_03', 'Weź tę magiczną runę jako symbol naszej wdzięczności za twoje dokonania.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_TELEPORT_08_04', 'Pozwoli ci ona w dogodnej chwili przeteleportować się na świątynny dziedziniec.', 1, 53, 8, null, 1202, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_TELEPORT_15_05', 'Dziękuję!', 1, 53, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_00', 'Nie wyglądasz mi na kogoś, kto chciałby nosić niewolnicze jarzmo nakładane ludziom przez Magnatów.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_01', 'Myślę, że jesteś raczej poszukiwaczem - kimś, kto szuka prawdziwej wiary. Czy czujesz, jak ogień trawi twoje ciało podczas snu?', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_02', 'Widzę, że powątpiewasz w rzeczy opowiadane ci przez sługusów Magnatów. Przecież wiesz, dlaczego nie można im ufać, prawda? To kłamcy!', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_03', 'Ich łgarstwa czynią słabych ludzi ślepcami. Ale twój duch jest silniejszy niż ich kłamstwa!', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_04', 'Czy nie odczuwasz pragnienia wolności każdego dnia? Nie czujesz, jak z każdą godziną pragnienie to staje się silniejsze? Pozwól mu pokierować twoim duchem!', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_05', 'Czy wiesz, co robisz, próbując zagłuszyć w sobie ten głos? Wyrzekasz się swojej duszy, wyrzekasz się samego siebie! Nie pozwól, by strach tobą kierował.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_06', 'Uwolnij się. Przejrzyj na oczy! Śniący zbudzi się pewnego dnia, wyzwoli swoich poddanych i strąci niewiernych w najczarniejsze czeluści piekieł.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_07', 'Znikną z tego świata jak nieczystości spłukane przez deszcz. Będą błagać o litość, ale wtedy będzie już dla nich za późno.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_FanaticTeacher_13_08', 'Wtedy zapłacą cenę. Zapłacą ją własną krwią... I własnym życiem.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_YouTalked_15_00', 'Hej! Odezwałeś się do mnie. Czy to znaczy, że mogę już z tobą rozmawiać?', 1, 68, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_YouTalked_13_01', 'Widzę, że zaznajomiłeś się już z naszymi zasadami. To dobrze.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_YouTalked_13_02', 'Wyczuwam w tobie wielką siłę ducha. Wkrótce będziesz gotów, by do nas dołączyć.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_YouTalked_13_03', 'Przemówiłem do ciebie, bo chcę dać ci szansę udowodnienia swojej lojalności.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_Loyality_15_00', 'W jaki sposób mogę udowodnić swoją lojalność?', 1, 68, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_Loyality_13_01', 'Przede wszystkim, potrzebujemy nowych dusz, które zechcą przyłączyć się do naszej społeczności.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_Loyality_13_02', 'Jeśli chcesz mnie przekonać o swojej przydatności dla naszego obozu, przyprowadź mi jeszcze jednego człowieka, który zechce zostać członkiem Bractwa.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_NewMember_15_00', 'Gdzie mam szukać nowych członków Bractwa?', 1, 68, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_NewMember_13_01', 'Na początek rozejrzyj się w Starym Obozie. Wielu z tamtejszych ludzi ma już dość terroru i kłamstw. Potrzebują tylko odrobiny wsparcia.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_NewMember_13_02', 'W Nowym Obozie raczej wiele nie zwojujesz. Mieszkają tam sami barbarzyńcy.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_NewMember2_15_00', 'Dlaczego tak desperacko szukacie nowych członków?', 1, 68, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_NewMember2_13_01', 'Śniący przemówił do naszego mistrza, oznajmiając, że ma dla nas niezwykle ważną wiadomość.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_NewMember2_13_02', 'Ale nie zebrał jeszcze wszystkich sił. Dlatego potrzebuje NASZEJ siły, by nawiązać ostateczny kontakt.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_NewMember2_13_03', 'Dlatego przygotowujemy się do wielkiego przyzwania. Im więcej ludzi weźmie w nim udział, tym większe będą szanse powodzenia.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_NewMember2_13_04', 'Jeśli chcesz dowiedzieć się więcej na ten temat, idź na świątynny dziedziniec. Tylko nie przeszkadzaj naszemu mistrzowi w medytacji!', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_DustySuccess_15_00', 'Mistrzu, oto ktoś, kto chciałby cię poznać!', 1, 68, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_DustySuccess_13_01', 'Kogóż mi tu przyprowadziłeś? Czy jest godzien?', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_DustySuccess_15_02', 'Cóż, bez twojego duchowego wsparcia zapewne się nie obędzie, Mistrzu.', 1, 68, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_DustySuccess_13_03', 'Dobrze. Od dzisiaj ten człowiek będzie moim uczniem.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_DustySuccess_13_04', 'Każdego dnia będziesz przychodził do mojej chaty po nauki. Dla twojej duszy jeszcze nie jest zbyt późno.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_SendToKalom_15_00', 'Mistrzu! Chciałbym dołączyć do Bractwa. Czy mogę liczyć na twoją przychylność?', 1, 68, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTondral_SendToKalom_13_01', 'Udowodniłeś, że jesteś człowiekiem prawym. Cor Kalom powinien cię przyjąć.', 1, 68, 13, null, 1203, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_NoTalk_Hi_15_00', 'Cześć! Jestem tu nowy!', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_NoTalk_Hi_02_01', '(Wzdycha)', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_NoTalk_Sleeper_15_00', 'Niech Śniący będzie z tobą!', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_NoTalk_Sleeper_02_01', '(Wzdycha)', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_NoTalk_Imp_15_00', 'Wszystko w porządku, kolego?', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_NoTalk_Imp_02_01', '(Wzdycha)', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_FirstTalk_02_00', '(Wzdycha)', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_FirstTalk_02_01', 'Zostałeś wybrany przez Śniącego. Czy twoim życzeniem naprawdę jest dołączyć do nas?', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_FirstTalk_Mute_15_00', '(Wzdycha)', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_FirstTalk_Mute_02_01', 'Co takiego?', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_FirstTalk_Sleeper_15_00', 'Tak, chcę podążać drogą Śniącego!', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalNamib_FirstTalk_Sleeper_02_01', 'Idź do Cor Kaloma. Powiedz mu, że przysyłam cię do niego, bo widzę, iż twoja wiara jest szczera!', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1204_BaalNamib_ARMOR_Info_15_01', 'Chciałbym otrzymać lepszą zbroję.', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1204_BaalNamib_ARMOR_Info_02_02', 'Minie jeszcze trochę czasu, zanim dane ci będzie nosić ciężką zbroję Nowicjusza.', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1204_BaalNamib_ARMOR_Info_02_03', 'Wróć, gdy uzbierasz trochę więcej rudy.', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1204_BaalNamib_ARMOR_Info_02_04', 'Ta zbroja chronić będzie twoje ciało, tak jak Śniący chroni twoją duszę!', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_15_01', 'Czy są jakieś zadania, których mógłbym się podjąć?', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_02_02', 'Nasz mistrz, mądry Y''Berion, kazał sobie przysłać Nowicjusza. Jako że jesteś teraz jednym z nas, możesz iść do niego i zaoferować swoje usługi.', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_YBWO_15_01', 'Gdzie znajdę Y''Beriona?', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_YBWO_02_02', 'Jego siedziba znajduje się pod świątynnym wzgórzem.', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_YBWAS_15_01', 'Wiesz może jakie zadanie ma dla mnie Y''Berion?', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_YBWAS_02_02', 'Aby doszło do wielkiego przyzwania musimy najpierw zdobyć pewien magiczny artefakt.', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_YBWAS_02_03', 'Y''Berion poszukuje śmiałka, który zechce się podjąć tego zadania.', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_YBWAS_15_04', 'To nie wydaje się zbyt trudne.', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_YBWAS_02_05', 'Gdyby było łatwe, już dawno mielibyśmy ten artefakt w naszym obozie. Porozmawiaj z Y''Berionem. On ci wszystko wyjaśni.', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_OK_15_01', 'W porządku. Zajrzę do niego natychmiast.', 1, 128, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalNamib_BROTHERHOOD_OK_02_02', 'Niech Śniący będzie z tobą!', 1, 128, 2, null, 1204, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_15_00', 'Cześć! Jestem tu nowy!', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Sleeper_15_00', 'Niech Śniący będzie z tobą!', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Sleeper_02_01', '(Wzdycha)', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Imp_15_00', 'Wszystko w porządku, kolego?', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Imp_02_01', '(Wzdycha)', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_SleepSpell_02_00', 'Co ty wyprawiasz? Próbuję medytować z moimi uczniami.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_SleepSpell_02_01', 'Kto cię nauczył wykorzystywać magiczne moce Śniącego?', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_SleepSpell_15_02', 'Nikt. To było całkiem proste!', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_SleepSpell_02_03', 'Wyglądasz mi na pojętnego ucznia. Będę twoim mistrzem.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_Teach_Info_15_01', 'Chciałbym zwiększyć potęgę moich zaklęć!', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_Teach_Info_02_02', 'Kluczem do tego jest siła twego ducha.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_FIRSTTEST_Info_15_01', 'Naucz mnie wykorzystywać magię runiczną.', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_FIRSTTEST_Info_02_02', 'Wielu poznało język runiczny, ale tylko kilku rozumie naturę ich magii.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_FIRSTTEST_Info_02_03', 'Spróbuję ci ją wyjaśnić.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS1_Info_15_01', 'Jestem gotów, by przystąpić do Pierwszego Kręgu:', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS1_Info_02_02', 'Słuchaj mnie uważnie:', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS1_Info_02_03', 'Dawno temu Śniący przybył tutaj i zesłał ludziom proroczą wizję.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS1_Info_02_04', 'Jednak wielu z nich nie chciało zobaczyć jego potęgi. Nie chciało uwierzyć. Zaślepiała ich chciwość rudy.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS1_Info_02_05', 'Tylko Y''Berion, wraz z garstką towarzyszy usłuchał głosu Śniącego. Tak powstało Bractwo.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS1_Info_02_06', 'W chwili, w której po raz pierwszy wstąpili na ścieżkę zbawienia, powstał również Pierwszy Krąg. Magia runiczna staje się zrozumiała dla każdego, kto podąża śladem Śniącego.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS2_Info_15_01', 'Jestem gotów, by przystąpić do Drugiego Kręgu.', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS2_Info_02_02', 'Zatem słuchaj uważnie:', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS2_Info_02_03', 'Śniący wskazał Y''Berionowi i jego uczniom miejsce, w którym mieli się osiedlić.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS2_Info_02_04', 'Wybrani pracowali bez przerwy, dniem i nocą, niebaczni na niebezpieczeństwa i zmęczenie. Co chwila przybywali do nich nowi ludzie, gotowi wysłuchać nauk Śniącego.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS2_Info_02_05', 'Wspólnie spróbowali przez modlitwę zjednoczyć się duchowo ze Śniącym.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS2_Info_02_06', 'Narodził się Drugi Krąg.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS3_Info_15_01', 'Jestem gotów, by przystąpić do Trzeciego Kręgu.', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS3_Info_02_02', 'Zapamiętaj sobie:', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS3_Info_02_03', 'Zsyłane przez Śniącego wizje były co raz wyraźniejsze, ale Bractwo nie dysponowało siłą wystarczającą by nawiązać kontakt.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS3_Info_02_04', 'Jeden z Guru, alchemik, znalazł rozwiązanie. Przygotował napój sporządzony z wydzieliny z wnętrzności pełzaczy. Bracia wypili go przed rozpoczęciem modłów i ich duchowe siły zjednoczyły się po raz pierwszy.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS3_Info_02_05', 'W tym samym czasie nasi Nowicjusze wyruszyli do innych obozów, by głosić tam nauki Śniącego i wyprowadzić niewiernych z błędów pogaństwa.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS3_Info_02_06', 'W ten sposób zamknął się Trzeci Krąg.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS4_Info_15_01', 'Jestem gotów, by przystąpić do Czwartego Kręgu.', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS4_Info_02_02', 'Długi czas upłynął od chwili założenia Obozu. Wiele się tutaj zmieniło.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS4_Info_02_03', 'Nasza wiara umocniła się i rozprzestrzeniła.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS4_Info_02_04', 'I nie zapomnieliśmy o naszym celu. Nie ustaliśmy w naszych wysiłkach, by przyzwać Śniącego do tego świata.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS4_Info_02_05', 'Trwałość i niezmienność naszej wiary symbolizuje Czwarty Krąg.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_KREIS4_Info_02_06', 'Teraz wiesz już wszystko, co członek Bractwa powinien wiedzieć o magii. Byłeś pojętnym uczniem.', 1, 121, 2, null, 1208, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Gur_1208_BaalCadar_SELLSTUFF_Info_15_01', 'Chciałbym zdobyć księgi traktujące o magii.', 1, 121, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_NoTalk_Hi_15_00', 'Cześć! Jestem tu nowy!', 1, 157, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_NoTalk_Hi_12_01', '(Wzdycha)', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_NoTalk_Sleeper_15_00', 'Niech Śniący będzie z tobą!', 1, 157, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_NoTalk_Sleeper_12_01', '(Wzdycha)', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_NoTalk_Imp_15_00', 'Wszystko w porządku, kolego?', 1, 157, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_NoTalk_Imp_12_01', '(Wzdycha)', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_FirstTalk_12_00', 'Rozmawiałem z Ghorimem. Oddałeś jednemu z naszych braci nie lada przysługę. Twoja sprawa była słuszna.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_FirstTalk_12_01', 'Dlatego postanowiłem wyznaczyć cię do pewnego szczególnego zadania.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_FirstTalk_12_02', 'Cor Kalom pilnie potrzebuje do swoich eksperymentów świeżej dostawy bagiennego ziela.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_FirstTalk_12_03', 'Nasi zbieracze pracują dniem i nocą. Idź do nich i przynieś wszystko co uzbierali do laboratorium alchemicznego Kaloma.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_FirstTalk_Where_15_00', 'Gdzie znajdę tych zbieraczy?', 1, 157, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_FirstTalk_Where_12_01', 'Nie pozwoliłem ci zwracać się do mnie!', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_FirstTalk_Where_12_02', 'Módl się, aby Śniący wybaczył ci to bluźnierstwo! A teraz odejdź! Twoje zadanie jest niezwykle ważne.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_GotWeed_12_00', 'Obroniłeś naszych zbieraczy...', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_GotWeed_12_01', 'Nie tylko udowodniłeś, że jesteś po naszej stronie - pokazałeś również, że jesteś godnym sługą Śniącego.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_GotWeed_12_02', 'Myślę, że jesteś godzien nosić szatę Nowicjusza.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_WeedAtKaloms_15_00', 'Zaniosłem ziele Cor Kalomowi.', 1, 157, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_WeedAtKaloms_12_01', 'Dobrze się spisałeś. Mam dla ciebie drobną nagrodę za twoje trudy. Proszę, weź to.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_WeedAtKaloms_12_02', 'To magiczne zaklęcie snu. Możesz go użyć tylko jeden raz, ale jestem pewien, że kiedyś ci się przyda.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_Perm_15_00', 'Jak przebiega produkcja ziela?', 1, 157, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_Perm_12_01', 'Wytężamy wszystkie siły, żeby nadążyć z produkcją. W końcu musimy zadbać o własne potrzeby, i jeszcze wymieniać część towaru z innymi obozami.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalOrun_Perm_12_02', 'Ale nasi Nowicjusze chętnie ponoszą tę ofiarę, ku większej chwale Śniącego.', 1, 157, 12, null, 1209, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_NoTalk_Hi_15_00', 'Cześć! Jestem tu nowy!', 1, 155, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_NoTalk_Hi_11_01', '(Wzdycha)', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_NoTalk_Sleeper_15_00', 'Niech Śniący będzie z tobą!', 1, 155, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_NoTalk_Sleeper_11_01', '(Wzdycha)', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_NoTalk_Imp_15_00', 'Wszystko w porządku, kolego?', 1, 155, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_NoTalk_Imp_11_01', '(Wzdycha)', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_SpecialJoint_15_00', 'Proszę, Mistrzu! Oto skromny prezent od twojego ucznia...', 1, 155, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_SpecialJoint_11_01', 'Mmmmmmm...', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_Vision_11_00', 'Na chwałę Śniącego! Miałem wizję!', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_Vision_11_01', 'To było niesamowite! Zobaczyłem, że wkrótce zyskamy nowego brata, który będzie inny niż wszyscy przed nim.', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_Vision_11_02', 'To miało coś wspólnego ze mną. W jego ręku lśnił miecz. On sam zaś zbiegał w dół po szerokich stopniach. Tutaj wizja się skończyła.', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_Vision_11_03', 'Wyglądał zupełnie jak TY! Kim jesteś? Czego tu szukasz?', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_Vision_15_04', 'Jestem tylko skromnym sługą Śniącego...', 1, 155, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTyon_Vision_11_05', 'Idź do Cor Kaloma. On się tobą zajmie.', 1, 155, 11, null, 1210, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_MEET_13_01', 'Dzięki za pomoc. Zjawiłeś się w ostatniej chwili.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DEAD_15_01', 'Po drodze znalazłem ciała Świątynnych Strażników! Co się stało?', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DEAD_13_02', 'Mistrz Cor Angar przysłał nas tutaj, byśmy przeszukali jaskinie.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DEAD_13_03', 'Spodziewaliśmy się znaleźć tu tylko stare groby i rozpadające się mumie.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DEAD_13_04', 'Nagle coś poruszyło się w ciemnościach i dookoła pojawili się Orkowie. Nie wiem, czego tam szukali, ale ich obecność tutaj jest bardzo niepokojąca!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DEAD_15_05', 'Gdzie są pozostali Strażnicy?', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DEAD_13_06', 'Nie żyją! Nieświadomie doprowadziłem do ich zagłady! Niech Śniący zlituje się nad moją duszą!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SUMMONING_15_01', 'Przysyła mnie Cor Angar. Odnaleźliście jakieś ślady Śniącego?', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SUMMONING_13_02', 'Jeszcze nie. A co z Y''Berionem? Doszedł już do siebie?', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SUMMONING_15_03', 'Nie, nadal jest nieprzytomny.', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SUMMONING_13_04', 'Musimy zbadać ten kompleks jaskiń. Po tych wszystkich straszliwych wydarzeniach nie mogę wrócić do Obozu z pustymi rękami.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SUMMONING_13_05', 'Ale moje zdolności bojowe są dość ograniczone, a Orkowie nie reagują na moją magię jak ci głupcy ze Starego Obozu.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SUMMONING_13_06', 'Skoro przysyła cię Bractwo, może pomożesz mi w badaniu tego cmentarzyska.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HELP_15_01', 'Pomogę ci.', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HELP_13_02', 'To wspaniale. Z tego pomieszczenia wychodzą trzy korytarze. Powinniśmy przeszukać każdy z nich.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HELP_13_03', 'Prowadź. Pójdę za tobą!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FOUNDNONE_15_01', 'Nic tu nie ma.', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FOUNDNONE_13_02', 'Musimy przeszukać wszystkie trzy tunele.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FOUNDONE_15_01', 'Najwyraźniej druga połowa pergaminu uległa zniszczeniu!', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FOUNDONE_13_02', 'Druga połowa musi być gdzieś w pobliżu! Musimy przeszukać pozostałe tunele!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FIRSTWAIT_13_01', 'Dalej już nie pójdziemy. Może w tych niszach znajdziemy jakąś wskazówkę.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FIRSTSCROLL_15_01', 'Znalazłem fragment pergaminu!', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FIRSTSCROLL_13_02', 'Wspaniale! To druga połowa zwoju z zaklęciem Orków!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FIRSTSCROLL_13_03', 'To mi wygląda na zwój z zaklęciem Orków. Niestety, został przerwany na pół.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_FIRSTSCROLL_13_04', 'Gdzieś musi być druga połowa tego pergaminu!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SECONDWAIT_13_01', 'Hmmm... Ten tunel okazał się ślepą uliczką. Może znajdziemy tutaj jakieś wskazówki, które pomogą nam w naszych poszukiwaniach.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SECONDSCROLL_15_01', 'Znalazłem fragment pergaminu!', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SECONDSCROLL_13_02', 'Wspaniale! To druga połowa zwoju z zaklęciem Orków!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SECONDSCROLL_13_03', 'To mi wygląda na zwój z zaklęciem Orków. Niestety, został przerwany na pół.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_SECONDSCROLL_13_04', 'Gdzieś musi być druga połowa tego pergaminu!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_BOTHSCROLLS_15_01', 'Co teraz zrobimy z tymi dwoma fragmentami?', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_BOTHSCROLLS_13_02', 'To dwie połowy tego samego manuskryptu. Ale nie potrafię odcyfrować tego pisma.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_RUNES_13_01', 'Czekaj! To interesujące...', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_RUNES_15_02', 'Cóż, nie widzę tu nic interesującego.', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_RUNES_13_03', 'Cicho! Przyjrzyj się uważnie ornamentom zdobiącym tę jaskinię.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_RUNES_13_04', 'Tak, to mi powinno wystarczyć do przetłumaczenia znalezionego przez nas pergaminu.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_RUNES_13_06', 'Już wiem! To zaklęcie teleportacji! Wygląda na to, że można go użyć tylko w konkretnym miejscu!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_RUNES_13_07', 'Dziwne!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_WHATNOW_15_01', 'Jakim "konkretnym" miejscu?', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_WHATNOW_13_02', 'Ta wielka komora, przez którą przechodziliśmy wcześniej wydała mi się dość... niezwykła. Powinniśmy tam czym prędzej wrócić!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HALLWITHOUT_13_01', 'To miejsce... Nie potrafię tego wyjaśnić, ale to miejsce...', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HALLWITHOUT_13_02', 'Och, nieważne. Pewnie mi się tylko wydaje.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HALLWITH_13_01', 'To miejsce posiada szczególną aurę. Aurę tajemnicy.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HALLWITH_15_02', 'To pomieszczenie przypomina mi obraz z naszej wizji.', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HALLWITH_13_03', 'Wizja... Jesteśmy już bardzo blisko celu...', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DOOR_13_01', 'Za tą ścianą... To musi być tutaj!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DOOR_13_02', 'Moje moce magiczne są wciąż bardzo osłabione.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_DOOR_13_03', 'Użyj orkowego zaklęcia teleportacji! Właśnie tutaj, przed tą ścianą.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_TELEPORT_13_01', 'Znalazłeś ukrytą komorę! Mój instynkt mnie nie zawiódł.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_TELEPORT_15_02', 'Naprawdę znajdziemy tu odpowiedź na tajemnicze wydarzenia związane z przyzwaniem Śniącego?', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_TELEPORT_15_03', 'To mi raczej wygląda na kolejną komorę grobowcową.', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_TELEPORT_13_04', 'Musimy iść dalej.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_HELP_13_03', 'Prowadź. Pójdę za tobą!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_01', 'NIE! To nie może być prawda! To nic nie ma... Tylko kurz i... i kości.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_02', 'NIE!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_03', 'PANIE, PRZEMÓW DO MNIE!!!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_04', 'ŚNIĄCY, UKAŻ SIĘ SWOJEMU SŁUDZE!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_05', 'NIEEE!!!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_15_06', 'No to koniec. Teraz całkiem mu odbiło.', 1, 55, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_07', 'To wszystko twoja wina. Twoja bluźniercza obecność rozgniewała wszechmocnego Śniącego!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_08', 'Teraz ja będę musiał ponieść karę za twoje grzeszne czyny!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_09', 'Muszę złożyć ofiarę, aby przebłagać mego pana. OFIARĘ Z CZŁOWIEKA!!!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_10', 'Wtedy Śniący znów spojrzy na mnie przychylnym okiem i uczyni mnie swoim sługą.', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_11', 'GIŃ, NIEWIERNY PSIE!!!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BaalLukor_ALTAR_13_12', 'AIIIEEEEHHHHHH!!!!!!', 1, 55, 13, null, 1211, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_10_01', 'Nareszcie, znów się spotykamy!', 1, 20, 10, null, 1212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_10_02', 'Mój pan uprzedził mnie o twoim przybyciu!', 1, 20, 10, null, 1212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_10_03', 'On potrafi wyczuć, że jesteś w pobliżu!', 1, 20, 10, null, 1212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_15_04', 'Wkrótce znajdę się bliżej niego, niż mógłby sobie tego życzyć!', 1, 20, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_10_05', 'Nie pozwolimy, byś pokrzyżował nasze plany.', 1, 20, 10, null, 1212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_10_06', 'Świat doświadczy wkrótce przebudzenia wielkiego Odkupiciela i nikt nie jest w stanie temu zapobiec.', 1, 20, 10, null, 1212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_10_07', 'Wszyscy niewierni zapłacą słoną cenę.', 1, 20, 10, null, 1212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_10_08', 'A ty będziesz miał zaszczyt być pierwszym z nich.', 1, 20, 10, null, 1212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1212_MadCorKalom_Talk2SC_10_09', 'ŚNIĄCY, ZBUDŹ SIĘ!!!', 1, 20, 10, null, 1212, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Announcer_ANNOUNCE_11_01', 'Moi szanowni Magnaci, drodzy Strażnicy, Cienie i Kopacze...', 1, 95, 11, null, 397, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Announcer_ANNOUNCE_11_02', 'Z prawdziwą przyjemnością przedstawiam wam...', 1, 95, 11, null, 397, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Announcer_ANNOUNCE_11_03', '!!! IN EXTREMO !!!!', 1, 95, 11, null, 397, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rodriguez_Hello_15_00', 'Szukam Arcymistrza Magów Ognia!', 1, 92, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Rodriguez_Hello_12_01', 'Zgłoś się do Miltena. On się zajmuje kurierami.', 1, 92, 12, null, 400, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_401_Damarok_WELCOME_Info_14_01', 'Niech Ogień rozświetla twe życie.', 1, 56, 14, null, 401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_401_Damarok_HEAL_Info_14_01', 'Gdybyś został ranny, uzdrowię cię.', 1, 56, 14, null, 401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_401_Damarok_HEALINFO_Info_15_01', 'Jestem ranny. Możesz mi pomóc?', 1, 56, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_401_Damarok_HEALINFO_Info_14_02', 'W zdrowym ciele - zdrowy duch.', 1, 56, 14, null, 401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_Intruder_14_00', 'Co ty tu robisz? Nie masz tu czego szukać! Precz!', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINMAGE_Info_15_01', 'Powiedz mi - jak to jest być magiem?', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINMAGE_Info_14_02', 'Jesteśmy Magami Ognia. Służymy Innosowi - najpotężniejszemu z bogów.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINMAGE_Info_14_03', 'Nasza magia jest darem niebios. Jesteśmy kapłanami, nauczycielami i sędziami jednocześnie.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINMAGE_Info_14_04', 'Dar, który jest jednocześnie wielkim ciężarem. To zadanie, które określa cel naszego życia.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_WANNBEKDF_Info_15_01', 'Chciałbym przystąpić do magicznego Kręgu.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_WANNBEKDF_Info_14_02', 'A więc chcesz zostać Magiem z Kręgu Ognia? Hmmm...', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_WANNBEKDF_Info_14_04', 'Nie jesteś jeszcze gotów. Wróć do mnie, kiedy zdobędziesz więcej doświadczenia.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_WANNBEKDF_Info_14_03', 'Wielu chciało należeć do naszego Kręgu, ale przez te wszystkie lata przyjąłem tylko jednego ucznia. Wszyscy pozostali zawiedli.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_WANNBEKDF_Info_14_05', 'Twój duch jest dojrzały i gotów do próby. Zanim zostaniesz magiem musisz pomyślnie przejść egzamin. Daj mi znać, kiedy będziesz gotów.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_Info_15_01', 'Jestem gotów. Możesz poddać mnie próbie.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_Info_14_02', 'Dobrze. Służyłeś Bractwu na bagnach, czyż nie?', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_JA_Info_15_01', 'Tak.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_JA_Info_14_02', 'Hmm...', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_JA_Info_14_03', 'Jak ma na imię najwyższy z bogów?', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_NO_Info_15_01', 'Nie.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_NO_Info_14_02', 'Hmm...', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_NO_Info_14_03', 'Nie potrzebujemy tu ludzi, którzy wypierają się własnych czynów.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_NO_Info_14_04', 'Spróbuj szczęścia jako wojownik, albo Kopacz. Ścieżka magii będzie dla ciebie zamknięta już na zawsze.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_ADANOS_Info_15_01', 'Adanos.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KDFTEST_ADANOS_Info_14_02', 'Hmm...', 1, 150, 14, null, 402, null);
