INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_AUFNAHME_Info_14_03', 'Przysięgam, na wszechmocnych bogów...', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_AUFNAHME_Info_15_04', 'Przysięgam, na wszechmocnych bogów...', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_AUFNAHME_Info_14_05', '...Przysięgam, na potęgę świętego Ognia...', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_AUFNAHME_Info_15_06', '...Przysięgam, na potęgę świętego Ognia...', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_AUFNAHME_Info_14_07', '...Że ma wiedza i me czyny teraz i na wieki stanowić będą jedność z płomieniem...', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_AUFNAHME_Info_15_08', '...Że ma wiedza i me czyny teraz i na wieki stanowić będą jedność z płomieniem...', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_AUFNAHME_Info_14_09', '...Dopóki me ciało nie powróci do królestwa Beliara, gdy płomień mego życia wygaśnie.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_AUFNAHME_Info_15_10', '...Dopóki me ciało nie powróci do królestwa Beliara, gdy płomień mego życia wygaśnie.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_ROBE_Info_14_01', 'Wygłaszając słowa przysięgi zostałeś po wsze czasy związany ze świętym Ogniem.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_ROBE_Info_14_02', 'Noś tę szatę na znak tego przymierza.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_MANA_Info_15_01', 'Potrzebuję większej mocy magicznej.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_MANA_Info_14_02', 'Pokażę ci, jak zwiększyć twoje zdolności magiczne. Jak je wykorzystać, zależy już tylko od ciebie.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINCIRCLES_Info_15_01', 'Wyjaśnij mi znaczenie magicznych Kręgów.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINCIRCLES_Info_14_02', 'Oczywiście. Kręgi symbolizują twój udział w magicznych mocach.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINCIRCLES_Info_14_03', 'Symbolizują wiedzę, umiejętności i poznanie magicznych zaklęć i formuł.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINCIRCLES_Info_14_04', 'Musisz ukończyć każdy Krąg, zanim wolno ci będzie przystąpić do następnego.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINCIRCLES_Info_14_05', 'Czeka cię wiele godzin ćwiczeń. To trudna droga, z której łatwo zboczyć, ale nagroda warta jest poświęcenia.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINCIRCLES_Info_14_06', 'Za każdym razem, kiedy awansujesz do kolejnego Kręgu, poznasz nowe, potężniejsze zaklęcia. Oczywiście magiczne Kręgi to coś więcej niż tylko mocniejsze czary.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINCIRCLES_Info_14_07', 'To istotna część twojego życia. One zawsze będą z tobą. Uczyń je częścią siebie.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_EXPLAINCIRCLES_Info_14_08', 'Pojmując ich potęgę, pojmiesz potęgę siebie samego.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_15_01', 'Jestem gotowy do przystąpienia do Pierwszego Kręgu.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_14_02', 'Przystąpienie do Pierwszego Kręgu wiąże się z poznaniem tajników magii runicznej.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_14_03', 'Każda runa zawiera esencję szczególnego zaklęcia magicznego.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_14_04', 'Wykorzystując swoje zdolności magiczne, będziesz w stanie ją uwolnić.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_14_05', 'W odróżnieniu od magicznych zwojów zawierających formuły zaklęć, magia zawarta w runach jest trwała.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_14_06', 'Runy są źródłem czarodziejskiej mocy, na którym możesz polegać w każdej sytuacji.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_14_07', 'Twoja własna magia potrzebna jest podczas korzystania z run tak samo, jak gdy korzystasz z magicznych zwojów.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_14_08', 'W miarę awansowania do kolejnych Kręgów, będziesz poznawał nowe runy.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS1_Info_14_09', 'Wykorzystaj drzemiącą w runach moc do poznania samego siebie.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS2_Info_15_01', 'Jestem gotowy do przystąpienia do Drugiego Kręgu.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS2_Info_14_02', 'Poznałeś już magiczną naturę języka runicznego. Teraz zgłębisz jego tajniki.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS2_Info_14_03', 'Po przystąpieniu do Drugiego Kręgu poznasz silniejsze zaklęcia ofensywne oraz tajemnicę magii uzdrawiającej.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS2_Info_14_04', 'Musisz się jeszcze wiele nauczyć, zanim dane ci będzie poznać prawdziwe oblicze magii.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS2_Info_14_05', 'Wiesz już, że runy mogą być wykorzystywane do chwili wyczerpania twoich własnych pokładów siły magicznej.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS2_Info_14_06', 'Jednak zanim przystąpisz do działania, zastanów się nad celem, jaki ci przyświeca. Moce, którymi będziesz dysponował mogą nieść śmierć i zniszczenie.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS2_Info_14_07', 'Ale prawdziwy mag wykorzystuje swoje zdolności tylko wtedy, gdy jest to absolutnie niezbędne.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS2_Info_14_08', 'Kiedy w pełni uświadomisz sobie ten fakt, zrozumiesz prawdę kryjącą się za magią runiczną.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS3_Info_15_01', 'Możesz mnie wprowadzić w arkana Trzeciego Kręgu?', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS3_Info_14_02', 'Trzeci Krąg to jeden z najważniejszych etapów w życiu każdego maga. Przystępując do niego przestajesz być uczniem.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS3_Info_14_03', 'Zaszedłeś już bardzo daleko na ścieżce magii. Potrafisz posługiwać się runami.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS3_Info_14_04', 'Ta wiedza posłuży za fundament twojej dalszej nauki. Używaj magii runicznej świadomie i z rozwagą.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS3_Info_14_05', 'To, czy z niej skorzystasz, czy nie, powinno zależeć wyłącznie od ciebie.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS3_Info_14_06', 'Wybór, którego dokonasz, musi być ostateczny. W magii nie ma miejsca na wahanie.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS3_Info_14_07', 'Wyobraź sobie wyraźnie ścieżkę, którą chcesz kroczyć i ponieś wszelkie konsekwencje swojego wyboru.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS4_Info_15_01', 'Jestem gotowy do przystąpienia do Czwartego Kręgu.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS4_Info_14_02', 'Ukończyłeś już pierwsze trzy Kręgi. Nadeszła pora, byś zgłębił prawdziwą naturę magii.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS4_Info_14_03', 'Magia runiczna jest zaklęta w kamieniu. W końcu runy to fragmenty magicznej rudy.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS4_Info_14_04', 'Tej samej rudy, która wydobywana jest w kopalniach. Z pomocą bogów runy nasycane są magią w naszych świątyniach stając się narzędziem naszej potęgi.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS4_Info_14_05', 'Z twoją znajomością magii runicznej, cała wiedza zgromadzona przez wszystkie świątynie w tym królestwie stoi przed tobą otworem.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS4_Info_14_06', 'Nauczyłem cię wszystkiego, co sam potrafię.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_KREIS4_Info_14_07', 'Pamiętaj: poznanie natury magii jest kluczem do poznania natury potęgi i władzy.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_HEAVYARMOR_Info_15_01', 'Mistrzu, chciałbym nosić szatę Arcymaga Ognia.', 1, 150, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_WANNBEKDF_Info_14_04', 'Nie jesteś jeszcze gotów. Wróć do mnie, kiedy zdobędziesz więcej doświadczenia.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_HEAVYARMOR_Info_14_03', 'Nie masz wystarczającej ilości rudy!', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_HEAVYARMOR_Info_14_04', 'Twój czas wreszcie nadszedł. Jesteś godzien, by nosić szatę Arcymaga Ognia.', 1, 150, 14, null, 402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_403_Drago_RUNE_Info_13_01', 'Przyjmij tę runę jako znak przychylności Innosa. Oby cię chroniła podczas marszu przez twą ścieżkę życia.', 1, 51, 13, null, 403, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DISTURB_14_01', 'KTO ŚMIE PRZESZKADZAĆ MI W MOICH STUDIACH?', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DISTURB_15_02', 'Nazywam się...', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DISTURB_14_03', 'Nie interesuje mnie twoje imię. To nieistotne.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DISTURB_14_04', 'Liczy się tylko to, że jesteś pierwszą osobą od wielu lat, której udało się rozwiązać zagadkę Golemów.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OTHERS_15_01', 'Czy ktoś jeszcze tu zaglądał?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OTHERS_14_02', 'Bardzo rzadko. Zwykle szybko zaczynali mnie irytować i nasyłałem na nich którąś z moich magicznych istot.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OTHERS_15_03', 'Wolisz wieść żywot samotnika, czyż nie?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SATURAS_15_01', 'Przysyła mnie Saturas. Potrzebujemy twojej pomocy!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SATURAS_15_02', 'Magowie Wody zamierzają zrobić użytek ze swojego kopca rudy.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SATURAS_14_03', 'Detonacja wielkiej góry nie jest żadnym rozwiązaniem!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SATURAS_15_04', 'Nie jest?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SATURAS_14_05', 'NIE!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_KDW_15_01', 'Wszyscy Magowie Ognia zginęli!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_KDW_15_02', 'Gomez kazał ich zamordować.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_KDW_14_03', 'Nie powiem, żebym był szczególnie zaskoczony. Tym durnym barbarzyńcom z zamku - z Gomezem na czele - nigdy nie można było ufać.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_KDW_14_04', 'Pomagając Gomezowi w objęciu władzy, Corristo i inni sami kopali sobie grób.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SLEEPER_15_01', 'Tak zwany "Śniący" okazał się ponoć potężnym demonem zagłady.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SLEEPER_15_02', 'Przekonało się o tym Bractwo z obozu na bagnie.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SLEEPER_15_03', 'Magowie Wody uważają teraz, że cała kolonia znalazła się w śmiertelnym niebezpieczeństwie.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SLEEPER_14_04', 'Stoimy przed poważniejszym zagrożeniem niż ktokolwiek wewnątrz Bariery jest w stanie sobie wyobrazić...', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DANGER_15_01', 'Jeśli detonacja kopca rudy nie wystarczy, by zażegnać niebezpieczeństwo...', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DANGER_14_02', '...Zapomnij o tym całym kopcu! Jego potęga nie wystarczy, by przełamać Barierę.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DANGER_14_03', 'Gdyby Corristo i Saturas nie tracili cennego czasu na te swoje dziecinne spory, wiedzieliby teraz co należy zrobić.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DANGER_15_04', 'A co twoim zdaniem należy zrobić?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_DANGER_14_05', 'Żaden z dwunastu magów nie zadał sobie trudu, by zbadać z jakich przyczyn Bariera wymknęła się spod kontroli, ani dlaczego przybrała tak ogromne rozmiary.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BARRIER_15_01', 'A ty wiesz, co się stało, tak?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BARRIER_14_02', 'Cóż, jedno jest pewne: odpowiedź spoczywa ukryta głęboko pod miastem Orków.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BARRIER_15_03', 'Miastem Orków?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BARRIER_14_04', 'Orkowie to nie zwierzęta, choć wielu ludzi tak właśnie myśli. Ich kultura dorównuje wiekiem naszej.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BARRIER_14_05', 'Wiele stuleci temu, pięciu orkowych szamanów przywołało do tego świata potężnego demona, który miał im pomóc zdominować pozostałe klany.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BARRIER_15_06', 'Ten demon... To Śniący, prawda?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BARRIER_14_07', 'Orkowie nadali mu to imię dużo później. Ale nie powiem ci dlaczego wybrali tę nazwę, ani dlaczego tak bardzo się go teraz boją!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENT_15_01', 'Dlaczego nie?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENT_14_02', 'Myślę, że możesz być... NIE, aby mnie przekonać, musisz wykonać jeszcze jedno zadanie!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENT_15_03', 'Jakie zadanie?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENT_14_04', 'Słuchaj uważnie: Orkowie wygnali z miasta jednego ze swoich szamanów.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTWHY_15_01', 'Dlaczego?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTWHY_14_02', 'Umierający Ork, którego kazałem przesłuchać moim demonom, nie był w stanie odpowiedzieć mi na to pytanie.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTHOW_15_01', 'Co ten szaman ma wspólnego z moim zadaniem?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTHOW_14_02', 'On opowie ci resztę historii związanej ze Śniącym.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTHOW_15_03', 'Obawiam się, że Ork nie będzie zbyt chętny do zwierzeń w mojej obecności!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTHOW_14_04', 'Chcesz żebym ci pomógł, czy nie?', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTHOW_15_05', 'Tak, ale...', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTHOW_14_06', 'Więc nigdy więcej nie kwestionuj tego, co mówię!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTHOW_14_07', 'Znajdź tego szamana. Nie pała miłością do swych braci z miasta Orków, więc może zgodzi się ciebie wysłuchać zanim zamieni cię w żywą pochodnię!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTHOW_15_08', 'Bardzo pocieszające!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTWHERE_15_01', 'Gdzie znajdę tego wygnanego szamana?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTWHERE_14_02', 'Idź do starej cytadeli na wschodzie. Na pewno trafisz - znajduje się na szczycie wysokiej góry. Widać ją już z daleka.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTWHERE_15_03', 'I mogę tak po prostu do niej wejść?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_EVENTWHERE_14_04', 'Mówią na nią stara cytadela, choć tak naprawdę to tylko sterta kamieni. Od wielu dziesięcioleci nikt tam nie zagląda.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_ACCEPT_15_01', 'Porozmawiam z tym szamanem!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_ACCEPT_14_02', 'Mój sługa dał ci już magiczną runę uaktywniającą pentagram piętro niżej.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_ACCEPT_14_03', 'W ten sposób będziesz mógł wrócić do mnie natychmiast po wykonaniu zadania.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Kdf_404_Xardas_SELLMAGICSTUFF_Info_15_01', 'Poszukuję wiedzy magicznej.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_15_01', 'Rozmawiałem z szamanem Orków.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_14_02', 'Świetnie! Czego się dowiedziałeś?', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_15_03', 'Pięciu szamanów, którzy przywołali Śniącego, wybudowało dla niego podziemną świątynię. Wejście do niej znajduje się w mieście Orków.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_14_04', 'Zgadza się!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_15_05', 'Miast okazać wdzięczność, Śniący wyrwał ich serca i skazał ich, oraz wszystkich, którzy pracowali przy budowie na wieczne potępienie, zamieniając ich w Ożywieńców!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_14_06', 'Doskonale, doskonale!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_15_07', 'Orkowie zapieczętowali wejście do świątyni i próbowali przebłagać demona składając mu ofiary!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_14_08', 'Znalazłeś sposób na dostanie się do świątyni?', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_15_09', 'Tak, jest pewien Ork, który...', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_14_10', 'Żadnych szczegółów! Udaj się do podziemnej świątyni. Tam znajdziesz jedyny sposób na zniszczenie Bariery!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_15_11', 'Nic nie rozumiem!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_14_12', 'Poprosiłeś mnie o pomoc w zniszczeniu Bariery, tak czy nie?!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_15_13', 'Tak, ale...', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_RETURN_14_14', 'WIĘC IDŹ! Zmarnowano już dość czasu! Idź do podziemnej świątyni! Tam znajdziesz odpowiedź!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FOUNDTEMPLE_15_01', 'Znalazłem drogę do podziemnej świątyni!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FOUNDTEMPLE_14_02', 'ZNALAZŁEŚ... To niesamowite!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FOUNDTEMPLE_14_03', 'Stałeś się niezwykle potężny! Potężniejszy niż ktokolwiek wewnątrz Bariery.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FOUNDTEMPLE_14_04', 'Może rzeczywiście jesteś człowiekiem, o którym wspomina proroctwo Orków!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_PROPHECY_15_01', 'Proroctwo? Jakie proroctwo?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_PROPHECY_14_02', 'Prastare manuskrypty Orków, spisane tuż po zamknięciu świątyni, wspominają o "Świętym Nieprzyjacielu".', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_PROPHECY_15_03', 'Świętym Nieprzyjacielu?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_PROPHECY_14_04', 'Kogoś, kto raz na zawsze wypędzi Śniącego z naszego świata!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_PROPHECY_15_05', 'I to ja mam być tą osobą z przepowiedni?! Mylisz się! Na pewno się mylisz!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_PROPHECY_14_06', 'Może tak... Może nie!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD_15_01', 'Znalazłem dziwny miecz.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD_14_02', 'Pokaż mi go.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD_14_03', 'Hmm... To ciekawe. Wyryto na nim słowo "URIZIEL".', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD_14_04', 'Słyszałem o tym mieczu. To oręż z dawnych lat, kiedy rasa ludzka była jeszcze bardzo młoda.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD_14_05', 'Nie wiem z jakiego materiału go wykuto, ani nawet KTO go wykuł.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD_14_06', 'Według legendy, miecz ma posiadać niezwykłe moce, ale nie wyczuwam wokół niego magicznej aury!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD01_15_01', 'URIZIEL posiadał niezwykłe moce?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD01_14_02', 'Napisano, że posiadacz tej broni był w stanie przebić najgrubszy pancerz i przezwyciężyć najsilniejsze zaklęcia.', 1, 39, 1, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD01_15_03', 'W jaki sposób tak potężny oręż trafił w ręce Orków?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD01_14_04', 'Ponoć Orkowie odebrali go potężnemu rycerzowi. Nie wiedzieli jak go wykorzystać, więc postanowili go ukryć!', 1, 39, 1, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD01_15_05', 'Jak widać - nie dość dobrze!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD02_15_01', 'Czy jest jakiś sposób na przywrócenie tej broni dawnej świetności?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD02_14_02', 'Nie obejdzie się bez odpowiednio silnego źródła magii.', 1, 39, 2, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD02_15_03', 'Masz na myśli źródło wystarczająco potężne, by wysadzić w powietrze Magiczną Barierę?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD02_14_04', 'Coś w tym rodzaju...', 1, 39, 2, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD02_14_05', 'Oprócz tego potrzebna będzie specjalna magiczna formuła, która przekaże całą wyzwoloną energię na miecz.', 1, 39, 2, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD02_14_06', 'Daj mi trochę czasu na przygotowanie formuły!', 1, 39, 2, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_15_01', 'W międzyczasie, jak poszukam sobie lepszej zbroi!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_15_02', 'Te posklecane w naprędce pancerze pełzaczy są zbyt gęsto podziurawione po wyprawie do podziemnej świątyni!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_15_03', 'Te niebieskie szmatki nie zapewniły mi zbyt wielkiej ochrony w podziemnej świątyni!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_15_04', 'Ożywieńcy porządnie podziurawili mój stary pancerz.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_14_05', 'Powinieneś zajrzeć do mojej starej wieży?', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_15_06', 'Twojej starej wieży?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_14_07', 'Podczas trzęsienia ziemi pochłonęło ją jedno ze wschodnich jezior. Jej szczyt powinien nadal wystawać nad poziom wody.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_14_08', 'Wewnątrz zostało kilka cennych artefaktów. Nigdy nie zadałem sobie trudu, by je odzyskać.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_15_09', 'Jak się tam dostanę?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_14_10', 'Nie zaglądałem tam od trzęsienia ziemi, więc sam będziesz musiał poszukać drogi do środka.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_BETTERARMOR_14_11', 'Weź ten klucz. Otwiera skrzynię, w której przechowywałem szczególnie cenne artefakty.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OREARMOR_14_01', 'Ach, jak widzę nosisz zbroję runiczną, wykonaną z magicznej rudy!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OREARMOR_14_02', 'Jak widzę, znalazłeś zbroję runiczną, wykonaną z magicznej rudy!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OREARMOR_15_03', 'Znalazłem ją w zatopionej wieży, w jednej z tych starych skrzyń.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OREARMOR_14_04', 'Należała kiedyś do tego samego generała, który dzierżył URIZIEL w bitwie z Orkami.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OREARMOR_15_05', 'Mam tylko nadzieję, że przyniesie mi trochę więcej szczęścia niż jemu!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FORMULA_15_01', 'Przygotowałeś już formułę, która przywróci URIZIELOWI jego dawną moc?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FORMULA_14_02', 'Tak, wszystko gotowe. Ale sam nie dasz rady jej użyć.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FORMULA_15_03', 'Dlaczego nie?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FORMULA_14_04', 'Będziesz musiał dotknąć mieczem źródła mocy magicznej. Dokładnie w tej samej chwili jakiś mag musi wypowiedzieć formułę.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FORMULA_15_05', 'Zatem muszę sobie poszukać kogoś do pomocy!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_FORMULA_14_06', 'Weź formułę i przywróć URIZIEL do jego dawnej świetności. Będzie ci wkrótce potrzebny!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_ALTRUNE_15_01', 'Jestem magiem. Nie wiem, czy potrafię posługiwać się mieczem takim jak URIZIEL!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_ALTRUNE_14_02', 'Jest na to sposób...', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_ALTRUNE_14_03', 'Ale najpierw naładuj miecz magiczną energią. Wróć jak najszybciej!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SWORDLOADED_15_01', 'Udało mi się! URIZIEL znów posiada magiczną aurę!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_SWORDLOADED_14_02', 'Niesamowite! Miecz odzyskał swą dawną moc! Dysponujesz teraz nie lada orężem!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNE_15_01', 'Powiedziałeś, że będę mógł posługiwać się tym mieczem mimo, iż jestem magiem?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNE_14_02', 'Przyjrzyj się mu uważnie. Zauważyłeś zapewne ten duży, błękitny klejnot zatopiony w ostrzu.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNE_14_03', 'Cała energia magiczna miecza skumulowana jest właśnie tutaj.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNE_14_04', 'Jeśli usunę klejnot, będę mógł stworzyć magiczną runę posiadającą wszystkie te cechy, które czynią URIZIEL tak szczególnym orężem.', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNE_15_05', 'Magiczna runa stworzona z URIZIEL?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNE_14_06', 'W bitwie ta runa będzie równie niebezpieczna co sam miecz!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNE_14_07', 'Ale nie zapominaj, że jedynie mag Szóstego Kręgu może zapanować nad tak potężną magią!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNEDOIT_15_01', 'Chcę, żebyś usunął klejnot z URIZIEL!', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNEDOIT_14_02', 'Ale nie opanowałeś jeszcze magii Szóstego Kręgu!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNEDOIT_14_03', 'Od tej decyzji nie ma odwrotu. Jesteś pewien, że chcesz abym usunął klejnot?', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNEDOIT_15_04', 'TAK, zrób to.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNEDOIT_14_05', 'Jeśli tego właśnie chcesz... Proszę, oto miecz i runa!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNEDOIT_15_06', 'Nie, nie chcę.', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_MAKERUNEDOIT_14_07', 'Jak sobie życzysz. Ostrze zachowa swą magiczną moc!', 1, 39, 14, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD09_15_01', 'Możesz mnie czegoś nauczyć?', 1, 39, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD09_14_02', 'Wprowadzę cię w Szósty Krąg Magii.', 1, 39, 9, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD09_14_03', 'Pamiętaj, że to przywilej zarezerwowany wyłącznie dla najbieglejszych magów. Mogą do niego przystąpić ci, których całe życie jest znakiem.', 1, 39, 9, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD09_14_04', 'Twoim znakiem jest zjednoczenie elementów.', 1, 39, 9, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD09_14_05', 'Szósty Krąg pozwala ci wykorzystywać magię dowolnej runy.', 1, 39, 9, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD09_14_06', 'I nie zapomnij: twoim zadaniem jest służyć potędze magii, a nie ją wykorzystywać.', 1, 39, 9, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_LOADSWORD09_14_07', 'Jeszcze nie. Jesteś zdolny, ale brak ci niezbędnego doświadczenia. Niech Saturas popracuje nad tobą przez jakiś czas. Wtedy zobaczymy.', 1, 39, 9, null, 404, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Hello_15_00', 'Szukam Arcymistrza Magów Ognia!', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Hello_04_01', 'Zgłoś się do Miltena. A teraz znikaj!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_15_00', 'Przysyła mnie Corristo. Przyniosłem mu list z zewnątrz i mam sobie wybrać nagrodę.', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_04_01', 'Wyświadczyłeś nam wielką przysługę i otrzymasz każdą nagrodę, jakiej zażądasz.', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_Str_15_00', 'Wezmę ten pierścień siły.', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_Str_04_01', 'Tak jak się spodziewałem. Proszę, oto on.', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_Dex_15_00', 'Wezmę pierścień zwinności.', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_Dex_04_01', 'Zwinność zawsze powinna iść przed siłą. To był mądry wybór.', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_Scrolls_15_00', 'Wezmę te zwoje z zaklęciami.', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_Scrolls_04_01', 'Wykorzystaj je mądrze! Każdego z nich możesz użyć tylko raz!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_ManaMax_15_00', 'Chciałbym dostać ten napój!', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_Belohnung_ManaMax_04_01', 'Mądra decyzja! To najcenniejszy z przedmiotów, które mogłeś wybrać. Wypij ten napój, a twoja siła znacznie wrośnie!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_15_00', 'Mam dla ciebie list! Ale najpierw chcę dostać swoją nagrodę!', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_04_01', 'Dlaczego nie porozmawiasz z Miltenem?', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_15_02', 'Już to zrobiłem.', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_04_03', 'Rozumiem. Mam tu twoją nagrodę. Pokaż mi list. Teraz!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_15_04', 'Oto on!', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_04_05', 'W nagrodę otrzymasz pierścień siły. To niezwykle rzadki artefakt. Z pewnością bardzo ci się przyda.', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_04_06', 'A teraz idź stąd!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_04_07', 'Pieczęć została złamana.', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_15_08', 'Cóż, wypadki się zdarzają.', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_BriefTausch_04_09', 'Jako zapłatę dostaniesz napój uzdrawiający. Ciesz się, posłańcy, którzy przynoszą otwarte listy zwykle nie dostają nic!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_PERM_15_00', 'Co słychać w świecie magii?', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torrez_PERM_04_01', 'Nie twój interes!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_BOOK_Info_04_01', 'Dla każdego magicznego Kręgu powstała księga, opisująca jego zasady. Powinieneś je uważnie przestudiować. Wiedza to potęga!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_BOOK_Info_04_02', 'Weź księgę Pierwszego Kręgu i przeczytaj ją uważnie. Zrozumiesz naturę Ognia.', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_SELLBOOKS_Info_15_01', 'Poszukuję magicznych ksiąg.', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_GREET_Info_15_01', 'Witaj, Magu!', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_GREET_Info_04_02', 'Niech Innos zawsze ma cię w swojej opiece! Zajmuję się sprzedażą magicznych artefaktów i mogę ci pokazać, jak zwiększyć twoje zdolności magiczne!', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_MANA_Info_15_01', 'Potrzebuję większej mocy magicznej.', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_MANA_Info_04_02', 'Pokażę ci, jak zwiększyć twoje zdolności magiczne. Jak je wykorzystać, zależy już tylko od ciebie.', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_WANNABEMAGE_Info_15_01', 'Co powinienem zrobić, żeby zostać magiem?', 1, 72, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_405_Torrez_WANNABEMAGE_Info_04_02', 'Porozmawiaj z Mistrzem Corristo, jeśli znajdzie czas, żeby cię wysłuchać.', 1, 72, 4, null, 405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_01', 'Nie mamy wiele czasu, więc słuchaj uważnie.', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_15_02', 'Jak się tu...', 1, 165, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_03', 'Śniący jest już blisko. Wykorzystałem całą swoją moc, żeby się tu dostać.', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_04', 'Przetłumaczyłem starożytne przepowiednie Orków i odkryłem o co chodzi z pięcioma sercami.', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_05', 'Pięć serc należących do kapłanów, których pokonałeś, złożono w pięciu kapliczkach.', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_06', 'Kapliczki można otworzyć, ale tylko starożytne sztylety kapłanów są w stanie je zniszczyć.', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_07', 'Musisz przebić serca kapłanów pięcioma sztyletami. Tylko w ten sposób uda ci się wygnać Śniącego z tego świata.', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_15_08', 'Rozumiem!', 1, 165, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_09', 'Spiesz się. Przebudzenie demona odbędzie się już wkrótce. Szalony Cor Kalom i jego poplecznicy są już tutaj.', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_10', 'Zebrali się w krypcie Śniącego.', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_15_11', 'Przelałem już zbyt dużo krwi! Nie pozwolę, by ktoś mnie teraz powstrzymał.', 1, 165, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_12', 'Śniący staje się potężniejszy z każdą minutą, nie mogę...', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_15_13', 'Co się z tobą dzieje?', 1, 165, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_OT_14_14', 'Ja... muszę...', 1, 165, 14, null, 406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_EXIT_14_01', 'Obyś wrócił cały i zdrowy!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_Intruder_14_00', 'Co ty tu robisz? Nie masz tu czego szukać! Precz!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_NEWS_15_01', 'Mam ważne wieści z obozu Bractwa!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_NEWS_14_02', 'Jeśli Cronos pozwolił ci mnie odwiedzić, musiało się stać coś naprawdę ważnego!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_15_01', 'Y''Berion nie żyje! Zginął podczas rytuału przyzwania Śniącego.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_14_02', 'Y''Berion martwy? To złe wieści... Bardzo złe.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_14_03', 'Kto teraz przewodzi Bractwu? Czyżby ten zbyt ambitny, jadowity wąż - Cor Kalom?', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_15_04', 'Nie! Kalom wyrzekł się Bractwa. Zabrał ze sobą kilku Strażników Świątynnych. Nikt nie wie dokąd się udali.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_14_05', 'Jak to możliwe? Był najważniejszym członkiem Bractwa, zaraz po Y''Berionie!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_15_06', 'Pewne wydarzenia uświadomiły wszystkim Guru, że droga, którą podążali była błędna. Ich rzekomy bóg okazał się niszczycielskim demonem.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_15_07', 'Pod wpływem Śniącego, jeden z Guru próbował mnie zgładzić, mimo, iż kilka chwil wcześniej ocaliłem jego życie.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_15_08', 'Cor Kalom był jedynym Guru, który nie chciał uznać prawdziwej natury Śniącego. Właśnie dlatego opuścił obóz na bagnie.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_14_09', 'Rozumiem! Cóż, przynajmniej tutaj mamy trochę szczęścia. Cor Angar to dobry człowiek. Twardy, ale uczciwy.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_YBERION_14_10', 'Jeśli ktoś może zapobiec całkowitemu rozpadowi Bractwa po tej katastrofie, to właśnie on.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BOOK_15_01', 'Mam ten almanach...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BOOK_15_02', 'Y''Berion wykorzystał go do naładowania kamienia ogniskującego.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BOOK_14_03', 'Świetnie. Wiedza zawarta w tej księdze pozwoli nam naładować pięć pierwotnych kamieni ogniskujących.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BOOK_14_04', 'Wezmę ten almanach!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_15_01', 'Mam tu ten kamień ogniskujący...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_14_02', 'Trzymasz w ręku klucz, który może nas wyzwolić z kajdan niewolnictwa.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_14_03', 'To jeden z pięciu kamieni ogniskujących, które wykorzystywano podczas tworzenia Magicznej Bariery.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_14_04', 'A my z pomocą tej samej siły ogniskującej zniszczymy wielką magiczną Barierę.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_15_05', 'Ale czy do tego nie będzie potrzeba potężnego źródła magicznej energii?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_14_06', 'To prawda. Dlatego przez te wszystkie lata gromadziliśmy rudę, zamiast wymieniać ją na towary z zewnętrznego świata.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_14_07', 'Jak zapewne wiesz, każdy kawałek rudy zawiera niewielki ładunek energii magicznej. Mamy nadzieję, że wyzwalając jednocześnie cały potencjał zgromadzonego przez nas kopca, będziemy w stanie zniszczyć Barierę.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_15_08', 'To chyba dość ryzykowne?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_14_09', 'Eksplozja energii magicznej może zniszczyć wyłącznie twory utworzone lub zmodyfikowane przy użyciu magii. Nie istnieje żadne zagrożenie dla istot ludzkich.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FOCUS_15_10', 'Proszę, oto kamień ogniskujący. Mam nadzieję, że wasze plany związane z detonacją kopca powiodą się.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_WHATNOW_15_01', 'Co teraz zrobicie z tym kamieniem i almanachem?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_WHATNOW_14_03', 'Nic. Najpierw musimy odnaleźć pozostałe cztery kamienie ogniskujące!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_WHATNOW_14_04', 'Niestety, nie trafiliśmy jeszcze na ślad żadnego z kamieni.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_15_01', 'Mógłbym spróbować odnaleźć brakujące kamienie.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_15_02', 'Koniec końców - mi też zależy na wydostaniu się z tej kolonii.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_14_03', 'Muszę cię ostrzec: te poszukiwania mogą się okazać równie trudne co i niebezpieczne.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_14_04', 'Konflikt ze Starym Obozem zaostrza się z dnia na dzień. Nie mogę ci nawet przydzielić eskorty Najemników.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_14_05', 'Będziesz zdany wyłącznie na siebie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_15_06', 'Cóż... To mi nie pierwszyzna! Jakoś sobie poradzę.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_14_07', 'Twoja pewność siebie dobrze o tobie świadczy, ale przyda ci się kilka przedmiotów...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_14_08', 'Weź tę mapę. Jest dość stara, ale zaznaczono na niej oryginalne rozmieszczenie kamieni ogniskujących w chwili tworzenia Bariery.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_14_09', 'Ten zwój magiczny pozwoli ci błyskawicznie przenieść się do naszego obozu.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_14_10', 'Na koniec powinieneś jeszcze porozmawiać z Riordianem. To człowiek, który przygotowuje magiczne wywary dla naszego obozu.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_OFFER_14_11', 'Znajdziesz go w jego chacie, tutaj, na najwyższym poziomie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_01', 'Hmmm, na dobry początek wystarczy. Nieźle sobie radzisz.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_02', 'Musisz jeszcze odnaleźć trzy pozostałe kamienie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_03', 'Ruszaj w drogę! Nie zostało nam zbyt wiele czasu.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_04', 'Świetnie. To już drugi kamień, który nam przynosisz!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_05', 'Jesteśmy już znacznie bliżej naszego celu.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_06', 'Nie ustawaj w wysiłkach. Potrzebujemy jeszcze dwóch kamieni ogniskujących.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_07', 'Niesamowite! Mamy już cztery kamienie ogniskujące!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_08', 'Brakuje jeszcze tylko jednego!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_09', 'Oddałeś naszej społeczności nieocenione usługi. Jeśli uda ci się odnaleźć ostatni z kamieni, wkrótce będziemy znów na wolności!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_10', 'Wspaniale! Mamy już wszystkie pięć kamieni!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_11', 'Nie wiem jak będziemy ci się mogli odwdzięczyć! Jestem twoim dozgonnym dłużnikiem.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_12', 'Pójdź teraz do Riordiana. On da ci chociaż skromną namiastkę nagrody za twoje wysiłki!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_13', 'Porozmawiaj również z Cronosem, strażnikiem rudy. Od niego dostaniesz kolejny wyraz naszej wdzięczności.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS_14_14', 'Widzę, że wykorzystałeś zwój teleportacyjny. Proszę, weź następny.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS2_15_01', 'Znalazłem kamień ogniskujący w kanionie Trolli!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS3_15_01', 'Znalazłem kamień ogniskujący w górskiej fortecy!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS4_15_01', 'Znalazłem kamień ogniskujący w ruinach starego klasztoru!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS4_15_02', 'Spotkałem tam Gorna, tego Najemnika. Pomógł mi w poszukiwaniach.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_BRINGFOCUS5_15_01', 'Znalazłem kamień ogniskujący pod kamiennym kręgiem!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ALLFOCI_15_01', 'Czy możecie teraz przystąpić do detonacji kopca rudy?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ALLFOCI_14_02', 'Mamy już wszystkie artefakty niezbędne do wprowadzenia naszego planu w życie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ALLFOCI_14_03', 'Ale Barierę utworzyło dwunastu magów.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ALLFOCI_14_04', 'W całym Kręgu Wody nie ma dość mistrzów magii, by zapanować nad tak ogromną ilością energii. Nie mówiąc już o jej odpowiednim ukierunkowaniu!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ALLFOCI_15_05', 'I co teraz zrobimy?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ALLFOCI_14_06', 'Wiem ile już zrobiłeś dla naszej społeczności. Wszyscy jesteśmy twoimi dłużnikami...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ALLFOCI_14_07', '...Ale w interesie wszystkich mieszkańców kolonii muszę cię poprosić o jeszcze jedną przysługę.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FAVOR_15_01', 'Jeszcze jedną przysługę?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FAVOR_14_02', 'Tak. Musisz iść do Starego Obozu i przekonać do naszej sprawy kilku Magów Ognia.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FAVOR_15_03', 'MAGÓW OGNIA?? Myślisz, że zechcą przyłączyć się do was i zrezygnować ze swego wygodnego życia?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FAVOR_15_04', 'Przecież upadek Bariery pozbawi ich uprzywilejowanej pozycji!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FAVOR_14_05', 'Właśnie dlatego to TY musisz podjąć się tego zadania. Znasz ludzi ze wszystkich obozów w całej kolonii.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_FAVOR_14_06', 'Przypomnij Magom Ognia stare czasy, kiedy wspólnie studiowaliśmy sztuki magiczne.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_15_01', 'No dobrze. Spróbuję jakoś przekonać Magów Ognia!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_15_02', 'Ale nic nie obiecuję! Obawiam się, że to zadanie jest z góry skazane na niepowodzenie!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_14_03', 'Musisz chociaż spróbować. Jeśli ci się nie powiedzie, jest już tylko jeden...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_14_04', 'Tylko jeden...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_15_05', '...jeden CO?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_14_06', 'Nieważne! MUSI ci się udać!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_14_07', 'Weź tę magiczną runę jako znak naszego zaufania. Pokażesz ją Corristo, Arcymistrzowi Magów Ognia.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_14_08', 'Dzięki jej pomocy będzie mógł przeteleportować się do tej komnaty, nie przechodząc przez posterunki straży.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_ACCEPT_14_09', 'Mam nadzieję, że to przekona naszych dawnych przyjaciół o szczerości naszych intencji.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_AMBUSH_14_01', 'Cieszę się, że wróciłeś. Stało się coś strasznego!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_AMBUSH_15_02', 'Niech zgadnę: Wolna Kopalnia została zaatakowana przez Strażników ze Starego Obozu, którzy niespodziewanie wyrośli jak spod ziemi?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_AMBUSH_14_03', 'Zaraz... Jak... Ależ oczywiście! Dowiedziałeś się o tym w Starym Obozie!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_AMBUSH_14_04', 'Gorn zjawił się tutaj tuż przed tobą.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_AMBUSH_14_05', 'Co mogło skłonić Gomeza do podjęcia tak drastycznych działań?', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_AMBUSH_14_06', 'Przecież musiał zdawać sobie sprawę, że ten napad stanowi wypowiedzenie wojny.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_COLLAPSE_15_01', 'Stara Kopalnia została zalana przez podziemną rzekę!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_COLLAPSE_14_02', '...Zalana... Naturalnie... Teraz zaczynam rozumieć...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_COLLAPSE_14_03', 'Gomez został przyparty do muru. Jest teraz jeszcze groźniejszy niż kiedyś. Nie ma nic do stracenia, więc stał się całkowicie nieobliczalny!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_MURDER_15_01', 'Gomez wymordował wszystkich Magów Ognia!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_MURDER_14_02', 'WYMORDOWAŁ?!? Na Beliara, czemu miałby zrobić coś takiego?!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_MURDER_15_03', 'Magowie sprzeciwili się atakowi na Wolną Kopalnię, a tym samym stanęli Gomezowi na drodze.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_MURDER_14_04', 'Zatem jesteśmy zgubieni. Bez pomocy pozostałych sześciu magów nie uda się nam zapanować nad energią wyzwoloną podczas detonacji kopca.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_MURDER_14_05', 'Mimo wszystko, dziękuję ci za dostarczenie tych przykrych wieści. Wróg już nas nie zaskoczy.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_NOMOREOC_Info_15_01', 'Wygnano mnie ze Starego Obozu za to, że wam pomogłem!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_NOMOREOC_Info_14_02', 'Nie należysz już do Starego Obozu?', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_NOMOREOC_Info_14_03', 'Zatem witaj w naszej społeczności!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_GOTOLEE_Info_15_01', 'Czy to oznacza, że zostanę przyjęty w poczet Najemników?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_GOTOLEE_Info_14_02', 'Porozmawiaj z Lee. On się tobą zajmie. Ale potem zajrzyj koniecznie do mnie!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_15_01', 'Czy to oznacza, że należę teraz do kręgu Magów Wody?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_14_02', 'Jeszcze nie. Najpierw musisz złożyć śluby Wody.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_15_03', 'Ale składałem już przysięgę Ognia!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_14_04', 'Hmmm...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_14_05', 'Przecież nie musisz jednocześnie łamać złożonej przysięgi!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_15_06', 'Eee... Nie rozumiem...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_14_07', 'Ty ją tylko rozszerzysz. Od tej pory będziesz magiem w służbie obydwu żywiołów!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_14_08', 'Posiądziesz siłę Ognia oraz mądrość Wody jednocześnie!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_01', 'Jestem gotów do złożenia ślubów.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_02', 'Sługo Ognia, otrzymasz teraz błogosławieństwo Wody!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_03', 'Powtarzaj za mną słowa przysięgi:', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_04', 'Przysięgam, na wszechmocnych bogów...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_05', 'Przysięgam, na wszechmocnych bogów...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_06', '...Przysięgam, na potęgę świętej Wody...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_07', '...Przysięgam, na potęgę świętej Wody...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_08', '...Że ma wiedza i me czyny teraz i na wieki stanowić będą jedność z Wodą...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_09', '...Że ma wiedza i me czyny teraz i na wieki stanowić będą jedność z Wodą...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_10', '...Dopóki me ciało nie powróci do królestwa Beliara, gdy źródło mego życia wyschnie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_11', '...Dopóki me ciało nie powróci do królestwa Beliara, gdy źródło mego życia wyschnie.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_12', 'Składając tę przysięgę zjednoczyłeś w sobie potęgę Ognia i błogosławieństwo Wody.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_13', 'Połączyłeś teraz to, co niegdyś rozdzielono. Niech twe życie i czyny będą znakiem zjednoczenia potęgi żywiołów.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_14', 'Noś tę szatę, jako symbol twojego przymierza ze świętą Wodą i wszechmocnym Adanosem.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_LESSON_Info_15_01', 'Możesz mnie czegoś nauczyć?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_LESSON_Info_14_02', 'Przed tobą jeszcze wiele nauki. Rozpoczniemy zajęcia, gdy będziesz gotów.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_LESSON_Info_14_03', 'Jest jeszcze jeden Krąg, o którym nie wiesz. Opowiem ci o nim, gdy będziesz gotów.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_LESSON_Info_14_04', 'Opanowałeś już umiejętności z Piątego Kręgu magii. Nauczyłem cię wszystkiego co sam wiem.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_LESSON_Info_14_05', 'Więcej nie jestem w stanie cię nauczyć!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_15_01', 'Jestem gotów, by przystąpić do Pierwszego Kręgu.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_14_02', 'Przystąpienie do Pierwszego Kręgu wiąże się z poznaniem tajników magii runicznej.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_14_03', 'Każda runa zawiera esencję szczególnego zaklęcia magicznego.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_14_04', 'Wykorzystując swoje zdolności magiczne, będziesz w stanie ją uwolnić.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_14_05', 'W odróżnieniu od magicznych zwojów zawierających formuły zaklęć, magia zawarta w runach jest trwała.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_14_06', 'Runy są źródłem czarodziejskiej mocy, na którym możesz polegać w każdej sytuacji.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_14_07', 'Twoja własna magia potrzebna jest podczas korzystania z run tak samo, jak gdy korzystasz z magicznych zwojów.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_14_08', 'W miarę awansowania do kolejnych Kręgów, będziesz poznawał nowe runy.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS1_Info_14_09', 'Wykorzystaj drzemiącą w runach moc do poznania samego siebie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS2_Info_15_01', 'Jestem gotowy do przystąpienia do Drugiego Kręgu.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS2_Info_14_02', 'Poznałeś już magiczną naturę języka runicznego. Teraz zgłębisz jego tajniki.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS2_Info_14_03', 'Po przystąpieniu do Drugiego Kręgu poznasz silniejsze zaklęcia ofensywne oraz tajemnicę magii uzdrawiającej.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS2_Info_14_04', 'Musisz się jeszcze wiele nauczyć, zanim dane ci będzie poznać prawdziwe oblicze magii.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS2_Info_14_05', 'Wiesz już, że runy mogą być wykorzystywane do chwili wyczerpania twoich własnych pokładów siły magicznej.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS2_Info_14_06', 'Jednak zanim przystąpisz do działania, zastanów się nad celem, jaki ci przyświeca. Moce, którymi będziesz dysponował mogą nieść śmierć i zniszczenie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS2_Info_14_07', 'Ale prawdziwy mag wykorzystuje swoje zdolności tylko wtedy, gdy jest to absolutnie niezbędne.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS2_Info_14_08', 'Kiedy w pełni uświadomisz sobie ten fakt, zrozumiesz prawdę kryjącą się za magią runiczną.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS3_Info_15_01', 'Możesz mnie wprowadzić w arkana Trzeciego Kręgu?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS3_Info_14_02', 'Trzeci Krąg to jeden z najważniejszych etapów w życiu każdego maga. Przystępując do niego przestajesz być uczniem.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS3_Info_14_03', 'Zaszedłeś już bardzo daleko na ścieżce magii. Potrafisz posługiwać się runami.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS3_Info_14_04', 'Ta wiedza posłuży za fundament twojej dalszej nauki. Używaj magii runicznej świadomie i z rozwagą.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS3_Info_14_05', 'To, czy z niej skorzystasz, czy nie, powinno zależeć wyłącznie od ciebie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS3_Info_14_06', 'Wybór, którego dokonasz, musi być ostateczny. W magii nie ma miejsca na wahanie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS3_Info_14_07', 'Wyobraź sobie wyraźnie ścieżkę, którą chcesz kroczyć i ponieś wszelkie konsekwencje swojego wyboru.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS4_Info_15_01', 'Jestem gotowy do przystąpienia do Czwartego Kręgu.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS4_Info_14_02', 'Ukończyłeś już pierwsze trzy Kręgi. Nadeszła pora, byś zgłębił prawdziwą naturę magii.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS4_Info_14_03', 'Magia runiczna jest zaklęta w kamieniu. W końcu runy to fragmenty magicznej rudy.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS4_Info_14_04', 'Tej samej rudy, która wydobywana jest w kopalniach. Z pomocą bogów runy nasycane są magią w naszych świątyniach stając się narzędziem naszej potęgi.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS4_Info_14_05', 'Z twoją znajomością magii runicznej, cała wiedza zgromadzona przez wszystkie świątynie w tym królestwie stoi przed tobą otworem.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS4_Info_14_07', 'Pamiętaj: poznanie natury magii jest kluczem do poznania natury potęgi i władzy.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS5_Info_15_01', 'Jestem gotów do przystąpienia do Piątego Kręgu.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS5_Info_14_02', 'Dobrze. Wprowadzę cię w arkana Piątego Kręgu Magii.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS5_Info_14_03', 'Od tej pory będziesz mógł wykorzystywać magiczne runy zaklęć Ognistej Burzy i Lodowej Fali oraz posiądziesz moc niszczenia Ożywieńców.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS5_Info_14_04', 'Jednak najpotężniejszym zaklęciem Piątego Kręgu Magii jest Tchnienie Śmierci. Gdyby udało ci się kiedyś odnaleźć tę runę, dysponowałbyś niewyobrażalną mocą.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS5_Info_14_05', 'Staraj się nie wykorzystywać magii tego rodzaju bez potrzeby. Jest ona darem od boga ciemności!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS4_Info_14_06', 'Nauczyłem cię wszystkiego, co sam potrafię.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KREIS5_Info_14_06', 'Poznaj granice swoich możliwości, a poznasz samego siebie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_HEAVYARMOR_Info_15_01', 'Chciałbym nosić szatę Arcymaga Wody.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_HEAVYARMOR_Info_14_02', 'Nie jesteś jeszcze godzien nosić szatę Arcymaga.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_HEAVYARMOR_Info_14_03', 'Te kila bryłek rudy, które posiadasz, nie wystarczy nawet na pokrycie kosztów jej utkania!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_HEAVYARMOR_Info_14_04', 'Twój czas nadszedł. Jesteś godzien, by od dziś nosić szatę Arcymaga Wody.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_NOWSLD_15_01', 'Lee przyjął mnie w poczet Najemników.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_NOWSLD_14_02', 'Dobrze. Bardzo dobrze. Teraz jesteś oficjalnie członkiem naszej społeczności.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_NOWSLD_14_03', 'Witaj wśród nas!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_15_01', 'Kiedy wysyłałeś mnie do Magów Ognia, wspomniałeś coś o... jeszcze jednym?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_14_02', 'Cóż, miałem nadzieję, że obejdziemy się bez jego pomocy, ale w świetle ostatnich wydarzeń...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_15_03', 'O kim mówisz?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_14_04', 'No dobrze już, dobrze.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_14_05', 'Wiele lat temu...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_15_06', 'Wolałbym wersję skróconą, jeśli łaska!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_14_07', 'Bądź cierpliwy. Cóż, kiedy tworzyliśmy magiczną Barierę, nadzorował nas jeszcze jeden, trzynasty mag. ', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_15_08', 'Trzynasty mag? Według legendy miało was być tylko dwunastu!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_14_09', 'Niewielu z żyjących pamięta dokładnie wydarzenia tamtych dni, a my - magowie - woleliśmy nie odświeżać im niepotrzebnie pamięci.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_14_10', 'Ten trzynasty mag był naszym przywódcą. Oczywiście działo się to jeszcze przed podziałem na Kręgi Wody i Ognia.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDAS_14_11', 'Tuż po założeniu Starego Obozu - a wtedy był to jeszcze jedyny obóz w kolonii - ów mag postanowił wieść życie samotnika.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHO_15_01', 'Jak ma na imię ten trzynasty mag?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHO_14_02', 'Nazywał się Xardas. Dzisiaj już tylko garstka ludzi pamięta o jego istnieniu.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHO_14_03', 'Ale ci, którzy go znali, nazywali go po prostu NEKROMANTĄ!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHY_15_01', 'Dlaczego opuścił Stary Obóz?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHY_14_02', 'Xardas chciał kontynuować swe badania nad przyzywaniem ożywieńców i istot z innych wymiarów.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHY_14_03', 'Nie tylko Gomez zaczął się tym niepokoić. Pozostali magowie również krzywo patrzyli na niego i jego plugawe badania.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHY_15_04', 'I co się z nim stało?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHY_14_05', 'W odróżnieniu od Gomeza, Xardas nie był rzeźnikiem i wolał uniknąć otwartego konfliktu. Pewnego dnia opuścił Obóz.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHERE_15_01', 'Wiesz może, gdzie podziewa się teraz ten trzynasty mag?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHERE_14_02', 'Żyje w odosobnieniu, w swej wieży, gdzieś na terytoriach kontrolowanych przez Orków.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASWHERE_14_03', 'To chyba najdalej wysunięty na południe punkt całej kolonii.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASHELP_15_01', 'Spróbuję dotrzeć do tego Xardasa i poproszę go o pomoc!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASHELP_14_02', 'Tylko on jeden może nas teraz uratować.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASHELP_14_03', 'A gdyby nawet on nie wiedział, jak nas stąd wydostać, albo nie zechciał nam pomóc...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASHELP_15_04', 'BĘDZIE... I ZECHCE!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASHELP_14_05', 'Jest jednak inny problem...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASPROBLEM_15_01', 'Mianowicie?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASPROBLEM_14_02', 'Cóż, przez te wszystkie lata kilkakrotnie próbowaliśmy nawiązać z Xardasem jakiś kontakt.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASPROBLEM_14_03', 'Ale wygląda na to, że nie życzy sobie, żeby mu przeszkadzano.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASPROBLEM_15_04', 'Co chcesz przez to powiedzieć?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASPROBLEM_14_05', 'Żaden z wysłanych przez nas posłańców nie wrócił z jego wieży.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASPROBLEM_14_06', 'Musisz znaleźć jakiś sposób, aby przedrzeć się przez strażników Xardasa.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASPROBLEM_15_07', 'Widzę, że szykuje się nie lada wyprawa!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASGO_15_01', 'Jak mogę przedostać się do Xardasa?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASGO_14_02', 'Niestety, nie mam żadnego pomysłu...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASGO_14_03', 'Radziłbym ci jednak rozejrzeć się trochę w naszej bibliotece.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASGO_14_04', 'Może w którejś ze starych ksiąg odnajdziesz jakieś wskazówki co do mocnych i słabych stron istot przywołanych magicznie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASGO_15_05', 'W takim razie pójdę rozejrzeć się trochę po bibliotece. Nie obawiaj się...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_XARDASGO_15_06', 'Niedługo wrócę!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_14_00', 'Rozmawiałeś z Xardasem?', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_15_01', 'No wiesz...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_14_02', 'Wiesz? CO WIESZ?', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_15_05', 'Nie...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_14_06', 'Dlaczego?', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_15_07', 'Nie udało mi się jeszcze do niego dotrzeć.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_14_08', 'Musisz go odnaleźć i poprosić go o pomoc!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_15_09', 'To nie jest tak jak myślisz...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_14_10', 'Jak to? Xardas musi nam pomóc w zdetonowaniu kopca rudy!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_15_11', 'Kopiec... jest... Ehm... Jest już bardzo duży!', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_TIMESUP_Info_14_12', 'Znajdź Xardasa! On musi nam pomóc!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_HogeAUFNAHME_15_00', 'Nefarius powiedział, że mogę już założyć szatę Maga Wody.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_NOMOREOC_Info_14_03', 'Zatem witaj w naszej społeczności!', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_15_01', 'Czy to oznacza, że należę teraz do kręgu Magów Wody?', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_14_02', 'Jeszcze nie. Najpierw musisz złożyć śluby Wody.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_01', 'Jestem gotów do złożenia ślubów.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_03', 'Powtarzaj za mną słowa przysięgi:', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_04', 'Przysięgam, na wszechmocnych bogów...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_05', 'Przysięgam, na wszechmocnych bogów...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_06', '...Przysięgam, na potęgę świętej Wody...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_07', '...Przysięgam, na potęgę świętej Wody...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_08', '...Że ma wiedza i me czyny teraz i na wieki stanowić będą jedność z Wodą...', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_09', '...Że ma wiedza i me czyny teraz i na wieki stanowić będą jedność z Wodą...', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_10', '...Dopóki me ciało nie powróci do królestwa Beliara, gdy źródło mego życia wyschnie.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_15_11', '...Dopóki me ciało nie powróci do królestwa Beliara, gdy źródło mego życia wyschnie.', 1, 123, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_KDWAUFNAHME_Info_14_14', 'Noś tę szatę, jako symbol twojego przymierza ze świętą Wodą i wszechmocnym Adanosem.', 1, 123, 14, null, 600, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_Hallo_15_00', 'Kim jesteś?', 1, 175, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_Hallo_04_01', 'Nazywam się Nefarius. Mag Kręgu Wody.', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_WoSaturas_15_00', 'Gdzie mogę znaleźć Saturasa?', 1, 175, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_WoSaturas_04_01', 'Poszukaj za tą wielką, okrągłą bramą.', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_WannaMage_15_00', 'Chciałbym zostać Magiem Kręgu Wody.', 1, 175, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_WannaMage_04_01', 'Nie tak szybko, mój chłopcze!', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_WannaMage_04_02', 'Nie przyjmujemy do naszego grona byle kogo. Najpierw musisz się wykazać czymś niezwykłym.', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_WannaMage_04_03', 'Potem czeka cię okres próbny.', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_WannaMage_04_04', 'Jeżeli poważnie myślisz o zostaniu Magiem Wody, dołącz najpierw do Najemników. W ten sposób będziesz mógł nam udowodnić swoją wartość.', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_WannaMage_04_05', 'Kto wie, może pewnego dnia uda ci się nas przekonać...', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_NowReady_15_00', 'Czy jestem już gotów, by zostać Magiem Wody?', 1, 175, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_NowReady_04_01', 'Najpierw zaciągnij się do Najemników, potem - zobaczymy...', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_NowReady_04_02', 'Jak widzę, zostałeś jednym z Najemników. Dobrze, bardzo dobrze!', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_NowReady_04_03', 'Czekaj teraz cierpliwie na swoją szansę...', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_OCNews_04_00', 'Są jakieś wieści od naszych przyjaciół ze Starego Obozu?', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_OCNews_15_01', 'Gomez kazał wymordować wszystkich Magów Ognia!', 1, 175, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_OCNews_04_02', 'Nie! Durny barbarzyńca! Uprzedzałem Corristo - Gomezowi od początku nie można było ufać! Musisz donieść o tym Saturasowi!', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_OCNews_04_03', 'Czekaj!', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_OCNews_04_04', 'Naraziłeś się dla nas na nie lada niebezpieczeństwa.', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_OCNews_04_05', 'Jesteś już chyba godzien, by nosić szaty Maga Wody.', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Nefarius_OCNews_04_06', 'A teraz spiesz do Saturasa! Nie trać czasu!', 1, 175, 4, null, 603, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Brief_15_00', 'Mam tu list dla Arcymistrza Magów Ognia.', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Brief_08_01', 'My jesteśmy Magami Wody. Magów z Kręgu Ognia znajdziesz w Starym Obozie.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Brief_15_02', 'Ale strażnicy nie chcą mnie wpuścić do zamku? Możesz mi jakoś pomóc?', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Brief_08_03', 'Cóż, co jakiś czas wysyłamy kurierów do naszych braci ze Starego Obozu...', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Brief_08_04', 'Ale przesyłki powierzamy wyłącznie ludziom Laresa. Od wielu lat jego chłopcy dbają o to, by nasze przesyłki docierały do Magów Ognia nienaruszone.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Barrier_15_00', 'Chcecie ponoć zniszczyć magiczną Barierę. Jak zamierzacie tego dokonać?', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Barrier_08_01', 'Próbujemy zgromadzić w jednym miejscu możliwie dużą ilość magicznej rudy.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Barrier_08_02', 'Podczas wielkiego rytuału, cała skumulowana w rudzie magiczna energia zostanie wyzwolona i Bariera pryśnie jak mydlana bańka!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Barrier_08_03', 'Naturalnie tak wielka ilość rudy przyciąga tutaj różnych włóczęgów i bandytów!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Barrier_08_04', 'Dlatego potrzebujemy wielu ludzi do pilnowania naszych zapasów.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_WannaJoin_15_00', 'Chciałbym do was dołączyć!', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_WannaJoin_08_01', 'Jeśli chcesz zostać jednym z nas, powinieneś porozmawiać z Lee albo z Laresem.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_WannaMage_15_00', 'Chciałbym zostać magiem!', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_WannaMage_08_01', 'Nie możemy dzielić się naszą wiedzą z przeciwnikiem!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_WannaMage_08_02', 'Dopóki nie przekonasz nas o swojej lojalności, nie masz nawet o czym marzyć - nie będziemy cię uczyli!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Bandit_15_00', 'Jestem teraz jednym z ludzi Laresa. Masz jakąś wiadomość dla Magów Ognia, którą mógłbym dostarczyć do Starego Obozu?', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Bandit_08_01', 'W rzeczy samej, mam. Ale bez specjalnego znaku kurierskiego ludzie Gomeza nie wpuszczą cię do zamku.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_Bandit_08_02', 'Masz, oto list i znak. Tylko się pospiesz!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_BriefBack_15_00', 'Dostarczyłem twoje pismo!', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cronos_BriefBack_08_01', 'Ach, dobrze! Oto drobny prezent, w nagrodę za twoje trudy...', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_NEWS_15_01', 'Mam ważną wiadomość dla Saturasa!', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_NEWS_08_02', 'Cóż może być tak ważnego, byś miał przeszkadzać naszemu wielkiemu przywódcy w jego badaniach?', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_KALOM_15_01', 'Cor Kalom opuścił obóz Bractwa z grupą fanatycznych Strażników Świątynnych!', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_KALOM_15_02', 'Zamierza na własną rękę odnaleźć Śniącego i przebudzić go za wszelką cenę.', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_KALOM_08_03', 'Nigdy nie ufałem temu człowiekowi. Wielki Guru czy nie - to próżny i nieszczery człowiek zdolny do wszystkiego.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_KALOM_08_04', 'Bractwo da sobie radę i bez niego!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_KALOM_08_05', 'Powtórzę twoje informacje Saturasowi przy najbliższej okazji. Możesz już odejść!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_YBERION_15_01', 'Y''Berion, duchowy przywódca Bractwa Śniącego, nie żyje!', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_YBERION_08_02', 'CO?!? Jak to się stało?!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_YBERION_15_03', 'Bractwo przeprowadziło rytuał przyzwania Śniącego.', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_YBERION_15_04', 'Wygląda na to, że Y''Berion nie był w stanie wytrzymać tak wielkiego obciążenia.', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_YBERION_08_05', 'To smutna wiadomość. Na Y''Berionie zawsze można było polegać.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_YBERION_08_06', 'Ale to jeszcze nie powód, żeby przeszkadzać Saturasowi.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_15_01', 'Guru zorientowali się, że oddawali cześć potężnemu demonowi z piekła rodem!', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_08_02', 'Raptem doszli do wniosku, że Śniący jest demonem?', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_08_03', 'To mi wygląda na kolejny szalony pomysł ludzi z Bractwa, ale...', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_08_04', '...Gdyby okazało się, że mają rację... Cała kolonia znalazłaby się w śmiertelnym niebezpieczeństwie.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_08_05', 'Powtórzysz te informacje samemu Saturasowi. On zdecyduje co nam wypada czynić.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_15_06', 'Gdzie znajdę Saturasa?', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_08_07', 'Wejdź na wyższy poziom. Powiedz strażnikom, że pozwoliłem ci przejść.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_08_08', 'Hasło brzmi TETRIANDOCH.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_08_09', 'Saturasa znajdziesz przy wielkim pentagramie.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_SLEEPER_08_10', 'W zasadzie się stamtąd nie rusza. Cały czas obmyśla sposób na wysadzenie kopca rudy.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_PAROLE_15_01', 'Jak brzmiało to hasło?', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_PAROLE_08_02', 'Już moja świętej pamięci babcia miała lepszą pamięć od ciebie. Hasło brzmi "TETRIANDOCH".', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_REWARD_15_01', 'Saturas powiedział, że masz dla mnie nagrodę.', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_REWARD_08_02', 'Jako strażnik rudy, chciałbym podarować ci część naszego urobku jako nagrodę za zasługi dla Nowego Obozu.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Cronos_REWARD_08_03', 'Mam nadzieję, że zrobisz z tej rudy równie dobry użytek jak my!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_604_Cronos_WELCOME_Info_08_01', 'Mądrze postąpiłeś przystępując do Magów Wody. Bądź pozdrowiony, bracie!', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_604_Cronos_MANA_Info_15_01', 'Potrzebuję większej mocy magicznej.', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_604_Cronos_MANA_Info_08_02', 'Mogę ci pokazać, jak zwiększyć twoje zdolności magiczne. Jak je wykorzystasz zależy już tylko od ciebie.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_604_Cronos_SELLSTUFF_Info_15_01', 'Poszukuję magicznych ksiąg.', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_604_Cronos_GREET_Info_15_01', 'Witaj, magu!', 1, 82, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_604_Cronos_GREET_Info_08_02', 'Niech błogosławieństwo Adanosa zawsze będzie z tobą. Mogę ci pomóc zwiększyć twoje magiczne moce lub zaopatrzyć cię w kilka pożytecznych przedmiotów.', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_604_Cronos_GREET_Info_08_03', 'Co mogę dla ciebie zrobić?', 1, 82, 8, null, 604, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_NEWS_15_01', 'Przysyła mnie Saturas.', 1, 112, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_NEWS_14_02', 'Ach, chodź bliżej. Już mi o wszystkim doniesiono.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_NEWS_14_03', 'Proszę, weź to. Znajdziesz tu najróżniejsze wywary.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_NEWS_14_04', 'Teraz możesz już ruszać na poszukiwanie kamieni ogniskujących. Jesteś naszą jedyną nadzieją.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_REWARD_15_01', 'Saturas powiedział, że masz dla mnie nagrodę.', 1, 112, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_REWARD_14_02', 'Ach, chodź, chodź! ', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_REWARD_14_03', 'Nasz przywódca opowiedział mi o twoich bohaterskich czynach.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_REWARD_14_04', 'Cały nasz obóz... Ach, co ja mówię - cała KOLONIA powinna ci być dozgonnie wdzięczna.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_REWARD_14_05', 'Przyjmij tę skromną nagrodę w uznaniu twoich zasług.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_MESSAGE_14_01', 'Cieszę się, że już jesteś. Czekałem na ciebie!', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_MESSAGEWHY_15_01', 'Czekałeś? Jak to?', 1, 112, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_MESSAGEWHY_14_02', 'Gorn prosił mnie, żebym cię do niego przysłał, gdy tylko się zjawisz.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_MESSAGEWHY_15_03', 'O co chodzi?', 1, 112, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_MESSAGEWHY_14_04', 'Ma plan, jak odzyskać zajętą kopalnię.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_MESSAGEWHY_15_05', 'Czy wciąż pilnuje wejścia do kopalni?', 1, 112, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Riordian_MESSAGEWHY_14_06', 'Tak! Proszę, zajrzyj do niego możliwie jak najszybciej!', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_605_Riordian_WELCOME_Info_14_01', 'Cieszę się, że do nas dołączyłeś.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_605_Riordian_HEAL_Info_14_01', 'Jeśli jesteś ranny, mogę ci pomóc.', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_605_Riordian_HEALINFO_Info_15_01', 'Jestem ranny. Możesz coś na to poradzić?', 1, 112, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_605_Riordian_HEALINFO_Info_14_02', 'Tymi słowy przywołuję uzdrawiającą siłę! Niech twe ciało i duch znów zaznają spokoju!', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_605_Riordian_GREET_Info_15_01', 'Witaj, magu!', 1, 112, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_605_Riordian_GREET_Info_14_02', 'Jestem Riordian, alchemik. Zgaduję, że szukasz magicznego napoju?', 1, 112, 14, null, 605, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_605_Riordian_TRADE_Info_15_01', 'Pokaż mi co masz do zaoferowania.', 1, 112, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gilbert_First_04_00', 'Co tu robisz? Nie miewam tu zbyt często gości, he he!', 1, 88, 4, null, 1500, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gilbert_First_04_01', 'Widzę, że niezły cwaniak z ciebie. Tak znaleźć moją kryjówkę, no no!', 1, 88, 4, null, 1500, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gilbert_Hallo_15_00', 'Co tu robisz?', 1, 88, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gilbert_Hallo_04_01', 'Miałem już dość Starego Obozu. Podpadłem paru ludziom Gomeza. To było dawno temu.', 1, 88, 4, null, 1500, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gilbert_Hallo_04_02', 'Teraz pewnie nikt już o mnie nie pamięta, ale ja się stąd nie ruszam. Jak na mój gust - w Starym Obozie wciąż jest za dużo tępych osiłków.', 1, 88, 4, null, 1500, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_UR_Info_15_01', 'Ty jesteś Talas, ten którego obrabowano!', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_UR_Info_02_02', 'Zostaw mnie w spokoju! Nie chcę o tym więcej mówić!', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_Info_15_01', 'Mogę ci pomóc w odzyskaniu tej księgi.', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_Info_02_02', 'Naprawdę? Zostałem obrabowany przez gobliny! A teraz mam je odnaleźć i odzyskać księgę!', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_Info_02_03', 'Mam pomysł: ja ci pokażę, gdzie jest almanach, a ty go odzyskasz!', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_OK_15_01', 'Zgoda.', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_OK_02_02', 'Świetnie. Wyruszymy, gdy tylko będziesz gotów.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_BRING_15_01', 'To cię będzie kosztowało 30 bryłek rudy.', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_BRING_02_02', 'W porządku. Możemy wyruszyć, gdy tylko będziesz gotowy.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_MORE_15_01', 'Wejdę w to... za 50 bryłek rudy.', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_HELP_MORE_02_02', 'Co? Toż to rozbój! A zresztą. Daj mi znać, gdy będziesz gotowy do drogi.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_READY_Info_15_01', 'Jestem gotowy, możemy ruszać w drogę.', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_READY_Info_02_02', 'Dobrze. Chodź za mną.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_BRIDGE_Info_02_01', 'Te przeklęte bestyjki mieszkają w jaskini, za tym mostem. Uważaj na siebie!', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_BRIDGE_Info_15_02', 'Nie pójdziesz ze mną?', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_BRIDGE_Info_02_03', 'Zostanę tutaj i będę... ubezpieczał tyły.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_BACK_Info_02_01', 'Odzyskałeś almanach! Dobra robota! Wracajmy czym prędzej do Obozu!', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Talas_RETURNED_02_01', 'No to jesteśmy. Najlepiej zanieś od razu ten almanach Cor Kalomowi.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Talas_RETURNED_15_02', 'Tylko uważaj, żebyś nie umarł z przepracowania.', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Talas_RETURNED_02_03', 'Spokojna głowa. Nic mi nie będzie. Nie musisz się o mnie martwić.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_OGY_15_01', 'Przysyła mnie Cor Angar. Masz mnie zabrać na Cmentarzysko Orków, gdzie przebywa Baal Lukor i jego Strażnicy.', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_OGY_02_02', 'A więc znów mam robić za przewodnika. Niech to szlag! Bodajbym nigdy nie ujrzał tej księgi na oczy!', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_OGY_02_03', 'No dobrze, chodź za mną.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_BACKAGAIN_Info_02_01', 'Nie pójdę z tobą na drugą stronę tego mostu. Nie jestem samobójcą.', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_BACKAGAIN_Info_02_02', 'Oszalałeś, że chcesz tam wchodzić?! Nawet Baal Lukor stamtąd nie wrócił, a on miał ze sobą Świątynnych Strażników!', 1, 172, 2, null, 1300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1300_Talas_BACKAGAIN_Info_15_03', 'Co ma być to będzie. Wracaj do obozu. Ja się tu trochę rozejrzę.', 1, 172, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Hallo_15_00', 'Cześć, jestem tu nowy.', 1, 181, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Hallo_13_01', 'Ja... Ja jestem Caine, uczeń Cor Kaloma. Zapewne już o nim słyszałeś, co?', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Hallo_Ja_15_00', 'Tak.', 1, 181, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Hallo_Ja_13_01', 'Zatem wiesz już, że to najważniejszy człowiek w tym obozie, zaraz po Jaśnie Oświeconym Y''Berionie.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Hallo_Nein_15_00', 'Nie.', 1, 181, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Hallo_Nein_13_01', 'Nie?! Chyba jesteś tu od niedawna, co?', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Hallo_Nein_13_02', 'Cor Kalom to najważniejszy człowiek w Bractwie, po Y''Berionie. To on decyduje, kto zostanie przyjęty w szeregi Nowicjuszy.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Job_15_00', 'A ty czym się zajmujesz?', 1, 181, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Job_13_01', 'Pomagam mojemu mistrzowi w pracach nad jego magicznymi wywarami.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_Job_13_02', 'Głównie z ziela bagiennego i wydzieliny pełzaczy. Swoją drogą, mój mistrz pilnie potrzebuje tej wydzieliny.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_WoSekret_15_00', 'Gdzie mogę zdobyć tę... Wydzielinę pełzaczy?', 1, 181, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_WoSekret_13_01', 'Stara Kopalnia aż roi się od pełzaczy, ale trzeba umieć pozyskać ich wydzielinę.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_WoSekret_13_02', 'Jeśli poważnie myślisz o walce z pełzaczami, porozmawiaj z którymś ze Strażników trudniących się polowaniem na nie. Na przykład z Gor Na Drakiem.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_WoSekret_13_03', 'On każdego dnia wyrusza z naszego obozu do Starej Kopalni. O świcie znajdziesz go w pobliżu laboratorium.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_AddInfoKalom_15_00', 'Co możesz mi jeszcze powiedzieć o swoim mistrzu?', 1, 181, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Caine_AddInfoKalom_13_01', 'Jest inny niż pozostali Guru. Każdy może się do niego odezwać, ale NIKOMU nie wolno marnować jego cennego czasu.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1301_Caine_CHEST_Info_15_01', 'Jak mogę zdobyć recepturę Kaloma?', 1, 181, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1301_Caine_CHEST_Info_13_02', 'Nie możesz. Wszystkie receptury przechowywane są w zamkniętej skrzyni.', 1, 181, 13, null, 1301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_What_15_00', 'Czym się zajmujecie?', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_What_07_01', 'Zbieramy bagienne ziele, które zostanie przetworzone przez naszych braci tak, by można było je palić.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_What_07_02', 'Praca na bagnach jest bardzo niebezpieczna, ale ziele rośnie wyłącznie tutaj. Oczywiście ma to również pewne zalety.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_What_15_03', 'Jakie?', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_What_07_04', 'Pozostałe obozy nie mają do niego dostępu. Jesteśmy jedynym osiedlem w całej kolonii, które może zbierać ziele.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_What_07_05', 'Możemy je sprzedawać do pozostałych obozów, i to za każdą cenę, jakiej zażądamy!', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_FetchWeed_15_00', 'Przybywam z polecenia Baala Oruna. Mam zabrać wszystko co udało się wam zebrać do Cor Kaloma.', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_FetchWeed_07_01', 'I co, myślisz, że to takie łatwe?', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_FetchWeed_07_02', 'Każdy mógłby się tutaj zjawić mówiąc "Przysyła mnie Baal Orun". I co wtedy? Mam wydać całe ziele byle włóczędze?', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_FetchWeed_Really_15_00', 'Ale mnie naprawdę przysyła Baal Orun!', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_FetchWeed_Really_07_01', 'Jaaasne.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_FetchWeed_GotoHim_15_00', 'Jeśli mi nie wierzysz, sam go o to zapytaj!', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_FetchWeed_GotoHim_07_01', 'Mam lepszy pomysł. Jeśli chcesz nas przekonać, że jesteś tym, za kogo się podajesz, wyświadczysz nam drobną przysługę!', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Bloodflies_15_00', 'Co mam zrobić?', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Bloodflies_07_01', 'To tylko drobiazg. Praca na bagnach nie należy do najbezpieczniejszych, no i roi się tu od tych przeklętych Krwiopijców.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Bloodflies_07_02', 'Gdyby ich tutaj nie było, nasza praca stałaby się o wiele bardziej znośna. Kapujesz?', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Running_15_00', 'Nie widzę już żadnych Krwiopijców w pobliżu.', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Running_07_00', 'Przecież widać kilka z nich w odległości nie większej niż dwadzieścia kroków!', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Running_07_01', 'Tak łatwo się nie wywiniesz!', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Running_07_02', 'Żadnego robala w polu widzenia. Odwaliłeś kawał solidnej roboty!', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Running_07_03', 'Cóż, albo jesteś po naszej stronie, albo jesteś skończonym idiotą. Nikt inny nie podjąłby się takiego zadania.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Running_07_04', 'Ale skończony idiota nie próbowałby mnie wykiwać, co nie?', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Running_07_05', 'Masz, to wszystko, co udało się nam zebrać. Zanieś to do Cor Kaloma.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Running_07_06', 'Jakby zaczął narzekać, że to za mało, możesz mu powiedzieć, żeby sam ruszył tutaj swój zadek i przekonał się jak ciężko musimy harować.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Perm_15_00', 'Dobrze się bawicie?', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Perm_07_01', 'Śmiało, żartuj sobie ze mnie. Założę się, że zadania, które dostajesz od Guru też nie należą do najprzyjemniejszych.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_Perm_07_02', 'Cóż, przynajmniej nie muszę własnoręcznie odwalać brudnej roboty. Od tego jest "piechota" - ha ha ha.', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_RipOff_15_00', 'Mam zabrać następny ładunek ziela do Kaloma.', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_RipOff_07_01', 'Co, znowu?', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_RipOff_15_02', 'Chyba nie każesz mi teraz wybić dla ciebie wszystkich błotnych węży, co? Nie mam tyle czasu.', 1, 159, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Viran_RipOff_07_03', 'Dobra już, dobra! Masz tu to cholerne ziele!', 1, 159, 7, null, 1302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Hallo_15_00', 'Cześć, jestem tu nowy.', 1, 163, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Hallo_03_01', 'Niech Śniący będzie z tobą, nieznajomy.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_15_00', 'Co możesz mi powiedzieć o tym miejscu?', 1, 163, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_03_01', 'Cóż - najważniejszymi osobami w obozie są Guru. Oni głoszą słowo Śniącego i przekazują Nowicjuszom informacje o wizjach naszego Mistrza.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_03_02', 'On sam jest naturalnie zbyt zapracowany, by rozmawiać ze wszystkimi osobiście.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_03_03', 'Ale czasami przemawia do zgromadzonych na świątynnym dziedzińcu, objawiając święte prawdy ustanowione przez Śniącego.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_Casual_15_00', 'I co wtedy mówi?', 1, 163, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_Casual_03_01', 'Śniący wskazuje nam jedyną słuszną drogę. Ale niewierny nigdy tego nie zrozumie!', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_Holy_15_00', 'Opowiedz mi jeszcze o świętych słowach Śniącego.', 1, 163, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_Holy_03_01', 'On będzie tym, który wyprowadzi nas na wolność.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_Holy_03_02', 'Y''Berion powiedział, że poznamy właściwą drogę, jak tylko uda się nam nawiązać kontakt ze Śniącym.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_Holy_03_03', 'Nasz Mistrz przygotowuje rytuał wielkiego przyzwania, podczas którego wspólnie z najlepszymi Nowicjuszami nawiąże kontakt ze Śniącym.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_Holy_03_04', 'Pomaga mu w tym Cor Kalom, alchemik, który przygotowuje magiczne wywary wprowadzające nas w stan transu.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Nyras_Ort_Holy_03_05', 'Tylko w transie - lub we śnie - można usłyszeć słowa naszego Wyzwoliciela.', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1303_Nyras_GREET_Info_03_00', 'Idź precz! Nie masz tu czego szukać!', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1303_Nyras_LEAVE_Info_15_01', 'Szukam kamienia ogniskującego!', 1, 163, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1303_Nyras_LEAVE_Info_03_02', 'Obawiam się, że trochę się spóźniłeś! Ja go znalazłem wcześniej!', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1303_Nyras_LEAVE_Info_03_03', 'I zamierzam go sobie zatrzymać!', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1303_Nyras_LEAVE_Info_03_04', 'Śniący przemówił do mnie ostatniej nocy i uczynił mnie swym arcykapłanem!', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1303_Nyras_LEAVE_Info_03_05', 'Teraz jestem jedynym prawdziwym sługą Śniącego. Żadnej Straży, żadnych Guru!', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1303_Nyras_LEAVE_Info_03_06', 'TYLKO JA!!!', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1303_Nyras_LEAVE_Info_03_07', 'GIŃ!', 1, 163, 3, null, 1303, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_FetchWeed_15_00', 'Przysyła mnie Baal Orun. Mam dostarczyć do obozu zebrane przez was ziele.', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_FetchWeed_01_01', 'Świetnie. Nie będę musiał sam tego dźwigać.', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_FetchWeed_01_02', 'Nie zapomnij zajrzeć do Virana, po drugiej stronie bagna, jeśli jeszcze cię tam nie było.', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_FetchWeed_01_03', 'W przeciwnym razie dostawa będzie zbyt mała i ktoś mógłby pomyśleć, że sprzedałeś część towaru komuś innemu, he he.', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_SellUnder_15_00', 'Komu niby miałbym sprzedać to ziele?', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_SellUnder_01_01', 'Oho! Podsunąłem ci niezły pomysł, co?', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_SellUnder_ForgetIt_15_00', 'Nieważne, tak tylko pomyślałem.', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_SellUnder_HalfHalf_15_00', 'Gdybyś kogoś znał, moglibyśmy podzielić się po połowie.', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_SellUnder_HalfHalf_01_01', 'Cóż, znam pewnego człowieka w Nowym Obozie. Pewnie zainteresowałoby go nasze ziele...', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_SellUnder_HalfHalf_01_02', 'Ale gdyby Guru złapali cię na gorącym uczynku, rzuciliby cię na pożarcie wężom! Ja o niczym nie wiem, jasne?', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_SellUnder_ComeOn_15_00', 'Nie, powiedz mi - komu?', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_SellUnder_ComeOn_01_01', 'Widzę, że coś knujesz. Posłuchaj: jeśli ten towar nie dotrze do Cor Kaloma, obydwaj wpadniemy w nie lada kłopoty!', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_15_00', 'Dobra. Kto będzie odbiorcą w Nowym Obozie?', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_01_01', 'Myślisz, że podam ci imię, a ty ulotnisz się z całym towarem? Tak łatwo ci nie pójdzie!', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_01_02', 'Chcę 50 bryłek rudy zaliczki. Wtedy pogadamy.', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_Pay_15_00', '50 bryłek to uczciwa cena. Proszę bardzo.', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_Pay_01_01', 'Dobra, słuchaj. Facet nazywa się Cipher. Znajdziesz go pewnie w karczmie na jeziorze,', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_Pay_01_02', 'Bądź ostrożny i nie daj się zrobić w konia.', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_Pay_NoOre_01_00', 'Nie widzę tu żadnych 50 bryłek. Chcę 50 i ani sztuki mniej, jasne?', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_ForgetIt_15_00', 'Zapomnij o tym.', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_ForgetIt_01_01', 'Tylko nie wyobrażaj sobie, że możesz tak po prostu pójść do Nowego Obozu i sprzedać towar byle komu! Jeśli nie trafisz na właściwego człowieka, nigdy się go nie pozbędziesz.', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_TellDealer_ForgetIt_01_02', 'No chyba, że jakiś Szkodnik ci go zabierze.', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_RipOff_15_00', 'To ja, wróciłem. Przychodzę po następną dostawę.', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_RipOff_01_01', 'Jasne! Żeby sprzedać ją znowu w Nowym Obozie!', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_RipOff_01_02', 'Najpierw moje 50 bryłek zaliczki!', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_RipOff_01_03', 'Znowu ty? No dobra, bierz. Tylko nie próbuj wywinąć jakiegoś numeru, jasne?', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_RipOff_15_04', 'Gdzieżbym śmiał!', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_Perm_15_00', 'Nie przeszkadzaj sobie w pracy!', 1, 141, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Balor_Perm_01_01', 'A myślisz, że co ja robię? Grzebię sobie w jajach?', 1, 141, 1, null, 1304, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Greet_15_00', 'Czym się tu zajmujesz?', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Greet_07_01', 'Przekazuję mądrość Śniącego naszym Nowicjuszom.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Greet_07_02', 'Sam jestem jeszcze Nowicjuszem, ale już wkrótce zostanę Baalem - jednym z Guru.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Greet_07_03', 'Rozmawiałem nawet z Y''Berionem. To wielki Wybraniec. Powiedział mi, że jeśli będę pracował wystarczająco ciężko, niedługo sam zostanę wielkim mistrzem.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Greet_07_04', 'Ale to jeszcze przyszłość. Nie spieszy mi się, rozumiesz? Zostanę mistrzem, gdy przyjdzie odpowiednia pora.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Greet_07_05', 'Chwilowo jestem bardzo zadowolony z mojej pracy.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Tester_15_00', 'Na czym polega twoja praca?', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Tester_07_01', 'Wraz z kolegami testuję magiczne substancje opracowane przez Cor Kaloma w jego laboratorium.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Tester_07_02', 'Jego asystent przynosi nam co kilka dni coś nowego, a my to testujemy.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_Tester_07_03', 'To ziele otwiera twoją duszę. Po zażyciu odpowiedniej ilości będziesz mógł nawiązać kontakt ze Śniącym!', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_SleeperContact_15_00', 'A tobie udało się kiedyś stanąć przed obliczem Śniącego?', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_SleeperContact_07_01', 'Nie, jeszcze nie! Ale tylko dlatego, że nie dostajemy wystarczającej ilości ziela.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_SleeperContact_07_02', 'Kalom zawsze pyta nas o efekty, ale odnoszę wrażenie, że wcale mu nie zależy na moim zdaniu.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_SleeperContact_07_03', 'Jeśli jego wynalazki działają stymulująco, natychmiast trafiają do Guru...', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_SleeperContact_07_04', 'Ale niedługo ja sam zostanę Guru. Wtedy otrzymam odpowiednią porcję ziela i będę mógł osobiście wysłuchać głosu Śniącego.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JoinPsi_15_00', 'Chciałbym dołączyć do waszego obozu. Możesz mi pomóc?', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JoinPsi_07_01', 'Chcesz do nas dołączyć! To świetnie! Zaczekaj... Tak, chyba mógłbym ci pomóc!', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JoinPsi_07_02', 'Nie jestem jeszcze Guru, ale mam pewne wpływy w Bractwie.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JoinPsi_07_03', 'Oczywiście musiałbyś wyświadczyć mi drobną przysługę. Rozmawiałeś już z Fortuno?', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JoinPsi_Ja_07_00', 'Zatem masz swoją dzienną rację? Jeśli mi ją oddasz, dobijemy targu.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JoinPsi_Ja_15_01', 'Przemyślę to sobie.', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JoinPsi_Nein_07_00', 'W takim razie idź do niego i odbierz swoją dzienną rację. Jeśli dasz mi całe ziele, które od niego otrzymasz, dobijemy targu.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JoinPsi_Nein_15_01', 'Przemyślę to sobie.', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JointsRunning_15_00', 'Mam ziele przy sobie. Możemy zawrzeć układ.', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JointsRunning_07_01', 'Dobrze. Zauważyłeś pewnie, że żaden z Guru nie chce z tobą rozmawiać.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JointsRunning_07_02', 'Możesz to zmienić, sprawiając na nich dobre wrażenie. Mogę ci powiedzieć, jak tego dokonać.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_JointsRunning_NO_JOINTS_07_00', 'Miał być Mrok Północy a nie jakaś trawa! Przynieś mi to, o co cię prosiłem, wtedy dobijemy targu!', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_ImpressGurus_15_00', 'Jak mogę przekonać do siebie Guru?', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_ImpressGurus_07_01', 'Baal Cadar wprowadza Nowicjuszy w tajniki magii.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_ImpressGurus_07_02', 'Jeśli chcesz zwrócić na siebie jego uwagę, posłuż się czarami.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_ImpressGurus_07_03', 'Tylko nie potraktuj go od razu Uderzeniem Wiatru! Uśpij któregoś z jego uczniów, albo coś w tym stylu.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_ImpressGurus_07_04', 'Baal Namib to ten przy bramie. To jeden z najpotężniejszych ludzi w obozie. Lester będzie mógł ci jakoś pomóc. Porozmawiaj z nim jak tylko mistrz oddali się na chwilę.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_ImpressGurus_07_05', 'Pozostali Guru są mniej wymagający. Spróbuj się im jakoś przypodobać, a raz-dwa - dostaniesz się do Bractwa!', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_ImpressGurus_15_06', 'Dzięki za radę.', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_ImpressGurus_07_07', 'W końcu umowa to umowa, nie?', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_GetMagic_15_00', 'Jak mogę opanować magię Śniącego?', 1, 130, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_GetMagic_07_01', 'Baal Cadar sprzedaje magiczne runy i zwoje z zaklęciami, ale to dla ciebie niewielka pociecha, bo nie będzie chciał z tobą rozmawiać.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Joru_GetMagic_07_02', 'Może inny Guru będzie mógł ci pomóc.', 1, 130, 7, null, 1305, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_MissingHarlok_15_00', 'Cześć, jak leci?', 1, 117, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_MissingHarlok_02_01', 'Ledwie się trzymam na nogach. Pracuję od dwóch dni, bez chwili przerwy.', 1, 117, 2, null, 1310, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_MissingHarlok_02_02', 'Harlok powinien mnie zmienić już dawno temu. Ten człowiek nigdy się nie zmieni.', 1, 117, 2, null, 1310, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_MissingHarlok_02_03', 'Pewnie śpi teraz jak zabity w swojej chacie!', 1, 117, 2, null, 1310, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_MissingHarlok_15_04', 'Dlaczego nie pójdziesz do niego i nie dasz mu porządnego kopa w tyłek?', 1, 117, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_MissingHarlok_02_05', 'Nie mogę stąd odejść, póki Baal Orun wszystkiego pilnuje. Tak, czy inaczej - robota musi zostać wykonana!', 1, 117, 2, null, 1310, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_MissingHarlok_02_06', 'Ale ty mógłbyś tam pójść zamiast mnie. Jego chata jest zaraz pod laboratorium Cor Kaloma, koło Fortuno.', 1, 117, 2, null, 1310, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_MissingHarlok_02_07', 'Powiedz mu, żeby ruszył tu swój leniwy tyłek.', 1, 117, 2, null, 1310, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_SUCCESS_15_00', 'No i? Wreszcie ktoś cię zluzował?', 1, 117, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ghorim_SUCCESS_02_01', 'Tak, nareszcie mogę się porządnie wyspać. Dzięki, stary!', 1, 117, 2, null, 1310, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Darrion_Hello_15_00', 'Cześć! Jestem tu nowy i chciałbym poznać lepiej wasz Obóz.', 1, 97, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Darrion_Hello_11_01', 'Zatem trafiłeś nie tam gdzie trzeba. Odkąd Strażnicy Świątynni rozpoczęli przygotowania do walki, pracujemy dniem i nocą.', 1, 97, 11, null, 1312, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Darrion_Hello_11_02', 'Nie mam wiele czasu na pogawędki, więc nie zawracaj mi głowy jeśli nie chcesz niczego kupić.', 1, 97, 11, null, 1312, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Darrion_Trade_15_00', 'Chciałbym coś kupić!', 1, 97, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Darrion_Trade_11_01', 'To świetnie! Oto broń, którą mam aktualnie na składzie.', 1, 97, 11, null, 1312, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_Greet_10_00', 'Niech Śniący będzie z tobą, nieznajomy.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_Greet_10_01', 'Jestem tu, by wskazać ci właściwą ścieżkę.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_RightWay_15_00', 'A która ścieżka jest właściwa?', 1, 48, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_RightWay_10_01', 'Ścieżka Śniącego, oczywiście. Tylko on może nas stąd uwolnić.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_RightWay_10_02', 'Guru przygotowują w naszym obozie rytuał wielkiego przyzwania. Zamierzają nawiązać kontakt ze Śniącym.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_RightWay_10_03', 'Do tej pory przemawiał do nas wyłącznie za pośrednictwem wizji, ale już wkrótce stanie przed nami w pełni swej chwały.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_RightWay_10_04', 'Jednak aby to osiągnąć, potrzebujemy jak największej rzeszy wyznawców. Jednocząc nasze siły duchowe uda nam się nawiązać z nim kontakt.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_RightWay_10_05', 'Nasz obóz znajduje się dość daleko stąd - na wielkim bagnie. Mogę cię tam zaprowadzić, jeśli chcesz.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_MyAdvantage_15_00', 'Co mi przyjdzie z przyłączenia się do was?', 1, 48, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_MyAdvantage_10_01', 'Może okażesz się jednym z wybrańców, którzy otrzymują od Śniącego dar magii.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_MyAdvantage_10_02', 'A może dostąpisz zaszczytu służby w Świątynnej Straży. Tylko najlepsi spośród wojowników mogą należeć do Strażników.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_MyAdvantage_10_03', 'Jeśli Śniące będzie ci szczególnie sprzyjał - może dane ci będzie połączyć jedno z drugim! Najlepsi Strażnicy otrzymują również dar magii!', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_MyAdvantage_10_04', 'Jak widzisz, nasze Bractwo otwiera przed tobą wielkie możliwości!', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_MyAdvantage_10_05', 'Pamiętaj o tym zanim zdecydujesz się przyłączyć do któregoś z innych obozów!', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_Sleeper_15_00', 'Kim jest Śniący?', 1, 48, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_Sleeper_10_01', 'Śniący przemawia do nas poprzez sny i wizje.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_Sleeper_10_02', 'Przewodzi nam odkąd nawiązał pierwszy kontakt z Y''Berionem, pięć lat temu.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_Sleeper_10_03', 'Wszyscy wyznawcy Bractwa wyrzekli się trzech bogów. Teraz modlimy się o zbawienie tylko do Śniącego.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_Sleeper_15_04', 'Zbawienie od czego?', 1, 48, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_Sleeper_10_05', 'Od tego przeklętego miejsca, naturalnie! Śniący wskaże nam drogę do wolności!', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_SleeperSaid_15_00', 'Co powiedział wam Śniący?', 1, 48, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_SleeperSaid_10_01', 'Zaprowadził nas na bagna, na ruiny starej świątyni. Tam zbudowaliśmy nasz obóz.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_SleeperSaid_10_02', 'Dał nam niezależność - żaden z nas nie musi pracować pod ziemią.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_SleeperSaid_10_03', 'Pokazał nam jaka moc drzemie w bagiennym zielu. Teraz sprzedajemy je innym obozom, otrzymując w zamian wszystko, czego nam potrzeba.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_SleeperSaid_10_04', 'Wreszcie obdarzył niektórych z nas darem magii. Magii starożytnej i potężnej. Różnej od tej, którą wykorzystywali dotąd magowie tego królestwa.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_PSIMagic_15_00', 'Opowiedz mi jeszcze o magii Śniącego.', 1, 48, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_PSIMagic_10_01', 'Magia Śniącego pozwala ci kontrolować rzeczy siłą twojej woli.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_PSIMagic_10_02', 'Jednak tylko wtajemniczeni Guru poznali tajniki tej magii.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_GotoPSI_15_00', 'Zaprowadź mnie do waszego obozu. Chciałbym się tam rozejrzeć.', 1, 48, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_GotoPSI_10_01', 'To wspaniale. Chodź za mną!', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_AtPSI_10_00', 'Jesteśmy na miejscu. Tam leży obóz Bractwa Śniącego.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_AtPSI_LATE_10_00', 'Nie spieszyłeś się zbytnio, bracie! Przed nami obóz wyznawców Śniącego!', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_AtPSI_10_01', 'Przejdź przez bramę i porozmawiaj z moimi braćmi. Gwarantuję ci, że nie przyszedłeś tu na próżno.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_AtPSI_10_02', 'Zapytaj o Cor Kaloma. To on opiekuje się Nowicjuszami.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_AtPSI_10_03', 'Ja wrócę teraz do Starego Obozu. Wielu niewiernych potrzebuje wciąż pomocy w odnalezieniu właściwej ścieżki.', 1, 48, 10, null, 1330, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalParvez_AtPSI_15_04', 'Powodzenia!', 1, 48, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Greet_15_00', 'Jestem tu nowy. Kim jesteś?', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Greet_05_01', 'Jestem Baal Taran z Bractwa Śniącego.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Bruderschaft_15_00', 'Bractwo Śniącego? A cóż to takiego?', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Bruderschaft_05_01', 'Jesteśmy wspólnotą wyznawców nowej wiary.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Bruderschaft_05_02', 'Nasz obóz znajduje się na wschód stąd, na bagnie. Przyszedłem tutaj, by nauczać niewiernych takich jak ty słów Śniącego.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Sleeper_15_00', 'Kim jest Śniący?', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Sleeper_05_01', 'Śniący będzie naszym wyzwolicielem. Pięć lat temu ujawnił się nam przez Y''Beriona, naszego wielkiego mistrza.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Sleeper_05_02', 'Od tej chwili, wyrzekliśmy się trzech bogów, co i tobie radzę.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Sleeper_05_03', 'Bogowie przyglądali się bezczynnie, gdy byliśmy skazywani na dożywotnią katorgę w tym więzieniu. Ale Śniący wskaże nam drogę do wolności.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Lehre_15_00', 'Opowiedz mi o naukach Śniącego.', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Lehre_05_01', 'Śniący jest niezwykle potężny, może nawet potężniejszy od Innosa, boga światła.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Lehre_05_02', 'Zjednoczył się z nami duchowo, ale jego moc jest wciąż ograniczona. Był uśpiony przez tysiące lat, ale moment jego wielkiego przebudzenia jest już bardzo bliski!', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Lehre_05_03', 'Wybrał nas na świadków swojego nadejścia i kazał nam szerzyć jego słowa w całej kolonii.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Lehre_05_04', 'Zatem słuchaj: każdy, kto stanie po jego stronie zostanie zbawiony, ale ci, którzy się mu sprzeciwią, poniosą surową karę.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Lehre_05_05', 'Ale Śniący jest miłosierny i wszystkim wątpiącym przysyła znak swojej potęgi.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Freiheit_15_00', 'Jak będzie wyglądać ta droga do wolności?', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Freiheit_05_01', 'Przygotowujemy się do wielkiego przyzwania, w którym wszyscy Nowicjusze zjednoczą swoje duchowe siły.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Freiheit_05_02', 'W trakcie rytuału Śniący ujawni nam świętą drogę do wolności.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Beweis_15_00', 'W jaki sposób wasz bóg udowodnił swoją potęgę?', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Beweis_05_01', 'Przemawiając do nas za pośrednictwem wizji. Kto raz usłyszy jego głos, już nigdy nie zbłądzi na ścieżkę zła.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Beweis_05_02', 'Zażyj rosnące na bagnach ziele, a zbliżysz się do Śniącego i będziesz mógł usłyszeć jego słowa. Niektórym wybrańcom zdarzyło się go nawet zobaczyć!', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_Beweis_15_03', 'Rozumiem.', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_WayToST_15_00', 'Jak mogę dotrzeć do obozu Bractwa?', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_WayToST_05_01', 'Jestem teraz zajęty, ale Baal Parvez powinien przebywać jeszcze w tym obozie.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_WayToST_05_02', 'Znajdziesz go gdzieś w pobliżu targowiska, po drugiej stronie zamku. Zdaję się, że ma tam nawet własną chatę!', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_15_00', 'Muszę się dostać do zamku. Mógłbyś mi pomóc?', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_05_01', 'Obawiam się, że nie. Tylko Bracia dostarczający Gomezowi ziele mają wstęp do zamku.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_05_02', 'Zbieramy bagienne ziele, i część zbiorów sprzedajemy do Starego Obozu w zamian za różne dobra z zewnętrznego świata.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_05_03', 'Gdybyś był jednym z kurierów pracujących dla Cor Kaloma, mógłbyś dostać się do zamku. Oczywiście musiałbyś najpierw przystąpić do Bractwa.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_05_04', 'A czego, jeśli wolno spytać, chcesz szukać w zamku?', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_MeetSomeone_15_00', 'Muszę się tam z kimś spotkać.', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_MeetSomeone_05_01', 'Naprawdę? A z kim? Nie mógłbyś po prostu zaczekać, aż do ciebie wyjdzie?', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Letter_15_00', 'Mam list do Arcymistrza Magów Ognia.', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Letter_05_01', 'Czyżby? A skąd go masz? Może dostałeś go od jednego z magów zanim cię tu wrzucono?', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Letter_05_02', 'Jesteś głupcem, rozpowiadając o tym na lewo i prawo, ale nie obawiaj się - nikomu o tym nie powiem.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Letter_05_03', 'Jednak na twoim miejscu trzymałbym język za zębami. Za coś takiego większość ludzi bez wahania poderżnęłaby ci gardło.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Letter_05_04', 'Nagroda, jaką otrzymują posłańcy za dostarczenie wiadomości z zewnętrznego świata, jest niezwykle cenna.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Mage_15_00', 'To jeden z magów.', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Mage_05_01', 'Cóż, obawiam się, że oni nigdy nie opuszczają zamku. Rzeczywiście, musiałbyś dostać się do środka.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Mage_05_02', 'A czego od nich chcesz? Magicznych run? A może napojów?', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_ForgetIt_15_00', 'To nie twoja sprawa.', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_ForgetIt_05_01', 'Dobrze, jak sobie życzysz.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Exactly_15_00', 'Właśnie tak!', 1, 64, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Exactly_05_01', 'Wiedziałem! Czegóż innego ktoś taki jak ty mógłby chcieć od maga.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Exactly_05_02', 'Dam ci dobrą radę: daruj sobie tych całych magów. Ceny, których żądają za swoje zabawki są niezwykle wygórowane.', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalTaran_IntoCastle_Exactly_05_03', 'Runy i napoje dostaniesz również w naszym obozie i to za połowę ceny!', 1, 64, 5, null, 1331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_Hello_15_00', 'Jesteś z obozu Sekty, nieprawdaż?', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_Hello_13_01', 'Jesteśmy Bractwem Śniącego, ale tak - pochodzę z obozu na bagnie.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_Hello_13_02', 'Jestem Baal Kagan. Niech Śniący zawsze będzie z tobą.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WhyHere_15_00', 'Co tu robisz?', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WhyHere_13_01', 'Początkowo przybyłem tutaj, by werbować nowych ludzi do naszego Bractwa.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WhyHere_13_02', 'Ale ci barbarzyńcy mają w nosie swoje duchowe zbawienie. Dlatego teraz zajmuję się wyłącznie sprzedażą ziela.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WhyHere_13_03', 'Palenie ziela to dość popularne zajęcie w tych stronach. Może nawet zbyt popularne. Ledwie nadążam z kolejnymi dostawami.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_TRADE_15_00', 'Pokaż mi co masz do zaoferowania.', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_TRADE_13_01', 'Jak sobie życzysz.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_OrderHelp_15_00', 'Dlaczego nie przyślą ci tu kogoś do pomocy?', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_OrderHelp_13_01', 'Miał mi pomagać Baal Isidro, ale on woli spędzać całe dnie w karczmie na jeziorze i wymieniać swoje ziele na ryżówkę.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_OrderHelp_13_02', 'Obawiam się, że uzależnił się od alkoholu. Nie mogę raczej liczyć na jego pomoc.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WannaHelp_15_00', 'Mógłbym ci pomóc w sprzedaży ziela...', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WannaHelp_13_01', 'Tak duże ładunki ziela mogę powierzyć tylko innym członkom Bractwa.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WannaHelp_13_02', 'Ale mógłbyś pomóc mi w rozdzielaniu prezentów.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WannaHelp_13_03', 'Jeszcze całkiem spora grupa ludzi nie miała okazji skosztować mojego towaru. Gdyby spróbowali, chcieliby kupować więcej, czyli zyski ze sprzedaży mogłyby wzrosnąć.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WannaHelp_15_04', 'Myślałem, że i bez tego ledwie sobie radzisz w pracy!', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WannaHelp_13_05', 'Zająłem się już problemem Baala Isidro. Wysłałem wiadomość do Cor Kaloma.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WasDrin_15_00', 'Co będę z tego miał, jeśli zgodzę się rozdawać twoje "prezenty"?', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WasDrin_13_01', 'Mogę cię wynagrodzić na kilka różnych sposobów.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WasDrin_13_02', 'Mogę ci podarować zwoje z magicznymi zaklęciami Śniącego.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WasDrin_13_03', 'Albo mogę pomóc ci zostać jednym z nas, jeśli zechcesz. Utrzymuję dobre kontakty z Cor Kalomem i Baal Tyonem.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WasDrin_13_04', 'To bliscy przyjaciele samego Y''Beriona, naszego wielkiego mistrza.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_WasDrin_13_05', 'Wreszcie mogę ci zapłacić rudą, jeśli tak wolisz. 100 bryłek powinno wystarczyć, czyż nie?', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_GimmeKraut_15_00', 'Dobrze, daj mi to ziele. Komu mam je rozdawać?', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_GimmeKraut_13_01', 'Na pewno znajdzie się wielu chętnych. Porozmawiaj z ludźmi. Tylko każdemu z nich dawaj JEDNĄ porcję.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_GimmeKraut_13_02', 'I jeszcze coś: jeśli pozwolisz, by ktoś odebrał ci ziele, albo sam je wypalisz, naszą umowę uznam za nieważną.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_GimmeKraut_15_03', 'Oczywiście.', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_15_00', 'Rozdałem już całe ziele.', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_13_01', 'Pierwsi klienci zaczęli się już do mnie zgłaszać. Wykonałeś kawał dobrej roboty.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_13_02', 'Co chcesz dostać jako wynagrodzenie?', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_NO_SUCCESS_13_00', 'Nie przyszli do mnie jeszcze żadni nowi klienci. Musisz rozdzielić jeszcze trochę ziela.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_WhatSpells_15_00', 'Te zwoje magiczne wydają się całkiem interesujące - jakie zaklęcia zawierają?', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_WhatSpells_13_01', 'Uderzenie wiatru, Urok, Telekinezę, Pirokinezę i Sen. Możesz sobie wybrać trzy z nich.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_Join_15_00', 'Pomóż mi dostać się do Bractwa.', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_Join_13_01', 'Twoja prośba jest bardzo skromna. Pomogę ci, tylko słuchaj uważnie. Baal Tyon jest jednym z młodszych Guru, tak jak ja.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_Join_13_02', 'Y''Berion uczynił z niego swojego osobistego doradcę. Obawiam się, że to nie była najlepsza decyzja.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_Join_13_03', 'Tyon stał się przez to tak zarozumiały, że nie chce już pomagać nikomu oprócz swoich uczniów.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_Join_13_04', 'Daj mu to, jeśli chcesz mu rozwiązać język.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_Erz_15_00', 'Wezmę 100 bryłek rudy.', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_Erz_13_01', 'Proszę bardzo.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_TakeScrolls_15_00', 'Wezmę te zwoje z zaklęciami.', 1, 147, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_TakeScrolls_13_01', 'Mądra decyzja. Wybierz trzy.', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_TakeScrolls_DREI_13_00', '', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_TakeScrolls_DREI_13_00', '', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_TakeScrolls_DREI_13_00', '', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_TakeScrolls_DREI_13_00', '', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalKagan_SUCCESS_TakeScrolls_DREI_13_00', '', 1, 147, 13, null, 1332, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Hello_15_00', 'Nie wyglądasz mi na zbyt zadowolonego.', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Hello_03_01', 'Bo nie jestem!', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Hello_03_02', 'Muszę się pozbyć dużego ładunku ziela.', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Hello_15_03', 'Sprzedajesz towary z obozu Bractwa?', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Hello_03_04', 'Tak, ale nie idzie mi najlepiej.', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_TRADE_15_00', 'Pokaż mi co tam masz...', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_TRADE_03_01', 'Proszę...', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_GimmeKraut_15_00', 'Mógłbym pomóc ci sprzedać to ziele. Oczywiście za drobną prowizję.', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_GimmeKraut_03_01', 'Zapomnij o tym. Nie jestem aż tak pijany. Dałbyś nogę z całym towarem.', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Problem_15_00', 'Wiesz co? Masz nieźle przechlapane. Baal Kagan znajdzie sobie kogoś innego na twoje miejsce.', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Problem_03_01', 'Co? Na potęgę Śniącego! Muszę się koniecznie pozbyć tego towaru!', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Drink_15_00', 'Proszę, łyknij sobie! Ja stawiam.', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_Drink_03_01', 'Dzięki, kolego. Twoje zdrowie!', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_NO_Drink_03_00', 'Co? Gdzie?', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_ThinkAgain_15_00', 'Sam pomyśl - dasz mi ziele i podzielimy się zyskami.', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_ThinkAgain_03_01', 'Stary, muszę koniecznie sprzedać ten towar! Chyba nie chcesz mnie wystrychnąć na dudka, co?', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_ThinkAgain_15_02', 'Masz moje słowo.', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_ThinkAgain_03_03', 'Dobrze, oto ziele... Powinieneś za nie dostać jakieś 400 bryłek. To będzie po 200 bryłek na głowę. Zaczekam na ciebie tutaj. Wróć, jak tylko uda ci się sprzedać towar.', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_ThinkAgain_15_04', 'Wiesz może, kto może tutaj kupić większą ilość ziela?', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_ThinkAgain_03_05', 'Gdybym wiedział, sam bym je dawno sprzedał, nie sądzisz?', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_ThinkAgain_03_06', 'Poczułem się lepiej po pozbyciu się tego ziela, wiesz?', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_REFUSE_ThinkAgain_03_00', 'Nie, jakoś sobie poradzę...', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_RUNNING_15_00', 'Sprzedałem całe ziele.', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_RUNNING_03_01', 'A moje 200 bryłek?', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_RUNNING_15_02', 'Proszę bardzo. ', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_RUNNING_03_03', 'Świetnie... Teraz Baal Kagan może mi... No wiesz (Pijacki śmiech)', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_RUNNING_03_04', 'Miło było robić z tobą interesy.', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_RUNNING_NoOre_15_05', 'Nie mam ich przy sobie.', 1, 24, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalIsidro_RUNNING_NoOre_03_06', 'To lepiej je szybko przynieś!', 1, 24, 3, null, 1333, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_WhyHere_15_00', 'Co tu robisz?', 1, 63, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_WhyHere_02_01', 'Czy pozwoliłem ci się do mnie odezwać?!', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_WhyHere_02_02', 'Tylko żartuję! Te cholerne świry zaczynają mnie już denerwować, dlatego tu jestem!', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_WhyHere_02_03', '"Nie odzywaj się do mnie!" - "Módl się o łaskę Śniącego!" - "Twoje zadanie jest szczególnie ważne!"', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_WhyHere_02_04', 'Przy tych ludziach można w mig zwariować. Nic dziwnego, że mieszkają tam sami wariaci.', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_WhyHere_02_05', 'Jestem Shrat, Nowicjusz pierwszego stopnia. I będę nim już do końca życia!', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_JoinPSI_15_00', 'Chciałbym dołączyć do Bractwa. Możesz mi pomóc?', 1, 63, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_JoinPSI_02_01', 'Chcesz tu zamieszkać? A ja zastanawiam się właśnie jak stąd uciec!', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_JoinPSI_02_02', 'Moglibyśmy przemierzyć całą kolonię, odciążyć kilku frajerów z ich gotówki, zebrać trochę rudy - co ty na to?', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_ComeWithMe_15_00', 'Jasne! Trzymajmy się razem! Chodź ze mną!', 1, 63, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_ComeWithMe_02_01', 'To właśnie chciałem usłyszeć! Chodźmy!', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_LeaveMe_15_00', 'Tutaj nasze drogi się rozchodzą. Dalej pójdę sam.', 1, 63, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrat_LeaveMe_02_01', 'Dobra. Ja wracam do mojej kryjówki na bagnach. Uważaj na siebie!', 1, 63, 2, null, 1356, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_Greet_05_00', 'Chodź bliżej! Każdy nowoprzybyły otrzymuje od Bractwa powitalny prezent!', 1, 146, 5, null, 1357, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_GetGeschenk_15_00', 'Co to za prezent?', 1, 146, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_GetGeschenk_05_01', 'To Mrok Północy - dobry towar!', 1, 146, 5, null, 1357, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_GetGeschenk_05_02', 'Możesz do mnie przychodzić codziennie po nową porcję, ale gdybyś chciał dostać więcej niż przewiduje dzienna racja, będziesz musiał zapłacić.', 1, 146, 5, null, 1357, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_GetGeschenk_05_03', 'Gdybyś znalazł jakieś zioła lub owoce możesz je przynieść do mnie. Chętnie je od ciebie odkupię.', 1, 146, 5, null, 1357, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_DailyRation_15_00', 'Przyszedłem po moją codzienną porcję ziela.', 1, 146, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_DailyRation_05_01', 'Proszę bardzo. Trzy sztuki Mroku Północy. Tylko nie wypal wszystkiego na raz!', 1, 146, 5, null, 1357, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_DailyRation_05_02', 'Dostałeś już dziś swoją porcję. Jeśli chcesz więcej, będziesz musiał zapłacić. Najlepiej przyjdź jutro.', 1, 146, 5, null, 1357, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_BuyJoints_15_00', 'Chcę coś kupić.', 1, 146, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fortuno_BuyJoints_05_01', 'Czego szukasz? A może chcesz coś sprzedać?', 1, 146, 5, null, 1357, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_FetchHarlok_15_00', 'Przysyła mnie Ghorim.', 1, 134, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_FetchHarlok_01_01', 'Co?', 1, 134, 1, null, 1358, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_FetchHarlok_Please_15_00', 'Mam ci przypomnieć, że powinieneś go wreszcie zluzować.', 1, 134, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_FetchHarlok_Please_01_01', 'To bardzo miło z twojej strony. Przypomnij mi znowu, jak już się wyśpię, dobra?', 1, 134, 1, null, 1358, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_FetchHarlok_OrElse_15_00', 'Rusz dupę do roboty, albo dostaniesz kopa!', 1, 134, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_FetchHarlok_OrElse_01_01', 'Tylko spróbuj mi podskoczyć, frajerze!', 1, 134, 1, null, 1358, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_FetchHarlok_BACK_15_00', 'Dobra, dobra.', 1, 134, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_HarlokAgain_15_00', 'Chciałem ci tylko przypomnieć, że masz zmienić twojego kolegę.', 1, 134, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_HarlokAgain_01_01', 'Słuchaj, koleś. Kazałem ci spadać!', 1, 134, 1, null, 1358, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_SendHarlok_15_00', 'No i co? Masz już ochotę zmienić swojego kolegę?', 1, 134, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_SendHarlok_01_01', 'Wiesz co? Jesteś jak wrzód na tyłku! Czemu wtykasz nos w nie swoje sprawy?', 1, 134, 1, null, 1358, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_SendHarlok_15_02', 'Chciałem tylko zobaczyć cię przy pracy...', 1, 134, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_SendHarlok_01_03', 'Dobra, dobra - już idę... Frajer!', 1, 134, 1, null, 1358, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Harlok_Angry_01_00', 'Zostaw mnie w spokoju! Przecież już idę!', 1, 134, 1, null, 1358, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_CRAZY_Info_15_01', 'Kim jesteś?', 1, 23, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_CRAZY_Info_03_02', 'Jestem Guru z obozu na bagnie. Moi słudzy mówią na mnie Baal Netbek.', 1, 23, 3, null, 1371, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_CRAZY_Info_15_03', 'Słudzy? Nie widzę tu żadnej służby.', 1, 23, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_CRAZY_Info_03_04', 'Och, ależ oni są wszędzie. Spójrz na drzewa. Jak one tańczą!', 1, 23, 3, null, 1371, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_CRAZY_Info_15_05', '...Eee, rozumiem. Cóż, chyba pójdę już dalej...', 1, 23, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_CRAZY_Info_03_06', 'Zaczekaj, mógłbyś pomóc mi przekształcić to bagno w ogromną łąkę pełną kwiatów!', 1, 23, 3, null, 1371, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_CRAZY_Info_15_07', 'Może zaczniesz beze mnie? Wrócę... niedługo.', 1, 23, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_CRAZY_Info_15_08', 'Ten człowiek raczej mi nie pomoże...', 1, 23, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_AGAIN_Info_15_01', 'Cześć, co słychać?', 1, 23, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Nov_1371_BaalNetbek_AGAIN_Info_03_02', 'Tylko uważaj, żebyś nie skrzywdził moich kochanych drzew!', 1, 23, 3, null, 1371, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_THX_17_01', 'Podziękować, Obcy!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_THX_17_02', 'Zły Orkowie chcieli mnie zabić.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_THX_17_03', 'Kiedyś brat - dzisiaj wróg.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_WHO_15_01', 'Kim jesteś?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_WHO_17_02', 'Jestem Ur-Shak.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_WHO_17_03', 'Jestem syn-ducha. Ludzie mówią - Szaman.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_TONGUE_15_01', 'Skąd nauczyłeś się naszego języka?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_TONGUE_17_02', 'Ur-Shak niewolnik ludzi z kopalni.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_TONGUE_17_03', 'Uciec. To wiele zim temu.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_MINE_15_01', 'Byłeś niewolnikiem w kopalni? A w której?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_MINE_17_02', 'Kopalnia pod wioską w Kotle.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_WHY_15_01', 'Dlaczego twoi bracia walczą z tobą?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_WHY_17_02', 'Ur-Shak w niełasce.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_WHY_17_03', 'Nie wierzyć w KRUSHAK.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_WHY_17_04', 'KRUSHAK jest zły demon.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_KRUSHAK_15_01', 'KRUSHAK? Co to takiego?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_KRUSHAK_17_02', 'Ludzie mówią - SPAĆ.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_KRUSHAK_15_03', 'Masz na myśli Śniącego?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_KRUSHAK_17_04', 'Tak, ludzie mówią ŚNIĄCY!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SLEEPER_15_01', 'Co wiesz o Śniącym?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SLEEPER_17_02', 'Było pięciu braci, dużo zim temu.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SLEEPER_17_03', 'Oni syn-ducha, jak Ur-Shak!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SLEEPER_15_04', 'Masz na myśli pięciu szamanów!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SLEEPER_17_05', 'Wezwali KRUSHAK!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SLEEPER_17_06', 'Chcieli pokonać zły klan!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SLEEPER_17_07', 'Pięciu braci zbudowało świątynia dla KRUSHAK. Pod ziemią.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SLEEPER_15_08', 'Podziemna świątynia Śniącego! Zapewne to miał na myśli Xardas mówiąc, że wejście znajduje się w mieście Orków.', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_CURSE_15_01', 'Co się stało w podziemnej świątyni?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_CURSE_17_02', 'Bracia dali serca dla KRUSHAK!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_CURSE_17_03', 'Ale KRUSHAK zły, rzucił klątwę na wszystkich co budowali mu dom.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_CURSE_17_04', 'Bracia bez serc - i żyją i nie. Tak i tak!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_CURSE_17_05', 'KRUSHAK ma serca braci. Serce da mu moc!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_CURSE_15_06', 'Co stało się z budowniczymi, którzy wznieśli świątynię Śniącego?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_CURSE_17_07', 'Wszyscy przeklęci. Wszyscy. Żywi i martwi, tak i tak. Wszyscy.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OUTSIDE_15_01', 'A Orkowie na powierzchni nie próbowali temu zapobiec?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OUTSIDE_17_02', 'Oni zamknąć świątynię. Dziś bracia modlą się do KRUSHAK.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OUTSIDE_17_03', 'KRUSHAK dostaje ofiary, żeby nie był zły.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OUTSIDE_17_04', 'Ur-Shak myśli, że ofiary nie dobre. Powiedział, że KRUSHAK zły!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OUTSIDE_17_05', 'Bracia nie chcą słuchać. Mówią Ur-Shak iść. Bić Ur-Shak.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_INTEMPLE_15_01', 'Muszę się dostać do tej podziemnej świątyni. Możesz mnie tam zaprowadzić?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_INTEMPLE_17_02', 'Ur-Shak dziękuje Obcy. Obcy uratował Ur-Shak.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_INTEMPLE_17_03', 'Ale wejście do świątyni jest w domu. Ur-Shak nie może tam iść.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_INTEMPLE_15_04', 'Rozumiem. Obawiasz się, że twoi pobratymcy nie wpuszczą cię do miasta.', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_MAP_15_01', 'Możesz zaznaczyć na mojej mapie położenie waszego miasta?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_MAP_17_02', 'Dom Ur-Shaka tam, gdzie mapa pusta.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_MAP_17_03', 'Obcy da mapę, Ur-Shak skończy mapę!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_MAP_17_04', '(Rysuje mapę)', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_MAP_15_05', 'Niesamowite! Nie lada z ciebie kartograf! Dzięki!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FIGHT_15_01', 'Trudno, spróbuję się jakoś przebić do wejścia.', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FIGHT_17_02', 'Bracia w domu bardzo silni! Bracia baaardzo wielu!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FIGHT_17_03', 'Obcy nie iść! Dużo wojowników! Obcy zabity!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FIGHT_17_04', 'Inni syn-ducha w domu. Spalić Obcy! Zabić Obcy!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OTHERWAY_15_01', 'Dobrze już, dobrze! Ale muszę się jakoś dostać do tej świątyni!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OTHERWAY_17_02', 'Ur-Shak wie jak! Obcy weźmie ULU-MULU!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OTHERWAY_15_03', 'ULU-MULU? A co to takiego?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OTHERWAY_17_04', 'Znak przyjaźni! ULU-MULU! Bracia uszanują!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_OTHERWAY_17_05', 'Obcy weźmie ULU-MULU, to Obcy nie zginie!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_15_01', 'Gdzie mogę znaleźć to... Ulu-Mulu?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_17_02', 'Obcy znajdzie przyjaciel Ur-Shak!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_17_03', 'Przyjaciel Ur-Shak da ULU-MULU! Obcy weźmie ULU-MULU i nie zginie!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_15_04', 'W porządku, rozumiem o co ci chodzi, tylko gdzie ja znajdę tego twojego przyjaciela?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_17_05', 'Przyjaciel Ur-Shak w kopalni! On został. Chory. Nie uciekł.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_15_08', 'Byłeś niewolnikiem w opuszczonej kopalni?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_17_09', 'Ur-Shak nie zna słowo.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_15_10', 'Byłeś przetrzymywany w Starej Kopalni?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_17_11', 'Ur-Shak nie rozumie!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_15_12', 'Byłeś więźniem w Wolnej Kopalni?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_17_13', 'Ur-Shak niewolnik w kopalni w Kocioł.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ULUMULU_17_14', 'Ur-Shak słyszał, jak ludzie mówili!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_BYEBYE_15_01', 'Dziękuję za pomoc!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_BYEBYE_17_02', 'Ur-Shak dziękuje Obcy! Obcy uratował Ur-Shak. Obcy teraz przyjaciel Ur-Shak!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_BYEBYE_17_03', 'Przyjaciel weźmie talizman Ur-Shak. Talizman ochroni przed oddechem smoka!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_BYEBYE_17_04', 'Ur-Shak nie może iść do domu. Ur-Shak zostanie tu! Przyjaciel przyjdzie jak pomoc potrzebna!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_BYEBYE_15_05', 'Kto wie, może kiedyś skorzystam z twojej oferty!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FRIENDLYHELLO_15_01', 'Jak się masz, przyjacielu!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FRIENDLYHELLO_17_02', 'Ur-Shak zdrowy!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FRIENDLYHELLO_17_03', 'Ur-Shak potrzebuje ULU-MULU dla siebie!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FRIENDLYHELLO_17_04', 'Może z ULU-MULU Ur-Shak pójdzie do domu!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FRIENDLYHELLO_17_05', 'Przyjaciel przyjdzie, jak pomoc potrzebna!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_FRIENDLYHELLO_15_06', 'Trzymaj się!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ORCCITY_17_01', 'Ur-Shak pozdrawia Przyjaciel!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ORCCITY_17_02', 'Przyjaciel ma ULU-MULU! Dobrze!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ORCCITY_17_03', 'Przyjaciel trzyma ULU-MULU, jak przechodzi przez most!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ORCCITY_17_04', 'Przyjaciel nie ma ULU-MULU! Nie dobrze!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_ORCCITY_17_05', 'Przyjaciel nie pójdzie przez most! Tam śmierć!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_YOUHERE_15_01', 'Co robisz tak blisko miasta?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_YOUHERE_17_02', 'Ur-Shak obserwuje braci w domu.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_YOUHERE_17_03', 'Ur-Shak boi, że KRUSHAK niedługo obudzi!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_YOUHERE_17_04', 'Ur-Shak zaczeka. Jak KRUSHAK obudzi, Ur-Shak zaatakuje.', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_YOUHERE_15_05', 'Śniący ma się wkrótce przebudzić? Obyś się mylił.', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_YOUHERE_15_06', 'Zważywszy wszystko, czego dowiedziałem się o tym demonie, wolałbym, żeby się zbyt szybko nie budził!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SEAL_15_01', 'Podczas naszego ostatniego spotkania powiedziałeś, że twoi bracia zamknęli wejście do świątyni!', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SEAL_17_02', 'Bracia Ur-Shak zamknęli świątynię bardzo mocno!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SEAL_17_03', 'Przyjaciel tam nie wejdzie!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SEAL_17_04', 'Przyjaciel musi użyć magii braci, co są syn-ducha jak Ur-Shak!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SCROLL_15_01', 'Gdzie mogę znaleźć taką magię?', 1, 137, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SCROLL_17_02', 'Musi iść do jaskini braci, którzy są syn-ducha jak Ur-Shak!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SCROLL_17_03', 'Ale trzeba uważać z magią!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_SCROLL_17_04', 'Bracia Ur-Shak nie lubią! ULU-MULU nie pomoże, jak Przyjaciel użyje magii!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_IDOL_17_03', 'Przyjaciel znalazł figurkę na kolumnie!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_IDOL_17_04', 'Przyjaciel może teraz otworzyć bramę do świątyni!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_IDOL_17_05', 'Przyjaciel musi zabrać figurkę!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_OrcShaman_IDOL_17_06', 'Figurka otworzy wejście do świątyni!', 1, 137, 17, null, 2200, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest1_17_01', 'ŚMIERTELNY!', 1, 111, 17, null, 2995, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest1_17_02', 'JAK ŚMIESZ ZAKŁÓCAĆ MÓJ SPOKÓJ?!', 1, 111, 17, null, 2995, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest1_17_03', 'PRZYGOTUJ SIĘ NA ŚMIERĆ!', 1, 111, 17, null, 2995, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest1_15_04', 'Jeszcze się przekonamy, na kogo przyszła pora, ty gnijący ochłapie.', 1, 111, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest2_17_01', 'NIEWIERNY? W DOMU PANA?!', 1, 154, 17, null, 2996, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest2_17_02', 'BĄDŹ PRZEKLĘTY!', 1, 154, 17, null, 2996, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest2_15_03', 'Sam bądź przeklęty, pajacu!', 1, 154, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest3_17_01', 'ŚMIERTELNY!', 1, 166, 17, null, 2997, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest3_17_02', 'TWÓJ CZAS WŁAŚNIE DOBIEGŁ KOŃCA!', 1, 166, 17, null, 2997, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest3_15_03', 'Ależ skąd, kobiety i gnijące mumie przodem!', 1, 166, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest4_17_01', 'TWOJA DROGA KOŃCZY SIĘ TUTAJ!', 1, 158, 17, null, 2998, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest4_17_02', 'NIECH SCZEŹNIE TWA CIELESNA POWŁOKA!', 1, 158, 17, null, 2998, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest4_15_03', 'Wolałbym nie, jeśli łaska!', 1, 158, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest5_17_04', 'MASZ ZE SOBĄ POTĘŻNY ORĘŻ!', 1, 49, 17, null, 2999, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest5_17_05', 'POWSTRZYMAM CIĘ!', 1, 49, 17, null, 2999, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest5_17_01', 'MUSISZ TUTAJ ZAWRÓCIĆ!', 1, 49, 17, null, 2999, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest5_17_02', 'NIKT NIE MOŻE ZAKŁÓCIĆ SNU MEGO PANA!', 1, 49, 17, null, 2999, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest5_15_03', 'Nie ma lekko! Budzimy ŚPIOCHA!', 1, 49, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest5FAILED_15_01', 'Cholera! Nie zadaję mu nawet najmniejszych obrażeń. Potrzebuję innej...', 1, 49, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest5FAILED_17_02', 'TERAZ ZGINIESZ!', 1, 49, 17, null, 2999, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_HighPriest5FAILED_15_03', 'Lepiej się stąd wynosić! I to zaraz!', 1, 49, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_YouHere_11_00', 'Jak się tu dostałeś? Co się dzieje z Roscoe?', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_YouHere_15_01', 'Wolał nie próbować mnie powstrzymywać!', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_YouHere_11_02', 'Czego chcesz?', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_WannaJoin_15_00', 'Chcę do was dołączyć.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_WannaJoin_11_01', 'Tak? A co takiego możesz nam zaoferować?', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringList_15_00', 'Mam przy sobie listę zamówień dla Starej Kopalni.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringList_11_01', 'O niech mnie... Albo jesteś cholernie odważny, albo cholernie głupi...', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringList_11_02', 'Pokaż!', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringList_15_03', 'Oto ona...', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringList_11_04', 'Rzeczywiście! Wiesz, co z nią teraz zrobimy? Dopiszemy parę rzeczy, a ty zaniesiesz ją do Starego Obozu!', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringList_11_05', 'A jak już dostarczą wszystko do kopalni, obrabujemy ich ze wszystkiego! To nie zajmie długo... Ha! Masz tu listę. Wiesz, co masz robić.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringListBack_15_00', 'Przekazałem listę Diego.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringListBack_11_01', 'Świetnie! Rozmieściłem paru ludzi na drodze do Starej Kopalni. Strażnicy Thorusa pewnie już gryzą ziemię.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringListAnteil_15_00', 'Napadliście już na konwój?! A gdzie moja dola?!', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringListAnteil_11_01', 'Pogadaj z Gornem. On ci coś da.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringListAnteil_15_02', 'Znam Gorna, ale on nie należy do waszej bandy. Jest Najemnikiem, pracuje dla Magów.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringListAnteil_11_03', 'Zgadza się.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringListAnteil_15_04', 'To on też maczał w tym palce?', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_BringListAnteil_11_05', 'Czasem lepiej jest nie wiedzieć za dużo. Idź do niego po swoją nagrodę.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_MordragSentMe_15_00', 'Przysyła mnie Mordrag. Mam dla ciebie pierścień.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_MordragSentMe_11_01', 'Cenna błyskotka. To taki zwyczaj - część łupu oddaje się szefowi bandy.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_MordragSentMe_11_02', 'Ale skoro powierzył ci ten pierścień, musi mieć o tobie wysokie mniemanie.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_MordragSentMe_11_03', 'Chcę, żebyś poszedł do niego i przekazał mu wiadomość ode mnie.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_MordragSentMe_11_04', 'Powiedz mu, że potrzebuję kogoś w obozie na bagnie. Bractwo planuje coś dużego, a ja chcę wiedzieć, co się tam będzie działo.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Vorbeigemogelt_15_00', 'Udało mi się ominąć twoje straże.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Vorbeigemogelt_11_01', 'Fakt. Ale to jeszcze za mało.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GetKraut_15_00', 'To co mam zrobić, żeby cię przekonać?', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GetKraut_11_01', 'Pewien człowiek z Sekty, niejaki Baal Isidro, ma przy sobie ziele warte co najmniej 400 bryłek rudy. Chcę, żebyś mi je przyniósł. Jak tego dokonasz - to już twoja sprawa.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GetKraut_15_02', 'Jeśli masz na myśli tę stertę trawy, to mam ją już od dawna.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GetKraut_11_03', 'Widzę, że sprytny z ciebie chłopak!', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GetKraut_11_04', 'Skoro masz już ziele, chcę, żebyś je sprzedał. Przynieś mi 400 bryłek rudy.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GetKraut_11_05', 'Wtedy wrócimy do twojego członkostwa w mojej bandzie.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_400Ore_15_00', 'Mam dla ciebie 400 bryłek.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_400Ore_11_01', 'Dobrze! Świetnie! To mi chyba wystarczy.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_400Ore_NOORE_11_00', 'Lepiej przelicz jeszcze raz! Mam nadzieję, że nie wydałeś ich na gorzałę!', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Reicht_15_00', 'Czy to wystarczy, byście mnie przyjęli?', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Reicht_AUFNAHME_11_00', 'Myślę, że tak!', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Reicht_AUFNAHME_11_01', 'I mam dla ciebie mały prezent! Lepszy pancerz. Może nie jest to szczyt marzeń, ale zasłużyłeś na niego.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Reicht_11_02', 'Mordrag opowiedział się za tobą.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Reicht_11_03', 'Stałeś się bardzo popularny, odkąd przyniosłeś nam tę listę.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Reicht_11_04', 'Ale nie jesteś gotowy. Popracuj nad sobą jeszcze trochę.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GotoKalom_15_00', 'I co mam robić dalej?', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GotoKalom_11_01', 'Należysz teraz do naszej bandy. Możesz robić, co ci się żywnie podoba.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GotoKalom_11_02', 'Jeśli chcesz robić coś pożytecznego, pogadaj z Mordragiem i pomóż mu w sprawie Sekty.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GotoKalom_11_03', 'Zginął Mordrag, jeden z naszych ludzi w Starym Obozie. Przed śmiercią zdążył przysłać nam wiadomość. Wygląda na to, że w obozie Sekty dzieje się coś ważnego.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GotoKalom_11_04', 'Chcę, żebyś udał się do obozu na bagnie i trochę tam powęszył.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GotoKalom_11_05', 'Wrócił Mordrag, jeden z naszych ludzi w Starym Obozie.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GotoKalom_11_06', 'Chcę, żebyś z nim porozmawiał. Powiedz mu, że potrzebuję wtyczki w obozie Sekty. Bractwo planuje coś dużego, a ja chcę wiedzieć, co się tam dzieje.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_GotoKalom_11_07', 'Masz mu pomóc.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_WhereLearn_Info_15_01', 'Gdzie mogę się tu czegoś nauczyć.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_WhereLearn_Info_11_02', 'Na przykład u mnie. Mogę ci pokazać, jak zwiększyć twoją siłę i zręczność.', 1, 174, 11, null, 801, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_801_Lares_Teach_15_00', 'Chcę nauczyć się czegoś nowego.', 1, 174, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_Greet_06_00', 'A dokąd to się wybieramy?', 1, 14, 6, null, 804, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_WayTo_15_00', 'A gdzie MOGĘ pójść?', 1, 14, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_WayTo_06_01', 'Do Laresa.', 1, 14, 6, null, 804, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_ToLares_15_00', 'Chcę porozmawiać z Laresem.', 1, 14, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_ToLares_06_01', 'Ale Lares raczej nie będzie chciał rozmawiać z tobą.', 1, 14, 6, null, 804, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_ToLares_15_02', 'To już mój problem.', 1, 14, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_ToLares_06_03', 'Jak sobie chcesz...', 1, 14, 6, null, 804, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_PERM_15_00', 'Mogę porozmawiać z Laresem?', 1, 14, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_804_Organisator_PERM_06_01', 'Pogadaj najpierw z Roscoe.', 1, 14, 6, null, 804, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_804_FirstWarn_Info_06_00', 'Ludzie Gomeza nie mają tu wstępu! Spadaj!', 1, 14, 6, null, 804, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_804_LastWarn_06_00', 'Idź stąd, póki jeszcze możesz!', 1, 14, 6, null, 804, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WrongWay_07_00', 'Hej, ty!', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WrongWay_15_01', 'Czego chcesz?', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WrongWay_07_02', 'Chcę cię ostrzec. Idąc dalej wejdziesz na nasze tereny łowieckie.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WhatGame_15_00', 'Na co polujecie?', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WhatGame_07_01', 'Głównie na ścierwojady. Da się je zjeść, no i nietrudno je zabić... Jeśli wie się jak to zrobić.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WhatGame_15_02', 'Naprawdę? Macie jakąś specjalną metodę?', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WhatGame_07_03', 'Zapytaj mojego kumpla, Draxa. Nikt nie wie więcej o ścierwojadach niż on.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WhyDangerous_15_00', 'Dlaczego ten teren jest tak niebezpieczny?', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WhyDangerous_07_01', 'Jesteś tu nowy, co? W całej kolonii jest mnóstwo mniej lub bardziej niebezpiecznych miejsc.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WhyDangerous_07_02', 'Ścieżki pomiędzy obozami są dość bezpieczne, ale nawet tam można natknąć się na stado wilków, które będą chciały zjeść cię na kolację.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WhyDangerous_07_03', 'Dlatego lepiej nie ruszać się nigdzie bez odpowiedniego oręża i zbroi.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoEquipment_15_00', 'Skąd mogę wziąć lepsze wyposażenie?', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoEquipment_07_01', 'Najbliżej będzie pewnie Stary Obóz. Idź dalej tą samą ścieżką, na pewno trafisz.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoEquipment_07_02', 'Ale lepsze ceny znajdziesz u nas - w Nowym Obozie. Oczywiście pod warunkiem, że znasz właściwych ludzi.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoEquipment_07_03', 'Kiedy trafisz do Starego Obozu, poszukaj mężczyzny imieniem Mordrag. To jeden z naszych. Za kilka bryłek rudy można u niego kupić wiele wartościowych rzeczy.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_MoreLocations_15_00', 'Opowiedz mi jeszcze o kolonii.', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_MoreLocations_07_01', 'Jeśli zamierzasz podróżować między obozami, przyda ci się mapa z wszystkimi ścieżkami i ślepymi zaułkami.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_MoreLocations_07_02', 'Niektóre ścieżki prowadzą do niebezpiecznych kanionów, gdzie można wpaść na istoty, na które... lepiej nie wpadać.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_MoreLocations_07_03', 'Pod żadnym pozorem nie włócz się w pobliżu starych ruin. Większość z nich pamięta jeszcze pierwszą wojnę z Orkami. Niektóre są nawet pozostałościami po ich osiedlach.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_MoreLocations_07_04', 'Często kręcą się tam Orkowie albo jeszcze gorsze poczwary. Na twoim miejscu unikałbym takich miejsc jak ognia. Zwłaszcza nocą.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_MoreLocations_07_05', 'I jeszcze jedna rada - nie wchodź do lasu!', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoKarte_15_00', 'Gdzie mogę zdobyć jakąś mapę?', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoKarte_07_01', 'Popytaj ludzi w Starym Obozie. Mieszka tam jeden kartograf. ', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoKarte_07_02', 'Może uda ci się gwizdnąć mu jakąś mapę. Przy okazji mógłbyś zwinąć także jedną dla mnie!', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoKarte_Stehlen_15_00', 'Jeśli uda mi się zdobyć je bez płacenia, wezmę ile tylko dam radę udźwignąć!', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoKarte_Stehlen_07_01', 'Równy z ciebie gość! Powinieneś pomyśleć o dołączeniu do Nowego Obozu. Gdybyś kiedyś tam trafił, pytaj o Laresa. To on zajmuje się nowymi. Na pewno znajdzie dla ciebie jakieś zajęcie!', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoKarte_Kaufen_15_00', 'Dlaczego? Jego mapy nie są na sprzedaż?', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_WoKarte_Kaufen_07_01', 'Jeśli stać cię na tak ogromny wydatek...', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_Thanks_15_00', 'Dzięki za pomoc.', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_Thanks_07_01', 'Tylko nie myśl, że wszyscy tutaj są tacy mili!', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_Thanks_07_02', 'Niewiele można znaleźć w kieszeniach Nowego, ale w kolonii są ludzie, którzy rozłupaliby ci czaszkę za stary kilof.', 1, 170, 7, null, 818, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_818_Ratford_Thanks_15_04', 'Będę o tym pamiętał.', 1, 170, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_HuntHere_15_00', 'Widzę, że jesteś myśliwym.', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_HuntHere_06_01', 'Na to wygląda... Czego chcesz?', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_HuntHere_15_02', 'Mógłbyś nauczyć mnie polować?', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_HuntHere_06_03', 'Parę sztuczek mógłbym ci pokazać, ale to będzie kosztować.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_HuntHere_15_04', 'Ile dokładnie?', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_HuntHere_06_05', 'Na początek wystarczy łyk dobrego piwa, potem zobaczymy.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Scavenger_15_00', 'Proszę, oto piwo. Teraz opowiedz mi o polowaniu.', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Scavenger_06_01', 'Ścierwojady - tak nazywamy te wielkie ptaszyska - należy atakować jeden po drugim. Na szczęście łatwo odciągnąć jednego osobnika od reszty stada.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Scavenger_06_02', 'Jeśli podejdziesz do nich zbyt blisko, zaczną się denerwować, aż wreszcie rzucą się w twoją stronę. Lepiej, żebyś w tej chwili miał broń w pogotowiu.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Scavenger_06_03', 'Jeśli uda ci się trafić ścierwojada zanim on dziobnie ciebie, jak najszybciej wyprowadź kolejne uderzenie. Przy odrobinie szczęścia uda ci się go pokonać bez zadraśnięcia.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Scavenger_06_04', 'A jeśli ON dziobnie cię pierwszy... Cóż, lepiej, żeby nie dziobnął.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Scavenger_KEIN_BIER_15_00', 'Nie mam piwa.', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Scavenger_KEIN_BIER_06_01', 'To poszukaj! To najlepsza rada, jaką otrzymasz ode mnie za darmo. A skoro już będziesz szukał, znajdź dla mnie jeszcze parę bryłek rudy.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Scavenger_KEIN_BIER_06_02', 'Mogę ci wiele opowiedzieć o różnych zwierzakach, ale to cię będzie kosztowało.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_15_00', 'Czego jeszcze możesz mnie nauczyć?', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_06_01', 'Wielu rzeczy, ale głupie piwo nie wystarczy.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_06_02', 'Wprawny łowca potrafi zdobyć kły, pazury i skórę zwierzyny. Nie jest to łatwe, ale dość opłacalne.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_06_03', 'W każdym razie każdy kupiec chętnie je od ciebie odkupi.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_TaughtAll_06_00', 'Powiedziałem ci już wszystko co wiem.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_PrettyMuch_15_00', 'Dużo żądasz za swoje usługi.', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_PrettyMuch_06_01', 'Być może, ale wiedza, którą mogę ci przekazać pozwoli ci szybko odzyskać zainwestowaną kwotę.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_PrettyMuch_06_02', 'Wszystkie zwierzęta, które zabijesz nie wiedząc jak je oprawić, po prostu zgniją.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_PrettyMuch_06_03', 'A to najzwyklejsze marnotrawstwo. Za ich skórę mógłbyś zarobić sporo pieniędzy.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_PrettyMuch_06_04', 'Na twoim miejscu spróbowałbym możliwie szybko posiąść te umiejętności.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Zahn_15_00', 'Jak mogę zdobyć kły upolowanej zwierzyny?', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Zahn_06_01', 'Przede wszystkim musisz uważać, żeby kły nie popękały podczas wyciągania. W tym celu wbij nóż w pobliżu środka zęba i delikatnie go podważaj.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Zahn_06_02', 'Warto zabierać kły wilków, cieniostworów i zębaczy', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_KEINE_LP_06_00', 'Musisz najpierw zdobyć trochę więcej doświadczenia. Inaczej moja wiedza będzie bezużyteczna.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_KEIN_ERZ_06_00', 'Najpierw chcę zobaczyć trochę rudy. W tej kolonii nic nie ma za darmo!', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Fell_15_00', 'Jak mogę zdobyć skóry upolowanej zwierzyny?', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Fell_06_01', 'Zaczynaj skórowanie od zadu, przesuwając się stopniowo ku głowie. Spróbuj kilka razy. To nie jest takie trudne, a futra potrafią być bardzo cenne!', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Fell_06_02', 'Futra wilków i cieniostworów można wykorzystać do szycia odzieży. Badając futro zabitego zwierza łatwo ocenisz, czy nadaje się do dalszego wykorzystania.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_KEINE_LP_06_01', 'Musisz najpierw zdobyć trochę więcej doświadczenia. Inaczej moja wiedza będzie bezużyteczna.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_KEIN_ERZ_06_01', 'Najpierw chcę zobaczyć trochę rudy. W tej kolonii nic nie ma za darmo!', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Kralle_15_00', 'Pokaż mi jak zdobyć pazury upolowanej zwierzyny.', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Kralle_06_01', 'Prawdę mówiąc to dziecinnie proste, trzeba tylko znać odpowiednią metodę. Wygnij pazury do przodu - nigdy do tyłu! I pod żadnym pozorem nie próbuj ich wyciągać!', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Kralle_06_02', 'Najlepiej pozyskiwać pazury jaszczurów. Od tej pory będziesz wiedział, które zwierzęta dostarczają dobrych pazurów.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_KEINE_LP_06_02', 'Musisz najpierw zdobyć trochę więcej doświadczenia. Inaczej moja wiedza będzie bezużyteczna.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_KEIN_ERZ_06_02', 'Najpierw chcę zobaczyć trochę rudy. W tej kolonii nic nie ma za darmo!', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Haut_15_00', 'Na co powinienem zwracać uwagę zdzierając skórę z gadów?', 1, 35, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Haut_06_01', 'Skóry topielców i bagiennych węży są szczególnie cenne.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_Haut_06_02', 'Jeśli przetniesz skórę na bokach, powinna sama odejść od mięsa. Myślę, że od tej pory poradzisz już sobie ze skórowaniem gadów.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_KEINE_LP_06_03', 'Musisz najpierw zdobyć trochę więcej doświadczenia. Inaczej moja wiedza będzie bezużyteczna.', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_819_Drax_Creatures_KEIN_ERZ_06_03', 'Najpierw chcę zobaczyć trochę rudy. W tej kolonii nic nie ma za darmo!', 1, 35, 6, null, 819, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_825_Organisator_PERM_15_00', 'Czego tu pilnujecie?', 1, 176, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_825_Organisator_PERM_07_01', 'Pilnujemy, żeby żaden z ludzi Lee ani Gomeza nie zbliżał się do Laresa.', 1, 176, 7, null, 825, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Greet_11_00', 'Hej, nowa twarz! Jestem Mordrag. Zapamiętaj sobie to imię - u mnie kupisz wszystko, czego potrzebujesz za niewielką cenę!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Trade_15_00', 'Pokaż mi co masz do zaoferowania.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Trade_11_01', 'Wybierz coś...', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Courier_15_00', 'Naprawdę jesteś kurierem Magów?', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Courier_11_01', 'A jeśli jestem?', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Courier_15_02', 'Chciałbym porozmawiać z którymś z magów. Muszę dostać się do zamku.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Courier_11_03', 'Każdy kurier magów ma przy sobie magiczną pieczęć, dzięki której może wejść do zamku. Gdybyś był jednym z nas, mógłbyś taką zdobyć.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Problem_15_00', 'Masz problem.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Problem_11_01', 'Czyżby? A jaki?', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Problem_15_02', 'Są w tym obozie osoby, które mają cię już serdecznie dosyć.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Problem_11_03', 'Tak? To powiedz im, żeby przysłały tutaj kogoś, kto spróbuje mnie stąd przepędzić!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Problem_15_04', 'Skąd pewność, że nie przysłały właśnie mnie?', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Problem_11_05', 'Bo myślę, że jesteś na to zbyt mądry. Wkrótce przekonasz się, że są w tej kolonii ciekawsze rzeczy do roboty niż usługiwanie Gomezowi.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Problem_11_06', 'Nowy Obóz potrzebuje zdolnych ludzi. Tam przynajmniej nikt nam nie mówi co mamy robić.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_NCInfo_15_00', 'Opowiedz mi o Nowym Obozie.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_NCInfo_11_01', 'Tylko tam znajdziesz prawdziwą wolność... jak na kolonię karną, oczywiście. Nie ma tam żadnych Magnatów ani Guru, którzy mogliby tobą pomiatać.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_NCInfo_11_02', 'Mamy własną kopalnię, ale nie sprzedajemy ani grama rudy temu zramolałemu królowi!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_NCInfo_15_03', 'Więc do czego ją wykorzystujecie?', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_NCInfo_11_04', 'Nasi magowie opracowują plan ucieczki z kolonii. Zbieranie rudy jest częścią tego planu.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_NCInfo_11_05', 'Gomez i jego ludzie pławią się w luksusie, a my ciężko pracujemy, żeby się stąd wydostać. Tak to wygląda!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_JoinNewcamp_15_00', 'A gdybym chciał dołączyć do Nowego Obozu... mógłbyś mi pomóc?', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_JoinNewcamp_11_01', 'Jeśli myślisz o tym poważnie, możemy wyruszyć od razu. Zaprowadzę cię do Laresa. To szef naszej bandy.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_JoinNewcamp_11_02', 'Ale gdybyś chciał wyrzucić mnie z Obozu siłą - możesz spróbować.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoNewcamp_15_00', 'Chodźmy do Nowego Obozu!', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoNewcamp_11_01', 'Dobra! Chodź za mną!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_AtNewcamp_11_00', 'No to jesteśmy.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_AtNewcamp_LATE_11_00', 'Myślałem, że już tu nie dotrzesz! Zresztą nieważne - jesteśmy na miejscu!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_AtNewcamp_11_01', 'Za tą bramą rozciąga się Nowy Obóz. Porozmawiaj z Laresem, on ci pomoże. Daj mu ten cenny pierścień.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_AtNewcamp_11_02', 'To twoja przepustka do Laresa. Trzeba mieć nie lada powód, żeby się z nim spotkać.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_AtNewcamp_11_03', 'Wiesz co? Po zastanowieniu - chyba posiedzę tu parę dni. Zarobiłem już niezłą sumkę, a w Starym Obozie zaczyna robić się trochę za gorąco.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_AtNewcamp_11_04', 'Jak byś czegoś potrzebował - znajdziesz mnie w karczmie na środku jeziora. Uważaj na siebie!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_AtNewcamp_15_05', 'Do zobaczenia.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Fight_15_00', 'W tym obozie nie ma miejsca dla ludzi takich jak ty!', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_Fight_11_01', 'Słucham?', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mordrag_Fight_GetAway_15_00', 'Wynoś się stąd i nigdy nie wracaj!', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mordrag_Fight_GetAway_11_01', 'Wielkie słowa małego człowieczka...', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mordrag_Fight_OreBarons_15_00', 'Nie tolerujemy tu ludzi, którzy okradają Magnatów!', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mordrag_Fight_OreBarons_11_01', 'Ach, więc o to ci chodzi! Dlaczego nie powiedziałeś tak od razu...', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mordrag_Fight_Thorus_15_00', 'Przysyła mnie Thorus. Mam się ciebie pozbyć raz na zawsze.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Mordrag_Fight_Thorus_11_01', 'Thorus? Naprawdę? Cóż, to wszystko co chciałem wiedzieć...', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_HauAb_GotoNewcamp_15_00', 'Wynoś się stąd...', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalom_15_00', 'Lares ma dla ciebie wiadomość.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalom_11_01', 'Czego chce?', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalom_15_02', 'Interesują go ostatnie wydarzenia w obozie Sekty. Mam ci przekazać, że to twoje zadanie.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalom_11_03', 'Mam wrażenie, że ten problem sam się wkrótce rozwiąże...', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_15_00', 'Lares powiedział, że mam ci pomóc w tej sprawie.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_11_01', 'Widzisz! Wiedziałem, że nie będę musiał sam się z tym męczyć!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_15_02', 'Chcesz żebym zajął się tym w pojedynkę?', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_11_03', 'Na pewno jakoś sobie poradzisz. Słuchaj: musisz koniecznie wywęszyć, co się kryje za tą całą historią z przywołaniem.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_11_04', 'Wiem, że te świry z sekty przygotowują się do wielkiego przywołania, i choć sam nie wierzę w Śniącego powiem ci jedno:', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_11_05', 'Guru dysponują potężną magią, dlatego tak uważnie musimy im patrzeć na palce. Nadążasz?', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_Precise_15_00', 'Nie masz dla mnie żadnych dokładniejszych wskazówek?', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_Precise_11_01', 'Porozmawiaj z Lesterem. Spędziłem kiedyś sporo czasu w obozie sekty, a on mi pomógł. Gość jest w porządku.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_DoIt_15_00', 'Zobaczę co się da zrobić.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_GotoKalomNOW_DoIt_11_01', 'Jak tylko dowiesz się czegoś o ich zamiarach, zgłoś się do mnie.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_15_00', 'Jeśli chodzi o tę sprawę z sektą...', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_11_01', 'Tak?', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_15_04', 'Odbyło się wielkie przywołanie.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_11_09', 'Niemożliwe! Chcesz powiedzieć, że brałeś w tym udział?', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_15_06', 'Bractwo zamierza wzmocnić swoje siły duchowe przy pomocy potężnego eliksiru wytwarzanego z jaj pełzaczy. Dzięki temu mają nadzieję nawiązać kontakt ze Śniącym.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_11_07', 'Banda idiotów! Te świry naprawdę wierzą w te brednie, co?', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_15_10', 'Jestem ciekaw co z tego wszystkiego wyjdzie.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_11_11', 'Ja też. Daj mi znać, gdy Guru zbłaźnią się już całkowicie.', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_15_02', 'Niczego się jeszcze nie dowiedziałem.', 1, 152, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_RUNNING_11_03', 'Więc bierz się do roboty!', 1, 152, 11, null, 826, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_Hello_15_00', 'Co słychać?', 1, 8, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_Hello_06_01', 'Nie najgorzej, ale nie mam już nic do palenia.', 1, 8, 6, null, 829, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_OfferJoint_15_00', 'Mam przy sobie trochę ziela - chcesz?', 1, 8, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_OfferJoint_06_01', 'Jasne! A ty co - handlarz z obozu sekty, czy jak?', 1, 8, 6, null, 829, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_OfferJoint_No_Joint_06_00', 'Hej, koleś! Nie próbuj mnie wykiwać! Bardzo tego nie lubię!', 1, 8, 6, null, 829, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_SpecialInfo_15_00', 'Jestem tu nowy. Masz może dla mnie jakieś wskazówki?', 1, 8, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_SpecialInfo_06_01', 'Jasne! Po dotarciu do Obozu idź do Gorna. Wprawdzie to jeden z najemników w służbie Magów, ale jest w porządku. Kiedyś był jednym z nas.', 1, 8, 6, null, 829, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_SpecialInfo_15_02', 'Co masz na myśli mówiąc "jednym z nas"?', 1, 8, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_SpecialInfo_06_03', 'No, Szkodnikiem, rzecz jasna. Postrachem Magnatów, ot co!', 1, 8, 6, null, 829, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_PERM_15_00', 'Czego mogę się spodziewać w Obozie?', 1, 8, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_829_PERM_06_01', 'Najlepiej idź i sam się przekonaj.', 1, 8, 6, null, 829, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_Hello_15_00', 'Cześć, jestem tu nowy.', 1, 101, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_Hello_13_01', 'I co z tego?', 1, 101, 13, null, 830, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_What_15_00', 'Co robisz?', 1, 101, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_What_13_01', 'A na co ci to wygląda? Palę!', 1, 101, 13, null, 830, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_What_13_02', 'Jeśli myślisz, że dam ci się zaciągnąć, to się grubo mylisz!', 1, 101, 13, null, 830, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_Aufhalten_15_00', 'Nie będziesz próbował mnie zatrzymać? Nie zapytasz czego tu szukam, albo coś w tym rodzaju?', 1, 101, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_Aufhalten_13_01', 'A po cholerę mam sobie zawracać głowę. Zresztą ktoś taki jak ty nie narobi raczej wielkich szkód.', 1, 101, 13, null, 830, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_Perm_15_00', 'Co słychać wewnątrz?', 1, 101, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_ORG_830_Perm_13_01', 'To co zwykle - ogólnie spokój, od czasu do czasu jakaś drobna burda.', 1, 101, 13, null, 830, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ORG_833_Buster_02_01', 'Wiesz co, poruszasz się tak jakoś sztywno. Mógłbym ci pomóc.', 1, 19, 2, null, 833, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ORG_833_Buster3_02_01', 'Mogę ci pokazać, jak należy balansować ciałem. Nauczę cię AKROBATYKI.', 1, 19, 2, null, 833, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ORG_833_Buster3_02_02', 'Po kilku lekcjach nauczysz się skakać na większe odległości.', 1, 19, 2, null, 833, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ORG_833_Buster3_02_03', 'Pokażę ci w jaki sposób można złagodzić efekt upadku z dużej wysokości. Tylko nie myśl sobie, że będziesz mógł skakać bóg wie skąd!', 1, 19, 2, null, 833, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_ORG_833_Buster3_02_04', 'Akrobatyka przyda ci się również w trakcie walki. Pokażę ci jak bardzo szybko zmniejszyć lub zwiększyć odległość dzielącą cię od przeciwnika. Powodzenia!', 1, 19, 2, null, 833, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_BringList_15_00', 'Mam tu listę z zamówieniami dla Starej Kopalni. ', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_BringList_10_01', 'Nieźle! Skąd ją wytrzasnąłeś?', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_BringList_15_02', 'Dostałem ją od Iana.', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_BringList_10_03', 'Masz tupet! Wysłali cię, żeby poddać cię próbie, tak? Założę się, że Thorusa trafia teraz jasny szlag!', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_BringList_15_04', 'To Diego zlecił mi to zadanie.', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_BringList_10_05', 'Diego wypełnia tylko rozkazy Thorusa. Jak go znam, pękłby ze śmiechu na wieść, że tu jesteś.', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_BringList_15_06', 'To jak - mogę wejść, czy nie?', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_BringList_10_07', 'Wchodź śmiało. Laresowi oczy wyjdą na wierzch!', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_Mordrag_15_00', 'Przysyła mnie Mordrag.', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_Mordrag_10_01', 'Mordrag już dawno tu nie zaglądał. Pewnie przeszedł na stronę Starego Obozu.', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_Mordrag_15_02', 'To on mnie do was przyprowadził.', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_Mordrag_10_03', 'Mordrag wrócił?! Jakbyś go jeszcze spotkał, powiedz mu, że Lares chce się z nim widzieć.', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_Mordrag_15_04', 'Mordrag dał mi coś dla Laresa.', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_Mordrag_10_05', 'Co takiego?', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_Mordrag_15_06', 'Pierścień.', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_Mordrag_10_07', 'Założę się, że bardzo cenny... Dobra, możesz się zobaczyć z szefem.', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_WannaJoin_15_00', 'Chciałbym do was dołączyć.', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_WannaJoin_10_01', 'Nie ty jeden, ale samo "chcenie" nie wystarczy. Musisz udowodnić, że będzie z ciebie jakiś pożytek.', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Roscoe_ComeAgain_10_00', 'Znowu ty.', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Roscoe_FirstWarn_Info_10_00', 'Dokąd się wybierasz?', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Roscoe_FirstWarn_Info_15_01', 'Chcę się zobaczyć z Laresem.', 1, 85, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Roscoe_FirstWarn_Info_10_02', 'Szef jest u siebie, ale trzeba mieć niezły powód, żeby mu przeszkodzić.', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Roscoe_LastWarn_10_00', 'Ogłuchłeś?', 1, 85, 10, null, 840, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Silas_Hehler_15_00', 'Jak leci?', 1, 80, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Silas_Hehler_06_01', 'Świetnie! Sprzedajemy tu naszą ryżówkę za parę bryłek rudy.', 1, 80, 6, null, 841, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Silas_Hehler_06_02', 'Da się z tego wyżyć. W końcu co innego mogą chłopcy zrobić z ciężko zarobioną rudą?', 1, 80, 6, null, 841, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Silas_Trade_15_00', 'Chcę się napić.', 1, 80, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Silas_Trade_06_01', 'Nie ma nic za darmo.', 1, 80, 6, null, 841, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrike_Hello_15_00', 'Co słychać?', 1, 60, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrike_Hello_07_01', 'Spadaj!', 1, 60, 7, null, 842, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrike_GetLost_15_00', 'Zejdź mi z oczu.', 1, 60, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrike_GetLost_07_01', 'Porozmawiamy innym razem!', 1, 60, 7, null, 842, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_843_Sharky_Fisk_Info_15_00', 'Fisk ze Starego Obozu szuka nowego partnera do interesów.', 1, 113, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_843_Sharky_Fisk_Info_10_01', 'A dlaczego mówisz o tym właśnie mi?', 1, 113, 10, null, 843, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_843_Sharky_Fisk_Info_15_02', 'Pomyślałem, że zainteresuje cię możliwość zarobienia paru bryłek rudy.', 1, 113, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_843_Sharky_Fisk_Info_10_03', 'Czemu nie... Powiedz Fiskowi, że może na mnie liczyć.', 1, 113, 10, null, 843, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_843_Sharky_TRADE_Info_15_01', 'Przydałoby mi się kilka drobiazgów.', 1, 113, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_843_Sharky_GREET_Info_15_01', 'Cześć, jak leci?', 1, 113, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_843_Sharky_GREET_Info_10_02', 'Chcesz coś kupić?', 1, 113, 10, null, 843, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Aidan_Hello_15_00', 'Co tu robisz?', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_846_Hello_07_01', 'Pracuję dla Ryżowego Księcia.', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Ricelord_Arbeit_15_00', 'A masz dla mnie jakieś zajęcie?', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Shrike_GetLost_07_01', 'Porozmawiamy innym razem!', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_First_07_00', 'Hej! Jesteś tu nowy, nie? Potrzebuję kogoś, kto zaniesie wodę naszym zbieraczom ryżu.', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_First_07_01', 'W ten sposób od razu poznasz kilku ludzi. Zainteresowany?', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_First_Yes_15_00', 'Jasne, chętnie wam pomogę.', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_First_Yes_07_01', 'Świetnie! Idź do Ryżowego Księcia. On da ci wodę i powie ci co należy zrobić.', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_First_Never_15_00', 'Sam sobie noś tę wodę.', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_First_Never_07_01', 'Tak się nie traktuje przyjaciół! Widzę, że muszę nauczyć cię dobrych manier!', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_First_Later_15_00', 'Może innym razem.', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_First_Later_07_01', 'Innym razem mogę cię już nie potrzebować. Zdecyduj się: chcesz mi pomóc czy nie?', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_WorkDay_07_00', 'Hej, ty!', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_WorkDay_NextChance_07_00', 'Masz ogromne szczęście! Postanowiłem dać ci drugą szansę.', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_WorkDay_NextChance_07_01', 'Ale tym razem postaraj się tego nie spartaczyć! Idź do Ryżowego Księcia, a potem roznieś wodę wszystkim zbieraczom, jasne?', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_WorkDay_StillRunning_07_00', 'Przecież kazałem ci roznieść wodę zbieraczom!', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_WorkDay_StillRunning_07_01', 'Nie lubię ludzi, którzy coś obiecują, a potem nie dotrzymują słowa!', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_WorkDay_SUCCESS_07_00', 'Dobra robota! Może będą z ciebie ludzie.', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_WorkDay_SUCCESS_07_01', 'Widzę, że jesteś wprost stworzony do tego zadania! Od tej pory będziesz to robił codziennie. Bierz się do roboty!', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_NeverAgain_15_00', 'Od tej pory możesz sam sobie biegać z tą wodą!', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_NeverAgain_07_01', 'Czyżby? A co - masz coś lepszego do roboty?', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_NeverAgain_07_02', 'Chyba muszę ci przypomnieć kto tu jest szefem!', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_PERM_15_00', 'Co słychać, przyjacielu?', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_PERM_07_01', 'Człowieku! Czego chcesz?!', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_PERM_AufsMaul_15_00', 'Miałem paskudny dzień, i mam ochotę rozładować część drzemiącej we mnie złości... Nie ruszaj się przez chwilkę!', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_PERM_Durstig_15_00', 'Zbieracze wyglądają na spragnionych.', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_PERM_Durstig_07_01', 'Zajmę się tym... Nie ma obawy.', 1, 30, 7, null, 844, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lefty_PERM_Nothing_15_00', 'Chciałem zobaczyć, co u ciebie słychać.', 1, 30, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_845_Hello_15_00', 'Co tu robisz?', 1, 69, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_845_Hello_13_01', 'Pracuję dla Ryżowego Księcia.', 1, 69, 13, null, 845, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_845_Hello_13_02', 'Jakbyś czegoś potrzebował, zapytaj Lewusa.', 1, 69, 13, null, 845, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_846_Hello_15_00', 'Co tu robisz?', 1, 86, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_846_Hello_07_01', 'Pracuję dla Ryżowego Księcia.', 1, 86, 7, null, 846, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_846_Hello_07_02', 'Jakbyś czegoś potrzebował, zapytaj Lewusa.', 1, 86, 7, null, 846, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Psst_05_00', 'Ciiii... Hej, ty!', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Psst_15_01', 'Co? Ja?', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Psst_05_02', 'Tak... Chodź no tutaj!', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Hello_15_00', 'Czego ode mnie chcesz?', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Hello_05_01', 'Jesteś tu nowy, co? Od razu zauważyłem.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Hello_05_02', 'Musisz się jeszcze wiele nauczyć. Mógłbym ci pokazać, co w trawie piszczy.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Hello_05_03', 'Przede wszystkim musisz uważać z kim rozmawiasz. Widzisz tego faceta, tam - przy ognisku? To Butch. Strzeż się go!', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_WarnsOfButch_15_00', 'A co z nim jest nie tak?', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_WarnsOfButch_05_01', 'Ma paskudny nawyk napadania nowoprzybyłych. Na twoim miejscu unikałbym go jak ognia.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_15_00', 'Czego możesz mnie nauczyć?', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_05_01', 'To zależy... A co chcesz wiedzieć?', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Schleichen_15_00', 'Chciałbym nauczyć się poruszać bezszelestnie.', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Schleichen_05_01', 'Grunt to zachować równowagę. Oprócz tego musisz nauczyć się kontrolować swój oddech.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Schleichen_05_02', 'Przyjmij odpowiednią postawę, a nikt nie usłyszy twoich kroków.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Lockpick_15_00', 'Chciałbym nauczyć się otwierać zamki.', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Lockpick_05_01', 'Nie wątpię! Cóż... Początki nie są zbyt trudne.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Lockpick_05_02', 'Przede wszystkim musisz uważać, żeby nie złamać wytrycha.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Lockpick_05_03', 'Musisz być bardzo cierpliwy. Wtedy nie będziesz potrzebował tylu wytrychów, he he!', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Lockpick2_15_00', 'Chciałbym zostać ekspertem w otwieraniu zamków.', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Lockpick2_05_01', 'Gdy nabierzesz już trochę doświadczenia, nauczysz się rozpoznawać dźwięk, jaki wydaje wytrych zanim pęknie.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Lockpick2_05_02', 'Myślę, że powinieneś sobie z tym poradzić. Wsłuchaj się uważnie w dźwięki jakie wydaje otwierany zamek, a nie będziesz potrzebował tylu wytrychów, he, he!', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Lockpick2_05_03', 'Prawdziwy mistrz w tym fachu potrafi otworzyć każdą skrzynię nie łamiąc ani jednego wytrycha.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_PICKPOCKET_15_00', 'Chciałbym zostać zręcznym kieszonkowcem!', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_PICKPOCKET_05_01', 'Chciałbyś odciążyć parę osób z ich dobytku, co? No dobra.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_PICKPOCKET_05_02', 'Pokażę ci na czym powinieneś się skoncentrować, ale szanse, że zostaniesz złapany będą nadal znaczne.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_PICKPOCKET_05_03', 'Podejmuj ryzyko wyłącznie jeśli w pobliżu ofiary nie ma osób trzecich.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_PICKPOCKET_05_04', 'Tylko prawdziwy mistrz potrafi ukraść coś pozostając całkowicie niezauważonym!', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_lehrer_Pickpocket_05_05', 'Nie ma o czym mówić! Nie będzie z ciebie złodzieja, dopóki nie nauczysz się skradać!', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Pickpocket2_15_00', 'Chciałbym zostać mistrzem kieszonkowców!', 1, 142, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Pickpocket2_05_01', 'Cóż, chyba rzeczywiście potrafisz już wystarczająco dużo, żeby opanować zaawansowane sztuczki.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Pickpocket2_05_02', 'Ale musisz pamiętać, że nawet mistrzowie złodziejscy od czasu do czasu zostają złapani.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wedge_Lehrer_Pickpocket2_05_03', 'Uważaj na siebie.', 1, 142, 5, null, 850, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Butch_Hello_15_00', 'Cześć. Kim jesteś?', 1, 67, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Butch_Hello_13_01', 'Nie twój interes! Nie podoba mi się twoja gęba!', 1, 67, 13, null, 851, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_Hello_15_00', 'Kim jesteś?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_Hello_09_01', 'Jestem płatnerzem. Mówią na mnie Wilk.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_GreetORG_09_00', 'Hej, teraz jesteś jednym z nas!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_855_Wolf_TRADE_15_00', 'Zajmujesz się czymś jeszcze?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_855_Wolf_TRADE_09_01', 'Skupuję skóry i futra od myśliwych. Gdybyś miał kiedyś taki towar na zbyciu - zgłoś się do mnie.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_855_Wolf_WhereHunter_15_00', 'Jak mogę zdobyć futra albo skóry?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_855_Wolf_WhereHunter_09_01', 'Przy drodze do Nowego Obozu kręci się Aidan. On może cię nauczyć, jak ściągać skórę ze zwierząt.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_855_Wolf_WhereHunter_09_02', 'Ratford i Drax polują zwykle na północ od Starego Obozu, na drodze do miejsca wymiany.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_15_00', 'Potrzebuję lepszej zbroi.', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_09_01', 'Teraz, kiedy jesteś jednym z nas, mogę ci jakąś sprzedać.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_WRONGGUILD_09_00', 'Nie mogę ci nic sprzedać. Lares zabiłby mnie, gdyby dowiedział się, że sprzedaję zbroje obcym.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_M_15_01', 'Potrzebuję wzmocnionego pancerza.', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_M_09_02', 'Nie ma rudy, nie ma zbroi.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_M_09_03', 'To solidny pancerz. Oczywiście nie tak dobry jak ten, który mam na sobie, ale zapewnia niezłą ochronę.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_H_15_01', 'Możesz mi sprzedać ciężki pancerz?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_H_09_02', 'Nie ma rudy, nie ma zbroi.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Wolf_SellArmor_H_09_03', 'Ta zbroja uchroni cię przed każdym zagrożeniem. Sam taką noszę, i jak dotąd nie zostałem nawet draśnięty. To bardzo solidny pancerz.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINOFFER_Info_15_01', 'Chciałbym nauczyć się strzelać z łuku.', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINOFFER_Info_09_02', 'Cóż, mógłbym cię nauczyć, ale to będzie kosztować. Ja też muszę jeść, no nie?', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINOFFER_Info_15_03', 'Ile?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINOFFER_Info_09_04', '50 bryłek, bez targowania.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAIN_Info_15_01', 'Naucz mnie strzelać z łuku.', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAIN_Info_09_02', 'Twoja celność zależy głównie od twojej zręczności. Im bardziej zwinnie będą twoje ruchy, tym pewniej twoje strzały będą trafiały w cel.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAIN_Info_09_03', 'Twoje umiejętności wpłyną na odległość z jakiej będziesz mógł skutecznie razić wrogów. Jeśli chcesz kiedyś zostać strzelcem wyborowym, musisz systematycznie rozwijać zarówno zręczność jak i umiejętności.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINAGAIN_Info_15_01', 'Chciałbym sprawniej posługiwać się łukiem.', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINAGAIN_Info_09_02', 'Jesteś już całkiem niezłym myśliwym. Teraz pora abyś poznał resztę najważniejszych informacji.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINAGAIN_Info_09_03', 'Dobry łucznik bierze pod uwagę wiele czynników zewnętrznych, ale robi to odruchowo, nieświadomie.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINAGAIN_Info_09_04', 'Odkryj tajniki funkcjonowania twojego oka, pamiętaj o sile naciągu i wyobrażaj sobie trajektorię lotu strzały, ale przede wszystkim - zawsze bądź czujny!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_TRAINAGAIN_Info_09_05', 'Opanowałeś już większość tajników strzelania z łuku. Teraz pozostało ci tylko rozwijać twoje umiejętności podczas polowania i walki.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_Teach_15_00', 'Możesz mnie czegoś nauczyć?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_855_Wolf_Teach_09_01', 'Powodzenie podczas polowania zależy przede wszystkim od twojej zręczności.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_GOOD_15_01', 'Gorn powiedział, że chcesz ze mną pilnie porozmawiać?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_GOOD_09_02', 'Dobrze, że zdążyłeś zajrzeć do mnie przed wymarszem!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_GOOD_15_03', 'Przed jakim wymarszem?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_GOOD_09_04', 'Przed waszym wymarszem do Niezupełnie-Wolnej-Kopalni.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SPEAK_15_01', 'O co chodzi?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SPEAK_09_02', 'Mam pomysł na zupełnie nowy rodzaj pancerza.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SPEAK_15_03', 'Czyżby? A cóż to za pomysł?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SPEAK_09_04', 'Pancerze pełzaczy są niezwykle twarde. Znacznie trwalsze niż choćby stal.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SPEAK_09_05', 'Oczywiście nie mam tu na myśli tych wychudzonych osobników, które nawiedzały zawaloną kopalnię Gomeza...', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SPEAK_09_06', '... O nie, one nie wystarczą. W NASZEJ kopalni żyją PRAWDZIWE PEŁZACZE. Większe, silniejsze i jeszcze bardziej wredne.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SPEAK_09_07', 'Pancerz tych bestii jest niemal nie do przebicia!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SPEAK_09_08', 'Gdybyś mógł mi przynieść kilka płytek z ich pancerzy, mógłbym z nich poskładać nie lada zbroję!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SKIN_15_01', 'W jaki sposób mam oddzielić te płytki od zwłok pełzaczy?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SKIN_09_02', 'To proste. Płytki na grzbiecie przymocowane są tylko przy krawędziach.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SKIN_09_03', 'Wystarczy wziąć ostry nóż i "ciąć wzdłuż przerywanej linii".', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_SKIN_15_04', 'W porządku. Postaram się przynieść ci kilka płytek z pancerzy pełzaczy.', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_PROFIT_15_01', 'I mówisz mi to wszystko nie żądając niczego w zamian?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_PROFIT_09_02', 'No niezupełnie... Jeśli uda mi się sklecić z tych płytek porządną zbroję, będę... bardzo szybko... bardzo dużo... Ach, nieważne!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_MCPLATESFEW_15_01', 'Przyniosłem ci kilka tych płytek, o które prosiłeś!', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_MCPLATESFEW_09_02', 'To za mało! Nie starczy na całą zbroję!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_MCPLATESFEW_09_03', 'Przynieś mi więcej płytek!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_MCPLATESENOUGH_15_01', 'Zebrałem mnóstwo płytek z pancerzy pełzaczy!', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_MCPLATESENOUGH_09_02', 'Fantastycznie! Natychmiast zabieram się do roboty!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_MCPLATESENOUGH_15_03', 'Jak długo to zajmie?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_MCPLATESENOUGH_09_04', 'Nie mam pojęcia. To coś zupełnie nowego. Jeszcze nigdy czegoś takiego nie robiłem!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_MCPLATESENOUGH_09_05', 'Będziesz musiał zaglądać do mnie od czasu do czasu.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORINWORK_15_01', 'Jak postępują prace nad nowym pancerzem?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORINWORK_09_02', 'To zajmie dłużej niż myślałem! Te płytki są niezwykle twarde. Nie bardzo wiem jak mam je ze sobą połączyć!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORINWORK_09_03', 'Daj mi jeszcze trochę czasu! Dam radę, zaufaj mi!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORFINISHED_15_01', 'Jak postępują prace nad nowym pancerzem?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORFINISHED_09_02', 'Udało mi się wreszcie znaleźć sposób na połączenie płytek ze sobą!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORFINISHED_15_03', 'Czy to znaczy, że zbroja jest już gotowa!', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORFINISHED_09_04', 'Dokładnie! Oto i ona! Jest twardsza niż jakikolwiek pancerz jaki widziałem na oczy!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORFINISHED_15_05', 'Dzięki, jestem twoim dłużnikiem!', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Wolf_ARMORFINISHED_09_06', 'Nie ma o czym mówić! Na pewno na tym nie stracę! Co to, to nie! Ha Ha!', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_855_Wolf_SELLBOW_Info_15_01', 'Gdzie mogę kupić jakiś łuk?', 1, 122, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_855_Wolf_SELLBOW_Info_09_02', 'Trafiłeś pod właściwy adres. Mam tu dobry towar za bardzo przystępne ceny.', 1, 122, 9, null, 855, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Aidan_Hello_15_00', 'Co tu robisz?', 1, 4, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Aidan_Hello_13_01', 'Jestem myśliwym. Utrzymuję się ze sprzedaży skór i kłów zabitych zwierząt.', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Aidan_Hello_15_02', 'Da się z tego wyżyć?', 1, 4, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Aidan_Hello_13_03', 'Jeśli potrafi się zręcznie oporządzać zwierzynę - tak, i to całkiem nieźle!', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_15_00', 'Chciałbym się nauczyć oprawiać zwierzynę.', 1, 4, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_13_01', 'A co chcesz wiedzieć?', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_TaughtAll_13_00', 'Nauczyłem cię już wszystkiego co sam wiem.', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Zahn_15_00', 'Jak mogę zdobyć kły upolowanej zwierzyny?', 1, 4, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Zahn_13_01', 'Przede wszystkim musisz uważać, żeby kły nie popękały podczas wyciągania. W tym celu wbij nóż w pobliżu środka zęba i delikatnie go podważaj.', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Zahn_13_02', 'Warto zabierać kły wilków, cieniostworów i zębaczy', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_KEINE_LP_13_00', '', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_KEIN_ERZ_13_00', '', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Fell_15_00', 'Jak mogę zdobyć skóry upolowanej zwierzyny?', 1, 4, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Fell_13_01', 'Zaczynaj skórowanie od zadu, przesuwając się stopniowo ku głowie. Spróbuj kilka razy. To nie jest takie trudne, a futra potrafią być bardzo cenne!', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Fell_13_02', 'Futra wilków i cieniostworów można wykorzystać do szycia odzieży. Badając futro zabitego zwierza łatwo ocenisz, czy nadaje się do dalszego wykorzystania.', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_KEINE_LP_13_00', '', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_KEIN_ERZ_13_00', '', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Kralle_15_00', 'Pokaż mi jak zdobyć pazury upolowanej zwierzyny.', 1, 4, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Kralle_13_01', 'Prawdę mówiąc to dziecinnie proste, trzeba tylko znać odpowiednią metodę. Wygnij pazury do przodu - nigdy do tyłu! I pod żadnym pozorem nie próbuj ich wyciągać!', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Kralle_13_02', 'Najlepiej pozyskiwać pazury jaszczurów. Od tej pory będziesz wiedział, które zwierzęta dostarczają dobrych pazurów.', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_KEINE_LP_13_00', '', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_KEIN_ERZ_13_00', '', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Haut_15_00', 'Na co powinienem zwracać uwagę zdzierając skórę z gadów?', 1, 4, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Haut_13_01', 'Skóry topielców i bagiennych węży są szczególnie cenne.', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_Haut_13_02', 'Jeśli przetniesz skórę na bokach, powinna sama odejść od mięsa. Myślę, że od tej pory poradzisz już sobie ze skórowaniem gadów.', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_KEINE_LP_13_00', '', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_859_Aidan_Creatures_KEIN_ERZ_13_00', '', 1, 4, 13, null, 859, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_860_Renyu_GetLost_Info_06_00', 'Spadaj!', 1, 71, 6, null, 860, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_861_Killian_GetLost_Info_13_00', 'Spadaj!', 1, 131, 13, null, 861, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GoAway_Info_06_00', 'Czego tu do cholery szukasz?', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Info_06_00', 'Czyżbyśmy pobłądzili, hę?', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Info_15_01', 'Cor Kalom wie o waszym małym przedsięwzięciu.', 1, 133, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Info_06_02', 'Co? Dlaczego tu jesteś?', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Templer_Info_15_00', 'Jestem tu, żeby was ostrzec. Cor Kalom wysłał pięciu Strażników Świątynnych, którzy mają was wykończyć.', 1, 133, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Templer_Info_06_01', 'Że jak? Chyba żartujesz!', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Templer_Info_15_02', 'Mogą tu być w każdej chwili!', 1, 133, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Templer_Info_06_03', 'Niech to szlag! Musimy stąd wiać!', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_InfoWert_Info_15_00', 'Chcę wiedzieć ile ta informacja jest dla ciebie warta.', 1, 133, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_InfoWert_Info_06_01', 'Ach, więc o to ci chodzi... No dobrze. Ty zrobisz coś dla mnie - ja zrobię coś dla ciebie. Proszę, to cała ruda jaką mam przy sobie.', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_InfoWert_Info_06_02', 'Musimy już iść! Tobie zresztą też to radzę!', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Angriff_Info_15_00', 'Aby położyć kres całej tej sprawie!', 1, 133, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_GUARD_Angriff_Info_06_01', 'Chłopaki! Chodźcie no tu na chwilę!', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_Banditencamp_15_00', 'A więc to tutaj się zaszyliście.', 1, 133, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('ORG_862_Jacko_Banditencamp_06_01', 'Był blisko. Strażnicy z Sekty posiekaliby nas na dzwona.', 1, 133, 6, null, 862, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_Hello_15_00', 'Co słychać?', 1, 73, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_Hello_12_01', 'Nasypaliśmy trochę piasku w machinę Gomeza.', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_Hello_12_02', 'Trzech zabitych strażników i mnóstwo towaru na sprzedaż. Trzeba to opić!', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_Hello_15_03', 'Jesteś jednym z ludzi, którzy bez przerwy napadają Stary Obóz?', 1, 73, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_Hello_12_04', 'Nie. Napadamy go tylko wtedy, kiedy się to opłaca.', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_Fisk_15_00', 'Fisk ze Starego Obozu szuka nowego partnera do interesów.', 1, 73, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_Fisk_12_01', 'Nie jestem zainteresowany.', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_Fisk_12_02', 'Ale powinieneś porozmawiać z Sharkym. Może on na to pójdzie.', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_FromBalor_15_00', 'Co masz do zaoferowania?', 1, 73, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_FromBalor_12_01', 'Nie, nie! Pytanie brzmi: co TY masz do zaoferowania! Interesują mnie wyłącznie poważne dostawy.', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_FromBalor_15_02', 'Balor powiedział mi, że interesuje cię bagienne ziele.', 1, 73, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_FromBalor_12_03', 'Mhm. Masz coś na sprzedaż?', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_FromBalor_15_04', 'Niestety nie.', 1, 73, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_FromBalor_12_05', 'Więc wróć do mnie, jak będziesz miał coś co mnie zainteresuje.', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_TRADE_15_00', 'Dobijmy targu.', 1, 73, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cipher_TRADE_12_01', 'Czego chcesz?', 1, 73, 12, null, 873, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_875_PERM_15_00', 'Wpuszczacie tu tylko Szkodniki i Krety?', 1, 11, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_875_PERM_13_01', 'Nie mamy też nic do Braci z Sekty.', 1, 11, 13, null, 875, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_875_PERM_13_02', 'Ale poza nimi nie wpuszczamy tu nikogo.', 1, 11, 13, null, 875, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_AmSfb_15_00', 'Jestem Kretem, i chcę się napić!', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_AmSfb_06_01', 'Rzeczywiście, wyglądasz mi na jednego z tych brudnych szczurów. Właź!', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_AmSfb_NOSFB_06_00', 'Nie wyglądasz mi na Kreta. Tak łatwo się tu nie dostaniesz, chłopcze.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_15_00', 'Może parę bryłek rudy załatwi sprawę?', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_06_01', 'Parę, to znaczy ile?', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_10Erz_15_00', 'Mam przy sobie 10 bryłek - oto one.', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_10Erz_06_01', 'Za 10 bryłek mogę nie obić ci buzi i pozwolić jeszcze raz spróbować mnie przekupić.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_10Erz_06_02', 'Gdzie? Nie widzę żadnych 10 bryłek!', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_50Erz_15_00', 'Co byś powiedział na 50 bryłek?', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_50Erz_06_01', 'To jakaś połowa tego, co w tych stronach nazywamy "paroma bryłkami"!', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_50Erz_06_02', 'Niby gdzie? Nie widzę żadnych 50 bryłek.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_100Erz_15_00', '100 bryłek powinno wystarczyć?', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_100Erz_06_01', 'Święte słowa - możesz wejść.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_Bribe_100Erz_06_02', 'To fakt, ale obawiam się, że nie masz tyle przy sobie.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_PERM_15_00', 'Jak tam sprzedaż ryżówki?', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_PERM_06_01', 'Pogadaj z Silasem. MY nie narzekamy.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_ScSld_06_00', 'Stój! Znasz zasady - tylko Krety i Szkodniki!', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_ScSld_15_01', 'A co, spróbujesz mnie powstrzymać?', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_ScSld_06_02', 'Nie... Wchodź...', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_ScSekte_06_00', 'Zwykle wpuszczamy tu tylko naszych ludzi, ale nie mamy nic przeciwko odwiedzinom członków Bractwa.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_ScSekte_06_01', 'Zwłaszcza, jeśli mają przy sobie coś do palenia.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_GibKraut_15_00', 'Coś się pewnie znajdzie. Proszę, to dla ciebie.', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_GibKraut_06_01', 'Zawsze jesteś mile widzianym gościem.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_GibKraut_KEIN_15_00', 'Cholera, czekaj. Chyba jednak nie mam nic przy sobie.', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Org_876_GibKraut_KEIN_06_00', 'Trudno. Pamiętaj o mnie następnym razem.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_876_FirstWarn_Info_06_00', 'A dokąd to się wybieramy?', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_876_FirstWarn_Info_15_01', 'Noo... Do środka?', 1, 76, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_876_FirstWarn_Info_06_02', 'Nie żartuj. Silas wpuszcza do siebie tylko Krety i Szkodniki.', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Org_876_LastWarn_06_00', 'Ogłuchłeś, czy co?!', 1, 76, 6, null, 876, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Erpresser_Info_13_01', 'Hej, chłopcze! Jeśli chcesz wejść do środka, będziesz musiał zapłacić 10 bryłek, kapujesz?', 1, 9, 13, null, 888, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Erpresser_Choice_AufsMaul_15_01', 'To dlaczego nie przyjdziesz tutaj i ich sobie nie weźmiesz!', 1, 9, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Erpresser_Choice_AufsMaul_13_02', 'Dzięki, stary. Właśnie zaczynałem się nudzić.', 1, 9, 13, null, 888, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Erpresser_Choice_Zahlen_15_01', 'Proszę, oto 10 bryłek.', 1, 9, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Erpresser_Choice_Zahlen_13_02', 'Jaka szkoda.', 1, 9, 13, null, 888, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Erpresser_Choice_Zahlen_15_03', 'Ummm... Nie mam przy sobie 10 bryłek.', 1, 9, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Erpresser_Choice_Zahlen_13_04', 'Wielka szkoda...', 1, 9, 13, null, 888, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BereitsErpresst_Info_13_02', 'Zapłaciłeś - możesz przejść. Właź, zanim się rozmyślę.', 1, 9, 13, null, 888, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_BereitsAufsMaul_Info_13_02', 'Spadaj zanim zetrę ten głupi uśmiech z twojej gęby!', 1, 9, 13, null, 888, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_EXIT_09_01', 'Do boju!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_EXIT_09_02', 'Do zobaczenia.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_First_09_00', 'Hej, Nowa twarz.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_First_15_01', 'Kim jesteś?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_First_09_02', 'Nazywam się Gorn. Jestem najemnikiem w służbie magów.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Leben_15_00', 'Czym się zajmują Najemnicy?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Leben_09_01', 'Lee zawarł z Magami umowę. Zatrudnia najlepszych wojowników z całej kolonii - czyli nas.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Leben_09_02', 'Pilnujemy, żeby nikt nie przeszkadzał Kretom w pracy i dbamy o bezpieczeństwo Magów.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Leben_09_03', 'Magowie natomiast przygotowują plan, który pozwoli się nam stąd wyrwać. Jako wynagrodzenie otrzymujemy trochę rudy.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Hut_15_00', 'Czy w Obozie są jeszcze wolne miejsca, czy będę musiał wykopać kogoś z jego chaty?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Hut_09_01', 'Chyba będziesz musiał. Jeśli naprawdę chcesz to zrobić, zacznij od Krzykacza.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Hut_09_02', 'Złapał dla siebie chatę przy samym wejściu do jaskini. Była pusta, ale tak naprawdę należała do nas.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Hut_15_03', 'Nas?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Hut_09_04', 'No nas, Najemników. Najemnicy i Szkodniki starają się nie włazić sobie w drogę. Ludzie Laresa nie mają wstępu do tej części obozu.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_Hut_09_05', 'W sumie to drobiazg, ale sukinsyn nie zapytał nawet o pozwolenie. Tym Szkodnikom nie można pozwolić na zbyt wiele, bo zrobią się nie do wytrzymania.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_HutFree_15_00', 'Krzykacz przeniósł się już do innej chaty.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_HutFree_09_01', 'Świetnie! Przed chwilą Torlof powiedział, że zamierza pokazać temu chłoptasiowi, gdzie jest jego miejsce.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_BecomeSLD_15_00', 'Co mam zrobić, żeby zostać członkiem Nowego Obozu?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_BecomeSLD_09_01', 'Musisz trochę popracować nad swoimi umiejętnościami bojowymi, zanim Lee zgodzi się cię przyjąć. Nieważne w jakiej broni się specjalizujesz, byleś był w tym dobry.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_BecomeSLD_09_02', 'Oprócz tego powinieneś mieć chociaż ogólne pojęcie o życiu w kolonii, układach między obozami, i takie tam...', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_BecomeSLD_09_03', 'Jeśli nie interesują cię inne obozy, spróbuj na początek dołączyć do Szkodników. Na zostanie Najemnikiem jeszcze przyjdzie czas.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_TRADE_15_00', 'Masz więcej tego towaru?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_TRADE_09_01', 'Całe mnóstwo. Chcesz kupić?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_DuHehler_15_00', 'Jak to możliwe, że wziąłeś udział w jednym z napadów zorganizowanych przez tę bandę?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_DuHehler_09_01', 'A kto twierdzi, że wziąłem?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_DuHehler_15_02', 'Skąd mógłbyś wziąć taką ilość towaru, gdybyś nie uczestniczył w napadzie.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_DuHehler_09_03', 'Naprawdę myślisz, że taką ilość towaru można zebrać po JEDNYM głupim napadzie?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_DuHehler_15_04', 'To znaczy, że uczestniczysz w nich regularnie?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_DuHehler_09_05', 'Nawet gdyby tak było, nie mógł bym ci o tym powiedzieć. Lee dałby mi zdrowo popalić.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gorn_DuHehler_15_06', 'Rozumiem.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_NCWAIT_09_01', 'Ach, to ty! Mój przyjaciel z obozu na bagnie, Lester, doniósł mi o twoich dokonaniach.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_NCWAIT_09_02', 'Jak na kogoś, kto jest tu od niedawna, zaszedłeś całkiem daleko.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_NCWAIT_15_03', 'Parę razy zaszedłem nawet na skraj własnego grobu.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_MAGES_15_01', 'Mam ważną wiadomość dla Magów Wody!', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_MAGES_09_02', 'W takim razie powinieneś zgłosić się do Saturasa. To najwyższy z Magów Wody. Jak go znam, siedzi teraz nad jakąś magiczną księgą albo czymś w tym stylu.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_MAGES_09_03', 'Ale niezależnie od tego jak ważne są wieści, które przynosisz, strażnicy z górnego poziomu nie pozwolą ci się z nim zobaczyć.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_MAGES_15_04', 'A nie mógłbyś się za mną wstawić?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_MAGES_09_05', 'Ja nie, ale Cronos, strażnik rudy może udzielić ci pozwolenia na spotkanie z Saturasem.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_CRONOS_15_01', 'Gdzie znajdę tego "strażnika rudy"?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_CRONOS_09_01a', 'Idąc stąd trafisz na wielką jaskinię mieszkalną, niedaleko tamy.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_CRONOS_09_02', 'Cronos przebywa zwykle obok kraty broniącej dostępu do kopca rudy.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_CRONOS_09_03', 'Ale to nieco arogancki człowiek. Będziesz musiał go jakoś przekonać, że twoja wiadomość jest naprawdę ważna.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWAIT_09_01', 'Cześć, żółtodziobie. Jak widzisz kolonia to bardzo małe miejsce.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWAIT_09_02', 'Cały czas wpada się na tych samych ludzi.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWHAT_15_01', 'Co tu robisz?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWHAT_09_02', 'Och, podążam śladem pewnej prastarej legendy.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWHAT_15_03', 'Legendy?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWHAT_09_04', 'Tak, Milten - mój kumpel ze Starego Obozu, powiedział mi, że kiedyś ten teren zamieszkiwali mnisi.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWHAT_09_05', 'Oczywiście to było na długo przed powstaniem Bariery.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWHAT_09_06', 'Ponoć czczono tutaj bóstwo, które pozwalało mnichom przybierać postać zwierząt.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWHAT_09_07', 'Założę się, że są tu jeszcze jakieś skarby pozostałe po dawnych czasach.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWHAT_09_08', 'A co ciebie tu sprowadza?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINFOCUS_15_01', 'Szukam magicznego kamienia ogniskującego.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINFOCUS_15_02', 'Powinien być gdzieś w okolicy.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINFOCUS_09_03', 'Przedmiot, którego szukasz może znajdować się na terenie starego klasztoru, za tym kanionem.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINJOIN_15_01', 'Moglibyśmy wybrać się tam razem.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINJOIN_09_02', 'Dobry pomysł. Cała okolica aż roi się od zębaczy.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINJOIN_09_03', 'W pojedynkę nie powinny stwarzać kłopotu wytrawnemu myśliwemu, ale te bestie zwykle polują całymi stadami.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINJOIN_09_04', 'A grupa zębaczy potrafi rozerwać na strzępy nawet bardzo doświadczonego wojownika.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINJOIN_15_05', 'Zatem pójdziemy tam razem?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINJOIN_09_06', 'Dobra, ale zanim przejdziemy po tym pniu, chciałbym przyjrzeć się uważniej temu kanionowi. Lubię wiedzieć, co mam za plecami.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINJOIN_09_07', 'Chodź za mną. Odkryłem ścieżkę, która nas tam zaprowadzi.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINABYSS_09_01', 'To się nazywa szczęście! Najwyraźniej ta jaskinia była wykorzystywana jako składowisko.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINABYSS_09_02', 'Możesz teraz prowadzić do klasztoru. Chciałem mieć pewność, że nie spotkają nas jakieś paskudne niespodzianki w drodze powrotnej.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINLEAVE_09_01', 'Widzę, że ten stary klasztor przestał cię już interesować.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINLEAVE_09_02', 'Zatem dalej pójdę sam.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINLEAVE_09_03', 'Gdybyś zmienił zdanie, możesz mnie dogonić.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWALL_09_01', 'Cholerna brama. Ponoć nikomu jeszcze nie udało się jej otworzyć.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWALL_09_02', 'Te bestyjki pod drugiej stronie są pewnie jedynymi istotami, którym udało się dostać do środka.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWALLWHAT_15_01', 'I co teraz?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWALLWHAT_09_02', 'Musisz znaleźć jakiś sposób na przedostanie się na drugą stronę bramy.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINLEDGE_09_01', 'Na górze jest chyba jakaś platforma. Ale wątpię, żeby udało się nam wspiąć tak wysoko.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINLEDGE_09_02', 'Musimy znaleźć inną drogę.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINPLATFORM_09_01', 'To mi wygląda na jakiś piedestał.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINPLATFORM_09_02', 'Może leżał tu kiedyś artefakt, którego szukasz.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINGATE_09_01', 'Widzę, że udało ci się otworzyć tę bramę. To zaklęcie, którego użyłeś było całkiem sprytne.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINGATE_15_02', 'No, możemy iść dalej.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINLEAVEINSIDE_09_01', 'Widzę, że ten stary klasztor przestał cię już interesować.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINLEAVEINSIDE_09_02', 'Dalej pójdę sam.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINLEAVEINSIDE_09_03', 'Gdybyś zmienił zdanie, możesz mnie dogonić.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINSUCCESS_09_01', 'A więc znalazłeś swój magiczny artefakt!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINSUCCESS_15_02', 'Tak. Muszę zanieść ten kamień ogniskujący do Magów Wody. ', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINSUCCESS_09_03', 'Pójdę kawałek z tobą.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINTROLL_09_01', 'O JASNA CHOLERA! A co to za monstrum?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINTROLL_15_02', 'Skąd się tu wzięło coś takiego?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINTROLL_09_03', 'To mi wygląda na jednego z tych niezniszczalnych Trolli, ale jest trochę mniejsze.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINTROLL_09_04', 'Trudno, jeśli chcemy się stąd wydostać, musimy go jakoś minąć.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINVICTORY_09_01', 'Nie było łatwo!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINVICTORY_15_02', 'Tak, ale w końcu się nam udało! To chyba był jakiś młody Troll.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINVICTORY_09_03', '... Więc pewnie nie chciałbyś wpaść na jego rodziców, co?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINVICTORY_15_04', 'Raczej nie!', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINVICTORY_09_05', 'Tutaj nasze drogi się rozchodzą. Chcę tu trochę zostać i rozejrzeć się po okolicy.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINVICTORY_09_06', 'Ale na pewno jeszcze się spotkamy. Do zobaczenia, przyjacielu.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_DIEGOMILTEN_15_01', 'Spotkałem Diego i Miltena przed Starym Obozem!', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_DIEGOMILTEN_09_02', 'To dobra wiadomość!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_DIEGOMILTEN_15_03', 'Mają się spotkać z tobą i z Lesterem w zwykłym miejscu.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_DIEGOMILTEN_09_04', 'Dzięki. W dzisiejszych czasach nie ma nic cenniejszego niż kilku oddanych przyjaciół.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_DIEGOMILTEN_09_05', 'Jesteś już prawie jednym z nas. Udowodniłeś, że można na tobie polegać!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FREEMINE_15_01', 'Co zobaczyłeś w Wolnej Kopalni?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FREEMINE_09_02', 'Po powrocie ze starego klasztoru chciałem złożyć wizytę Okylowi, szefowi Wolnej Kopalni.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FREEMINE_09_03', 'Ale gdy dotarłem na miejsce, zastałem tylko stygnące ciała.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FREEMINE_09_04', 'Dostrzegłem kilku Strażników okopujących się przy wejściu do kopalni.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FREEMINE_15_05', 'Jak to możliwe, że duży oddział Najemników uległ garstce Strażników?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FREEMINE_09_06', 'To musiała być jakaś zasadzka. W końcu kto mógłby się spodziewać ataku od strony gór?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FREEMINE_09_07', 'Element zaskoczenia może zwielokrotnić zdolności bojowe oddziału.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNC_15_01', 'Co zamierzasz robić dalej?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNC_09_02', 'Musimy zmienić całą naszą strategię obrony. To trochę potrwa.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNC_09_03', 'Dopóki Lee nie zdoła przeorganizować swoich oddziałów, dołączę do prowizorycznej straży Corda.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNC_15_04', 'Przygotowujecie się do kontrataku?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNC_09_05', 'Jeszcze nie, ale wkrótce na pewno to zrobimy.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNC_09_06', 'Gdybyś mnie kiedyś potrzebował, zacznij tutaj i idź w stronę kopalni. Będę tam stał na straży.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNCRUNNING_15_01', 'Jak leci?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNCRUNNING_09_02', 'Na razie cicho. W Wolnej Kopalni nic się nie rusza.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_GUARDNCRUNNING_09_03', 'Lee zajmuje się jeszcze organizacją naszej obrony!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_POST_09_01', 'Przybywasz w samą porę! Przygotowujemy się do kontruderzenia.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_POST_09_02', 'Na początek spróbujemy odbić Wolną Kopalnię.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_15_01', 'Zamierzacie ją zdobyć we czterech? A gdzie są wszyscy Najemnicy?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_02', 'Uderzenie od frontu nie ma szans powodzenia. Ludzie Gomeza za dobrze się okopali.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_03', 'Spróbujemy zaatakować po cichu, zabijając jednego strażnika po drugim. Może się uda...', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_04', 'Lee kazał mi przekazać ci wiadomość.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_05', 'Jako jeden z naszych najlepszych Najemników zostałeś wyznaczony do udziału w tej misji.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_06', 'Jako Mag z Kręgu Wody i doświadczony wojownik, zostałeś wybrany do udziału w tej misji.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_07', 'Jako jeden z naszych najlepszych Szkodników zostałeś wybrany do udziału w tej misji.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_08', 'Choć nie jesteś jednym z nas, wielokrotnie oddałeś nam nieocenione przysługi.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_09', 'Dlatego chcemy cię prosić o udział w tej misji.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_TAKEBACK_09_10', 'Pójdę z tobą. Razem może się nam udać.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_SECOND_15_01', 'Na początek? A co zamierzacie robić później?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_SECOND_09_02', 'Jak tylko odbijemy kopalnię, spróbujemy odnaleźć ścieżkę, którą przyszli ludzie Gomeza!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_SECOND_09_03', 'Kiedy ustawimy przy niej straż, będziemy bezpieczni.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_SECOND_15_04', 'Rozumiem.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WHYME_15_01', 'Dlaczego właśnie ja?!', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WHYME_09_02', 'Wielokrotnie udowodniłeś, że jesteś silnym i przebiegłym wojownikiem!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WHYME_09_03', 'Poza tym znasz Stary Obóz i jego strażników lepiej niż ktokolwiek z nas.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WHYME_09_04', 'Trudno o kogoś lepszego niż ty!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_KICKBUTT_15_01', 'No dobrze, chodźmy. Nauczymy tych nieproszonych gości dobrych manier.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_KICKBUTT_09_02', 'Wiedziałem, że można na ciebie liczyć.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_KICKBUTT_09_03', 'Weź ten klucz. Otwiera stróżówkę przy wejściu do kopalni.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_MYWAY_15_01', 'Czemu nie. I tak muszę dostać się do kopalni!', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_MYWAY_09_02', 'Nieważne DLACZEGO to robisz. Cieszę się, że jesteś z nami!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_MYWAY_09_03', 'Weź ten klucz. Otwiera stróżówkę przy wejściu do kopalni.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WOLF_09_01', 'Ach, prawie zapomniałem!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WOLF_09_02', 'Wilk chce z tobą koniecznie porozmawiać, zanim ruszymy do kopalni.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WOLF_15_04', 'To może zaczekać, mamy teraz ważniejsze sprawy na głowie.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WOLF_09_05', 'Jak chcesz!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WOLF_15_06', 'Więc lepiej do niego zajrzę.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_WOLF_09_07', 'W porządku. Zaczekam na ciebie tutaj.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_LEAVEFORPOST_09_01', 'Widzę, że jednak nie chcesz porozmawiać z Wilkiem!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_LEAVEFORPOST_09_02', 'Idziesz w złą stronę! Mamy iść prosto do kopalni!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_LEAVEFORPOST_09_03', 'Zaczekam na ciebie przy prowizorycznym punkcie strażniczym!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_REJOINFORFM_15_01', 'Ruszamy do kopalni!', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_REJOINFORFM_09_02', 'Pora przepędzić stamtąd ludzi Gomeza!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_REJOINFORFM_09_03', 'Idź przodem. Pójdę za tobą.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RAZOR_09_01', 'UWAGA! BRZYTWY!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RAZOR_09_02', 'Polują w stadach, jak zębacze, tylko gryzą znacznie mocniej!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RAZOR_09_03', 'Powinniśmy się najpierw z nimi rozprawić. Znasz mnie - lubię wiedzieć, co mam za plecami.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMCENTRANCE_09_01', 'Zaczekaj! Widzisz te wszystkie ciała?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMCENTRANCE_09_02', 'Idź do wejścia do kopalni. Ja zaczekam tutaj i przypilnuję, żeby ktoś lub coś nie zaszło nas od tyłu.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMCENTRANCE_09_03', 'Kiedy już zejdziesz na dół, pójdę za tobą.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMGATE_09_01', 'Usłyszałem odgłosy walki i przybiegłem najszybciej jak mogłem!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMGATE_15_02', 'Stary znajomy... Rachunek wyrównany.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMGATE_09_03', 'Dobra, otwieraj bramę. Je będę tu stał na straży!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_AFTERFM_09_01', 'Stary, to się dopiero nazywa trudna walka!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_AFTERFM_09_02', 'Nie spodziewałem się, że Strażnicy Gomeza będą stawiali tak zaciekły opór.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_AFTERFM_15_03', 'Grunt, że kopalnia znowu jest w naszych rękach.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_AFTERFM_09_04', 'Zostanę tutaj i dopilnuję, żeby tak już zostało!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMWATCH_15_01', 'Co słychać?', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMWATCH_09_02', 'Na razie cicho. W Wolnej Kopalni nic się nie rusza.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMWATCH_09_03', 'Lee powinien niedługo podesłać tu posiłki.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FMWATCH_09_04', 'Póki co postaram się tutaj rozgościć.', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FOUNDULUMULU_09_01', 'Masz przy sobie ciekawą ozdóbkę. Orkowa, prawda?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FOUNDULUMULU_09_02', 'To od tego niewolnika z kopalni?', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FOUNDULUMULU_15_03', 'To orkowy symbol przyjaźni. Przy jego pomocy zamierzam dostać się do miasta Orków.', 1, 183, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_FOUNDULUMULU_09_04', 'Oby tylko Orkowie uszanowali to... COŚ!', 1, 183, 9, null, 3, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GornFM_EXIT_09_01', 'Do boju!', 1, 107, 9, null, 5, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GornFM_EXIT_09_02', 'Do zobaczenia.', 1, 107, 9, null, 5, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GornFM_WAIT_15_01', 'Utrzymuj pozycję! Spróbuję się trochę rozejrzeć!', 1, 107, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GornFM_WAIT_09_02', 'Dobra. Zaczekam przy wejściu do kopalni i postaram się, żeby nikt nie zaszedł nas od tyłu!', 1, 107, 9, null, 5, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GornFM_FOLLOW_15_01', 'Chodź ze mną, potrzebuję twojej pomocy.', 1, 107, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GornFM_FOLLOW_09_02', 'Nareszcie coś się dzieje! Idź przodem, pójdę za tobą.', 1, 107, 9, null, 5, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_EXIT_02_00', 'Ruszamy w drogę.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_EXIT_02_01', 'Do zobaczenia.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_First_02_00', 'Nie wolno ci przekroczyć progu tego domu bez pozwolenia Mistrza Corristo.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Hello_15_00', 'Szukam Arcymistrza Kręgu Ognia.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Hello_02_01', 'Chodzi ci o Corristo? Czego od niego chcesz?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Hello_15_00', 'Szukam Arcymistrza Kręgu Ognia.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Hello_02_01', 'Chodzi ci o Corristo? Czego od niego chcesz?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_15_00', 'Mam list dla Arcymistrza.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_02_03', 'Pokaż to pismo.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_Give_15_00', 'Oto i ono.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('GUR_1200_Yberion_EARN_Info_15_01', 'Chyba należy mi się jakaś nagroda?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSEAL_02_05', 'To już nie będzie potrzebne.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_GotoCorristo_02_01', 'Słyszeliśmy o twoich dokonaniach w Starej Kopalni. Nasi górnicy nie muszą się już obawiać ataków ze strony pełzaczy.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_GotoCorristo_02_02', 'Wieści o tobie dotarły nawet do Corristo. Mistrz życzy sobie z tobą rozmawiać. Idź do niego natychmiast.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_15_00', 'Mam list dla Arcymistrza.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_02_01', 'Jesteś posłańcem z zewnętrznego świata?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_15_02', 'Tak. Jakiś mag dał mi to pismo zanim zrzucono mnie na dół.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_02_03', 'Pokaż to pismo.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_Give_15_00', 'Oto i ono.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_Give_02_03', 'Ależ ten list zaadresowano do Xardasa!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_Give_15_04', 'Co w tym takiego niezwykłego?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_Give_02_05', 'Xardas już od dawna nie jest sługą Innosa. Opuścił nas wiele lat temu i zwrócił się w stronę czarnej magii.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_Give_02_06', 'Mieszka w wieży, w samym środku terytorium Orków. Chyba całkowicie poświęcił się swoim badaniom.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_Give_02_07', 'Xardas próbuje na własną rękę dowiedzieć się co poszło nie tak przy tworzeniu Bariery.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_Give_02_08', 'Zaczekaj tu na mnie. Niedługo wrócę.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_NO_15_00', 'Najpierw chcę dostać moją nagrodę.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_NO_02_01', 'Corristo każe Torrezowi wydać ci nagrodę, jak tylko obejrzy ten list.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_NO_02_02', 'Jestem sługą Innosa - nigdy nie kłamię. A teraz daj mi ten list.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_NO_AGAIN_15_00', 'Wolałbym oddać ten list Torrezowi.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_NO_AGAIN_02_01', 'Nie dasz się przekonać, co?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_NO_AGAIN_15_02', 'Nie. Najpierw chcę zobaczyć moją nagrodę.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_Letter_NO_AGAIN_02_03', 'Cóż. Jeśli tego sobie życzysz. Zaczekaj tutaj.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_ComesBack_02_00', 'Corristo nie był zachwycony brakiem szacunku, jaki okazałeś sługom Innosa.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_ComesBack_02_01', 'Ale powiedział, że możesz iść do Torreza i odebrać zwyczajową nagrodę posłańców.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_ComesBack_02_02', 'Corristo jest niezwykle uradowany. Powiedział, że możesz iść do Torreza i wybrać sobie nagrodę.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_WoTorrez_15_00', 'Gdzie znajdę tego Torreza?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_WoTorrez_02_01', 'W ciągu dnia znajdziesz go pewnie przed świątynią.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_WoTorrez_02_02', 'Noc spędza w środku, jak my wszyscy, ale tylko magom wolno wchodzić do świątyni, więc możesz z nim porozmawiać jedynie za dnia.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_NochEinBrief_15_00', 'Przynoszę list od Magów Wody.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_NochEinBrief_02_01', 'Ach, to świetnie! Zaniosę go Corristo.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_NochEinBrief_02_02', 'Magowie Wody z pewnością sowicie wynagrodzą cię po powrocie do Nowego Obozu.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_PERM_15_00', 'Opowiedz mi coś o Magach Ognia.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_PERM_02_01', 'Krąg Magów Ognia czerpie swą moc z łaski Innosa. Bóg światła, prawdy i sprawiedliwości roztacza nad nami swoją opiekę.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_PERM_02_02', 'Magowie są jego wybrańcami i pozostałych ludzi traktują w sposób należny wybrańcom.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_PERM_02_03', 'Przyjęcie do Kręgu to najważniejszy moment w moim życiu. Opiekę nade mną roztoczył sam Corristo, który twierdzi, że wniosłem do naszej społeczności powiew świeżości.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_PERM_02_04', 'Od tej chwili cały mój czas poświęcam na ciągłe doskonalenie umiejętności magicznych. Mam nadzieję, że pewnego dnia zostanę przyjęty do wyższego Kręgu.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_WannaMage_15_00', 'Chciałbym zostać uczniem maga, tak jak ty.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_WannaMage_02_01', 'Corristo wybrał mnie, bo oddałem szczególne usługi potężnym Magnatom.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_WannaMage_02_02', 'Jeśli naprawdę chcesz zostać jego uczniem, musisz wykazać się czymś niezwykłym.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Milten_WannaMage_02_03', 'No i oczywiście musisz najpierw zostać przyjęty do Starego Obozu. Corristo niechętnie patrzy na ludzi z innych osiedli.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHWAIT_02_01', 'Witaj! Mój przyjaciel Lester, z obozu na bagnie powiadomił mnie o twoich niezwykłych czynach!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHWAIT_02_02', 'Jestem pod wrażeniem. Stałeś się bardzo potężny.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHWAIT_15_03', 'Robię co mogę.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHWAIT_02_04', 'Ach, zawsze skromny, co?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHGORN_15_01', 'Spotkałem Gorna.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHGORN_02_02', 'Naprawdę? Gdzie?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHGORN_15_03', 'W ruinach klasztoru, nad morzem. Bawiliśmy się w poszukiwaczy skarbów.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHGORN_02_04', 'Zapewne nie omieszka mi o tym opowiedzieć podczas naszego następnego spotkania.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHLESTER_15_01', 'Lester i ja rozejrzeliśmy się trochę po fortecy w górach.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHLESTER_02_02', 'Tak, słyszałem. Wygląda na to, że można ci zaufać.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHLESTER_15_03', 'Gdzie wasza czwórka zwykła się spotykać?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHLESTER_02_04', 'Ach, tu i tam. Spotykamy się w najróżniejszych miejscach.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHYOU_15_01', 'Co tu robisz?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHYOU_02_02', 'Niedaleko stąd leży starożytny kamienny krąg. W jego centrum znajduje się wejście do podziemnej komory.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHYOU_15_03', 'Jakiś rodzaj grobowca?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHYOU_02_04', 'Tak, coś w tym rodzaju.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHYOU_02_05', 'W tym grobowcu znajduje się przedmiot, który chciałbym zdobyć.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHME_15_01', 'Szukam kamienia ogniskującego. Powinien gdzieś tam być.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHME_02_02', 'Wygląda na to, że obydwaj szukamy czegoś w tym samym miejscu.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHPROBLEM_15_01', 'Dlaczego nie zejdziesz do grobowca i nie zabierzesz tego, czego szukasz?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHPROBLEM_02_02', 'Och, to długa historia. Musiałbym zanudzać cię opowieścią o bardzo dawnych czasach.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHPROBLEM_15_03', 'Śmiało, nigdzie mi się nie spieszy.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHPROBLEM_02_04', 'No dobrze! Po utworzeniu magicznej Bariery, która stała się naszym wspólnym więzieniem...', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHPROBLEM_02_05', '... Jeden z magów zamknął pod ziemią potężny artefakt.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHFOCUS_15_01', 'Czyżbyś mówił o jednym z pięciu kamieni ogniskujących?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHFOCUS_02_02', 'Dokładnie! A więc znasz już historię pięciu kamieni?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHFOCUS_15_03', 'Tylko mi nie mów, że ty też szukasz tego kamienia!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHFOCUS_02_04', 'Nie. Nie interesuje mnie kamień ogniskujący. Szukam pewnego talizmanu Orków.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSEAL_15_01', 'Artefakt jest w jakiś sposób chroniony?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSEAL_02_02', 'Tak. Strzeże go potężne zaklęcie. Pierwszy rabuś, który spróbuje go zabrać...', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSEAL_02_03', '... będzie przeklęty i zostanie skazany na wieczną egzystencję jako Ożywieniec. Od tej pory po wsze czasy sam stanie się strażnikiem kamienia, który próbował ukraść.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSEAL_15_04', 'Czy istnieje jakiś sposób na uniknięcie klątwy?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSEAL_02_05', 'To już nie będzie potrzebne.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSEAL_02_06', 'Kilka lat temu jeden z Magnatów polujący dla rozrywki na Orków okazał się na tyle bezmyślny, że zszedł do grobowca.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSEAL_02_07', 'Teraz ON jest strażnikiem spoczywających pod ziemią skarbów.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHTALISMAN_15_01', 'A co z twoim talizmanem?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHTALISMAN_02_02', 'Jestem przekonany, że jego poprzedni właściciel wykorzystywał go do ochrony przed rozwścieczonymi Orkami.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHTALISMAN_02_03', 'Jeśli mam rację, ten talizman może się okazać niezwykle przydatny.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER_15_01', 'Zatem powinniśmy wspólnie przeszukać ten grobowiec! Ty znajdziesz swój talizman, a ja - mój kamień ogniskujący!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER_02_02', 'W porządku, ale jest pewien mały problem...', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER_15_03', 'Problem?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER_02_04', 'Tak. Strażnik podziemnej krypty...', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER_15_05', 'A nie można go po prostu posiekać na drobne kawałeczki?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER_02_06', 'To nie będzie takie proste. Ten ożywieniec zdaje się być niezwykle odporny na działanie zwykłego oręża.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER_15_07', 'Niech zgadnę: pewnie masz już jakiś plan, jak go pokonać, tak?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER_02_08', 'Umm... No cóż... MAM pewien plan, ale nie jestem w stanie sam go wykonać.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER2_15_01', 'Zamieniam się w słuch!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER2_02_02', 'Mam przy sobie magiczny zwój z niezwykle potężnym zaklęciem.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER2_02_03', 'To zaklęcie natychmiast niszczy wszystkich ożywieńców znajdujących się w okolicy.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER2_15_04', 'Zatem dostanie się do grobowca powinno być dziecinnie proste, prawda?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER2_02_05', 'Hmmm... Nie zupełnie! Obawiam się, że nasz przeklęty strażnik nie jest już sam.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER2_02_06', 'Wygląda na to, że rabusie, którzy przyszli po nim mieli równie mało szczęścia co on sam.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHOFFER2_02_07', 'Pewnego razu zszedłem na dół i mało brakowało, a postradałbym życie. Jeden człowiek nie sprosta wszystkim przeciwnikom.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHACCEPT_15_01', 'Daj mi ten magiczny zwój i razem zajmiemy się tymi ożywieńcami!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHACCEPT_02_02', 'Ha! Miałem nadzieję, że to powiesz.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHACCEPT_02_03', 'Niestety, mam tylko jeden zwój. Wykorzystaj go przeciw Strażnikowi.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHACCEPT_02_04', 'Pozostałe ożywieńce można zabić zwykłym orężem.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHACCEPT_15_05', 'Rozumiem. No dobrze, którędy do tego kamiennego kręgu?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHACCEPT_02_06', 'Chodź za mną!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHARRIVED_02_01', 'No i jesteśmy. Ten tunel prowadzi wprost do grobowca.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHARRIVED_15_02', 'Zatem ruszajmy. Pora złożyć wizytę strażnikom.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHHEAL_15_01', 'Jestem ranny. Możesz mi pomóc?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHHEAL_02_02', 'Weź ten napój uzdrawiający.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHHEAL_02_03', 'Nie mam już żadnych magicznych wywarów.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHRUNNING_15_01', 'Strażnik wciąż żyje!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHRUNNING_02_02', 'Więc zniszcz go przy użyciu magicznego zwoju!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSCROLL_15_01', 'Wykorzystałem zwój, ale niestety nie na Strażniku!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSCROLL_02_02', 'Jesteśmy zgubieni! Chyba, że znajdziesz jakiś inny sposób, żeby go pokonać!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSCROLL_02_03', 'Może w którymś z obozów uda ci się kupić następny zwój albo magiczną runę.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSCROLL_02_04', 'Zaczekam na ciebie w miejscu, w którym się spotkaliśmy.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHNEWSCROLL_15_01', 'Mam nowy zwój z zaklęciem "Śmierć Ożywieńcom!"', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHNEWSCROLL_02_02', 'To wspaniale! Możemy złożyć Strażnikowi kolejną wizytę!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHNEWSCROLL_02_03', 'Idź przodem. Pójdę za tobą.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHLEAVE_02_01', 'Czyżbyś stracił zainteresowanie tym grobowcem?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHLEAVE_02_02', 'Jakbyś zmienił zdanie, znajdziesz mnie w miejscu naszego pierwszego spotkania.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHCONTINUE_15_01', 'To jak? Schodzimy znowu do krypty?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHCONTINUE_02_02', 'Jestem gotów. Idź przodem. Pójdę za tobą.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSUCCESS_02_01', 'Dobrze. Widzę, że znalazłeś talizman.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSUCCESS_15_02', 'Proszę, weź go. Taka była umowa.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSUCCESS_02_03', 'Dziękuję, przyjacielu. Nigdy nie zapominam o ludziach, którzy mi pomogli.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_SHSUCCESS_02_04', 'Wrócę teraz do Starego Obozu. Może tam się jeszcze kiedyś spotkamy.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_02_01', 'Oni... nie żyją... Wszyscy zginęli... Nie mogłem im pomóc... Byłem za daleko... Ja...', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_15_02', 'Spokojnie, Miltenie. Spotkałem już Diego po drugiej stronie Obozu.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_02_03', 'Zatem wiesz już, co się stało. Co ci powiedział Diego?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_15_04', 'Powiedział, że jeśli spotkam Gorna i Lestera, mam im powiedzieć, że spotkanie odbędzie się tam gdzie zwykle.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_02_05', 'Powodzenia i uważaj na siebie!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_15_06', 'Uspokój się, Miltenie. Co się stało?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_02_07', 'Wymordowali Magów Ognia! Wszystkich... oprócz mnie. Ale nawet ja otarłem się o śmierć.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_15_08', 'Lepiej opowiedz mi wszystko po kolei, od samego początku.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_02_09', 'Już dobrze, uspokój się, przyjacielu.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_02_10', 'Wszystko zaczęło się od zawalenia Starej Kopalni?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_15_11', 'Zawalenia Starej Kopalni?!?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_02_12', 'Tak. To działo się tak szybko. Nikt nie zdołał się wydostać.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWARN_02_13', 'Strażnicy zablokowali wejście do kopalni.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCMINE_15_01', 'Jak do tego doszło?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCMINE_02_02', 'Nie mam pojęcia. Kilku Kopaczy stojących przy wejściu mówiło coś o potężnym wstrząsie i wielkiej chmurze pyłu z tunelu.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCMINE_15_03', 'Byłeś tam, kiedy to się stało?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCMINE_02_04', 'Tak. Stąd wiem o zawaleniu się kopalni.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCKDW_15_01', 'Mówiłeś coś o Magach Ognia?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCKDW_02_02', 'Wiem tylko, że wszyscy zostali zabici przez Magnatów tuż po zawaleniu się Starej Kopalni.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCKDW_02_03', 'Kiedy wróciłem z naszej wyprawy pod kamienny krąg, strażnicy przy bramie rzucili się na mnie bez ostrzeżenia.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCKDW_02_04', 'Krzyczeli "zdrajca" i "spiskowiec". Ledwie uszedłem z życiem.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWHY_15_01', 'Dlaczego Magnaci mieliby wymordować Magów? To bez sensu!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWHY_02_02', 'Wiem, ale nie miałem czasu, żeby zapytać strażników. Zaatakowali mnie natychmiast.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCWHY_02_03', 'Może Diego będzie wiedział więcej. Był w Obozie, kiedy rozegrała się ta tragedia.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCYOU_15_01', 'Powinieneś się ukryć. Najlepiej daleko stąd.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCYOU_02_02', 'Nie. Diego kazał mi pilnować drugiego wejścia do Obozu. Mamy ostrzegać naszych przyjaciół przed niebezpieczeństwem.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCYOU_02_03', 'Proszę, porozmawiaj z Diego!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCDIEGO_15_01', 'Gdzie znajdę Diego?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCDIEGO_02_02', 'Ukrywa się po drugiej stronie Obozu, w pobliżu tylnej bramy.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_OCDIEGO_02_03', 'Musisz z nim koniecznie porozmawiać!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD_02_01', 'Witaj, przyjacielu! Dawno się nie widzieliśmy.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD_15_02', 'Cześć, Milten! Wiele się wydarzyło od naszego ostatniego spotkania.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD_15_03', 'Chętnie bym ci wszystko opowiedział, ale chwilowo nie mam czasu. Bardzo się spieszę.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD1_15_01', 'Potrzebuję twojej pomocy!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD1_02_02', 'Co się stało? Jak mogę ci pomóc?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD1_15_03', 'Chodźmy w jakieś ustronne miejsce, gdzie będziemy mogli spokojnie porozmawiać.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD1_02_04', 'Dobrze. Chodź za mną.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_02_01', 'A teraz mów - co się stało?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_15_02', 'Muszę wykorzystać magiczną energię kopca rudy, a wolałbym nie pytać Magów Wody o pozwolenie.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_02_03', 'Żartujesz sobie ze mnie!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_15_04', 'To nie pora na żarty. Mówię poważnie.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_15_05', 'Spotkałem Xardasa, Nekromantę!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_15_06', 'Wypełniam jego polecenia!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_02_07', 'XARDAS?! Zaczynasz mnie przerażać!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_02_08', 'Nikt z nim nie rozmawiał odkąd opuścił Stary Obóz.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_15_09', 'Ja rozmawiałem!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_02_10', 'Do czego potrzebna ci jest energia kopca rudy?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_15_11', 'Muszę ją skumulować w tym oto mieczu.', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_02_12', 'Cóż za niesamowita broń!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSAWAY_15_13', 'Nazywa się URIZIEL!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD4_15_01', 'Xardas dał mi magiczne zaklęcie, które pozwoli mi przenieść energię!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD4_15_02', 'Będziesz musiał je odczytać, podczas gdy ja dotknę rudy mieczem!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD4_02_03', 'Hmmm... Mówisz, że trzeba je tylko odczytać?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LOADSWORD4_02_04', 'Ale Saturas i jego magowie nie puszczą nam tego płazem!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_15_01', 'Musimy zaryzykować!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_15_02', 'To bardzo, BARDZO ważne!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_15_03', 'Ważne dla WSZYSTKICH mieszkańców kolonii...', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_02_04', 'Nic nie rozumiem.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_15_05', 'Dzięki temu wydostaniemy się na wolność! Musisz mi zaufać!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_02_06', 'Dobrze! Po tym wszystkim, co dla nas zrobiłeś, ufam ci bezgranicznie.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_02_07', 'No i wygląda na to, że nawet Xardas darzy cię zaufaniem.', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_02_08', 'Spotkamy się przy kopcu rudy. Tylko nikomu ani słowa!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSRISK_15_09', 'Dobrze, zatem spotkamy się przy kopcu! Do zobaczenia!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSOREHEAP_02_01', 'Masz miecz i zaklęcie?', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSNOW_15_01', 'Proszę, oto ono!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSNOW_15_02', 'Jesteś gotów?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSNOW_02_03', 'Nie, ale nie mamy wielkiego wyboru. Teraz albo nigdy!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSNOW_15_04', 'Zatem do dzieła!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSDONE_02_01', 'Gotowe!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSDONE_15_02', 'Niesamowite! Ten szary kryształ rozbłysnął pięknym błękitem!', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSDONE_02_03', 'To dobry znak! Wygląda na to, że cała energia z kopca została przeniesiona na miecz!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSDONE_02_04', 'Ale nasze działania zwróciły uwagę strażników!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSDONE_02_05', 'Teleportuj się stąd, natychmiast!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSDONE_15_06', 'A co z tobą?', 1, 151, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Milten_LSDONE_02_07', 'O mnie się nie martw! Coś wymyślę! Uciekaj stąd! Już!', 1, 151, 2, null, 2, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Lester_EXIT_05_01', 'Chodźmy.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Lester_EXIT_05_02', 'Niech Śniący ma cię w swojej opiece!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Sakrileg_05_00', 'Odezwałeś się do Guru! Nigdy więcej tego nie rób, to bluźnierstwo! Jeśli jakiś mistrz zechce z tobą rozmawiać, sam się do ciebie odezwie.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Hallo_15_00', 'Kim jesteś?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Hallo_05_01', 'Nazywam się Lester. Zajmuję się naszymi nowymi gośćmi.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Hallo_05_02', 'Masz szczęście, że nie odezwałeś się do Baal Namiba. Obcym nie wolno rozmawiać z Guru.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WannaTalkToMaster_15_00', 'Ale ja muszę porozmawiać z twoim mistrzem.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WannaTalkToMaster_05_01', 'Nie próbuj! Gwarantuję ci, że potrafię udzielić ci wszystkich potrzebnych informacji.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_15_00', 'Opowiedz mi o waszym obozie.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_05_01', 'A co chcesz wiedzieć?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_GIL_15_00', 'Opowiedz mi o tutejszych kastach.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_GIL_05_01', 'Najwyższą kastę stanowią Guru. To niezwykle potężni duchowi przywódcy naszego obozu. Strażnicy Świątyni wykorzystują siłę swego ducha w walce.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_GIL_05_02', 'Ich ciało i duch funkcjonują w idealnej harmonii. Lepiej nie wchodź im w drogę. Ja natomiast jestem Nowicjuszem. Naszym zadaniem jest wykonywanie wszystkich pomniejszych zadań, no i oczywiście żarliwa modlitwa do Śniącego.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_GIL_05_03', 'Niektórzy Nowicjusze dostąpili zaszczytu pobierania nauk u Guru, ale aby to osiągnąć, trzeba służyć w Obozie przynajmniej kilka lat.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_SLEEPER_15_00', 'Co możesz mi powiedzieć o Śniącym?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_SLEEPER_05_01', 'Śniący to boska istota, która zsyła nam wizje objawiające jego wolę. W każdym razie zsyła je Guru.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_SLEEPER_05_02', 'Modlimy się do niego, bo obiecał zwrócić nam wolność.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_SLEEPER_15_03', 'I wierzycie mu?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_SLEEPER_05_04', 'Hej, jestem w tej kolonii od dwóch lat. Wiesz jak długie mogą się wydać DWA LATA w więzieniu?!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_SLEEPER_05_05', 'Nie wyobrażasz sobie w co byłbym w stanie uwierzyć, byle tylko wydostać się z tego przeklętego miejsca!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_HERB_15_00', 'Co możesz mi powiedzieć o bagiennym zielu?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_HERB_05_01', 'Cóż, ziele rośnie wyłącznie na bagnach. Zanim da się je palić, trzeba je odpowiednio przetworzyć. Tym właśnie zajmują się Nowicjusze.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_HERB_05_02', 'Ziele ma działanie relaksujące i uspokajające. Dzięki niemu można osiągnąć stan umysłu pozwalający na nawiązanie kontaktu ze Śniącym.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_HERB_05_03', 'Część zebranego ziela wymieniamy ze Starym Obozem. Tam też pozyskujemy nowych członów Bractwa.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_CampInfo_HERB_05_04', 'Wielu z nich dołącza do nas tylko ze względu na ziele, ale przynajmniej pomagają nam w pracy.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WannaJoin_15_00', 'Chciałbym zostać członkiem Bractwa.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WannaJoin_05_01', 'O tym, czy możesz zostać jednym z nich zadecyduje Cor Kalom.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WannaJoin_05_02', 'Ale on polega zwykle na opinii pozostałych Guru. Baal Namib na przykład jest jednym z nich.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WannaJoin_05_03', 'Najpierw musisz udowodnić, że jesteś godny, by należeć do Bractwa. Dopiero wtedy Guru wyślą cię do Cor Kaloma.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_HowProofWorthy_15_00', 'Jak mam tego dokonać, jeśli żaden z Guru nie chce się do mnie odezwać?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_HowProofWorthy_05_01', 'Chociaż trudno w to uwierzyć, Guru będą obserwowali każdy twój krok.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_HowProofWorthy_05_02', 'Jeśli uznają, że zasługujesz na zostanie jednym z nas, sami się do ciebie odezwą.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_HowProofWorthy_05_03', 'Z pewnością znajdziesz w Obozie wiele okazji, by udowodnić swoją przydatność.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_15_00', 'Jak mogę skłonić twojego mistrza do rozmowy ze mną?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_05_01', 'Musisz wiedzieć, co chciałby usłyszeć?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_15_02', 'A co chciałby usłyszeć?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_05_03', 'Kiedy następnym razem będziemy blisko niego, zwrócisz się do mnie i porozmawiamy chwilę.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_05_04', 'Baal Namib martwi się, gdyż wielu Nowicjuszy oprócz modlitwy do Śniącego czci jeszcze starych bogów.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_05_05', 'Powiesz mi, że wyrzekłeś się innych bóstw i od tej pory zamierzasz wznosić modły wyłącznie do Śniącego.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_05_06', 'Wtedy ja zapytam dlaczego podjąłeś taką decyzję, a ty odpowiesz, że przeżyłeś wizję, w której Śniący wzywał cię do siebie.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_05_07', 'To go powinno zainteresować. Myślisz, że dasz sobie radę?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_WeitWeg_15_08', 'Oczywiście!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_ShowHallo_05_00', 'ACH! MIŁO CIĘ ZNÓW WIDZIEĆ. CO U CIEBIE SŁYCHAĆ?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Show_15_00', 'WYRZEKŁEM SIĘ STARYCH BOGÓW!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Show_05_01', 'CZYŻBY? CO CIĘ SKŁONIŁO DO TAK DRASTYCZNYCH KROKÓW?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Show_15_02', 'PRZEŻYŁEM OBJAWIENIE: ŚNIĄCY ZWRÓCIŁ SIĘ DO MNIE...', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Show_05_03', 'I CO POWIEDZIAŁ?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Show_15_04', 'POWIEDZIAŁ: IDŹ DO OBOZU NA BAGNIE I PRZYŁĄCZ SIĘ DO BRACTWA.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_Show_05_05', 'JESTEŚ SZCZĘŚLIWYM CZŁOWIEKIEM, NIEZNAJOMY: TYLKO NIELICZNI DOSTĄPILI TAKIEJ NAGRODY.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_GuideOffer_15_00', 'Jak znajdę najważniejsze miejsca w Obozie?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lester_GuideOffer_05_01', 'Mogę ci pokazać wszystko, co warto tu obejrzeć.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SOON_Info_15_01', 'Daleko jeszcze?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SOON_Info_05_02', 'Jakbyś mi nie przeszkadzał, dawno bylibyśmy na miejscu.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_CHANGE_Info_15_01', 'Rozmyśliłem się.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_CHANGE_Info_05_02', 'Wiesz, gdzie mnie znaleźć.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_Info_15_01', 'Pokaż mi jak dojść...', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_SMITH_Info_15_01', '... do kuźni.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_SMITH_Info_05_02', 'Chodź za mną!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_TEMPEL_Info_15_01', '... do świątyni.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_TEMPEL_Info_05_02', 'Chodź za mną!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_TRAIN_Info_15_01', '.. do nauczycieli.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_TARIN_Info_05_02', 'Chodź za mną!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_HERB_Info_15_01', '... do laboratorium alchemicznego.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_GUIDEFIRST_HERB_Info_05_02', 'Chodź za mną!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_TRAIN_Info_05_01', 'Tam znajdziesz Baal Cadara. To on naucza Nowicjuszy.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_TRAIN_Info_05_02', 'Nad nami znajduje się plac treningowy Świątynnych Strażników. Zaczekam na ciebie na dole, albo u Baal Namiba, przy wejściu do obozu.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_TEMPEL_Info_05_01', 'Oto świątynia! Zaczekam na ciebie tutaj, ale gdybyś zamarudził, znajdziesz mnie przy wejściu do Obozu.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SMITH_Info_05_01', 'Jesteśmy w kuźni. Rozejrzyj się trochę. Będę czekał przez jakąś godzinę. Później znajdziesz mnie przy wejściu do obozu.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_HERB_Info_05_01', 'Na górze tej drabiny znajdziesz laboratorium alchemiczne Cor Kaloma. Tu na dole rezyduje Fortuno, handlarz zielem.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_HERB_Info_05_02', 'Zaczekam na ciebie tutaj. Tylko nie marudź zbyt długo, bo wrócę do Baal Namiba.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SEND_Info_05_00', 'Cieszę się, że cię widzę. Mam dla ciebie wiadomość.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SEND_Info_15_01', 'Mam nadzieję, że dobrą?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SEND_Info_05_02', 'Nasze Bractwo przygotowuje się do wielkiego wydarzenia.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SEND_Info_15_03', 'Jakiego wydarzenia? Planujecie ucieczkę?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SEND_Info_05_04', 'Guru próbują skontaktować się ze Śniącym, ale potrzebują czegoś, co zjednoczy ich duchowe siły.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SEND_Info_15_05', 'I co dalej?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_SEND_Info_05_06', 'Poszukują magicznego artefaktu, kamienia ogniskującego.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_BROTHERHOOD_TODO_15_01', 'Czemu miałbym być tym zainteresowany?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_BROTHERHOOD_TODO_05_02', 'Porozmawiaj koniecznie z Jaśnie Oświeconym Y''Berionem. To twoja wielka szansa, żeby spojrzał na ciebie łaskawym okiem.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_BROTHERHOOD_TODO_15_03', 'Gdzie mogę go znaleźć?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_BROTHERHOOD_TODO_05_04', 'Idź do świątyni. Bardzo rzadko ją opuszcza. Pewnie w tych zimnych ruinach czuje się bliżej Śniącego niż gdzie indziej.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_05_01', 'Hej, co tu robisz?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_15_02', 'Przybywam z polecenia Magów Wody. Szukam magicznych artefaktów zwanych kamieniami ogniskującymi.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_05_03', 'Szukasz kamieni ogniskujących, tak? Odważny jesteś.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_15_04', 'Saturas i pozostali magowie z Nowego Obozu zamierzają wykorzystać ich moc, by wysadzić w powietrze Barierę i zwrócić nam wolność.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_05_05', 'Jak zobaczę to uwierzę...', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_15_06', 'Tu się zgadzamy... Ale powiedz, czemu ty tu przyszedłeś?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_05_07', 'Zastanawiam się, czy warto zaryzykować wyprawę do górskiej fortecy.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_05_08', 'Wiesz... jest tam pewien dokument, który chciałbym odzyskać, ale taka wyprawa może się okazać bardzo niebezpieczna.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_NORMAL_Info_15_01', 'Jak ci się udało przejść przez tę żywą górę?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_NORMAL_Info_05_02', 'Pobierałem nauki u najlepszych Guru. Ich magia potrafi być bardzo przydatna.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_STORY_Info_15_01', 'Ten dokument, którego szukasz... Co to jest?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_STORY_Info_05_02', 'Wiele lat temu władca tych ziem rezydował w górskiej fortecy, skąd kontrolował kopalnię i okoliczne tereny.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_STORY_Info_05_03', 'Jak wszyscy możni, posiadał w swoich zbiorach dokument, który poświadczał jego prawo do tych ziem. Zamierzam odnaleźć to pismo.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_STORY_Info_15_04', 'Przecież tak długo, jak będziemy uwięzieni wewnątrz Bariery, ten dokument nie będzie wart złamanego grosza!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_STORY_Info_05_05', 'Wiem. Ale prędzej czy później magowie zdołają przerwać Barierę. Wtedy ten kawałek papieru zapewni mi dostatnie życie na długie lata.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_COMEWITHME_Info_15_01', 'Moglibyśmy wspólnie rozejrzeć się po fortecy!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_COMEWITHME_Info_05_02', 'Niezły pomysł. Prowadź. Pójdę za tobą.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOKUSPLACE_Info_05_01', 'Patrz, chyba miałeś rację co do tego kamienia ogniskującego.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOKUSPLACE_Info_15_02', 'Racja, to rzeczywiście wygląda na punkt ogniskujący... Ale nie łatwo go będzie dosięgnąć...', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_COMEBACK_Info_05_01', 'Dokąd się wybierasz? Jeszcze nie skończyliśmy!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_IAMHURT_Info_15_01', 'Jestem ranny. Możesz mi pomóc?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_IAMHURT_Info_05_02', 'Weź ten napój uzdrawiający.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_URKUNDE_Info_15_01', 'Znalazłem dokument!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_URKUNDE_Info_05_02', 'Dobra robota! Przyjmij te zwoje magiczne jako wyraz mojej wdzięczności. Przy ich pomocy uda ci się dotrzeć do kamienia.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_URKUNDE_Info_05_03', 'Zaczekam na ciebie przy platformie.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_TIP_Info_15_01', 'Jak mam dosięgnąć tego kamienia?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_TIP_Info_05_02', 'Mistrz Y''Berion zwykł mawiać: Uczeń próbuje przesuwać przedmioty rękami i nogami. Mistrz porusza je siłą swego ducha.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_LEAVE_Info_05_01', 'Zostanę tutaj jeszcze trochę i poszukam dokumentu.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_BALKON_Info_05_01', 'Pójdę rozejrzeć się na górze.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FINISH_Info_05_01', 'Teraz obaj mamy to, po co przyszliśmy. Chciałbym tu jeszcze trochę zostać, poczytać stare księgi.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FINISH_Info_15_02', 'Do następnego spotkania!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_CHESTCLOSED_Info_15_01', 'Znalazłeś coś?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_CHESTCLOSED_Info_05_02', 'Tamta skrzynia jest zamknięta. Może uda się nam gdzieś znaleźć klucz.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_CHESTCLOSED_Info_05_03', 'Znalazłeś już ten dokument?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_CHESTCLOSED_Info_15_04', 'Nie, jeszcze nie...', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_CHESTCLOSED_Info_05_05', 'Zaglądałeś już do biblioteki?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_COMEAGAIN_Info_15_01', 'Przeszukajmy tę fortecę razem.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_COMEAGAIN_Info_05_02', 'Dobrze, idź przodem!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SFB_1_DieLage_15_00', 'Co słychać?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_FOLLOWME_Info_05_01', 'Hej, co tu robisz?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_COLLAPSE_15_01', 'Stara Kopalnia została zalana przez podziemną rzekę!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_05_01', 'I co z tego?', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_KDW_15_01', 'Wszyscy Magowie Ognia zginęli!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Xardas_KDW_15_02', 'Gomez kazał ich zamordować.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_5_GetThingsRight', 'Nie łatwo będzie to teraz odkręcić!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_DIEGOMILTEN_15_01', 'Spotkałem Diego i Miltena przed Starym Obozem!', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_lester_DIEGOMILTEN_15_01', 'Chce się z tobą spotkać, tam gdzie zawsze.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_5_YeahWellDone', 'Najwyższy czas!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Gorn_RUINWALLWHAT_15_01', 'I co teraz?', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_lester_DIEGOMILTEN_05_02', 'Zostanę tutaj, żeby przejrzeć stare księgi.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDW_600_Saturas_OATH_Info_15_06', 'Eee... Nie rozumiem...', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Psionic_TIP_Info_05_02', 'Mistrz Y''Berion zwykł mawiać: Uczeń próbuje przesuwać przedmioty rękami i nogami. Mistrz porusza je siłą swego ducha.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Grd_6_DasLager_WasIstAerger_15_04', 'Dobrze, dobrze. Zrozumiałem aluzję.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Pickpocket2_05_03', 'Uważaj na siebie.', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EXIT_15_03', 'Dziękuję. Muszę już ruszać w dalszą drogę.', 1, 25, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Lester_EXIT_05_02', 'Niech Śniący ma cię w swojej opiece!', 1, 25, 5, null, 4, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Gamestart_11_00', 'Nazywam się Diego.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Gamestart_15_01', 'Jestem...', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Gamestart_11_02', 'Nie interesuje mnie kim jesteś. Jesteś tu nowy - a do mnie należy dbanie o nowych. Na razie to tyle...', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Gamestart_11_03', 'Jeśli chcesz jeszcze trochę pożyć, słuchaj się mnie, ale oczywiście nie będę ci przeszkadzał w ewentualnej próbie samobójstwa. To jak będzie?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_EXIT_Gamestart_15_00', 'Dzięki za pomoc.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_EXIT_Gamestart_11_01', 'Jak sobie chcesz. Miło było cię poznać.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_EXIT_Gamestart_11_02', 'Spotkamy się w Starym Obozie.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_EXIT_11_01', 'Chodźmy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_EXIT_15_00', 'Trzymaj się.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Brief_15_00', 'Mam list do Arcymistrza Magów Ognia.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Brief_11_01', 'Czyżby...?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Brief_15_02', 'Jakiś mag dał mi go zanim mnie tu wrzucono.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Brief_11_03', 'Twoje szczęście, że nie mogę się więcej pokazywać u magów. Ktoś inny mógłby ci poderżnąć gardło za taki list.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Brief_11_04', 'A to dlatego, że magowie hojnie opłacają swoich kurierów, a większość z tutejszych ludzi nic nie posiada.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Brief_11_05', 'Na twoim miejscu trzymałbym język za zębami aż do chwili, gdy spotkasz któregoś z magów. Chociaż wątpię, żeby ci się udało.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Brief_15_06', 'Dlaczego?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Brief_11_07', 'Magowie mieszkają w zamku, w Starym Obozie. Tylko ludzie Gomeza mają tam wstęp.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WarumGeholfen_15_00', 'Dlaczego mi pomogłeś?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WarumGeholfen_11_01', 'Bo potrzebowałeś pomocy. Gdyby nie ja, Bullit i jego chłopcy mogliby cię wykończyć.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WarumGeholfen_11_02', 'A ja jestem zbyt miły, żeby się temu spokojnie przyglądać. W końcu przebyłem całą tę drogę po to, by złożyć ci propozycję.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WarumGeholfen_15_03', 'Propozycję...', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WarumGeholfen_11_04', 'Tak. Po tym zajściu z Bullitem i jego ludźmi powinieneś się domyślić, że przyda ci się ochrona.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WarumGeholfen_11_05', 'Każdy, kto tu trafia ma wybór. W kolonii są trzy obozy i w końcu będziesz musiał do któregoś dołączyć.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WarumGeholfen_11_06', 'Jestem tu, by udowodnić wszystkim nowym, że najlepszym miejscem dla nich będzie Stary Obóz.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Bullit_15_02', 'A gdzie jest teraz Bullit?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Bullit_11_03', 'On i pozostali przenoszą towary z zewnątrz do Obozu. Tam go znajdziesz.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Bullit_11_04', 'Ale jeśli chcesz z nim walczyć, radzę ci uważać. To doświadczony wojownik.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Kolonie_15_00', 'Dobra, co powinienem wiedzieć o tym miejscu?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Kolonie_11_01', 'Nazywamy je kolonią. Wiesz już, że wydobywamy rudę dla króla.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Kolonie_11_02', 'Cóż, w każdym razie tak robią ludzie ze Starego Obozu.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Kolonie_11_03', 'Wewnątrz Bariery powstały trzy obozy. Największy i najstarszy jest tak zwany Stary Obóz.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Barriere_15_00', 'Opowiedz mi jeszcze o Barierze.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Barriere_11_01', 'Nie ma za bardzo o czym mówić. Jest nie do sforsowania.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Barriere_15_02', 'A co się stanie, jeśli po prostu spróbuję stąd wyjść?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Barriere_11_03', 'Ostatni, który tego spróbował dotarł na drugą stronę jako trup. Przez to przeklęte magiczne pole można wejść, ale już nigdy się stąd nie wydostaniesz.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Barriere_15_04', 'Jeśli jest stąd jakieś wyjście - znajdę je.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Barriere_11_05', 'Tak ci spieszno, żeby się stąd wyrwać? Dopiero co tu trafiłeś!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OtherCamps_15_00', 'A co z pozostałymi obozami?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OtherCamps_11_01', 'Te dwa obozy zamieszkują szaleńcy, którzy próbują się stąd wydostać za wszelką cenę.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OtherCamps_11_02', 'W zachodniej części kolonii znajduje się Nowy Obóz. Rezydują tam magowie, którzy myślą, że uda się im wysadzić Barierę, jak tylko zbiorą dostatecznie dużo rudy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OtherCamps_11_03', 'No i są jeszcze świry z Sekty, na wschodzie. Ich obóz znajduje się na środku bagna. Oni z kolei czekają aż ich bóstwo pomoże im się stąd wydostać.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OtherCamps_11_04', 'Wygląda na to, że jeszcze trochę poczekają.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OtherCamps_11_05', 'Na twoim miejscu nie traciłbym czasu na zadawanie się z szaleńcami.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OldCamp_15_00', 'Opowiedz mi o Starym Obozie.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OldCamp_11_01', 'To największy i najpotężniejszy z trzech obozów. Gomez i jego ludzie kontrolują kopalnię, a tym samym - cały handel ze światem zewnętrznym.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OldCamp_11_02', 'Raz w miesiącu król przysyła nam wszystko, czego potrzebujemy. Mamy staruszka w garści, kapujesz?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OldCamp_11_03', 'Przysyła nam broń, chleb, mięso... wszystko.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OldCamp_11_04', 'Ty też możesz mieć w tym udział. Musisz tylko dołączyć do ludzi Gomeza.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WhosGomez_15_00', 'Kim jest Gomez?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WhosGomez_11_01', 'Gomez jest najpotężniejszym z Magnatów kierujących handlem rudą. To on rządzi w Starym Obozie i ma najwięcej do powiedzenia w całej kolonii.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinOldcamp_15_00', 'Załóżmy, że chciałbym dołączyć do jego ludzi. Co powinienem zrobić?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinOldcamp_11_01', 'Przy bramie do zamku znajdziesz człowieka imieniem Thorus. Powiedz mu, że Diego cię przysłał.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WayToOldcamp_15_00', 'Jak dostanę się do Starego Obozu?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WayToOldcamp_11_01', 'Podążaj tą ścieżką. Stary Obóz to najbliższe, mniej więcej bezpieczne miejsce jakie napotkasz po drodze.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WayToOldcamp_11_02', 'Pomiędzy obozami kręci się wiele groźnych zwierząt. Radziłbym ci postarać się o jakąś broń.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WoWaffe_15_00', 'Gdzie mogę znaleźć oręż?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WoWaffe_11_01', 'Rozejrzyj się trochę w pobliżu Opuszczonej Kopalni. Na pewno znajdziesz tam coś przydatnego.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WoWaffe_11_02', 'Kopalnię nie trudno znaleźć. Leży parę metrów w dół kanionu.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_ThorusSays_15_00', 'Rozmawiałem z Thorusem.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_ThorusSays_11_01', 'I co ci powiedział?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_ThorusSays_15_02', 'Mówi, że będę mógł dołączyć do Starego Obozu, jeśli TY uznasz, że się nadaję.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_ThorusSays_11_03', 'Widzę, że czeka mnie dodatkowa robota.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_ThorusSays_15_04', 'Zaczynamy od razu?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_ThorusSays_11_05', 'Najpierw powinieneś dowiedzieć się kilku rzeczy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Rules_15_00', 'Co powinienem wiedzieć, zanim zostanę przyjęty do Starego Obozu?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Rules_11_01', 'Jeśli chcesz do nas należeć, musisz najpierw zaplusować u kilku ludzi.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Rules_11_02', 'W Zewnętrznym Pierścieniu możesz spotkać paru wpływowych ludzi, głównie Cieni. Jeśli uda ci się ich do siebie przekonać, twoje szanse wzrosną.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Rules_11_03', 'Później czeka cię test zaufania.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Rules_11_04', 'Oprócz tego musisz się jeszcze wiele nauczyć. Im więcej nowych umiejętności zdobędziesz, tym cenniejszy będziesz dla nas.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Celebs_15_00', 'Gdzie znajdę te ważne osoby?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Celebs_11_01', 'Cóż, na jednego z nich właśnie patrzysz. Poza tym, jest jeszcze Thorus, jego już znasz.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Celebs_11_02', 'Co do pozostałych... sam musisz ich rozpoznać. Jeśli nie jesteś w stanie tego zrobić, to i tak nie masz tu czego szukać.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Celebs_11_03', 'Najlepiej przejdź się po Zewnętrznym Pierścieniu i porozmawiaj z ludźmi.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teachers_15_00', 'Kto może mnie czegoś nauczyć?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teachers_11_01', 'Zacznij od Rączki. To najzręczniejszy człowiek w Obozie.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teachers_11_02', 'Miej oczy szeroko otwarte, a na pewno znajdziesz wielu ludzi, którzy zechcą cię czegoś nauczyć.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teachers_15_03', 'Gdzie znajdę Rączkę?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teachers_11_04', 'Jego chata stoi nieco na uboczu, zaraz przy murach zamku. Idąc stąd udaj się w stronę areny.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teachers_11_05', 'Przy zamkowej bramie pójdź w lewo. To właśnie droga do areny.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teach_15_00', 'Możesz mnie czegoś nauczyć?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teach_11_01', 'Tak. Mogę ci pokazać, jak zwiększyć swoją siłę lub zręczność.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teach_BACK_11_00', 'Jesteś teraz o wiele silniejszy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teach_BACK_11_01', 'Umiesz teraz sprawniej posługiwać się łukiem i kuszą.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Teach_BACK_11_02', 'Wróć niedługo. Musisz się jeszcze wiele nauczyć.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Offer_15_00', 'Na czym polega test zaufania?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Offer_11_01', 'Będziesz się musiał wybrać do Starej Kopalni. Tam znajdziesz faceta imieniem Ian. Od niego dostaniesz listę.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Offer_11_02', 'To bardzo ważny dokument. Zawiera spis wszystkich rzeczy, których potrzebują od nas ludzie z kopalni.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Offer_11_03', 'Postaramy się, żeby dostarczono je z następnym konwojem.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Offer_15_04', 'Żaden problem!', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Offer_11_05', 'Właśnie że jest problem. Ta lista nie może wpaść w ręce ludzi z Nowego Obozu!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Offer_11_06', 'Jak już powiedziałem: to bardzo ważna lista. Jeśli nie zawalisz - daleko tu zajdziesz.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_IanPassword_Info_15_01', 'Skoro ta lista jest taka ważna, skąd pewność, że Ian wyda ją komuś takiemu jak JA?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_IanPassword_Info_11_02', 'Bo powiesz mu, że przysłał cię Diego.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_IanPassword_Info_15_03', 'Tak zrobię.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_MapToOldMine_Info_15_00', 'Gdzie znajdę Starą Kopalnię?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_MapToOldMine_Info_11_01', 'Porozmawiaj z Grahamem, to nasz kartograf. Powiedz mu, że ja cię przysyłam, i że potrzebujesz mapy. Z niej dowiesz się, gdzie leży kopalnia.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_MapToOldMine_Info_11_02', 'Graham mieszka na lewo od północnej bramy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Success_15_00', 'Mam listę od Iana.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_BringList_Success_11_01', 'Dobra robota! Zaczynasz mi się naprawdę podobać!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_15_00', 'Jak tam z moją opinią w Obozie?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_11_01', 'Rozmawiałem z kilkoma ludźmi...', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_15_02', 'I?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Scatty_11_01', 'Scatty powiedział mi, że pokonałeś Kirgo.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Scatty_11_02', 'Scatty powiedział mi, że pozwoliłeś Kirgo spuścić sobie baty. Chyba nie jest tobą zachwycony.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Scatty_11_03', 'Scatty powiedział mi, że nie może się doczekać na twoją walkę z Kirgo.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Scatty_11_04', 'Ale był pod wrażeniem twojej śmiałości. Nie każdy miałby odwagę, żeby wyzwać Kharima. Choćby nawet z nim przegrał.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Scatty_11_05', 'Ale był pod wielkim wrażeniem twojej walki z Kharimem. Bez przerwy opowiada jaki to z ciebie wojownik.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Scatty_11_06', 'I nie może się doczekać, kiedy staniesz do walki z Kharimem.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Whistler_11_01', 'Świstak opowiedział mi o tej historii z Fiskiem... Cóż, na twoim miejscu wziąłbym tę rudę i dał nogę, ale tak, czy inaczej - Świstak chyba bardzo cię polubił.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Whistler_11_02', 'Rozmawiałem ze Świstakiem. Zwiałeś z jego rudą, cwaniaku! Muszę przyznać, że śmiałości ci nie brakuje!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Whistler_11_03', 'Świstak czeka na swój miecz. Zdecyduj się wreszcie czy zamierzasz mu go dać, czy nie. W przeciwnym wypadku może pomyśleć, że zwiałeś z jego rudą!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Sly_11_01', 'Zły powiedział mi, że znalazłeś Neka. Wydawał się być bardzo zadowolony.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Sly_11_02', 'Moim zdaniem Zły myli się co do Neka. Był uciążliwy, to fakt, ale nie wierzę, żeby zdezerterował do Nowego Obozu.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Fingers_11_01', 'Mówiłem ci już o Rączce! On może cię wiele nauczyć!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Fingers_11_02', 'Rączka powiedział mi, że trochę się już nauczyłeś, ale uważa, że mógłbyś być jeszcze lepszy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Dexter_11_01', 'Muszę poważnie porozmawiać z Dexterem. Wykorzystuje cię do załatwiania własnych porachunków.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Dexter_11_02', 'Ale jeśli chodzi o nasz test - nie ma żadnych przepisów. Jeśli uda ci się dokonać czegoś TAKIEGO, to będzie wielki krok do przodu.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Dexter_11_03', 'Naprawdę udało ci się zdobyć przepis Kaloma. Dexter jest pod wrażeniem. Ja zresztą też!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Thorus_11_01', 'Ta sprawa z Mordragiem to nie lada wyzwanie. Niezły z niego wojownik. Musisz porządnie poćwiczyć, jeśli chcesz go pokonać.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Thorus_11_02', 'Thorus uważa, że przyda się nam ktoś taki jak ty - to dla ciebie niezwykle korzystne.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Thorus_11_03', 'Thorus dostał ataku apopleksji. Zresztą wcale mu się nie dziwię. Jak można AŻ TAK schrzanić robotę?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Fisk_11_01', 'Fisk powiedział mi, ze go zaskoczyłeś. W każdym razie będzie po twojej stronie.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_JoinAnalyze_Fisk_11_02', 'Fisk bardzo się na ciebie wkurzył. Na twoim miejscu znalazłbym kogoś na miejsce Mordraga.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Points_11_00', 'Udało ci się zjednać wystarczająco wiele osób.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Points_11_01', 'Przeszedłeś również test zaufania. Idź do Thorusa. Już go o wszystkim powiadomiłem. Pozwoli ci się spotkać z Gomezem.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Points_11_02', 'Ale musisz jeszcze przejść test zaufania.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Points_11_10', 'W sumie - całkiem nieźle jak na żółtodzioba.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_Points_11_20', 'Bierz się do roboty. Przed tobą jeszcze daleka droga, jeśli chcesz do czegoś dojść w tym obozie.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WhatToSayToGomez_Info_15_00', 'Co mam zrobić, kiedy stanę przed Gomezem?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WhatToSayToGomez_Info_11_01', 'Gomez podejmuje decyzje na podstawie instynktu. Jeśli spodoba mu się twoja gęba - pozwoli ci zostać.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_WhatToSayToGomez_Info_11_02', 'Od tej pory musisz sobie radzić sam - postaraj się! Powodzenia!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_ARMOR_Info_15_01', 'Mogę dostać taką zbroję jak twoja?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_ARMOR_Info_11_02', 'A masz dość rudy?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_ARMOR_Info_11_03', 'Zdobądź rudę, to dostaniesz zbroję.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_11_00', 'Hej! Myślałem, że już nie żyjesz!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_15_01', 'Parę razy też mi się tak wydawało.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_11_02', 'Wiele się wydarzyło od naszego ostatniego spotkania. Słyszałem, że miałeś swój wkład w wielkie przywołanie!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_15_03', 'Widzę, że jesteś świetnie poinformowany.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_11_04', 'Lepiej niż myślisz... Teraz szukasz kamienia ogniskującego?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_15_05', 'Tak. Powinien być gdzieś w pobliżu.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_11_06', 'Wiem, gdzie go można znaleźć. Jest tylko jeden problem.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_15_07', 'Rozumiem. Czego chcesz?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_11_08', 'Widzę, że szybko się uczysz, ale nie o to mi chodziło.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_15_09', 'Nie? Więc cóż to za problem?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_11_10', 'O, to całe trzy tony problemów!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_MEETAGAIN_Info_11_11', 'Chodźmy. Za chwilę sam zobaczysz.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_SHOWFOCUS_Info_11_01', 'Po lewej stronie tego kanionu znajdziesz wejście do jaskini, która prowadzi do kamienia.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_SHOWFOCUS_Info_15_02', 'Wszystko jasne. Jednak najpierw musimy się jakoś pozbyć tamtego bydlaka.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_SHOWFOCUS_Info_11_03', 'Spróbuj znaleźć jakiś jego słaby punkt albo inny sposób na pokonanie tego Trolla.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_SHOWFOCUS_Info_11_04', 'Ściągnę na siebie jego uwagę.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_AFTERTROLL_Info_11_01', 'To było niesamowite. Niezły jesteś. Teraz możesz iść po kamień ogniskujący.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_AFTERTROLL_Info_11_02', 'Ja dopilnuję, żebyśmy nie mieli już więcej niemiłych niespodzianek.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_WHEEL_Info_11_01', 'Kołowrót chyba się zaciął!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_WHEEL_Info_11_02', 'Czekaj, może uda mi się go naprawić!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_FIXWHEEL_Info_11_01', 'No, teraz powinno działać!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_WAITATFOCUS_Info_11_01', 'Idź po kamień. Zaczekam na ciebie tutaj!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_GOTIT_Info_11_01', 'Widzę, że znalazłeś kamień! Świetnie.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_GOTIT_Info_11_02', 'Chyba powinienem znowu zajrzeć do Starego Obozu. Powodzenia!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_GOTIT_Info_15_03', 'Nie daj się zabić!', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('PC_Thief_GOTIT_Info_11_04', 'Jeszcze się zobaczymy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_11_01', 'Hej... Ciii... Bądź cicho!', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_15_02', 'Cześć, Diego. Rozmawiałem już z Miltenem po przeciwnej stronie obozu.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_11_03', 'Dobrze, zatem wiesz już, co się stało.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_11_04', 'A słyszałeś o planowanym ataku na Wolną Kopalnię?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_15_05', 'Cześć, Diego. Co ma znaczyć ta cała zabawa w chowanego?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_11_06', 'Nic nie słyszałeś?', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_15_07', 'O czym?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_11_08', 'O zawaleniu się Starej Kopalni, zamordowaniu Magów Ognia i planach ataku na Wolną Kopalnię.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARN_15_09', 'CO?! O czym ty mówisz?!', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMINE_15_01', 'Jak mogło dojść do zawalenia się kopalni?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMINE_11_02', 'Jeden z Kopaczy, któremu udało się uratować, powiedział, że kopiąc na najniższym poziomie trafili na podziemną rzekę.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMINE_11_03', 'Kiedy woda wdarła się do szybów, popękały podpory i runęła cała górna część.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMINE_11_04', 'Tylko garstce ludzi udało się wydostać na powierzchnię.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCKDF_15_01', 'Co się stało z Magami Ognia?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCKDF_11_02', 'To długa historia.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCFM_15_01', 'Napad na Wolną Kopalnię?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCFM_11_02', 'To długa historia.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_15_01', 'Opowiadaj, to nie pierwsza długa historia, której musiałem wysłuchać.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_11_02', 'No dobra. Na szczęście byłem właśnie w siedzibie Magnatów, kiedy dotarły do nich wieści o zawaleniu się kopalni.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_11_03', 'Kiedy Gomez dowiedział się o wypadku, oszalał z wściekłości. Wcale mu się nie dziwię - jego autorytet mógł runąć w każdej chwili, razem z kopalnią.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_15_04', 'Jasne. Kto kontroluje rudę, kontroluje całą kolonię!', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_11_05', 'No właśnie. Przecież bez stałego napływu rudy, handel ze światem zewnętrznym padnie raz - dwa.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_11_06', 'Jeśli Gomez nie znajdzie szybko nowego źródła dochodu, ludzie przestaną go słuchać.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_15_07', 'I dlatego postanowił najechać Wolną Kopalnię?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_11_08', 'Cóż, obiektywnie rzecz biorąc, to jedyna szansa Gomeza na zachowanie władzy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCSTORY_11_09', 'Dwie godziny temu dwa tuziny strażników wyruszyły w kierunku Wolnej Kopalni.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARNNC_15_01', 'To szaleństwo! Muszę uprzedzić Nowy Obóz.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARNNC_11_02', 'W takim razie lepiej się pospiesz! Strażnicy są już pewnie niedaleko Wolnej Kopalni.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARNNC_15_03', 'Ale przecież nie przedrą się tak łatwo przez obronne fortyfikacje Nowego Obozu!', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCWARNNC_11_04', 'Wcale nie muszą się przez nie przedzierać. Kilka miesięcy temu znaleźliśmy ścieżkę, która prowadzi przez góry wprost do Wolnej Kopalni. Nikt inny nie wie o jej istnieniu.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCGUARDS_15_01', 'Widziałem Strażników pilnujących zamkniętych bram.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCGUARDS_11_02', 'Trzymaj się z dala od nich. Zaatakują każdego, kto spróbuje dostać się do Obozu.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCGUARDS_11_03', 'Obawiają się odwetu za napad na Wolną Kopalnię.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMURDER_15_01', 'Ale co stało się z Magami Ognia?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMURDER_11_02', 'Corristo i jego towarzysze byli jedynymi ludźmi w obozie, którzy zachowali zimną krew.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMURDER_11_03', 'Zabronili przeprowadzenia ataku i domagali się pertraktacji z pozostałymi obozami.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMURDER_15_04', 'ZABRONILI Gomezowi przeprowadzenia ataku na Wolną Kopalnię?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCMURDER_11_05', 'No właśnie. Corristo i jego ludzie byli zbyt zadufani w sobie. Gomez przestał im ufać i kazał ich zdradziecko zamordować.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCRETREAT_15_01', 'I co teraz zamierzacie zrobić? To znaczy - ty i Milten?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCRETREAT_11_02', 'Zostaniemy tu jeszcze przez jakiś czas. Będziemy ostrzegali innych przyjaciół, żeby nie wpadli w łapy Strażników.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCRETREAT_11_03', 'Ale mógłbyś coś dla nas zrobić.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCFAVOR_15_01', 'Nie ma sprawy. O co chodzi?', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCFAVOR_11_02', 'Znajdź Lestera i Gorna. Muszą się dowiedzieć o tym, co się tutaj wydarzyło.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCFAVOR_11_03', 'Powiedz im, że spotkamy się we czwórkę tam gdzie zwykle.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCFAVOR_15_04', 'Jeśli znajdę ich przed tobą, przekażę im ostrzeżenie i wezwanie na spotkanie.', 1, 10, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Diego_OCFAVOR_11_05', 'Dzięki, przyjacielu. Widzę, że równy z ciebie gość. Idź już. Jeszcze się kiedyś spotkamy.', 1, 10, 11, null, 1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Senyan_Hello_15_00', 'Przybywasz z Wolnej Kopalni, tak?', 1, 81, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Senyan_Hello_01_01', 'Tak. Skąd wiesz?', 1, 81, 1, null, 1000, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Senyan_JustTalk_15_00', 'Chcę z tobą chwilę porozmawiać.', 1, 81, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Senyan_JustTalk_01_01', 'Nie przyszedłem tutaj, żeby gadać.', 1, 81, 1, null, 1000, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sfb_1001_Hello_15_00', 'Co słychać w kopalni?', 1, 59, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sfb_1001_Hello_02_01', 'Większość roboty mamy już za sobą. Jeszcze tylko kilka tygodni i będziemy mieli dość.', 1, 59, 2, null, 1001, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Hello_15_00', 'Kim jesteś?', 1, 1, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Hello_09_01', 'Jestem najlepszym inżynierem, jakiego ta przeklęta kolonia kiedykolwiek widziała, chłopcze.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Hello_09_02', 'Pilnuję, żeby nasi chłopcy nie ściągnęli sobie na głowy sterty kamieni kopiąc w niewłaściwym miejscu.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_15_00', 'Chciałbym do was dołączyć, jako Kret.', 1, 1, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_09_01', 'Czyżby? Tylko nie oczekuj zbyt wiele po tej robocie. Trzy porcje ryżu na dzień. Resztę musisz sobie sam załatwić.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_09_02', 'Wiesz dlaczego odwalamy całą tę brudną robotę? Żeby pewnego dnia móc wyjść na wolność z tego przeklętego więzienia.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_09_03', 'Cały nasz urobek jest składowany na wielkim kopcu. Raz w miesiącu każdy z nas dostaje 50 bryłek, żeby móc się porządnie upić.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_09_04', 'To najważniejsze rzeczy, które powinieneś wiedzieć.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_09_05', 'Masz chociaż jakieś doświadczenie w tej robocie?', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_Ja_15_00', 'Tak.', 1, 1, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_Ja_09_01', 'To świetnie! Zatem wiesz, na co należy uważać. Masz tu swój strój roboczy. Kilof musisz znaleźć sobie sam. Miłej zabawy.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_Nein_15_00', 'Nie.', 1, 1, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_Nein_09_01', 'No jasne! Dlaczego to zawsze ja muszę was uświadamiać. Słuchaj uważnie: weź te ciuchy i załóż je na siebie - tutaj.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_Nein_09_02', 'Gdyby kawałek rudy spadł ci na bosą stopę, zostałbyś kaleką do końca życia. Oczywiście wtedy byłbyś dla nas znacznie mniej przydatny.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_Nein_09_03', 'Gdzieś w pobliżu powinien leżeć jakiś kilof.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_Schuerfer_Nein_09_04', 'Oczywiście wiele z nim nie zdziałasz... Mówi się trudno...', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_PERM_15_00', 'Jak dużo rudy udało się wam uzbierać do tej pory?', 1, 1, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Swiney_PERM_09_01', 'Magowie mówią, że mamy już niemal całą potrzebną ilość. Kiedy będziesz w Nowym Obozie rzuć okiem na kopiec.', 1, 1, 9, null, 1037, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_Greet_15_00', 'Jesteś szefem Najemników, tak?', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_Greet_08_01', 'Zgadza się, chłopcze!', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_Define_15_00', 'Czym zajmuje się najemnik w służbie magów?', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_Define_08_01', 'To proste: pilnuje rudy i broni magów.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_Define_08_02', 'Od czasu do czasu magowie zlecają nam jakieś zadania specjalne.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_Mitmachen_15_00', 'Chciałbym do was dołączyć!', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_Mitmachen_08_01', 'Odbiło ci? Myślisz, że przyjmuję każdego włóczęgę, który się do mnie zgłosi?', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_Mitmachen_08_02', 'Musisz najpierw spędzić trochę czasu w naszym obozie. Będę cię miał na oku! Zobaczymy, na co cię stać.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_NowReady_15_00', 'Chciałbym zostać najemnikiem w służbie magów. Myślisz, że jestem już gotów?', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLD_Info_08_01', 'Twoje dokonania w Starej Kopalni dowodzą, że stać cię na wiele.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLD_Info_08_02', 'Jestem skłonny przyjąć cię w poczet Najemników.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLD_Info_08_03', 'Ale nie jesteś gotowy do służby w naszych szeregach. Musisz zdobyć jeszcze trochę doświadczenia.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLD_Info_08_04', 'Dam ci szansę. Co ty na to?', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_NowReady_08_01', 'Nadal nie jesteś dość doświadczony. Musisz się jeszcze wiele nauczyć.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLD_Info_08_04', 'Dam ci szansę. Co ty na to?', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_Info_15_01', 'Chcę zostać Najemnikiem.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_Info_08_02', 'Mądra decyzja. Nie pożałujesz.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_Info_08_03', 'Powiedz mi: dlaczego? Dlaczego dołączyłeś do nas, a nie do Bractwa, albo do Starego Obozu?', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_NOOTHER_15_01', 'W tamtych obozach tylko traciłbym czas.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_NOOTHER_08_02', 'Jedyna rzecz, która ma tutaj jakąś prawdziwą wartość to pragnienie wolności. Witaj wśród nas, NAJEMNIKU!', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_FREEDOM_15_01', 'Od początku myślałem tylko o odzyskaniu wolności.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_FREEDOM_08_02', 'I dzięki nam wkrótce ją odzyskasz. Witaj wśród nas, NAJEMNIKU!', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_JUSTBECAUSE_15_01', 'Tak się jakoś złożyło.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_BECOMESLDNOW_JUSTBECAUSE_08_02', 'Żeby się tylko nie złożyło, że kiedyś nagle zmienisz zdanie. Witaj wśród nas, NAJEMNIKU!', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_01', 'Kiedyś wiodłem całkiem inne życie.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_02', 'Byłem jednym z najlepszych generałów tego królestwa.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_03', 'Całe życie spędziłem broniąc ojczyzny przed wrogiem.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_04', 'Ale szlachta patrzyła na mnie niechętnie, bo król wysoko cenił sobie moje rady. Te łotry wiedziały, że mogę pokrzyżować ich plany.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_05', 'Byłem zbyt pewny siebie i nie zauważyłem sideł, które na mnie zastawili. Aby mnie usunąć posłużyli się królewską żoną.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_06', 'Posądzono mnie o jej zamordowanie. Rhobar nie miał innego wyboru.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_07', 'Od szubienicy uratowało mnie tylko wiele lat przykładnej służby. W ten sposób trafiłem tutaj.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_08', 'Ale pewnego dnia odzyskam wolność, a wtedy nadejdzie czas zemsty...', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_DAMNPAST_Info_08_09', 'Zemszczę się!', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_FMTaken_15_00', 'Co myślisz o całej tej sprawie z kopalnią?', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Lee_FMTaken_08_01', 'Tym razem posunęli się za daleko. Jeszcze tego pożałują.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Lee_now_freeminefree_15_01', 'Myślę, że zagrożenie już minęło.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_CHANGESIDE_Info_08_02', 'Nasz obóz wiele ci zawdzięcza. Przydałby mi się ktoś taki jak ty.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_FreemineOrc_EXIT_15_03', 'Dziękuję. Muszę już ruszać w dalszą drogę.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_TELEPORT_08_01', 'Jeszcze coś!', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_TELEPORT_08_03', 'Weź tę magiczną runę jako symbol naszej wdzięczności za twoje dokonania.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_CorAngar_TELEPORT_15_05', 'Dziękuję!', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Exit_Info_15_01', 'Do zobaczenia!', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_CHANGESIDE_Info_15_01', 'Wyrzucono mnie ze Starego Obozu. Chciałbym do was dołączyć.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_CHANGESIDE_Info_08_02', 'Nasz obóz wiele ci zawdzięcza. Przydałby mi się ktoś taki jak ty.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_CHANGESIDE_Info_08_03', 'Przejdźmy od razu do rzeczy. Witaj w Nowym Obozie, Najemniku!', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_CHANGESIDE_Info_08_04', 'Weź tę zbroję. Dobrze, że mamy cię teraz po naszej stronie.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_Info_15_01', 'Przydałaby mi się lepsza zbroja.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_Info_08_02', 'Najpierw musisz sobie na nią zasłużyć. Poza tym - taka rzecz nie jest tania.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_M_Info_08_01', 'Chciałbym dostać wzmocnioną zbroję.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_M_Info_08_02', 'Nie jesteś jeszcze dość doświadczony, żeby otrzymać nowy pancerz. Wróć, jak zdobędziesz trochę doświadczenia.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_M_Info_08_03', 'Bez rudy też nie masz co marzyć o nowej zbroi.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_M_Info_08_04', 'Ta zbroja to kawał solidnej roboty. Będzie ci dobrze służyć.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_H_Info_08_01', 'Chciałbym dostać ciężką zbroję.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_H_Info_08_02', 'Nie jesteś jeszcze dość doświadczony, żeby otrzymać nowy pancerz. Wróć, jak zdobędziesz trochę doświadczenia.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_H_Info_08_03', 'Bez rudy też nie masz co marzyć o nowej zbroi.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ARMOR_H_Info_08_04', 'Ten pancerz to prawdziwe dzieło sztuki. Lepszego nie znajdziesz po tej stronie bariery. Możesz mi wierzyć, wart jest każdej bryłki...', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_Teach_15_00', 'Możesz mnie czegoś nauczyć?', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_Teach_08_01', 'Mogę ci pomóc zwiększyć twoją siłę i zręczność.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND1_Info_15_01', 'Chcę się nauczyć posługiwać dwuręcznym mieczem.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND1_Info_08_02', 'W porządku. Najpierw omówimy podstawy.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND1_Info_08_03', 'Wyciągnij miecz przed siebie. Aby zaatakować wroga tak ciężką bronią, musisz mocniej się zamachnąć.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND1_Info_08_04', 'Unieś rękę i zdecydowanie opuść miecz. To powinno wystarczyć, żeby powalić przeciwnika na ziemię.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND1_Info_08_05', 'Wykorzystaj bezwładność broni, by unieść ją ponownie do góry.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND1_Info_08_06', 'Dwuręczne miecze świetnie sprawdzają się przy zadawaniu ciosów z boku. W ten sposób możesz trzymać przeciwnika na dystans.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND1_Info_08_07', 'To ci powinno wystarczyć na początek. Potrenuj trochę.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_15_01', 'Chciałbym się dowiedzieć czegoś więcej o walce dwuręcznym mieczem.', 1, 44, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_08_02', 'Musisz się nauczyć płynnie przenosić swój środek ciężkości. Trzymaj miecz pionowo. Obie dłonie mocno zaciśnij na rękojeści i przesuń go nieco w bok.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_08_03', 'Teraz uderz szybko od góry i pozwól klindze powędrować nad twoje ramię. Teraz możesz wyprowadzić szybkie cięcie na prawo.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_08_04', 'Twój przeciwnik nie będzie miał okazji podejść bliżej.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_08_05', 'Albo spróbuj wyprowadzić z lewej strony cios do przodu, aby odrzucić rywala do tyłu. ', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_08_06', 'Teraz obrót, żeby kolejny cios nabrał odpowiedniej mocy. Przy odrobinie szczęścia wróg nie przeżyje tego uderzenia.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_08_07', 'A jeśli i to nie wystarczy, wykorzystaj resztę siły zamachowej, by ponownie unieść miecz do góry.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_08_08', 'Po skończonym ataku wykonaj zasłonę i wypatruj luki w obronie przeciwnika.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_700_Lee_ZWEIHAND2_Info_08_09', 'Kluczem do sukcesu jest ciągła zmiana pozycji i umiejętne wykorzystanie bezwładności broni.', 1, 44, 8, null, 700, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sld_702_First_04_00', 'Wiesz dokąd leziesz?', 1, 26, 4, null, 702, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sld_702_First_15_01', 'Nie, dokąd?', 1, 26, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sld_702_First_04_02', 'To droga do siedziby naszego przywódcy - Lee.', 1, 26, 4, null, 702, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sld_702_PERM_15_00', 'Co muszę zrobić, żebyś pozwolił mi zobaczyć się z Lee?', 1, 26, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sld_702_PERM_04_01', 'Nic!', 1, 26, 4, null, 702, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sld_702_PERM_04_02', 'Tu nie Stary Obóz, a Lee to nie Gomez!', 1, 26, 4, null, 702, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sld_702_PERM_04_03', 'On nie musi chować się za plecami całej armii siepaczy. Sam potrafi o siebie zadbać.', 1, 26, 4, null, 702, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Sld_702_PERM_04_04', 'MY jesteśmy tu tylko na wypadek, gdyby nas potrzebował.', 1, 26, 4, null, 702, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAINOFFER_Info_15_01', 'Chciałbym nauczyć się walki jednoręcznym orężem.', 1, 50, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAINOFFER_Info_14_02', 'Nie ma sprawy. Ale to cię będzie kosztowało 30 bryłek rudy. Może być?', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAIN_Info_15_00', 'Chciałbym nauczyć się walki jednoręcznym orężem.', 1, 50, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAIN_14_01', 'Mądra decyzja. Jednak zanim poznasz bardziej zaawansowane techniki, powinieneś nauczyć się prawidłowo trzymać oręż w ręku.', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAIN_14_02', 'Początkujący często łapią zwykły miecz obydwoma rękami. Radziłbym ci się do tego nie przyzwyczajać, to fatalny nawyk. ', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAIN_14_03', 'Trzymaj broń jedną ręką, ostrzem do góry, i zacznij nią machać.', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAIN_14_04', 'Musisz się nauczyć, jak zgrać twoje ruchy z bezwładnością oręża. Dzięki temu twoje ataki będą szybsze i bardziej zaskakujące.', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAIN_14_05', 'Zapamiętaj sobie dobrze, co ci powiedziałem, a twój styl walki stanie się o wiele bardziej elegancki i skuteczny.', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAIN_14_06', 'A, i jeszcze coś! Niektóre ciosy powodują większe obrażenia niż zwykle. Oczywiście, jako początkujący masz raczej niewielkie szanse na zadanie krytycznego uderzenia.', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAIN_14_07', 'Ale to się zmieni w miarę czynienia przez ciebie postępów.', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_HEAVYARMOR_Info_14_03', 'Nie masz wystarczającej ilości rudy!', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAINAGAIN_Info_15_01', 'Naucz mnie, jak sprawniej posługiwać się jednoręczną bronią.', 1, 50, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAINAGAIN_Info_14_02', 'Dobrze, podstawy już znasz. Nieznaczne opuszczenie broni zwiększy siłę twojego pierwszego ciosu.', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAINAGAIN_Info_14_03', 'Musisz wykorzystać siłę bezwładności, pamiętasz? Świetnie. Teraz nauczysz się lepiej balansować ciałem. Po zadaniu dwóch ciosów wykonaj obrót. To powinno zmylić twojego przeciwnika i pozwolić ci wyjść na dobrą pozycję do następnego ataku.', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAINAGAIN_Info_14_04', 'Wtedy wyprowadź następne cięcie z prawej strony...', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SLD_709_Cord_TRAINAGAIN_Info_14_05', 'I znowu do przodu. Pamiętaj - trening czyni mistrza, więc najlepiej weź się od razu do roboty!', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('KDF_402_Corristo_HEAVYARMOR_Info_14_03', 'Nie masz wystarczającej ilości rudy!', 1, 50, 14, null, 709, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_FirstWarn_11_01', 'STAĆ! Nikt nie przejdzie bez podania hasła.', 1, 136, 11, null, 723, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_CRONOS_15_01', 'Cronos udzielił mi pozwolenia!', 1, 136, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_CRONOS_11_02', 'W takim wypadku podałby ci również hasło. Zejdź mi z oczu, kłamco.', 1, 136, 11, null, 723, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_FORGOT_15_01', 'Cholera. Chyba zapomniałem...', 1, 136, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_FORGOT_11_02', 'To wróć, jak tylko sobie przypomnisz i przestań zawracać mi głowę!', 1, 136, 11, null, 723, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_FALSE1_15_01', 'Hasło brzmi TETRIDANOCH.', 1, 136, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_FALSE1_11_02', 'BŁĄD!', 1, 136, 11, null, 723, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_FALSE2_15_01', 'Hasło brzmi TERIANTROCH.', 1, 136, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_FALSE2_11_02', 'BŁĄD!', 1, 136, 11, null, 723, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_TRUE_15_01', 'Hasło brzmi TETRIANDOCH.', 1, 136, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_Parole_TRUE_11_02', 'Zgadza się. Możesz przejść.', 1, 136, 11, null, 723, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_723_LastWarn_11_01', 'Nie będę się powtarzał. ANI KROKU DALEJ!', 1, 136, 11, null, 723, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_EXIT_08_00', 'Uważaj na siebie!', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_First_08_00', 'Chcesz przejść przez tę bramę?', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_First_15_01', 'A spróbujesz mnie powstrzymać?', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_First_08_02', 'Nie, ale powinieneś wiedzieć, co cię tam czeka. Nie jesteś w Starym Obozie, ani wśród tych nawiedzonych świrów!', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_First_15_03', 'No i co mnie tam czeka?', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_First_08_04', 'Tutaj nie ma Cieni ani Świątynnych Strażników, którzy wyciągną cię z kłopotów. W Nowym Obozie każdy musi radzić sobie sam. Tylko my - Najemnicy - trzymamy się razem.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_SldInfo_15_00', 'Czym zajmują się Najemnicy?', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_SldInfo_08_01', 'Jesteśmy żołnierzami w służbie Magów Wody.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_SldInfo_08_02', 'Naszym celem jest wyrwanie się z tej przeklętej kolonii. Musimy ciężko pracować, bo nie chcieliśmy iść na łatwiznę, jak Magnaci ze Starego Obozu, którzy żerują na niewolniczej pracy Kopaczy.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_SldInfo_08_03', 'I wszyscy jesteśmy posłuszni Lee. To wspaniały człowiek. Tylko dzięki niemu ten cholerny obóz jeszcze się nie rozpadł.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Magier_15_00', 'Co robią magowie?', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Magier_08_01', 'Badają magiczne właściwości wydobywanej przez Krety rudy.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Magier_08_02', 'O ile się orientuję, zamierzają wysadzić w powietrze cały ten piekielny kopiec i zniszczyć Barierę.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Magier_15_03', 'To chyba niebezpiecznie.', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Magier_08_04', 'Magowie twierdzą, że nie mamy się czego obawiać.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Erzhaufen_15_00', 'Macie tutaj wielką hałdę rudy?', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Erzhaufen_08_01', 'Aha, można tak powiedzieć. Za taką ilość rudy Rhobar sprzedałby własną żonę.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Erzhaufen_08_02', 'Ale my mamy gdzieś tego starego pierdziela. Chcemy się stąd wydostać!', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_WoHaufen_15_00', 'Gdzie jest ten kopiec?', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_WoHaufen_08_01', 'Chcesz zobaczyć wielką górę rudy, co? Na środku jaskini jest dziura. Tam wszystko zrzucają.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_WoHaufen_08_02', 'Ale nie pozwolą ci się do niej zbliżyć, mówię ci. Magowie i nasi ludzie pilnują rudy dniem i nocą.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_WoHaufen_15_03', 'Pytałem z ciekawości.', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Rest_15_00', 'A co z innymi ludźmi?', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_Rest_08_01', 'Szumowiny, bez wyjątku. Mają gdzieś ten Obóz. Już wolałbym, żeby byle zbieracze ryżu pilnowali bramy.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_PERM_15_00', 'Co słychać w Obozie?', 1, 61, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jarvis_PERM_08_01', 'Krety nadal pracują. Kiedy uzbierają dość rudy, wysadzimy ją w powietrze.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_728_Jarvis_AUFNAHMESOLDIER_Info_08_01', 'Hej, słyszałem, że nieźle dałeś popalić pełzaczom z kopalni!', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Sld_728_Jarvis_AUFNAHMESOLDIER_Info_08_02', 'Lee pewnie zgodzi się przyjąć cię do Najemników. Powinieneś z nim pogadać.', 1, 61, 8, null, 728, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_What_15_00', 'Jestem tu nowy. A ty kim jesteś?', 1, 104, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_What_09_01', 'Jestem Kharim! Widzę, że trafiłeś tu niedawno, inaczej już byś o mnie usłyszał!', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_What_09_02', 'Jestem najlepszym wojownikiem jakiego ten zawszony Obóz kiedykolwiek oglądał.', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_15_00', 'Wyzywam cię na pojedynek! Chodźmy na arenę!', 1, 104, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_09_01', 'TY?! Takich jak ty zjadam na śniadanie!', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_09_02', 'Dobrze ci radzę, chłoptasiu - SPADAJ STĄD!', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_BACK_15_00', 'Dobra, spokojnie. Zapomnijmy o całej sprawie!', 1, 104, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_15_00', 'Boisz się, że oberwiesz, tchórzu?!', 1, 104, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_09_01', 'Nie stać cię na nic lepszego, chłopcze?', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_Goats_15_00', 'To może tak: twój ojciec zabawiał się z owcami...', 1, 104, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_Goats_09_01', 'Cóż, były takie plotki...', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_GomezAss_15_00', 'Powiedzmy sobie szczerze: przyszedłeś tutaj tylko dlatego, żeby móc pocałować Gomeza w dupę!', 1, 104, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_GomezAss_09_01', 'CO!?! Ty gnido! Nie wiesz o czym mówisz! Nowy Obóz ma was gdzieś!', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_GomezAss_09_02', 'A poza tym jest tylko jeden powód, dla którego tutaj przyszedłem: zamierzam publicznie upokorzyć każdego mięczaka, który ośmieli się wyzwać mnie na pojedynek.', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_GomezAss_09_03', 'Ale ciebie załatwię z wyjątkową przyjemnością! Czekam na ciebie na arenie!', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_Stupid_15_00', 'Pomyślmy... Nie, nie przychodzi mi do głowy nic, co byłbyś w stanie zrozumieć.', 1, 104, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_Stupid_09_01', 'Może jednak powinieneś spróbować.', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_Face_15_00', 'Z początku chciałem powiedzieć coś o twoich wątłych ramionach, ale potem zobaczyłem twoją paskudną mordę.', 1, 104, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_Charge_Insult_Face_09_01', 'To twoja ostatnia szansa, żeby odejść stąd o własnych siłach!', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Kharim_InArena_09_00', 'Ból to tylko kwestia siły woli!', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_LetsForgetOurLittleFight', 'Może zapomnimy o naszej małej sprzeczce...', 1, 104, 9, null, 729, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_FirstWarn_08_01', 'STAĆ! Nikt nie przejdzie bez podania hasła.', 1, 143, 8, null, 732, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_CRONOS_15_01', 'Cronos udzielił mi pozwolenia!', 1, 143, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_CRONOS_08_02', 'W takim wypadku podałby ci również hasło. Zejdź mi z oczu, kłamco.', 1, 143, 8, null, 732, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_FORGOT_15_01', 'Cholera. Chyba zapomniałem...', 1, 143, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_FORGOT_08_02', 'To wróć, jak tylko sobie przypomnisz i przestań zawracać mi głowę!', 1, 143, 8, null, 732, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_FALSE1_15_01', 'Hasło brzmi TETRIDANOCH.', 1, 143, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_FALSE1_08_02', 'BŁĄD!', 1, 143, 8, null, 732, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_FALSE2_15_01', 'Hasło brzmi TERIANTROCH.', 1, 143, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_FALSE2_08_02', 'BŁĄD!', 1, 143, 8, null, 732, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_TRUE_15_01', 'Hasło brzmi TETRIANDOCH.', 1, 143, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_Parole_TRUE_08_02', 'Zgadza się. Możesz przejść.', 1, 143, 8, null, 732, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_SLD_732_LastWarn_08_01', 'Nie będę się powtarzał. ANI KROKU DALEJ!', 1, 143, 8, null, 732, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Hallo_15_00', 'Kim jesteś?', 1, 5, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Hallo_04_01', 'Nazywam się Torlof.', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Hallo_04_02', 'Brałem udział w buncie załogi na pokładzie królewskiego okrętu.', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Hallo_04_03', 'To chyba nie był najlepszy pomysł. Większa część załogi była po stronie kapitana.', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Hallo_04_04', 'W ten sposób wylądowałem tutaj.', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Mitmachen_15_00', 'Chciałbym do was dołączyć.', 1, 5, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Mitmachen_04_01', 'Lee przyjmuje tylko najlepszych ludzi, możesz mi wierzyć.', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Mitmachen_04_02', 'I dopóki nie będziesz jednym z nich radzę ci dobrze żyć z Laresem i jego zgrają.', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Mitmachen_04_03', 'Jeśli chcesz dobrą radę, chłopcze: spróbuj zwinąć coś ze Starego Obozu albo Starej Kopalni.', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Mitmachen_04_04', 'Kiedy chłopcy uznają, że nie przepadasz za Gomezem, przestaną ci sprawiać kłopoty.', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Mitmachen_15_05', 'A jak mam to zrobić?', 1, 5, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Torlof_Mitmachen_04_06', 'Najpierw musisz zyskać ich zaufanie, a potem będziesz mógł ich zrobić w konia!', 1, 5, 4, null, 737, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_INTRO_INFO_01_01', 'Ach, gość! Nie próbuj nam tutaj sprawiać żadnych kłopotów, bo oberwiesz!', 1, 79, 1, null, 751, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_EXIT_1_INFO_15_01', 'Lepiej już sobie pójdę.', 1, 79, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_EXIT_1_INFO_01_02', 'Mam nadzieję, że się rozumiemy.', 1, 79, 1, null, 751, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_EXIT_2_INFO_15_01', 'Muszę już iść.', 1, 79, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_EXIT_2_INFO_01_02', 'No to idź!', 1, 79, 1, null, 751, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_UMSEHEN_INFO_15_01', 'Chcę się tylko trochę rozejrzeć.', 1, 79, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_UMSEHEN_INFO_01_02', 'Tylko uważaj, żebyś nie nadepnął komuś na odcisk.', 1, 79, 1, null, 751, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_INMINE_INFO_15_01', 'Chcę się dostać do kopalni.', 1, 79, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_751_Soeldner_INMINE_INFO_01_02', 'Nie wróżę ci wielkich szans powodzenia, ale pogadaj z Okylem.', 1, 79, 1, null, 751, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_INTRO_INFO_11_01', 'Hej, ty! Nie jesteś jednym z moich ludzi! Czego tu szukasz?!', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_EXIT_INFO_15_01', 'Muszę już iść.', 1, 93, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_EXIT_INFO_11_02', 'To nie zawracaj mi głowy!', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_UMSEHEN_INFO_15_01', 'Tylko się tu trochę rozejrzę.', 1, 93, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_UMSEHEN_INFO_11_02', 'Tylko nie próbuj rozrabiać w Kotle, bo trafisz do piachu szybciej niż myślisz.', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_WERBISTDU_INFO_15_01', 'Kim jesteś?', 1, 93, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_WERBISTDU_INFO_11_02', 'Jestem Okyl. To ja rozkazuję w Kotle.', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_INMINE_INFO_15_01', 'Chciałem rzucić okiem na kopalnię.', 1, 93, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_INMINE_INFO_11_02', 'Och, chciałeś sobie zrobić mały spacer po kopalni, co?', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_INMINE_INFO_11_03', 'Widzę, że nie masz pojęcia co się tutaj dzieje. Nikt nie może wejść do kopalni bez mojego pozwolenia.', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_INMINE_INFO_11_04', 'I zapamiętaj sobie: ktokolwiek wejdzie do stróżówki bez mojej zgody, będzie martwym człowiekiem.', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_PERMIT_INFO_15_01', 'Udzielisz mi powodzenia?', 1, 93, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_PERMIT_INFO_11_02', 'Nawet cię nie znam. Dlaczego miałbym cię wpuścić do kopalni?', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_752_OKYL_PERMIT_INFO_11_03', 'A teraz spadaj stąd, mam dużo roboty.', 1, 93, 11, null, 752, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Intro_08_01', 'Hej, ty! Co się dzieje?', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Wasmeinstdu_Info_15_01', 'Cześć!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Wasmeinstdu_Info_08_02', 'Kręcisz się tutaj, jakbyś czegoś szukał!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Wasmeinstdu_Info_15_03', 'Czyżby? Mmh, może masz rację. A dlaczego?', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Wasmeinstdu_Info_08_04', 'Świetnie! Zapytaj MNIE! Może mogę ci jakoś pomóc!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_Info_15_01', 'Co masz na myśli?', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_Info_08_01', 'A czego potrzebujesz?', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_Info_15_02', 'Na początek wystarczy dobry miecz, gruby pancerz i wstęp do kopalni.', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_Info_08_02', 'Phi! To małe piwo!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_Info_08_03', 'Mam tu coś takiego, że oczy ci wyjdą na wierzch. Mogę ci dać broń, którą pokonasz każdego wroga!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_Info_08_04', 'W zamian, wystarczy, że wyświadczysz mi drobną przysługę. To wszystko! Co ty na to?', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_ja_15_05', 'Co miałbym dla ciebie zrobić?', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_ja_08_03', 'To proste!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_ja_08_04', 'Przynieś mi 5 jabłek, 2 butelki ryżówki, 5 butelek piwa, 3 bochenki chleba, 2 kawałki sera i 2 kiście winogron. ', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_ja_08_05', 'Możesz mi wierzyć: nie pożałujesz! Jak już mówiłem - tą bronią pokonasz każdego wroga!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_ja_15_06', 'Dobrze! Zobaczę co się da zrobić!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_ja_08_06', 'To świetnie! Tylko się pospiesz.', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_ja_08_07', 'Tylko nie zapomnij: 5 jabłek, 2 butelki ryżówki, 5 butelek piwa, 3 bochenki chleba, 2 kawałki sera i 2 kiście winogron! Jasne?', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Worumgehts_ja_15_07', 'Jak słońce.', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsnichtdabei_Info_15_01', 'Nie udało mi się jeszcze zebrać wszystkich potrzebnych ci rzeczy. Mógłbyś mi przypomnieć, co to miało być?', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsnichtdabei_Info_08_01', 'Jasne. Słuchaj uważnie. Chcę, żebyś mi przyniósł...', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsnichtdabei_Info_08_02', '5 jabłek, 2 butelki ryżówki, 5 butelek piwa, 3 bochenki chleba, 2 kawałki sera i 2 kiście winogron! Zapamiętasz tym razem?', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsnichtdabei_Info_15_02', 'Oczywiście! Niedługo wrócę!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_15_01', 'Mam już wszystko! teraz porozmawiajmy o tej niesamowitej broni, tak?', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_08_01', 'Najpierw pokaż mi, co dla mnie masz.', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_15_02', 'Proszę bardzo!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_08_02', 'Nooo... W porządku!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_15_03', 'A teraz broń!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_08_03', 'Zapomnij o tym!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_15_04', 'Co?!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_08_04', 'Naprawdę myślałeś, że dostaniesz coś w zamian? Jeśli rzeczywiście jesteś taki głupi, to aż ci współczuję!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_08_05', 'Dziwię się, że przeżyłeś tak długo! Jeśli będziesz wierzył we wszystko co ci powiedzą tutejsi ludzie, nie pociągniesz długo!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_habsdabei_Info_08_06', 'A zresztą - nieważne! Teraz mamy dość jedzenia na małą ucztę. Wielkie dzięki! Może się jeszcze spotkamy! He he he!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_letztes_Wort_Info_15_01', 'Hej! Nie dam się robić w konia!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_letztes_Wort_Info_08_01', 'Czego znowu chcesz! Uciekaj stąd! Powkurzaj sobie kogoś innego, co? No już - spadaj!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_SC_wills_wissen_Info_15_01', 'Widzę, że będę ci musiał dać nauczkę.', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_SC_wills_wissen_Info_08_01', 'No już - pośmialiśmy się trochę, a teraz spadaj stąd! Sio!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_SC_wills_wissen_Info_15_02', 'Chyba mnie nie zrozumiałeś!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_SC_wills_wissen_Info_08_02', 'No dobra! Sam się o to prosiłeś! Ostrzegałem cię!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Exit_Info_15_01', 'Nie, nie! Nieważne! Nie jestem zainteresowany!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Exit_Info_08_02', 'Cóż, jak sobie życzysz! Marnujesz niepowtarzalną okazję!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Exit_Info_15_03', 'Przykro mi, ale nie mam czasu na pogawędki!', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Exit_Info_08_04', 'Och, jesteś zajęty! Porozmawiamy innym razem!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Angebotdochannehmen_Info_15_01', 'Zmieniłem zdanie. Porozmawiajmy jeszcze raz o twojej propozycji.', 1, 102, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_753_Baloro_Angebotdochannehmen_Info_08_01', 'Teraz jest już za późno. Miałeś swoją szansę!', 1, 102, 8, null, 753, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INTRO_INFO_13_01', 'Co się tak kręcisz? Dobrze ci radzę: łapy z dala od tych drzwi!', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_EXIT_1_INFO_15_01', 'Lepiej już sobie pójdę.', 1, 29, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_EXIT_1_INFO_13_02', 'Mam nadzieję, że się rozumiemy.', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_EXIT_2_INFO_15_01', 'Muszę już iść.', 1, 29, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_EXIT_2_INFO_13_02', 'No to idź!', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_UMSEHEN_INFO_15_01', 'Chciałbym się tutaj trochę rozejrzeć.', 1, 29, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_UMSEHEN_INFO_13_02', 'Tylko trzymaj łapy przy sobie, albo ci je odrąbię.', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INMINE_INFO_15_01', 'Chciałbym się dostać do kopalni.', 1, 29, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INMINE_INFO_13_02', 'Do kopalni? Nie wpuszczę nikogo, kto nie otrzymał upoważnienia od Okyla.', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INMINE_INFO_15_03', 'Kim jest Okyl?', 1, 29, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INMINE_INFO_15_08', 'Okyl? Czy to nie ten gość w ciężkiej zbroi i z wielkim toporem?', 1, 29, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INMINE_INFO_13_04', 'Uważaj co mówisz o naszym szefie!', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INMINE_INFO_13_05', 'Powiem ci coś o Okylu: to najtwardszy gość w całym Obozie. Kiedyś nawet wśliznął się do zamku w Starym Obozie i podwędził Magnatom spory ładunek rudy.', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INMINE_INFO_13_06', 'Więc na przyszłość radzę ci okazywać mu trochę więcej szacunku.', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_760_Soeldner_INMINE_INFO_13_07', 'Nie wiem, gdzie jest teraz, ale jakbyś go spotkał, lepiej pamiętaj o tym, co ci dziś powiedziałem.', 1, 29, 13, null, 760, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_INTRO_INFO_03_01', 'Co robisz tutaj, w kopalni?', 1, 91, 3, null, 761, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_EXIT_1_INFO_15_01', 'Mam jeszcze kilka rzeczy do załatwienia.', 1, 91, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_EXIT_1_INFO_03_02', 'Tak też myślałem.', 1, 91, 3, null, 761, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_EXIT_2_INFO_15_01', 'Najlepiej będzie, jak już sobie pójdę.', 1, 91, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_EXIT_2_INFO_03_02', 'W porządku.', 1, 91, 3, null, 761, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_UMSEHEN_INFO_15_01', 'Chciałem się trochę rozejrzeć po Obozie.', 1, 91, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_UMSEHEN_INFO_03_02', 'To trafiłeś w niewłaściwe miejsce. To jest wejście do kopalni. Nie możesz się tutaj kręcić.', 1, 91, 3, null, 761, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_INMINE_INFO_15_01', 'Chciałem tylko obejrzeć kopalnię.', 1, 91, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_INMINE_INFO_03_02', 'Jak widzisz, kopalnia jest zamknięta. Nie ma tu nic ciekawego do oglądania.', 1, 91, 3, null, 761, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_Bribe_INFO_15_01', 'Może się jakoś dogadamy?', 1, 91, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_Bribe_INFO_03_02', 'A o czym tu niby gadać?', 1, 91, 3, null, 761, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_Bribe_INFO_03_03', 'Sekundę, jeśli próbujesz mnie przekupić, to trafiłeś na niewłaściwego człowieka.', 1, 91, 3, null, 761, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_Bribe_INFO_15_04', 'Nie próbuję nikogo przekupić. Pomyślałem tylko...', 1, 91, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_SLD_761_Soeldner_Bribe_INFO_15_05', 'Lepiej już sobie pójdę.', 1, 91, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_300_Alberto_BUY_Info_15_01', 'Może masz coś, co chciałbyś sprzedać?', 1, 96, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_300_Alberto_BUY_Info_12_02', 'Jasne. Co tylko zechcesz... Jeśli masz dość rudy.', 1, 96, 12, null, 300, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_Exit_Info_15_01', 'Rozejrzę się trochę po okolicy.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_Exit_Info_13_02', 'Nie sprawiaj żadnych kłopotów.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_HI_Info_15_01', 'To ty jesteś Ian, szef tej kopalni?', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_HI_Info_13_02', 'Tak, to ja. A to moja kopalnia, więc lepiej nie próbuj niczego głupiego.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GOMEZ_Info_15_01', 'Myślałem, że to kopalnia Gomeza?', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GOMEZ_Info_13_02', 'No cóż, oczywiście, kopalnia należy do Starego Obozu. Ale tutaj, pod ziemią, jest tylko jeden szef - ja!', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_ORE_Info_15_01', 'Możesz mi opowiedzieć o wydobyciu rudy?', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_ORE_Info_13_02', 'Kopiemy dniem i nocą. Dzięki temu wydobywamy około 200 worków rudy na miesiąc, plus jakieś 20 worków, które od razu zostają przetopione.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_ORE_Info_13_03', 'Z rudy, którą dostarczamy królowi można by wykuć oręż dla nie lada armii.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MORE_Info_15_01', 'Słyszałem, że ruda ma właściwości magiczne. Opowiedz mi o tym.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MORE_Info_13_02', 'Tak, nasza ruda rzeczywiście posiada właściwości magiczne. Wykuta z niej broń nigdy się nie psuje, a miecze i topory są ostrzejsze, niż te wykute ze stali.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MORE_Info_13_03', 'Każda armia wyposażona w taki oręż ma poważną przewagę w boju.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MAGIC_Info_15_01', 'Opowiedz mi coś jeszcze o rudzie.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MAGIC_Info_13_02', 'Niestety, magiczne właściwości rudy zanikają podczas przetapiania. W hutach Nordmaru znają odpowiednie techniki przetapiania.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MAGIC_Info_13_03', 'Ale nawet bez mocy magicznych, broń wykonana z naszej rudy jest bardziej wytrzymała i zadaje większe obrażenia niż zwykły oręż.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MINE_Info_15_01', 'Opowiedz mi o kopalni.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MINE_Info_13_02', 'Jeśli chcesz się tu trochę rozejrzeć, to radzę ci dobrze uważać. W jaskiniach kryją się pełzacze. Najlepiej trzymaj się głównego szybu.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MINE_Info_13_03', 'I nie przeszkadzaj Świątynnym Strażnikom. Chociaż przez większość czasu zbijają bąki, to najlepsi sprzymierzeńcy, jakich można sobie wyobrazić podczas starcia z pełzaczami.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MINE_Info_15_04', 'Postaram się o tym pamiętać.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MINE_Info_13_05', 'Mam jeszcze sporo roboty. A, i nie przeszkadzaj w pracy moim ludziom!', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_MINE_Info_15_06', 'Tylko się tu trochę rozejrzę.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_WANTLIST_Info_15_01', 'Przychodzę tu po listę dla Obozu.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_WANTLIST_Info_13_02', 'Każdy może tak powiedzieć. Spadaj.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GETLIST_Info_15_01', 'Przysyła mnie Diego. Mam odebrać listę.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GETLIST_Info_13_02', 'W porządku. Oto i ona. Powiedz im, żeby się pospieszyli z dostawami.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_NEST_Info_15_01', 'Gdzieś tutaj musi być gniazdo pełzaczy.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_NEST_Info_13_02', 'Założę się, że jest tu przynajmniej z tuzin gniazd.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_NEST_Info_15_03', 'Słuchaj, muszę natychmiast iść do tego gniazda...', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_NEST_Info_13_04', 'Nie mam teraz na to czasu! Parę godzin temu zepsuła się nasza młocarnia. Koło zębate pękło w drzazgi.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_NEST_Info_13_05', 'Nie mam pojęcia, gdzie znajdę nowe.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_NEST_Info_13_06', 'Przynieś mi koło zębate. Wtedy zajmę się twoim problemem.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GEAR_RUN_Info_15_01', 'Koło zębate? A gdzie ja niby mam je znaleźć?', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GEAR_RUN_Info_13_02', 'Nie mam pojęcia. Jestem równie bezradny co ty!', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GEAR_RUN_Info_13_03', 'W którymś z bocznych szybów stoi zepsuta młocarnia. Może tam coś znajdziesz.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GEAR_SUC_Info_15_01', 'Mam koło zębate.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GEAR_SUC_Info_13_02', 'Dobra robota! Powinno działać. No a teraz wróćmy do twojej sprawy. Szukasz gniazda pełzaczy... Hmmm...', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GEAR_SUC_Info_13_03', 'Znajdź Asghana i powiedz mu, żeby otworzył ci drzwi. Będziesz mógł rozejrzeć się po zamkniętych korytarzach.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GEAR_SUC_Info_13_04', 'Powiedz mu "Wszystko będzie w porządku". Po tym pozna, że to ja cię przysyłam.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GOTOASGHAN_Info_15_01', 'Nadal szukam gniazda pełzaczy.', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_GOTOASGHAN_Info_13_02', 'Mówiłem ci już - idź do Asghana. To dowódca strażników. Znajdziesz go gdzieś na najniższym poziomie.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_AFTERALL_Info_15_01', 'Znalazłem gniazdo!', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_AFTERALL_Info_13_02', 'No to nareszcie będziemy tu mieli chwilę spokoju. Ha ha ha!', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_AFTERALL_Info_13_03', 'Bez obrazy. Dobra robota, chłopcze.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_AFTERALL_Info_13_04', 'Masz. Weź tę skrzynkę piwa. Zasłużyłeś.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_NOTENOUGH_Info_15_01', 'Znalazłem gniazdo! I jaja złożone przez królową pełzaczy!', 1, 108, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_301_IAN_NOTENOUGH_Info_13_02', 'Co? Tylko tyle tych jaj? A zresztą... Udowodniłeś, że twardy z ciebie gość.', 1, 108, 13, null, 301, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_GREET_Info_15_01', 'Podobno jesteś hutnikiem.', 1, 77, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_GREET_Info_11_02', 'Widzę, że bystry z ciebie chłopak.', 1, 77, 11, null, 302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_MELT_Info_15_01', 'Podobno przetapiasz tutaj część wydobytej rudy.', 1, 77, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_MELT_Info_11_02', 'Kiedyś przetapialiśmy tutaj cały urobek. Ale Gomezowi i Magom nie bardzo się to podobało.', 1, 77, 11, null, 302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_MELT_Info_11_03', 'Siedzieli tu tygodniami, badając rudę i wszystko dookoła.', 1, 77, 11, null, 302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_MELT_Info_11_04', 'Węszyli wszędzie i wtykali swoje szlachetne nochale w rzeczy, o których nie mieli pojęcia.', 1, 77, 11, null, 302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_MELT_Info_11_05', 'W końcu poprzestaliśmy na przetapianiu części urobku. Magowie więcej się tu nie pojawili.', 1, 77, 11, null, 302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_BUY_Info_15_01', 'Możesz mi dać trochę rudy?', 1, 77, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_302_Viper_BUY_Info_11_02', 'Jeśli dasz mi coś w zamian.', 1, 77, 11, null, 302, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_IAmNew_15_00', 'Cześć! Jestem tu nowy!', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_IAmNew_11_01', 'Czego chcesz?', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_IAmNew_15_02', 'Chciałbym zostać jednym z was - chcę zostać członkiem Obozu.', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_IAmNew_11_03', 'Szukasz ludzi, którzy cię poprą, co?', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_IAmNew_11_04', 'Jeśli chcesz, żebym zarekomendował cię u Diego, musisz coś dla mnie zrobić.', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_15_00', 'Co mam dla ciebie zrobić?', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_11_01', 'Chcę jedną z broni, którą ma na składzie Fisk. To jeden z handlarzy na targowisku.', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_11_02', 'Ale on nie chce mi jej sprzedać. To pewien szczególnie pięknie zdobiony miecz.', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_11_03', 'Dam ci 100 bryłek rudy, za które kupisz dla mnie ten miecz. Tylko nie mów mu, że ja cię przysłałem.', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_Ok_15_00', 'Dobrze. Daj mi 100 bryłek, a ja się wszystkim zajmę.', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_Ok_11_01', 'Masz. Tylko nie marudź za długo!', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_OreAway_15_00', 'Przyszło ci do głowy, że mógłbym po prostu uciec z twoją rudą?', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_OreAway_11_01', 'Nie zapominaj, że to jest niewielka kolonia. Prędzej czy później bym cię znalazł!', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_WhyNotSell_15_00', 'Dlaczego Fisk nie chce ci sprzedać tej broni?', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_WhyNotSell_11_01', 'Trochę się posprzeczaliśmy.', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_WhyNotSell_15_02', 'I?', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Favour_WhyNotSell_11_03', 'I to wszystko, co powinieneś wiedzieć!', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Running110_15_00', 'Fisk żąda teraz 110 bryłek rudy za ten miecz.', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Running110_11_01', 'I pewnie mam ci teraz dać dodatkowe 10 bryłek...', 1, 2, 10, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Running110_15_02', 'Myślałem, że zależy ci na tym mieczu.', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_Running110_11_03', 'Masz. Tylko się pospiesz!', 1, 2, 10, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_RunningPayBack_15_00', 'Nie mogę zdobyć tego miecza. Zwracam ci twoją rudę.', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_RunningPayBack_11_01', 'Ty idioto! Nie potrzebujemy tu takich jak ty! Zejdź mi z oczu!', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_RunningPayBack_11_02', 'Ale ja tu nie widzę żadnych 100 bryłek. Radzę ci, żeby szybko się znalazły, bo inaczej...', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_MySword_TooLate_11_00', 'Tu jesteś! Próbowałeś zwiać z moją rudą, co? Chodź no tu, chłopcze!', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_MySword_Success_15_00', 'Mam dla ciebie miecz...', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_MySword_Success_11_01', 'To nie było zbyt trudne. Tak, czy inaczej - wyświadczyłeś mi przysługę, teraz ja wyświadczę przysługę tobie.', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_MySword_Success_11_02', 'Jeśli Diego zapyta mnie o ciebie, opowiem się za tobą. Póki co - trzymaj się!', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_StandardKap1_15_00', 'Jak leci...', 1, 2, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Whistler_StandardKap1_11_01', 'Świetnie! Wyświadczyłeś mi przysługę, teraz ja wyświadczę przysługę tobie. Powiem Diego, że można na tobie polegać.', 1, 2, 11, null, 309, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_First_12_00', 'Witaj! Jestem Fisk. Handluję najróżniejszym towarem. Gdybyś kiedyś czegoś potrzebował, zgłoś się do mnie.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_Trade_15_00', 'Pokaż mi swoje towary.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_15_00', 'Chciałbym kupić miecz. Ale nie taki zwykły. Chciałbym coś... bogato zdobionego.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_12_01', 'Mam tu coś w sam raz dla ciebie. Cień, który miał to odebrać więcej się tu nie pokaże.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_12_02', 'Kosztuje jedyne 110 bryłek rudy. Zainteresowany?', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Org_826_Mordrag_WhistlersSword_BACK_15_00', 'Może innym razem.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_Fault_15_00', 'Przecież Świstakowi chciałeś go sprzedać za 100!', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_Fault_12_01', 'Ach! Chwileczkę... Racja! Mało brakowało, a sprzedałbym ci do zbyt tanio. Naturalnie miałem na myśli 500 bryłek.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_Fault_15_02', 'Pięćset?!', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_Fault_12_03', 'Za mało? Może wolisz 1000? Też dobrze. Chociaż wiesz co? Ten miecz nie jest jednak na sprzedaż.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_TakeIt_15_00', 'Dobrze, wezmę go.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_TakeIt_12_01', 'Trafiła ci się nie lada okazja.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_WhistlersSword_TakeIt_12_02', 'Obawiam się, że masz za mało rudy. Zachowam ten miecz dla ciebie, ale lepiej się pospiesz!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ForgetSword_15_00', 'Porozmawiajmy jeszcze o mieczu Świstaka.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ForgetSword_12_01', 'Powiedz mu, że nigdy nie dostanie tej broni.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_12_00', 'Hej, ty!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_12_01', 'Mordrag był jednym z moich najlepszych dostawców, ty głupcze!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_12_02', 'Jeśli chcesz zostać członkiem tego obozu, na mój głos nie masz co liczyć!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_Relax_15_00', 'Uspokój się! Może mogę ci to jakoś wynagrodzić?', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_Relax_12_01', 'Wątpię, żeby ci się udało. No chyba, że znajdziesz dla mnie nowy kontakt w Nowym Obozie!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_Relax_15_02', 'Jak ja ci znajdę kogoś takiego?', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_Relax_12_03', 'Przecież mówiłem, że nie wydaje mi się, żeby udało ci się tego dokonać.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_FuckOff_15_00', 'To pocałuj mnie w tyłek...', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_Petze_15_00', 'Handlujesz przedmiotami, które należały do Magnatów. Założę się, że Thorus chętnie się o tym dowie.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_MordragKO_Petze_12_01', 'Nawet nie próbuj, kolego!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_HehlerSuccess_15_00', 'Znalazłem kogoś z Nowego Obozu, kto chciałby nawiązać z tobą współpracę.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_HehlerSuccess_12_01', 'No nie! Kto by pomyślał. Widzę, że bardzo ci zależy na popularności w naszym Obozie...', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_HehlerSuccess_12_02', 'No i udało ci się! Kogo mi tu przyprowadziłeś?', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_HehlerSuccess_15_03', 'Nazywa się Sharky.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_HehlerSuccess_12_04', 'Sharky? Jest jeszcze gorszy niż Mordrag!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_HehlerSuccess_12_05', 'Jeśli chodzi o Diego... Nie musisz się już o niego martwić.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ARMOR_Info_15_01', 'Masz dla mnie jeszcze jakąś zbroję?', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ARMOR_Info_12_02', 'Cóż, myślę, że znajdę coś, co cię zadowoli.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ARMOR_L_Info_15_01', 'Potrzebuję lekkich spodni Kopacza.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ARMOR_L_Info_12_02', 'Wróć, gdy będziesz miał wystarczająco dużo rudy.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ARMOR_L_Info_12_03', 'Dobry wybór!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ARMOR_M_Info_15_01', 'Daj mi spodnie Kopacza.', 1, 167, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ARMOR_M_Info_12_02', 'Wróć, gdy będziesz miał wystarczająco dużo rudy.', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Stt_311_Fisk_ARMOR_M_Info_12_03', 'Dobry wybór!', 1, 167, 12, null, 311, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_Sly_10_01', 'Jesteś tu nowy, co? Nigdy wcześniej cię tu nie widziałem.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_Sly_10_02', 'Jestem Zły. Mam pewną robotę dla takiego żółtodzioba jak ty.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_15_00', 'Masz dla mnie robotę? O co chodzi?', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_10_01', 'Zniknął gdzieś jeden z naszych strażników. Nazywa się Nek. Możliwe, że dał nogę do Nowego Obozu.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_10_02', 'Jesteś tu nowy i zaglądasz w każdy kąt. Po prostu miej oczy szeroko otwarte.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_10_03', 'Jeśli uda ci się go znaleźć, będziesz mógł liczyć na moje poparcie.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_Why_15_00', 'A co mi przyjdzie z twojego poparcia?', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_Why_10_01', 'Jeśli chcesz dołączyć do naszego obozu, musisz zjednać sobie poparcie kilku wpływowych ludzi.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_Why_10_02', 'Gdybym szepnął o tobie dobre słowo, Diego spojrzałby na ciebie o wiele przychylniej.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_DoIt_15_00', 'Postaram się go odnaleźć.', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_DoIt_10_01', 'Jakbyś spotkał Fletchera, możesz go zapytać o Neka. Fletcher przejął jego rewir po tym całym tajemniczym zniknięciu.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_DoIt_15_02', 'Gdzie znajdę Fletchera?', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNek_DoIt_10_03', 'Zwykle patroluje teren wokół areny.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_15_00', 'Znalazłem Neka.', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_10_01', 'To świetnie! A masz na to jakieś dowody?', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_Proof_15_00', 'Znalazłem przy nim ten amulet. Proszę, oto on.', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_Proof_10_01', 'Właśnie o ten amulet mi chodziło. Mądry z ciebie chłopak.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_Proof_10_02', 'Założę się, że kusiło cię, żeby zachować ten amulet dla siebie, co? Spokojnie, dokonałeś mądrego wyboru.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_Proof_10_03', 'Jakby Diego pytał o ciebie, opowiem się za tobą.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_NoProof_15_00', 'Nie, obawiam się, że nie.', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_NoProof_10_01', 'Serio? Chyba nic przede mną nie ukrywasz, co? Nek miał przy sobie taki dziwny amulet.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_NoProof_10_02', 'Nie lubię jak ktoś ukrywa przede mną rzeczy, które należą do mnie. Jakbyś znalazł ten amulet, przynieś go mi!', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_LostNekSuccess_NoProof_15_03', 'Postaram się o tym pamiętać, kiedy już znajdę ten amulet.', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_Sly_AfterSuccess_15_00', 'Jak leci?', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_Sly_AfterSuccess_10_01', 'Świetnie! Jeśli o mnie chodzi - Diego usłyszy, że równy z ciebie gość!', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_Sly_AfterSuccess_15_02', 'Ręka rękę myje, co?', 1, 90, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_STT_315_Sly_AfterSuccess_10_03', 'Dokładnie.', 1, 90, 10, null, 315, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_IAmNew_10_00', 'Hej, ty! Sprzedaję bagienne ziele i różne wywary z obozu na bagnach. Może czegoś potrzebujesz?', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_Kraut_15_00', 'Co to jest "bagienne ziele"?', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_Kraut_10_01', 'Jesteś tu nowy, co? Bagienne ziele można palić. To bardzo odprężające.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_Trade_15_00', 'Pokaż mi swoje towary.', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_Trade_10_01', 'Mam tu tylko towar najwyższej jakości...', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_15_00', 'Chciałbym dołączyć do Obozu. Chcę zostać Cieniem.', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_01', 'O, i szukasz pewnie okazji, żeby pokazać, na co cię stać, tak?', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_02', 'Dobra - możesz wyświadczyć mi pewną przysługę. Jeśli dobrze się spiszesz, wstawię się za tobą u Diego.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_15_03', 'O co chodzi?', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_04', 'W obozie Sekty mieszka mężczyzna imieniem Kalom. To wielka szycha - jeden z Guru całej tej pomylonej zgrai.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_05', 'Kalom jest alchemikiem. Posiada przepis na niezwykle skuteczny napój uzdrawiający.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_06', 'Chciałbym go od niego odkupić, wtedy sam mógłbym zacząć produkcję tego napoju.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_07', 'Ale do Kaloma trudno się zbliżyć, zwłaszcza ludziom z zewnątrz.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_15_08', 'A czego oczekujesz ode mnie?', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_09', 'Te świry z sekty bez przerwy szukają nowych ludzi. Jesteś tu nowy, nikt cię nie zna. Udawaj, że chcesz do nich dołączyć.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_10', 'Kalom jest jednym z Guru, więc to on sprawdza nowych kandydatów. Jeśli uda ci się z nim spotkać, spróbuj zdobyć dla mnie tę recepturę.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_10_11', 'Czy za nią zapłacisz, czy nie - to już nie moja sprawa.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_Ok_15_00', 'Dobrze, zobaczę co się da zrobić.', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_HowMuch_15_00', 'To nie będzie łatwe. Co będę z tego miał?', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_HowMuch_10_01', 'Prędzej czy później Diego zapyta mnie co o tobie sądzę. Zgadnij od czego będzie zależała moja odpowiedź.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_Advance_15_00', 'Może będę mu musiał zapłacić za tę recepturę. Potrzebuję 50 bryłek rudy jako zaliczkę.', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_Advance_10_01', 'Nie ma mowy.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_Threat_15_00', 'Nie ma rudy - nie ma receptury!', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_Threat_10_01', 'No dobra, ale o rudzie porozmawiamy jak będziesz miał recepturę w ręku.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_OreNowOrElse_15_00', 'Nie! Albo zapłacisz mi z góry, albo sam sobie idź do obozu na bagnie.', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_OreNowOrElse_10_01', 'Jest tu wielu żółtodziobów. Chyba jednak zlecę to zadanie komuś innemu...', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_ForgetIt_15_00', 'Świetnie! Zapomnijmy o całej sprawie.', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_ForgetIt_10_01', 'Zaraz, powoli! Chciałem tylko zobaczyć, jak daleko się posuniesz... 50 bryłek to trochę dużo jak na żółtodzioba, nie sądzisz?', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_ForgetIt_15_02', 'To już lepiej...', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_JoinOC_ForgetIt_10_03', 'A niech cię szlag! Masz tu swoje 50 bryłek! Tylko nie próbuj mnie wykiwać, mały!', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_WhereST_15_00', 'Gdzie jest ten cały obóz na bagnie?', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_WhereST_10_01', 'Wyjdź z Zewnętrznego Pierścienia przez południową bramę, potem skieruj się na wschód. Najlepiej będzie, jak weźmiesz mapę...', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_WhereST_10_02', 'Mam tu jedną. Kosztuje 50 bryłek...', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_WhereST_15_02', 'Południowa brama to ta przy zawalonej wieży, tak?', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_WhereST_10_03', 'Dokładnie.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_KalomsRecipeSuccess_15_00', 'Mam dla ciebie recepturę, o którą prosiłeś!', 1, 65, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_KalomsRecipeSuccess_10_01', 'To świetnie! Pokaż ją!', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_KalomsRecipeSuccess_10_02', 'Znakomicie! Teraz sam będę mógł wytwarzać napój uzdrawiający.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_KalomsRecipeSuccess_10_03', 'Równy z ciebie chłop! Wspomnę o tobie Diego.', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dexter_KalomsRecipeSuccess_10_04', 'Weź to. To w nagrodę...', 1, 65, 10, null, 329, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_15_00', 'Chcę zostać Cieniem!', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_05_01', 'I co z tego?', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_AnyTips_15_00', 'Możesz mi pomóc?', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_AnyTips_05_01', 'Nie mam pojęcia jak to zrobić...', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_TeachMe_15_00', 'Szukam kogoś, kto mógłby mnie czegoś nauczyć.', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_TeachMe_05_01', 'To dlaczego przyszedłeś do mnie?', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_TeachMe_15_02', 'Przysłał mnie Diego.', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_TeachMe_05_03', 'Trzeba było mówić tak od razu.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_TeachMe_05_04', 'Jeśli chcesz dołączyć do naszego obozu, powinieneś być dobrym wojownikiem albo zręcznym złodziejem.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_TeachMe_05_05', 'Wpływowi ludzie z Obozu będą mieli dla ciebie różne zlecenia, podczas wykonywania których lepiej nie dać się złapać.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_TeachMe_05_06', 'Dlatego na początek proponowałbym ci szkolenie się w fachu złodziejskim.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_BecomeShadow_TeachMe_05_07', 'Zupełnym przypadkiem, tak się składa, że jestem najlepszym złodziejem w całym Starym Obozie.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_15_00', 'Czego możesz mnie nauczyć?', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_05_02', 'To zależy tylko od tego, co chciałbyś wiedzieć.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Schleichen_15_00', 'Chciałbym umieć poruszać się niepostrzeżenie.', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Schleichen_05_01', 'Myślę - bez żadnej fałszywej skromności - że jestem jednym z najlepszych złodziei zrzuconych do tej przeklętej kolonii.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Schleichen_05_02', 'Ale jeśli chodzi o skradanie się, powinieneś porozmawiać z Cavalornem.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Lockpick_15_00', 'Chciałbym nauczyć się otwierać zamki.', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Lockpick_05_01', 'Nie wątpię! Cóż... Początki nie są zbyt trudne.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Lockpick_05_02', 'Przede wszystkim musisz uważać, żeby nie złamać wytrycha.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Lockpick_05_03', 'Musisz być bardzo cierpliwy. Wtedy nie będziesz potrzebował tylu wytrychów, he he!', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Lockpick2_15_00', 'Chciałbym zostać ekspertem w otwieraniu zamków.', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Lockpick2_05_01', 'Gdy nabierzesz już trochę doświadczenia, nauczysz się rozpoznawać dźwięk, jaki wydaje wytrych zanim pęknie.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Lockpick2_05_02', 'Myślę, że powinieneś sobie z tym poradzić. Wsłuchaj się uważnie w dźwięki jakie wydaje otwierany zamek, a nie będziesz potrzebował tylu wytrychów, he, he!', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Lockpick2_05_03', 'Prawdziwy mistrz w tym fachu potrafi otworzyć każdą skrzynię nie łamiąc ani jednego wytrycha.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_PICKPOCKET_15_00', 'Chciałbym zostać zręcznym kieszonkowcem!', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_PICKPOCKET_05_01', 'Chciałbyś odciążyć parę osób z ich dobytku, co? No dobra.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_PICKPOCKET_05_02', 'Pokażę ci na czym powinieneś się skoncentrować, ale szanse, że zostaniesz złapany będą nadal znaczne.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_PICKPOCKET_05_03', 'Podejmuj ryzyko wyłącznie jeśli w pobliżu ofiary nie ma osób trzecich.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_PICKPOCKET_05_04', 'Tylko prawdziwy mistrz potrafi ukraść coś pozostając całkowicie niezauważonym!', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_lehrer_Pickpocket_05_05', 'Nie ma o czym mówić! Nie będzie z ciebie złodzieja, dopóki nie nauczysz się skradać!', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Pickpocket2_15_00', 'Chciałbym zostać mistrzem kieszonkowców!', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Pickpocket2_05_01', 'Cóż, chyba rzeczywiście potrafisz już wystarczająco dużo, żeby opanować zaawansowane sztuczki.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Pickpocket2_05_02', 'Ale musisz pamiętać, że nawet mistrzowie złodziejscy od czasu do czasu zostają złapani.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Lehrer_Pickpocket2_05_03', 'Uważaj na siebie.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_WhereCavalorn_15_00', 'Gdzie znajdę Cavalorna?', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_WhereCavalorn_05_01', 'Poluje gdzieś poza Obozem. Pewnie znajdziesz go na drodze do Nowego Obozu. Na zachód stąd jest taki kanion.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_WhereCavalorn_05_02', 'Tam znajdziesz opuszczoną chatę drwala. Cavalorn powinien kręcić się w jej pobliżu.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Learnt_15_00', 'Nie mógłbyś wstawić się za mną u Diego?', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Learnt_05_01', 'Czemu nie. Nauczyłeś się czegoś, co czyni cię przydatnym dla Starego Obozu.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Learnt_05_02', 'Zręcznych złodziei nigdy nie za wiele. Możesz na mnie liczyć.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Learnt_05_03', 'To zależy...', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Learnt_05_04', 'Jeśli udowodnisz, że nauczyłeś się czegoś w złodziejskim fachu, uznam, że będzie z ciebie jakiś pożytek.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Learnt_15_05', 'Jak mam to niby zrobić?', 1, 100, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Fingers_Learnt_05_06', 'Wyucz się którejś ze złodziejskich umiejętności. Naucz się skradać niepostrzeżenie, okradać ludzi albo otwierać zamki. Wtedy będziesz mógł liczyć na mój głos.', 1, 100, 5, null, 331, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_335_Santino_BUY_Info_15_01', 'Mogę coś od ciebie kupić?', 1, 169, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_335_Santino_BUY_Info_07_02', 'Mam tu wszystko, czego mógłbyś zapragnąć. To czego NIE MAM, i tak by ci się nie przydało.', 1, 169, 7, null, 335, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Hunter_15_00', 'Co tu robisz?', 1, 47, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Hunter_12_01', 'Jestem myśliwym. Poluję głównie na ścierwojady.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_15_00', 'Możesz mnie nauczyć czegoś o myślistwie?', 1, 47, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_12_01', 'To zależy tylko od tego, co chciałbyś wiedzieć.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Bow_15_00', 'Możesz mnie nauczyć, jak sprawniej posługiwać się łukiem?', 1, 47, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Bow_12_01', 'Jako początkujący powinieneś zawsze pamiętać, że skuteczność strzelania z łuku zależy przede wszystkim od przyjętej postawy.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Bow_12_02', 'Rozstaw stopy szeroko, ramiona unieś na tę samą wysokość, wstrzymaj oddech i strzelaj!', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Bow_12_03', 'Jeśli uda ci się trafić w szczególnie wrażliwe punkty ciała ofiary, nie będzie potrzeby oddawania drugiego strzału. Oczywiście początkujący strzelcy mogą tylko pomarzyć o trafieniu w czuły punkt.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Bow_12_04', 'Ale jeśli zastosujesz się do moich wskazówek, możesz liczyć na więcej trafień w cel.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Schleichen_15_00', 'Chciałbym poruszać się bezszelestnie.', 1, 47, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Schleichen_12_01', 'I słusznie. Skradanie pozwoli ci dostać się niepostrzeżenie do cudzych domów, albo po cichu zajść od tyłu przeciwnika.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Schleichen_12_02', 'Chodząc na lekko ugiętych nogach będziesz mógł uważniej obserwować grunt, po którym stąpasz, no i łatwiej będzie ci balansować ciałem.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Schleichen_12_03', 'Oczywiście ktoś obserwujący cię z boku natychmiast nabierze podejrzeń, więc skradaj się zawsze nie będąc widzianym przez osoby trzecie.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_cavalorn_Lehrer_Schleichen_12_04', 'Zapamiętaj sobie dobrze co ci powiedziałem, i przede wszystkim nie daj się złapać!', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cavalorn_Lehrer_Bow_2_Info_12_02', 'Jesteś już całkiem niezłym myśliwym. Teraz pora abyś poznał resztę najważniejszych informacji.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cavalorn_Lehrer_Bow_2_Info_12_03', 'Dobry łucznik bierze pod uwagę wiele czynników zewnętrznych, ale robi to odruchowo, nieświadomie.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cavalorn_Lehrer_Bow_2_Info_12_04', 'Odkryj tajniki funkcjonowania twojego oka, pamiętaj o sile naciągu i wyobrażaj sobie trajektorię lotu strzały, ale przede wszystkim - zawsze bądź czujny!', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Cavalorn_Lehrer_Bow_2_Info_12_05', 'Opanowałeś już większość tajników strzelania z łuku. Teraz pozostało ci tylko rozwijać twoje umiejętności podczas polowania i walki.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_336_cavalorn_SELLBOW_Info_15_01', 'Gdzie mogę zdobyć łuk?', 1, 47, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_336_cavalorn_SELLBOW_Info_12_02', 'Tutaj! Sprzedaję najwspanialsze łuki w całym Starym Obozie.', 1, 47, 12, null, 336, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('STT_336_cavalorn_TRADE_Info_15_01', 'Pokaż mi swoje towary.', 1, 47, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_Exit_Info_09_02', 'Niech Śniący zawsze będzie z tobą!', 1, 99, 9, null, 1400, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_SUGGEST_Info_15_01', 'Potrzebuję twojej pomocy.', 1, 99, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_SUGGEST_Info_15_02', 'Szukam wydzieliny pełzaczy dla Kaloma i chyba wiem już, gdzie znajduje się gniazdo tych drapieżców.', 1, 99, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_SUGGEST_Info_15_03', 'Możemy na ciebie liczyć, kiedy już odblokujemy prowadzące do niego przejście?', 1, 99, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_SUGGEST_Info_09_04', 'Gniazdo pełzaczy! Nareszcie! Mój miecz jest na twoje usługi.', 1, 99, 9, null, 1400, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_INFO_Info_15_01', 'Co możesz mi powiedzieć o pełzaczach?', 1, 99, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_INFO_Info_09_02', 'Te bestie muszą mieć gdzieś tutaj swoje gniazdo. Gdyby udało się je znaleźć, moglibyśmy wytępić je za jednym zamachem!', 1, 99, 9, null, 1400, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_VICTORY_Info_15_01', 'Znalazłem gniazdo królowej!', 1, 99, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1400_GorNaBar_VICTORY_Info_09_02', 'Wykazałeś się odwagą i hartem ducha. Potrzebujemy ludzi takich jak ty!', 1, 99, 9, null, 1400, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_Exit_Info_13_02', 'Niech Śniący zbudzi się ku naszemu zbawieniu!', 1, 160, 13, null, 1401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_SUGGEST_Info_15_01', 'Wiem, gdzie znajduje się gniazdo pełzaczy. Muszę tam pójść, żeby zdobyć coś dla Cor Kaloma.', 1, 160, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_SUGGEST_Info_13_02', 'Zatem przyda ci się moja pomoc. Pójdę z tobą.', 1, 160, 13, null, 1401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_SUGGEST_Info_15_03', 'Dobrze. Spotkamy się przy wielkim przejściu.', 1, 160, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_INFO_Info_15_01', 'Co tu robisz?', 1, 160, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_INFO_Info_13_02', 'Poluję na pełzacze.', 1, 160, 13, null, 1401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_INFO_Info_15_03', 'Możesz mi opowiedzieć o sposobach polowania na pełzacze?', 1, 160, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_INFO_Info_13_04', 'Przy łowach na pełzacze obowiązuje tylko jedna zasada: gdy jakiegoś zobaczysz, rzuć się na niego czym prędzej i spróbuj go zabić pierwszym ciosem.', 1, 160, 13, null, 1401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_INFO_Info_13_05', 'Walcz bez strachu i zabijaj bez litości.', 1, 160, 13, null, 1401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_CRAWLER_Info_15_01', 'Możesz mi opowiedzieć coś jeszcze o tych pełzaczach?', 1, 160, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_CRAWLER_Info_13_02', 'Te bestie działają instynktownie. Próbują zabić wszystko co nie jest pełzaczem.', 1, 160, 13, null, 1401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_CRAWLER_Info_13_03', 'Wykorzystaj tę wiedzę w walce z tymi potworami.', 1, 160, 13, null, 1401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_VICTORY_Info_15_01', 'Znalazłem gniazdo pełzaczy!', 1, 160, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1401_GorNaKosh_VICTORY_Info_13_02', 'Wspaniale! Wróć do obozu i wypełnij rozkaz do końca. Cor Kalom na pewno się niecierpliwi!', 1, 160, 13, null, 1401, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_15_00', 'Możesz mnie czegoś nauczyć?', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_11_01', 'Zejdź mi z oczu, niegodny robaku! Uczę wyłącznie Strażników Świątyni Śniącego.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_11_00', 'Rozmawiałeś z Cor Angarem? I co powiedział?', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_Normal_15_00', 'Kazał mi zgłosić się do niego, gdy już zostanę Świątynnym Strażnikiem.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_Normal_11_01', 'Najwyraźniej ma o tobie wysokie mniemanie. Inaczej nie odezwałby się do ciebie.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_Normal_11_02', 'To wielki zaszczyt zostać przez niego choćby zauważonym. Do mnie odezwał się po raz ostatni całe dwa miesiące temu!', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_Shark_15_00', 'Powiedział, że nigdy nie lubił błotnych węży.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_Shark_11_01', 'Co...? (zdecydowanie) Czeka mnie święta misja!', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_Shark_11_02', 'Życzenie mojego mistrza jest dla mnie rozkazem.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_Unworthy_15_00', 'Powiedział, że jesteś niegodny, by nosić zbroję Świątynnego Strażnika.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaToth_AngarTalked_Unworthy_11_01', 'Nigdy! Nie mógł tak powiedzieć! Nie o mnie!', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_GETSTUFF_Info_15_01', 'Chciałbym odebrać moją zbroję Świątynnego Strażnika.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_GETSTUFF_Info_11_02', 'To prawdziwy zaszczyt wręczyć zbroję człowiekowi, który zdobył dla nas jaja pełzaczy.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_GETSTUFF_Info_11_03', 'Niech ta zbroja chroni cię równie dobrze jak Śniący chroni nasze Bractwo!', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_15_01', 'Potrzebuję lepszej zbroi.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_11_02', 'Cóż, mógłbym ci dać lepszą zbroję, ale musiałbyś najpierw przekazać spory datek na rzecz Bractwa.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_M_15_01', 'Potrzebuję wzmocnionej zbroi Strażników Świątynnych.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_M_11_02', 'Nie jesteś wystarczająco doświadczony. Udowodnij swoją przydatność w Straży, a zasłużysz sobie na lepszy pancerz!', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_M_11_03', 'Gdy tylko wesprzesz naszą społeczność odpowiednim datkiem, zbroja będzie twoja!', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_M_11_04', 'Teraz, gdy jesteś gotów wesprzeć nas swoim hojnym datkiem, możesz odebrać swoją zbroję.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_H_15_01', 'Chciałbym otrzymać ciężką zbroję Straży Świątynnej.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_H_11_02', 'Nie jesteś jeszcze wystarczająco doświadczony. Udowodnij swoją przydatność dla naszej społeczności, a dostąpisz zaszczytu noszenia tak wspaniałego pancerza.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_H_11_03', 'Widzę, że jesteś już gotów, by nosić tę wspaniałą zbroję. Gdybyś tylko miał dość rudy, by wspomóc naszą małą społeczność jakimś hojnym datkiem...', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_H_11_04', 'Od tej pory ten wspaniały pancerz będzie dawał świadectwo twego męstwa i poświęcenia.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_BACK_15_01', 'Chyba się jednak rozmyślę.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorNaToth_ARMOR_BACK_11_02', 'Jak sobie życzysz. Wiesz, gdzie mnie szukać.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_Teach_15_00', 'Możesz mnie czegoś nauczyć?', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_Teach_11_01', 'Siła i zręczność są równie istotne jak potęga umysłu.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAIN_Info_15_00', 'Chciałbym nauczyć się walki jednoręcznym orężem.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAIN_11_01', 'Mądra decyzja. Jednak zanim poznasz bardziej zaawansowane techniki, powinieneś nauczyć się prawidłowo trzymać oręż w ręku.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAIN_11_02', 'Początkujący często łapią zwykły miecz obydwoma rękami. Radziłbym ci się do tego nie przyzwyczajać, to fatalny nawyk. ', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAIN_11_03', 'Trzymaj broń jedną ręką, ostrzem do góry, i zacznij nią machać.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAIN_11_04', 'Musisz się nauczyć, jak zgrać twoje ruchy z bezwładnością oręża. Dzięki temu twoje ataki będą szybsze i bardziej zaskakujące.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAIN_11_05', 'Zapamiętaj sobie dobrze co ci powiedziałem, a twój styl walki stanie się o wiele bardziej elegancki i skuteczny.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAIN_11_06', 'A, i jeszcze coś! Niektóre ciosy powodują większe obrażenia niż zwykle. Oczywiście, jako początkujący masz raczej niewielkie szanse na zadanie krytycznego uderzenia.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAIN_11_07', 'Ale to się zmieni w miarę czynienia przez ciebie postępów.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAINAGAIN_Info_15_01', 'Naucz mnie, jak sprawniej posługiwać się jednoręczną bronią.', 1, 115, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAINAGAIN_Info_11_02', 'Dobrze, podstawy już znasz. Nieznaczne opuszczenie broni zwiększy siłę twojego pierwszego ciosu.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAINAGAIN_Info_11_03', 'Musisz wykorzystać siłę bezwładności, pamiętasz? Świetnie. Teraz nauczysz się lepiej balansować ciałem. Po zadaniu dwóch ciosów wykonaj obrót. To powinno zmylić twojego przeciwnika i pozwolić ci wyjść na dobrą pozycję do następnego ataku.', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAINAGAIN_Info_11_04', 'Wtedy wyprowadź następne cięcie z prawej strony...', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('TPL_1402_GorNaToth_TRAINAGAIN_Info_11_05', 'I znowu do przodu. Pamiętaj - trening czyni mistrza, więc najlepiej weź się od razu do roboty!', 1, 115, 11, null, 1402, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaRan_Wache_15_00', 'Co tu robisz?', 1, 12, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaRan_Wache_13_01', 'Pilnuję, żeby błotne węże nie podpływały zbyt blisko Obozu.', 1, 12, 13, null, 1405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaRan_Wache_13_02', 'Na twoim miejscu trzymałbym się od nich z dala. W walce z takim potworem nie masz najmniejszych szans!', 1, 12, 13, null, 1405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaRan_Wache_13_03', 'A teraz idź już sobie. Muszę mieć oczy szeroko otwarte.', 1, 12, 13, null, 1405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1405_GorNaRan_Info_13_01', 'A dokąd to się wybierasz? Nikt nie ma tu prawa wstępu!', 1, 12, 13, null, 1405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1405_GorNaRan_Info_15_02', 'A co się tu tak w ogóle dzieje?', 1, 12, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1405_GorNaRan_Info_13_03', 'Pytasz, co się tu dzieje? Padnij na kolana i błagaj Śniącego o litość nad twą grzeszną duszą! Oto bowiem nadszedł moment jego wielkiego przebudzenia!', 1, 12, 13, null, 1405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1405_GorNaRan_Info_15_04', 'Chciałem się tylko trochę rozejrzeć.', 1, 12, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1405_GorNaRan_Info_13_05', 'Gnido! Tacy jak ty nie mają tu czego szukać we wzniosłej chwili ostatecznego triumfu Śniącego! Widzę, że muszę ci to wbić do głowy!', 1, 12, 13, null, 1405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1405_GorNaRan_Info_15_06', 'Nie powstrzymasz mnie!', 1, 12, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1405_GorNaRan_Info_13_07', 'Jak sobie życzysz, chłopcze, w imię Śniącego!', 1, 12, 13, null, 1405, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_KalomsGuard_PERM_15_00', 'Chyba nie będziesz miał nic przeciwko, jeśli tam wejdę?', 1, 119, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_KalomsGuard_PERM_13_01', 'Okazuj mojemu mistrzowi należyty szacunek, albo nie pożyjesz długo!', 1, 119, 13, null, 1406, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_13_00', 'Witaj, nieznajomy!', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_13_01', 'Stąpasz po świętej ziemi. Jesteś w obozie Bractwa Śniącego!', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_13_02', 'Co cię tu sprowadza?', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_Join_15_00', 'Słyszałem, że szukacie nowych członków. Chciałbym do was dołączyć.', 1, 52, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_Join_13_01', 'Zatem bądź pozdrowiony. Bractwo Śniącego chętnie wita wszystkich, którzy wyrzekli się drogi zła i chcą żyć wedle nauk Śniącego.', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_Join_13_02', 'Jeśli naprawdę chcesz zostać jednym z nas, spróbuj zwrócić na siebie uwagę Baal Namiba. Znajdziesz go na placu, tuż za bramą.', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_Join_13_04', 'Ale nie wolno ci odezwać się do niego. Zaczekaj, aż on zwróci się do ciebie.', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_JustLooking_15_00', 'Jestem tu nowy. Chciałbym rozejrzeć się trochę po waszym obozie.', 1, 52, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_JustLooking_13_01', 'Zatem wejdź. Będziesz tu mile widzianym gościem.', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_First_JustLooking_13_02', 'Tylko staraj się przestrzegać naszych zasad. W Obozie są miejsca, do których obcy nie mają wstępu.', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_Sit_15_00', 'Co słychać w Obozie?', 1, 52, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1415_Torwache_Sit_13_01', 'Wszystko w porządku. Możesz śmiało wejść do środka.', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Torwache_IMPORTANT_Info_13_01', 'Słyszałem, co się wydarzyło w kopalni. Dobra robota. Zasłużyłeś na przyjęcie w poczet Świątynnej Straży!', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Torwache_IMPORTANT_Info_13_02', 'Porozmawiaj koniecznie z Cor Angarem!', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Templer_ROCK_Info_15_01', 'Potrzebuję jakiegoś pancerza.', 1, 52, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Templer_ROCK_Info_13_02', 'Musiałbyś zasłużyć sobie na zbroję Świątynnej Straży, taką jak ta, którą noszę. Ale na początek wystarczy ci szata Nowicjusza.', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Templer_ROCK_Info_15_03', 'Lepszy rydz niż nic...', 1, 52, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Templer_ROCK_Info_13_04', 'Oczywiście nie otrzymasz jej za darmo!', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Templer_ROCK_BUY_15_01', 'Niech będzie, wezmę tę szatę.', 1, 52, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Templer_ROCK_BUY_13_02', 'Wróć, gdy będziesz miał wystarczająco dużo rudy.', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1415_Templer_ROCK_BUY_13_03', 'Ta szata może ocalić ci życie!', 1, 52, 13, null, 1415, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1416_Torwache_Life_15_00', 'Jak wygląda życie strażników Bractwa?', 1, 89, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1416_Torwache_Life_08_01', 'Otrzymałem niezwykle ważne zadanie. Jaśnie Oświecony i jego uczniowie złożyli swe życie w moich rękach.', 1, 89, 8, null, 1416, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Tpl_1416_Torwache_Life_08_02', 'Niech cień zapomnienia pokryje moje dawne życie. Teraz jestem GOR NA - Święty Strażnik Śniącego!', 1, 89, 8, null, 1416, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_What_15_00', 'Co tu robisz?', 1, 116, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_What_08_01', 'Ja? Walczę ku chwale wielkiego Śniącego!', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Arena_15_00', 'Walczysz na arenie?', 1, 116, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Arena_08_01', 'Zostałem wybrany przez moich mistrzów, by bronić na arenie honoru obozu na bagnie.', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Arena_08_02', 'Przyświeca mi więc wyższy cel. Walczę, by pokazać niewiernym jak wielka jest potęga Śniącego!', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Sleeper_15_00', 'Kim jest Śniący?', 1, 116, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Sleeper_08_01', 'W naszym obozie znajdziesz świętych mężów, którzy odpowiedzą ci na to pytanie znacznie lepiej niż ja.', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Sleeper_08_02', 'Powiem ci tylko tyle: Śniący będzie naszym zbawicielem. Przyprowadził nas tutaj i z jego pomocą uda się nam stąd wydostać.', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Sleeper_15_03', 'Chcesz przez to powiedzieć, że czekacie aż wasz bóg zwróci wam wolność?', 1, 116, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Sleeper_08_04', 'Tak! Nasze oczekiwanie wkrótce dobiegnie końca. W tej chwili przygotowujemy się do rytuału wielkiego przyzwania.', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Summoning_15_00', 'Na czym polega rytuał, który planujecie?', 1, 116, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Summoning_08_01', 'Nasi prorocy przewidzieli, że wspólne przywołanie Śniącego jest jedyną drogą do odzyskania wolności!', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Summoning_08_02', 'Jeśli chcesz się jeszcze czegoś dowiedzieć, powinieneś udać się do naszego obozu.', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_WayToST_15_00', 'Mógłbyś opisać mi drogę do waszego obozu?', 1, 116, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_WayToST_08_01', 'W Starym Obozie znajdziesz kilku Nowicjuszy Bractwa, którzy chętnie wskażą ci drogę do obozu na bagnie. Znajdź któregoś z nich i porozmawiaj z nim!', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Charge_15_00', 'Wyzywam cię na pojedynek na arenie!', 1, 116, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Charge_08_01', 'Zabicie kogoś takiego jak ty nie przysporzy raczej chwały Śniącemu.', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Charge_08_02', 'Stanę z tobą w szranki dopiero w tedy, gdy okażesz się godnym rywalem.', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_Charge_08_03', 'Ale jestem pewien, że wojownicy z Nowego Obozu nie będą mieli takich skrupułów...', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_ChargeGood_15_00', 'Czy jestem już dość silny, żeby się z tobą zmierzyć?', 1, 116, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_GorHanis_ChargeGood_08_01', 'Nie! Jesteś jeszcze zbyt słaby. Nie sprostasz mi w walce!', 1, 116, 8, null, 1422, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_Exit_Info_13_02', 'Niech nadejdzie przebudzenie Śniącego.', 1, 16, 13, null, 1433, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_HEALTH_Info_15_01', 'Potrzebuję twojej pomocy.', 1, 16, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_HEALTH_Info_15_02', 'Szukam wydzieliny pełzaczy dla Kaloma, i chyba wiem już, gdzie znajduje się gniazdo tych drapieżców.', 1, 16, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_HEALTH_Info_15_03', 'Pomożesz mi po otwarciu przejścia?', 1, 16, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_HEALTH_Info_13_04', 'Walka z pełzaczami to niebezpieczne zadanie. Przynieś mi napój uzdrawiający, wtedy ci pomogę.', 1, 16, 13, null, 1433, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_IAN_Info_15_01', 'Szukam gniazda pełzaczy.', 1, 16, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_IAN_Info_13_02', 'W pobliżu głównego szybu znajduje się wiele jaskiń, ale nie udało się nam jeszcze odnaleźć gniazda.', 1, 16, 13, null, 1433, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_HEALTH_SUC_Info_15_01', 'Proszę, może to ci pomoże.', 1, 16, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_HEALTH_SUC_Info_13_02', 'Dzięki. Możesz na mnie liczyć. Spotkamy się na dole, u Asghana.', 1, 16, 13, null, 1433, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNaVid_HEALTH_SUC_Info_15_03', 'Będę czekał.', 1, 16, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNavid_VICTORY_Info_15_01', 'Znalazłem gniazdo królowej!', 1, 16, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNavid_VICTORY_Info_13_02', 'Dziękuję ci w imieniu całego Bractwa!', 1, 16, 13, null, 1433, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1433_GorNavid_VICTORY_Info_13_03', 'Oby Śniący nigdy nie odwrócił od ciebie swego przychylnego spojrzenia.', 1, 16, 13, null, 1433, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1436_Templer_CRAWLER_Info_15_01', 'Co słychać?', 1, 153, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1436_Templer_CRAWLER_Info_13_02', 'Polujemy na pełzacze. Przy okazji bronimy Kopaczy przed atakami tych bestii.', 1, 153, 13, null, 1436, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1436_Templer_CRAWLER_Info_13_03', 'Jednak tak naprawdę interesuje nas wydzielina pełzaczy. Nasz Guru, Cor Kalom, przygotuje z niej magiczny wywar.', 1, 153, 13, null, 1436, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_NERV_Info_15_01', 'Co słychać?', 1, 149, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_NERV_Info_13_02', 'Słuchaj, mógłbyś przestać zawracać nam głowę?', 1, 149, 13, null, 1437, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVE_Info_15_01', 'Wszystko w porządku?', 1, 149, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVE_Info_13_02', 'Potrzebuję chwili spokoju, jasne? Idź stąd i zajmij się czymś pożytecznym!', 1, 149, 13, null, 1437, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVENOW_Info_15_01', 'Nie rozumiem!', 1, 149, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVENOW_Info_13_02', 'No to spróbuję wyrażać się jaśniej.', 1, 149, 13, null, 1437, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVENOW_Info_13_03', 'SPADAJ!', 1, 149, 13, null, 1437, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVENOW_Info_13_04', 'Opuść tę kopalnię!', 1, 149, 13, null, 1437, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVENOW_Info_13_05', 'NIGDY WIĘCEJ SIĘ DO MNIE NIE ODZYWAJ!', 1, 149, 13, null, 1437, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVENOW_Info_13_06', 'Idź sobie! Zostaw mnie w spokoju.', 1, 149, 13, null, 1437, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1437_Templer_LEAVENOW_Info_13_07', 'SPADAJ STĄD!', 1, 149, 13, null, 1437, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_Exit_Info_15_01', 'Do zobaczenia.', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_Exit_Info_13_02', 'Niech nadejdzie przebudzenie Śniącego.', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_INFO_Info_15_01', 'Co Strażnicy Świątynni robią w kopalni?', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_INFO_Info_13_02', 'Polujemy na pełzacze. Wracaj do Obozu. Tam będziesz bezpieczny.', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_WHY_Info_15_01', 'Dlaczego polujecie na pełzacze?', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_WHY_Info_13_02', 'Ich wnętrzności zawierają niezwykle cenną wydzielinę.', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_WHY_Info_15_03', 'Co to za wydzielina?', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_WHY_Info_13_04', 'Trucizna. Tylko nasz wielki Guru, Cor Kalom, potrafi przyrządzać z niej magiczne wywary.', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_KALOM_Info_15_01', 'Kim jest Cor Kalom?', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_KALOM_Info_13_02', 'To jeden z najpotężniejszych ludzi w całym Bractwie. Posiadł wiele tajemnic magii i potrafi kontrolować ludzkie myśli!', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_KALOM_Info_13_03', 'Oprócz tego jest również alchemikiem. Przygotowuje wywary, które pozwolą nam nawiązać kontakt ze Śniącym. Jeśli chcesz go poznać, udaj się do naszego obozu. Zawsze chętnie witamy nowych gości!', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_KALOM_Info_15_04', 'Zastanowię się...', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_EGGSEARCH_Info_15_01', 'Szukam gniazda pełzaczy.', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_EGGSEARCH_Info_13_02', 'Porozmawiaj z Gor Na Videm, Gor Na Koshem lub Gor Na Barem. Oni wiedzą więcej o pełzaczach niż ja.', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_ZANGEN_Info_15_01', 'Jak mogę pozyskać wydzielinę z wnętrzności pełzaczy?', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_ZANGEN_Info_13_02', 'To nie takie proste, ale mogę cię nauczyć.', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_TEACHZANGEN_Info_15_01', 'Naucz mnie pozyskiwać wydzielinę z wnętrzności pełzaczy.', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_TEACHZANGEN_Info_13_01', 'Najpierw musisz wykonać głębokie cięcie. Tylko uważaj, żeby nie przeciąć gruczołu jadowego, bo trucizna może trysnąć ci na ręce.', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_TEACHZANGEN_Info_15_02', 'To musi być bardzo bolesne.', 1, 98, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_TEACHZANGEN_Info_13_03', 'Jeszcze jak! Poznałeś kiedyś Korgura Trzy Palce, tego łowcę pełzaczy? A, nie - to było przed twoim przybyciem. Cóż, kontynuujmy...', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Tpl_1438_Templer_TEACHZANGEN_Info_13_04', 'Wytnij spory kawał mięsa dookoła gruczołu. Jeśli będziesz wystarczająco ostrożny, powinno ci się udać bezpiecznie pozyskać gruczoły.', 1, 98, 13, null, 1438, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_Greet_15_00', 'Cześć! Dokąd się wybieracie?', 1, 135, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_Greet_09_01', 'Zabieramy wydzielinę pełzaczy zdobytą przez naszych braci w Starej Kopalni do Cor Kaloma.', 1, 135, 9, null, 1439, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_Greet_09_02', 'Codziennie udajemy się do kopalni po nową porcję wydzieliny.', 1, 135, 9, null, 1439, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_WasSekret_15_00', 'Co to za wydzielina?', 1, 135, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_WasSekret_09_01', 'Pozyskujemy ją z wnętrzności pełzaczy. Przy odrobinie ostrożności można wyciąć ich gruczoły jadowe.', 1, 135, 9, null, 1439, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_TeachMandibles_15_00', 'Możesz mnie nauczyć pozyskiwać wydzielinę pełzaczy?', 1, 135, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_TeachMandibles_09_01', 'Oczywiście! Natychmiast po zabiciu potwora wytnij jego gruczoły jadowe. Tylko pod żadnym pozorem nie wolno ci ich uszkodzić!', 1, 135, 9, null, 1439, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_WhatFor_15_00', 'Po co Cor Kalomowi ta wydzielina?', 1, 135, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_WhatFor_09_01', 'Z tego co wiem, przyrządza z nich napój, który zwiększa magiczne zdolności Nowicjuszy.', 1, 135, 9, null, 1439, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_WhatFor_09_02', 'Przygotowujemy się teraz do wielkiego przyzwania, więc potrzebujemy jak najwięcej tej wydzieliny.', 1, 135, 9, null, 1439, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_WhatFor_09_03', 'Przy pomocy tego napoju Nowicjusze przywołają Śniącego.', 1, 135, 9, null, 1439, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_Permanent_15_00', 'Czy macie już wystarczająco dużo napoju, by przywołać Śniącego?', 1, 135, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_GorNaDrak_Permanent_09_01', 'Niestety! Nasi myśliwi polują na pełzacze dniem i nocą, ale wciąż nie mamy dość wydzieliny.', 1, 135, 9, null, 1439, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1441_FirstWarn_13_01', 'STÓJ! Na świątynne wzgórze można wejść tylko za pozwoleniem któregoś z Guru!', 1, 7, 13, null, 1441, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1441_FirstWarn_Condition_YBERION_15_01', 'Sam Y''Berion udzielił mi pozwolenia.', 1, 7, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1441_FirstWarn_Condition_YBERION_13_02', 'Kłamcy łatwo mogą stracić język, więc uważaj co mówisz.', 1, 7, 13, null, 1441, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1441_FirstWarn_Condition_LESTER_15_01', 'Przysyła mnie Nowicjusz Lester. Chciałbym ofiarować moje usługi Y''Berionowi.', 1, 7, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1441_FirstWarn_Condition_LESTER_13_02', 'Znam Lestera. Można mu zaufać. Możesz przejść.', 1, 7, 13, null, 1441, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1441_LastWarn_13_01', 'Jeszcze jeden krok, a będzie po tobie.', 1, 7, 13, null, 1441, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1442_FirstWarn_13_01', 'STÓJ! Na świątynne wzgórze można wejść tylko za pozwoleniem któregoś z Guru!', 1, 103, 13, null, 1442, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1442_FirstWarn_Condition_YBERION_15_01', 'Sam Y''Berion udzielił mi pozwolenia.', 1, 103, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1442_FirstWarn_Condition_YBERION_13_02', 'Kłamcy łatwo mogą stracić język, więc uważaj co mówisz.', 1, 103, 13, null, 1442, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1442_FirstWarn_Condition_LESTER_15_01', 'Przysyła mnie Nowicjusz Lester. Chciałbym ofiarować moje usługi Y''Berionowi.', 1, 103, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1442_FirstWarn_Condition_LESTER_13_02', 'Znam Lestera. Można mu zaufać. Możesz przejść.', 1, 103, 13, null, 1442, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1442_LastWarn_13_01', 'Jeszcze jeden krok, a będzie po tobie.', 1, 103, 13, null, 1442, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1455_GorBoba_08_01', 'Odejdź stąd, nie jesteś tu mile widziany.', 1, 41, 8, null, 1455, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1455_GorBoba1_15_01', 'A co, spróbujesz mnie powstrzymać?', 1, 41, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1455_GorBoba1_08_02', 'TAK! Powstrzymam cię. Nie przeszkodzisz mistrzowi Kalomowi w przebudzeniu Śniącego.', 1, 41, 8, null, 1455, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1455_GorBoba1_08_03', 'Nie próbuj mnie atakować. Arcykapłan przekazał część swojej mocy Mistrzowi Kalomowi i nam. Jesteśmy nieśmiertelni!', 1, 41, 8, null, 1455, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1455_GorBoba1_15_04', 'Ja ci pokażę tę waszą nieśmiertelność!', 1, 41, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_TPL_1455_GorBoba1_08_05', 'Przygotuj się na spotkanie ze stwórcą!', 1, 41, 8, null, 1455, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Bully_01_00', 'Zaczekaj! Słyszałem, że gadałeś z Bloodwynem?', 1, 173, 1, null, 511, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Bully_15_01', 'A co? Czego chcesz?', 1, 173, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Bully_01_02', 'Niezły z ciebie gość! Niewielu ma tyle odwagi, żeby mu podskoczyć!', 1, 173, 1, null, 511, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Bully_01_03', 'A to oznacza, że teraz my wszyscy będziemy musieli płacić twoją dolę.', 1, 173, 1, null, 511, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Bully_01_04', 'Postaram się, żebyś o tym pamiętał, gdy Bloodwyn znów poprosi cię o datek.', 1, 173, 1, null, 511, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Motz_15_00', 'Co słychać?', 1, 173, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Motz_01_01', 'W tym obozie jest miejsce tylko dla jednego z nas!', 1, 173, 1, null, 511, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Motz_15_02', 'Co proszę?', 1, 173, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Motz_01_03', 'Gdyby to zależało ode mnie, dawno już byś nie żył!', 1, 173, 1, null, 511, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Motz_01_04', 'Wiesz dlaczego tu trafiłem? Zabiłem dwunastu ludzi jednej nocy, ot - tak sobie... Hi hi hi!', 1, 173, 1, null, 511, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Anlegen_15_00', 'Myślisz, że taki twardziel z ciebie? Może spróbujesz szczęścia ze mną?!', 1, 173, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Herek_Anlegen_01_01', 'Chcesz dostać w czapę? Cóż, nasz klient - nasz pan!', 1, 173, 1, null, 511, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Vlk_520_LeaveMe_15_00', 'Co tu robisz?', 1, 46, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Vlk_520_LeaveMe_01_01', 'Szukam ciszy i spokoju, więc spadaj stąd!', 1, 46, 1, null, 520, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Hello_15_00', 'Cześć, jestem tu nowy. Jak leci?', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Hello_03_01', 'Zejdź mi z oczu. Harowałem pod ziemią przez ostatnie dwa tygodnie. I za co?!', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Hello_03_02', 'Parę nędznych bryłek rudy - nic ponad to! Większość z tego musiałem wydać na żywność.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Hello_03_03', 'Rozmawiałem niedawno z Baal Parvezem. Opowiedział mi wiele ciekawych rzeczy o Obozie Sekty.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Hello_03_04', 'Podobno jest tam o wiele lepiej. Przynajmniej nie trzeba harować na tych darmozjadów Gomeza.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_WhyNotLeave_15_00', 'Nie podoba ci się tutaj? To dlaczego po prostu nie odejdziesz?', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_WhyNotLeave_03_01', 'Bo nie wiem, co mnie tam czeka. Miałem tutaj kumpla - nazywał się Melvin. Poszedł do obozu na bagnie jakiś tydzień temu.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_WhyNotLeave_03_02', 'Ale od tej pory nie mam od niego żadnych wieści. Dopóki się do mnie nie odezwie, wolę się stąd nie ruszać!', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_MetMelvin_15_00', 'Byłem w Obozie Sekty i rozmawiałem z Melvinem.', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_MetMelvin_03_01', 'Naprawdę?! I co powiedział?', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_MetMelvin_15_02', 'Najwyraźniej przedkłada życie w Bractwie nad ciągłe zatargi ze Strażnikami.', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_MetMelvin_03_03', 'No nie! Ten stary cap wyleguje się, podczas gdy ja muszę tu tyrać jak wół! Już ja mu pokażę... Ale nie uda mi się opuścić tego obozu.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_MetMelvin_15_04', 'Dlaczego nie?', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_MetMelvin_03_05', 'Strażnicy dowiedzieli się, że zamierzam stąd odejść. Chyba za dużo o tym gadałem.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_MetMelvin_03_06', 'Potrzebuję przynajmniej 100 bryłek rudy, żeby ich przekupić.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Offer100Ore_15_00', 'A gdybym tak dał ci te 100 bryłek?', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Offer100Ore_03_01', 'Zrobiłbyś to? Ale dlaczego?', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Offer100Ore_15_02', 'Cóż, powiedzmy, że nie tylko ty wolisz życie w Bractwie od Starego Obozu.', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_Offer100Ore_03_03', 'To znaczy, że chcesz pójść ze mną?', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_IWouldGo_15_00', 'To znaczy, że odprowadzę cię do obozu Bractwa.', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_IWouldGo_03_01', 'To wspaniale! Jestem gotowy do drogi. Możemy ruszać w każdej chwili.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_IWouldGo_03_02', 'Ale nie zapominaj - potrzebujemy 100 bryłek rudy dla Strażników.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_LetsGo_15_00', 'Jestem gotowy - możemy ruszać.', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_LetsGo_03_01', 'Dobra - wyjdźmy południową bramą. Przy północnym wyjściu nic nie wskóramy. Tamtejsi Strażnicy są nieprzekupni.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_LetsGo_03_02', 'Wolałbym, żebyś to ty zajął się całą tą sprawą z rudą. Ja się nie nadaję do takich rzeczy.', 1, 178, 3, null, 524, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Dusty_LetsGo_15_03', 'Dobrze - ruszajmy!', 1, 178, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_Hello_15_00', 'Witam!', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_Hello_03_01', 'Mhm? Nie widziałem cię jeszcze tutaj. Jesteś nowy, prawda?', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_Hello_15_02', 'Tak, trafiłem tu niedawno...', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_Hello_03_03', 'Zdecydowałeś już, do którego obozu dołączysz?', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_Hello_15_04', 'Nie. Masz dla mnie jakieś sugestie?', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_Hello_03_05', 'Cóż, to zależy. Każdy obóz ma swoje wady i zalety.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_Hello_03_06', 'Dopóki nie podejmiesz decyzji, możesz zostać tutaj. Właśnie zwolniła się jedna chata.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_15_00', 'Jakie są zalety Starego Obozu?', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_03_01', 'Jeśli zapłacisz Strażnikom za ochronę, będziesz mógł żyć we względnym spokoju. Strażnicy pilnują, żeby ich ludziom nie działa się krzywda.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_03_02', 'Poza tym, tylko tutaj dostaniesz towary z zewnętrznego świata po przyzwoitych cenach. W innych obozach zapłacisz za nie fortunę!', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_BACK_15_00', 'Chyba dość już usłyszałem o Starym Obozie.', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_BACK_03_01', 'Podoba mi się tutaj.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_Warez_15_00', 'Jakie towary są tu szczególnie cenne?', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_Warez_03_01', 'Wszystko, co pochodzi z zewnętrznego świata: chleb, ser, boczek, ale przede wszystkim piwo i wino. W kolonii wytwarza się tylko tę paskudną ryżówkę!', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_Warez_03_02', 'Zawsze można zarobić na broni, a zbroje są NIEZWYKLE kosztowne.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_Warez_03_03', 'Strażnicy zdjęli zbroje z zabitych królewskich rycerzy.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_Warez_03_04', 'Zresztą łatwo ich rozpoznać właśnie po ich zbroi - tylko Strażnicy mogą takie nosić.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_Protection_15_00', 'A co się dzieje, gdy walczy dwóch ludzi, którzy zapłacili za ochronę?', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdOC_Protection_03_01', 'W takiej sytuacji Strażnicy po prostu się przyglądają, czekając aż jeden z walczących zginie. Wtedy zabijają drugiego!', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdNC_15_00', 'Jakie są zalety Nowego Obozu?', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdNC_03_01', 'Jeśli nie masz nic przeciwko poderżniętemu gardłu, możesz tam śmiało iść.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdNC_03_02', 'Nie, nie jest tam aż tak źle, ale to zupełnie inne osiedle.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdNC_03_03', 'Tutaj o względny porządek troszczy się Gomez. W Nowym Obozie natomiast pojęcie porządku nie istnieje.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdNC_03_04', 'Jedyni ludzie, którzy mają tam coś do powiedzenia to Magowie Wody. Ale oni spędzają całe dnie na badaniu Bariery.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdST_15_00', 'A co przemawia za przyłączeniem się do Sekty?', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdST_03_01', 'O to zapytaj już kogoś z Obozu Bractwa.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdST_03_02', 'Kilku ich Nowicjuszy zawsze kręci się po obozie. Jestem pewien, że udzielą ci wyczerpujących informacji.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdST_03_03', 'Osobiście nigdy tam nie byłem, ale jeśli wierzyć we wszystko, co o nich mówią, muszą być bardzo hojni.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_AdST_03_04', 'Ze wszystkich trzech osiedli chyba najłatwiej zostać członkiem obozu na bagnie.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_MyOwnHut_15_00', 'Którą chatę mogę zająć?', 1, 161, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Guy_MyOwnHut_03_01', 'Tamtą, z niewielkim baldachimem.', 1, 161, 3, null, 530, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Vlk_534_LeaveMe_15_00', 'Dlaczego siedzisz tutaj, a nie w Obozie?', 1, 180, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Vlk_534_LeaveMe_02_01', 'Czekam, aż mój przyjaciel wróci z kopalni. Jest mi winien parę bryłek rudy.', 1, 180, 2, null, 534, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Vlk_534_LeaveMe_02_02', 'Nie mogę się pokazać w Obozie bez rudy - nie stać mnie na zapłacenie za ochronę, a wolę nie ryzykować życiem.', 1, 180, 2, null, 534, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_HutRage_10_00', 'Ile razy mam wam powtarzać, sukinsyny, żebyście nie przebiegali przez moją chatę!', 1, 106, 10, null, 536, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_Problem_15_00', 'Co cię ugryzło?', 1, 106, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_Problem_10_01', 'Zostaw mnie w spokoju! Mam was wszystkich serdecznie dość!', 1, 106, 10, null, 536, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_Problem_10_02', 'Wszystko zaczęło się, gdy zbudowałem sobie tę chatę.', 1, 106, 10, null, 536, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_Problem_10_03', 'Wszyscy mówili: nie buduj chaty tak blisko rowu.', 1, 106, 10, null, 536, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_Problem_10_04', 'Ale żaden z tych sukinkotów nie powiedział mi, co się może stać, jeśli ją tu jednak wybuduję!', 1, 106, 10, null, 536, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_Problem_10_05', 'Jak wróciłem z kopalni kilka dni temu, miałem dodatkowe drzwi.', 1, 106, 10, null, 536, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_Problem_10_06', 'Banda wieprzy! Nienawidzę ich! Nie wyobrażasz sobie, jak ja ich NIENAWIDZĘ!!!', 1, 106, 10, null, 536, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Kyle_Problem_10_07', 'Teraz wszyscy przełażą przez moją chatę jakby nigdy nic. Każdy cholerny dupek!', 1, 106, 10, null, 536, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_YouKnowYourJob_15_00', 'Widzę, że znasz się na swoim fachu.', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_YouKnowYourJob_09_01', 'Jeszcze nikt nie miał powodu do narzekania.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_YouKnowYourJob_09_02', 'I lepiej, żeby nikt tego nie robił! Każdy dureń potrzebuje miecza, i to właśnie ode mnie dostają!', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowLong_15_00', 'Jak długo zajmuje wykucie jednego miecza?', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowLong_09_01', 'To zależy. Jeśli chodzi o najprostsze ostrza, wystarczy kilka minut.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowLong_09_02', 'Oczywiście pod warunkiem, że jestem odpowiednio zmotywowany... Finansowo.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowLong_09_03', 'Oczywiście świry pokroju Świstaka muszą czekać na swoje cacka nieco dłużej.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowLong_15_04', 'Dlaczego? Czyżby Świstak za mało ci zapłacił?', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowLong_09_05', 'Nie, wręcz przeciwnie. Za swój ostatni miecz dał mi 150 bryłek rudy.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowLong_09_06', 'Ale facet lubi bogate zdobienia i takie tam babskie fanaberie, a to oczywiście kosztuje!', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowLong_09_07', 'Hej, ciekawski z ciebie facet, kolego!', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowsYourBusiness_15_00', 'Jak stoisz z pracą, kowalu?', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowsYourBusiness_09_01', 'A co cię to obchodzi?', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowsYourBusiness_15_02', 'Być może mam dla ciebie zamówienie.', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowsYourBusiness_09_03', 'Czyżby? A cóż takiego, jeśli wolno spytać?', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowsYourBusiness_15_04', 'Jeszcze się zastanowię.', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_HowsYourBusiness_09_05', 'Wróć, jak naprawdę będziesz czegoś potrzebował. Póki co - nie zawracaj mi głowy.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_15_00', 'Chętnie spróbowałbym sił jako kowal.', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_09_01', 'Tylko nie wyobrażaj sobie, że tak łatwo jest wykuć solidny miecz!', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_15_02', 'Co powinienem zrobić?', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_09_03', 'Dobra, weź stal i rozgrzej ją nad ogniem.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_09_04', 'Potem rozbij ją na kowadle.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_09_05', 'Jak skończysz, włóż rozgrzane ostrze do wody, żeby je zahartować.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_09_06', 'Na koniec trzeba je jeszcze naostrzyć na kamieniu szlifierskim.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_15_07', 'Rozumiem.', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_LEARNSMITH_09_08', 'Oczywiście do tego wszystkiego potrzeba odpowiedniego wyposażenia. Mógłbym ci je sprzedać, jeśli chcesz.', 1, 162, 9, null, 538, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Huno_BUYSMITH_15_00', 'Chciałbym kupić narzędzia kowalskie!', 1, 162, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Hallo_15_00', 'Co słychać?', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Hallo_03_01', 'Jesteś tu nowy, co? Zapamiętaj sobie, żeby nigdy nie włazić w drogę Strażnikom.', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Hallo_03_02', 'Jak zażądają od ciebie pieniędzy - zapłać. Inaczej ściągniesz sobie na głowę połowę Obozu.', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Warn_03_00', 'Hej, ty! Słyszałem, że nie chcesz płacić Bloodwynowi za ochronę!', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Warn_15_01', 'Czego chcesz?', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Warn_03_02', 'Chcę cię ostrzec! Bloodwyn zapłacił paru ludziom, żeby cię załatwili.', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Warn_03_03', 'Widziałem, jak rozmawiał z paroma osobami, na przykład z tamtym gościem, Herekiem. Bóg wie, kogo jeszcze wynajął!', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Warn_15_04', 'Jeśli chodzi o Hereka, to twoje ostrzeżenie jest nieco spóźnione.', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Warn_03_05', 'Na pewno rozmawiał z kimś jeszcze, możesz mi wierzyć. Uważaj na siebie.', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_15_00', 'Dlaczego opowiedziałeś mi o Bloodwynie?', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_03_01', 'Bo za przysługę należy się przysługa. Jesteś mądrym chłopcem. Chyba się rozumiemy?', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_03_02', 'JA wyświadczyłem ci właśnie przysługę, więc teraz TWOJA kolej, żeby mi się odwdzięczyć!', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_ForgetIt_15_00', 'Nie jestem ci nic winien!', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_ForgetIt_03_01', 'Więc nie mamy o czym mówić!', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_What_15_00', 'Co dokładnie masz na myśli?', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_What_03_01', 'Nie mam już rudy, a Bloodwyn i mnie zaczyna dobierać się do tyłka.', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_What_03_02', 'Pomogłem ci, więc mógłbyś zapłacić za mnie te 10 bryłek, które zalegam, co? Powiedz mu, że to ode mnie!', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_YES_15_00', 'Zobaczę co się da zrobić.', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_YES_03_01', 'Dzięki, stary! Ocaliłeś mi życie! Daj mi znać, jak już wszystko załatwisz, dobra?', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_NO_15_00', 'Ja, miałbym zapłacić za ciebie? Chyba śnisz!', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_Mission_NO_03_01', 'Widzę, że myliłem się co do ciebie. W przyszłości nie oczekuj ode mnie pomocy.', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_MisSuccess_15_00', 'Zapłaciłem Bloodwynowi!', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_MisSuccess_03_01', 'Tak? To świetnie! No to teraz jesteśmy kwita.', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_MisSuccess_Waaas_15_00', 'COOO??? Wydałem 10 bryłek na cynk o którym i tak już wiedziałem?', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_MisSuccess_Waaas_03_01', 'Na to wygląda.', 1, 145, 3, null, 564, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Jesse_MisSuccess_Ok_15_00', 'Dokładnie. Ręka rękę myje.', 1, 145, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Hallo_15_00', 'Co słychać?', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Hallo_04_01', 'Odkąd rzuciłem robotę w kopalni, nie mogę narzekać.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Hallo_15_02', 'A skąd bierzesz środki na utrzymanie?', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Hallo_04_03', 'Pomagam ludziom w rozwiązywaniu ich problemów.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Hallo_04_04', 'Jeśli podpadniesz któremuś z wpływowych ludzi, zgłoś się do mnie. Razem coś wymyślimy.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpHow_15_00', 'Gdybym miał kłopoty, TY mógłbyś mi pomóc? W jaki sposób?', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpHow_04_01', 'No załóżmy, że nadepnąłeś na odcisk Thorusowi. Lepiej nigdy nie włazić mu w drogę, ale wypadki się zdarzają...', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpHow_04_02', 'Thorus potrafi być bardzo uparty. Jak raz się na ciebie wkurzy, nie będzie chciał zamienić z tobą słowa. A to już bardzo niedobrze.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpHow_04_03', 'Jako żółtodziób, musisz go mieć po swojej stronie. Więc przychodzisz do mnie i mówisz w czym rzecz. Znam tu wiele osób, z których zdaniem liczy się nawet Thorus.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpHow_04_04', 'Oni szepną o tobie dobre słówko i Thorus przestanie się na ciebie boczyć. Oczywiście chłopcy nie zrobią tego za darmo. Takie przysługi kosztują.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpHow_04_05', 'A ja pilnuję, żeby ruda trafiła do właściwych osób...', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_ANGRY_04_00', 'Zgadza się. Zagiął na ciebie parol.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_ANGRY_04_01', 'Poproszę paru ludzi, żeby go trochę uspokoili. 100 bryłek rudy i będzie po sprawie.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_ANGRY_04_02', 'Zobaczmy ile tu masz... Tak, powinno wystarczyć. Możesz uznać sprawę za niebyłą.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_ANGRY_04_03', 'Tylko nikomu ani słowa. Zachowuj się, jakby w ogóle nic się nie stało.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_NoOre_15_01', 'Nie mam tyle przy sobie.', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_NoOre_04_02', 'Przykro mi, chłopcze, ale w takim razie nic nie mogę dla ciebie zrobić.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_HOSTILE_04_00', 'To mają być kłopoty? To jest cholerna katastrofa! Obawiam się, że on najchętniej rozdarłby cię na strzępy.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_HOSTILE_04_01', 'Spróbuję przekonać paru ludzi, żeby się za tobą wstawili, ale to nie będzie tanio kosztować. 500 bryłek rudy, jeśli nie więcej!', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_HOSTILE_04_02', 'Zobaczmy ile tu masz... Widzę, że ci się poszczęściło. Wezmę te 500 bryłek i spróbuję to wszystko odkręcić.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_HOSTILE_04_03', 'I pamiętaj: nigdy, przenigdy nie wspominaj, że pomogłem ci załatwić tę sprawę. Trzymaj język za zębami. Zrozumiano?', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_NoOre_15_01', 'Nie mam tyle przy sobie.', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_NoOre_04_02', 'Przykro mi, chłopcze, ale w takim razie nic nie mogę dla ciebie zrobić.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('B_Gravo_HelpAttitude_NoProb_04_00', 'Z tego co mi wiadomo, nie masz z nim żadnego zatargu.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpAngryNow_15_00', 'Możesz mi pomóc? Chyba mam kłopoty.', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpAngryNow_04_01', 'Mogę spróbować, ale uprzedzam - moja pomoc będzie cię kosztowała od 100 do 500 bryłek rudy!', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpAngryNow_Diego_15_00', 'Pomóż mi z Diego.', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpAngryNow_Thorus_15_00', 'Pomóż mi z Thorusem.', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_HelpAngryNow_Gomez_15_00', 'Pomóż mi z Gomezem.', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Influence_15_00', 'Możesz mi powiedzieć, które Cienie należą do najbardziej wpływowych?', 1, 182, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Influence_04_01', 'Chcesz mieć po swojej stronie najważniejszych ludzi, co?', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Influence_04_02', 'Najpotężniejszym z Cieni jest Diego. Do jego zaufanych ludzi należą Rączka, Świstak i Zły.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Influence_04_03', 'Dexter i Fisk handlują na targowisku. Mają szeroką klientelę, w tym nawet Strażników, więc są dość wpływowi.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Gravo_Influence_04_04', 'No i jest jeszcze Scatty. On rządzi na arenie, organizuje walki i takie tam. Wielu ludzi jest mu winnych pieniądze, więc on również jest sporą szychą.', 1, 182, 4, null, 572, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_Hello_15_00', 'Cześć! Jestem tu nowy!', 1, 120, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_Hello_02_01', 'Nazywam się Graham. Rysuję mapy. Chyba się jeszcze nie widzieliśmy... Czego potrzebujesz?', 1, 120, 2, null, 573, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_15_00', 'Przysyła mnie Diego. Mam dostać od ciebie mapę wskazującą drogę do Starej Kopalni.', 1, 120, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_02_01', 'Nie ma sprawy. Jak dla ciebie... tylko 20 bryłek rudy.', 1, 120, 2, null, 573, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_BACK_15_00', 'Wrócę później.', 1, 120, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_Pay_15_00', 'Dobrze, zapłacę. Oto ruda.', 1, 120, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_Pay_02_01', 'Świetnie. To prawdziwa okazja, możesz mi wierzyć.', 1, 120, 2, null, 573, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_Pay_NoOre_02_00', 'Najpierw zdobądź trochę rudy. Upoluj coś, albo pozbieraj grzyby. Możesz je sprzedać w Obozie.', 1, 120, 2, null, 573, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_AufsMaul_15_00', 'Daj mi tę mapę, albo sam ją sobie wezmę!', 1, 120, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_AufsMaul_02_01', 'Uspokój się, stary. Nie chcę tu żadnych kłopotów. Masz, weź sobie tę mapę i daj mi wreszcie spokój!', 1, 120, 2, null, 573, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_GiveNotSell_15_00', 'Zaraz, Diego powiedział, że masz mi DAĆ tę mapę. Nie zamierzam za nią płacić!', 1, 120, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_GiveNotSell_02_01', 'A co mnie to obchodzi?! Wiesz ile pracy wymaga sporządzenie takiej mapy?', 1, 120, 2, null, 573, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_SellMap_GiveNotSell_02_02', '20 bryłek to moja specjalna cena dla przyjaciół Diego. Zwykle biorę 50.', 1, 120, 2, null, 573, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_BuyMaps_15_00', 'Chciałbym kupić mapę.', 1, 120, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Graham_BuyMaps_02_01', 'Jasne. Co cię interesuje? Im więcej widać na mapie, tym jest droższa.', 1, 120, 2, null, 573, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_FirstEXIT_07_00', 'Hej, kolego! Nowy? Chyba cię jeszcze tu nie widziałem.', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_FirstEXIT_07_01', 'Przyłączę się do ciebie na chwilę, jeśli nie masz nic przeciwko. Przyda ci się przyjaciel...', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_FirstEXIT_Verpiss_15_00', 'Spadaj!', 1, 36, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_FirstEXIT_Verpiss_07_01', 'Oho, nie jesteśmy w humorze, co? Lepiej będzie jak pójdę z tobą!', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_FirstEXIT_Komm_15_00', 'Czemu nie? Chodźmy!', 1, 36, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_FirstEXIT_Komm_07_01', 'Świetnie. Po drodze możemy sobie trochę porozmawiać.', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_ShutUp_15_00', 'Możesz się zamknąć choć na chwilę?', 1, 36, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_ShutUp_07_01', 'Jasne.', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_GetLost_15_00', 'Spadaj!', 1, 36, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_GetLost_07_01', 'Chcesz być przez chwilę sam, tak? Rozumiem... Będę się trzymał na uboczu.', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_GetLost_07_00', 'Hej, stary! Czemu mnie bijesz? Co ci takiego zrobiłem?', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_GetLost_15_01', 'Za chwilę znowu ci przyłożę! Bardzo lubię to robić!', 1, 36, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_GetLost_07_02', 'Jakiś świr z ciebie, czy co? Nie chcę mieć z tobą nic wspólnego!', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_0_07_00', 'Powiedz, dokąd idziemy? A może to niespodzianka?! Uwielbiam niespodzianki!', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_1_07_00', 'Nie zwracaj na mnie uwagi. Będę się trzymał ciebie, spokojna głowa.', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_2_07_00', 'Zdecydowałeś się wreszcie dokąd chcesz iść?', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_3_07_00', 'Może szukasz jakiegoś spokojnego miejsca, gdzie moglibyśmy pogadać?', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_4_07_00', 'Czy to możliwe, że chodzimy w kółko... To znaczy, nie wiem dokąd chcesz iść, ale...', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_5_07_00', 'Ale fajnie! Dzięki, że zabrałeś mnie ze sobą! Moglibyśmy robić to częściej. Nie mam nic do roboty przez większość dnia!', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_6_07_00', 'Wiesz co? Już cię polubiłem! Przeżyjemy wspólnie wiele ciekawych przygód! Co nie?! Gdzie nocujesz? Jakbyś chciał, możesz przenocować u mnie!', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_7_07_00', 'A tak w ogóle, to za co tutaj trafiłeś? Ty też za bardzo lubisz zwierzęta? Oni krzywo na to patrzą, wiesz? Właśnie tak tutaj wylądowałem.', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_8_07_00', 'Kilku facetów bez przerwy próbuje mnie pobić. Paskudni ludzie z Nowego Obozu! Bandziory jedne! Następnym razem powiem im, że kto ze mną zadziera, będzie miał z tobą do czynienia! To ich nauczy!', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_9_07_00', 'Ale się zdziwią ci z Nowego Obozu, jak im powiem jakiego mam obrońcę! Posikają się ze strachu! Ale będzie fajnie. Normalnie zabijają ludzi bez mrugnięcia okiem, ale teraz będą musieli dobrze się zastanowić.', 1, 36, 7, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_10_07_00', 'Wiesz co? Wyświadczę ci przysługę. Wstawię się za tobą. Może wtedy zostaniesz przyjęty do Obozu. W ten sposób moglibyśmy spotykać się codziennie.', 1, 36, 10, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_11_07_00', 'Niektórzy tutaj mają mnie za jakiegoś wariata. Ale przecież ktoś taki jak ty nie zadawałby się z wariatem, prawda? Teraz wszyscy zrozumieją jak niesprawiedliwie mnie ocenili.', 1, 36, 11, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_12_07_00', 'Jestem moim najlepszym kumplem, wiesz? Inni tylko próbują się mnie pozbyć. Jestem ci bardzo wdzięczny, naprawdę!', 1, 36, 12, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_13_07_00', 'Słuchaj, całe to bieganie zaczyna mnie męczyć. Może poszukamy sobie jakiegoś przytulnego gniazdka i chwilę odpoczniemy, co?', 1, 36, 13, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_14_07_00', 'Jesteś dla mnie jak starszy brat. Nigdy nie miałem starszego brata... Ani nawet młodszego! Moi rodzice mnie nie kochali, ale to musiało być dla nich bardzo trudne.', 1, 36, 14, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_14_15_01', 'Jaaasne.', 1, 36, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_15_07_00', 'Skąd jesteś? Na pewno cieszysz się, że znalazłeś tu bratnią duszę, kogoś, kto cię zrozumie. Jestem z Khorinis. Byłeś tam kiedyś? Zresztą - nieważne.', 1, 36, 15, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_16_07_00', 'Masz może dla mnie coś do jedzenia. Jestem jakby twoim gościem, więc uprzejmość nakazywałaby, abyś mnie czymś poczęstował. Nauczyłem się tego w Khorinis. Tam mieszkają uprzejmi ludzie.', 1, 36, 16, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_17_07_00', 'Myślisz, że ktoś wpadnie do nas z wizytą? Pewnie nie, bo nie mogliby wydostać się z powrotem, co nie?', 1, 36, 17, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_18_07_00', 'Teraz, gdy jesteśmy razem, moglibyśmy pokazać kilku ludziom, gdzie raki zimują. Te skurczybyki nachodzą mnie od lat! Jak zobaczę któregoś z nich, dam im do słuchu!', 1, 36, 18, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Mud_Nerve_19_07_00', 'Wiesz co? Stanowimy dobraną parę. Moglibyśmy przejąć kontrolę nad całym Starym Obozem. Jesteśmy zespołem, więc powinniśmy łatwo uporać się z Magnatami. Obmyślę jakiś plan.', 1, 36, 19, null, 574, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_06_00', 'Hej, ty! Czy to nie ty chcesz dołączyć do naszego obozu?', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_15_01', 'A jeśli chcę?', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_06_02', 'Mógłbym ci pomóc...', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_15_03', 'Jak?', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_06_04', 'Na zewnątrz Obozu siedzi dwóch gości. Jeden z nich ukradł coś cennego Magnatom. To cenny amulet, który miał nam zostać przysłany z ostatnim transportem ze świata zewnętrznego.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_06_05', 'Któryś z nich powinien mieć ten amulet przy sobie. Jeśli zaatakujemy ich razem, powinno nam się udać. Sam raczej nie dam rady. Co ty na to?', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_Deny_15_00', 'To nie dla mnie. Poszukaj sobie kogoś innego.', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_Deny_06_01', 'Z takim podejściem długo tu miejsca nie zagrzejesz. Daj mi znać, gdybyś zmienił zdanie!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_HowShare_15_00', 'A co się stanie, gdy już zdobędziemy amulet?', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_HowShare_06_01', 'To proste. Zwrócę go Magnatom i odbiorę nagrodę. Przy okazji powiem im, że mi pomogłeś. Ta wiadomość na pewno dotrze do Gomeza!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_HalfHalf_15_00', 'Nie! Albo dzielimy się po połowie, albo baw się sam!', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_HalfHalf_06_01', 'Niech będzie, pół na pół! Nagrody wystarczy dla nas dwóch! To jak? Mogę na ciebie liczyć?', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_Accepr_15_00', 'Pójdę z tobą.', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Falle_Accepr_06_01', 'Świetnie, daj mi znać, gdy będziesz gotów.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_ReadyToGo_15_00', 'Jestem gotowy. Chodźmy po ten amulet.', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_ReadyToGo_06_01', 'Zatem do dzieła!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_AtOCdraussen_06_00', 'Oto jesteśmy - daleko od twojego kumpla, Diego.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_AtOCdraussen_06_01', 'Mamy ci przekazać pozdrowienia od Bloodwyna!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_AtOCdraussen_06_02', 'Mam ci przekazać pozdrowienia od Bloodwyna!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_15_01', 'Ty głupcze, chciałeś mnie zwabić w pułapkę...', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_06_02', 'Hej, stary! Jedziemy na tym samym wózku! Ja też nie zamierzam ryć pod ziemią do końca moich dni!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_06_03', 'Dlatego wypełniam polecenia Strażników. Ja też chcę dołączyć do Obozu!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_06_04', 'Zresztą sam zasłużyłeś na cały ten bajzel. Dlaczego zadarłeś ze Strażnikami?', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_06_05', 'Osobiście nic do ciebie nie mam. To jak będzie - wojna czy pokój.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_Weiterpruegeln_15_00', 'Nie mam nic przeciwko wojnie!', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_Weiterpruegeln_06_01', 'Stary, mam już tego dość...', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_Frieden_15_00', 'Niech będzie pokój.', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_Frieden_06_01', 'Cieszę się, że mogliśmy to sobie wyjaśnić. Najlepiej zapomnijmy o całej sprawie. Od tej chwili jestem po twojej stronie.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_NACHFalle_Frieden_06_02', 'Gdybyś jeszcze kiedyś wpadł w tarapaty, możesz na mnie liczyć. W końcu jestem ci coś winien.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Hallo_15_00', 'Jestem tu nowy.', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Hallo_06_01', 'Żółtodziób, co? Nazywam się Grim - też jestem tu od niedawna. Wrzucili mnie niedługo przed tobą.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Leben_15_00', 'Jak wygląda życie w kolonii?', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Leben_06_01', 'Nie jest źle, jeśli zapłacisz Strażnikom za ochronę.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Aufnahme_15_00', 'Co mam zrobić, jeśli chcę zostać przyjęty do tego obozu?', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Aufnahme_06_01', 'Na początek musisz zostać Cieniem. W tym celu poszukaj sobie jakiegoś wpływowego opiekuna. Kogoś, kto wyjaśni ci co w trawie piszczy i wskaże ci właściwą drogę.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Aufnahme_06_02', 'Na twoim miejscu trzymałbym się blisko Diego - ja tak zrobiłem i nie żałuję!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Aufnahme_06_03', 'On podda cię testowi zaufania - dla każdego wygląda on trochę inaczej. No i musisz wypełniać jeszcze zadania zlecane ci przez Cienie.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_Aufnahme_06_04', 'Jeśli ci się uda, zostaniesz jednym z nas.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_HowFarAreYou_15_00', 'A ty, jak sobie radzisz?', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_HowFarAreYou_06_01', 'Rozmawiałem już z Dexterem, Złym i Rączką. To jedni najbardziej wpływowych ludzi w Zewnętrznym Pierścieniu.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_YourPDV_15_00', 'A jak wyglądał TWÓJ test zaufania?', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_YourPDV_06_01', 'Tego nie mogę ci powiedzieć. O takich rzeczach lepiej nie mówić głośno!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_INEXTREMO_06_01', 'Hej, słyszałeś już wieści?', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_INEXTREMO_06_02', 'Są tu In Extremo! Właśnie weszli na scenę!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_INEXTREMO_06_03', 'Pospiesz się, albo przegapisz koncert!', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_INEXTREMOAWAY_15_01', 'Gdzie są In Extremo?', 1, 74, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Grim_INEXTREMOAWAY_06_02', 'Pojechali dalej. Szkoda. Zdążyłem się przyzwyczaić do imprez pod sceną.', 1, 74, 6, null, 580, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Hello_15_00', 'Jak leci?', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Hello_01_01', 'Nienajgorzej! Człowiek, który umie dobrze gotować, ma tutaj wielu przyjaciół!', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Hello_01_02', 'Chcesz może trochę mojej ryżowej zupy?', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Hello_15_03', 'Dzięki.', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Hello_01_04', 'Mógłbyś coś dla mnie zrobić...', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_15_00', 'Co takiego?', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_01_01', 'Założę się, że lubisz sobie dobrze podjeść. Opracowałem właśnie nowy przepis: potrawka z chrząszcza a la Snaf z ryżem i grzybami.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_01_02', 'Dostaniesz ile tylko zechcesz, ale potrzebuję jeszcze 3 chrząszczy i parę piekielników - 5 powinno wystarczyć.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_KOTZ_15_00', 'Chcesz, żebym się porzygał?', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_KOTZ_01_01', 'Nie musisz tego jeść, ale powinieneś przynajmniej spróbować! Zresztą, zawsze możesz to komuś odsprzedać!', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_KOTZ_01_02', 'Wysłałem już kogoś po składniki, ale ślad po nim zaginął. Pewnie uciekł do Nowego Obozu.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_DoIt_15_00', 'Brzmi nieźle.', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_DoIt_01_01', 'Zatem idź, i przynieś mi potrzebne składniki.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_Zutaten_DoIt_01_02', 'Poprzedni człowiek, którego wysłałem nie wrócił. Zapewne uciekł do Nowego Obozu.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_ZutatenSuccess_15_00', 'Mam przy sobie rzeczy, o które prosiłeś!', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_ZutatenSuccess_01_01', 'Świetnie! Teraz muszę je tylko wrzucić i za chwilę potrawka będzie gotowa. Zaczekaj...', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_AfterSuccess_15_00', 'Powiedziałeś, że mogę dostać tyle potrawki ile tylko zapragnę...', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_AfterSuccess_01_01', 'I dotrzymam słowa. Proszę, weź te 3 porcje.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_AfterSuccess_01_02', 'Jasne! Ale nic mi już dzisiaj nie zostało. Wróć jutro!', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_WhereMeatbugs_15_00', 'Gdzie mogę znaleźć te chrząszcze?', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_WhereMeatbugs_01_01', 'Wszędzie, gdzie walają się jakieś odpady. Poszukaj w opuszczonych chatach przy zamkowych murach.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_WhereMeatbugs_01_02', 'Tylko niech cię nie odstraszy ich paskudny wygląd. Po ugotowaniu są całkiem smaczne.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_WhereMushrooms_15_00', 'Gdzie znajdę te piekielniki?', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_WhereMushrooms_01_01', 'Wyjdź z Obozu przez południową bramę, to ta pod zawaloną wieżą. Znajdziesz się na łące, na której rosną grzyby.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_WhereNek_15_00', 'Kim był człowiek, którego wysłałeś na poszukiwania przede mną?', 1, 164, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_WhereNek_01_01', 'Nazywał się Nek. Chyba nie czuł się tu zbyt dobrze. Podejrzewam, że uciekł do Nowego Obozu.', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Snaf_WhereNek_01_02', 'Wysłałem go po grzyby, ale nigdy nie wrócił...', 1, 164, 1, null, 581, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Melvin_Hello_15_00', 'Cześć! Nie jesteś z tego obozu, prawda?', 1, 32, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Melvin_Hello_03_01', 'Cóż, teraz już jestem! Tydzień temu wyruszyłem ze Starego Obozu. Mój kumpel, Dusty, miał iść ze mną, ale postanowił jeszcze trochę poczekać.', 1, 32, 3, null, 582, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Melvin_MetDusty_15_00', 'Znam Dustego - zamieniliśmy kiedyś kilka słów.', 1, 32, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Melvin_MetDusty_03_01', 'Gdybyś go jeszcze kiedyś spotkał, powiedz mu, że głupio zrobił nie idąc ze mną. Życie w Bractwie jest sto razy lepsze od ciągłego użerania się ze Strażnikami ze Starego Obozu.', 1, 32, 3, null, 582, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_Melvin_MetDusty_15_02', 'Nie omieszkam mu tego powtórzyć.', 1, 32, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_583_Glen_INFO_Info_15_01', 'O czym powinienem pamiętać, będąc w kopalni?', 1, 28, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_583_Glen_INFO_Info_02_02', 'Uważaj na pełzacze.', 1, 28, 2, null, 583, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_583_Glen_INFO_Info_02_03', 'Im niżej zejdziesz, tym częściej możesz na nie wpaść. Te przeklęte stwory przychodzą chyba wprost z królestwa samego Beliara!', 1, 28, 2, null, 583, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_583_Glen_INFO_Info_02_04', 'Bez przerwy słychać, jak grzebią i kopią. Siedzą w ciemności i czekają na jakiegoś biednego górnika, z którego zrobią sobie obiad.', 1, 28, 2, null, 583, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_583_Glen_INFO_Info_02_05', 'Są bezlitosne i bardzo szybkie. Jeśli ci życie miłe, uciekaj stąd ile sił w nogach. Prędzej czy później padnie i na ciebie.', 1, 28, 2, null, 583, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_583_Glen_LOCKPICK_15_01', 'Słyszałem, że można tu kupić wytrychy?', 1, 28, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_583_Glen_LOCKPICK_02_02', 'Skoro okazałeś się na tyle sprytny, żeby do mnie dotrzeć, możesz kilka kupić. To będzie 10 bryłek rudy za sztukę.', 1, 28, 2, null, 583, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_583_Glen_BUY_Info_15_01', 'Chcę kupić kilka wytrychów.', 1, 28, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Exit_Info_15_001', 'Do zobaczenia następnym razem!', 1, 144, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Exit_Info_07_02', 'Jasne!', 1, 144, 7, null, 584, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_Info_15_01', 'Jak leci?', 1, 144, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_Info_07_02', 'Mam dla ciebie pewną propozycję.', 1, 144, 7, null, 584, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_Info_07_03', 'Spraw, żeby Aaron odczepił się od tej skrzyni, a zapłacę ci 10 bryłek rudy.', 1, 144, 7, null, 584, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_RUN_Info_15_01', 'Należy mi się 10 bryłek rudy!', 1, 144, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_RUN_Info_07_02', 'Proszę, zasłużyłeś na nie.', 1, 144, 7, null, 584, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_RUN_Info_07_03', 'Ach, i jeszcze coś: mam przy sobie klucz do tej skrzyni. Jak dla ciebie - 30 bryłek.', 1, 144, 7, null, 584, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_2_Info_15_01', 'Wezmę ten klucz.', 1, 144, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_2_Info_07_02', 'Trafiła ci się nie lada okazja.', 1, 144, 7, null, 584, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_2_Info_15_03', 'Zastanawiam się co TY z tego masz.', 1, 144, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_2_Info_07_04', 'Zawsze się cieszę, kiedy mogę dać prztyczka w nos któremuś ze Strażników. Zresztą, gdyby znaleźli przy mnie rzeczy z tej skrzyni, byłbym martwy.', 1, 144, 7, null, 584, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_584_Snipes_DEAL_2_Info_07_05', 'Ma być 30 bryłek! Daj mi rudę, to dostaniesz klucz.', 1, 144, 7, null, 584, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_Exit_Info_15_01', 'Powodzenia!', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_Exit_Info_05_02', 'Cóż, wiesz, gdzie mnie znaleźć.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_CLEVER_Info_05_01', 'He he he, strażnicy nigdy mnie nie złapią!', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_GUARDS_Info_15_01', 'Co masz na myśli?', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_GUARDS_Info_05_02', 'Pracuję tylko wtedy, gdy w pobliżu jest jakiś Strażnik, który może mnie zobaczyć. Poza tym tylko sobie odpoczywam.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_GUARDS_Info_15_03', 'I nie robią się podejrzliwi?', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_GUARDS_Info_05_04', 'Oczywiście, że tak! Wydobywam mniej rudy niż inny Kopacze, więc muszę nadrabiać braki drobnym handlem wymiennym.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_GUARDS_Info_05_05', 'Mam oczy szeroko otwarte, więc dowiedziałem się kilku ciekawych rzeczy. Masz może przy sobie trochę rudy? Jakieś 10 bryłek?', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_INFO_Info_15_01', 'Jasne, oto 10 bryłek.', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_INFO_Info_05_02', 'Dzięki. Idź do głównego szybu i zejdź na dół po rusztowaniu. Powinieneś trafić na dwie boczne jaskinie.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_INFO_Info_05_03', 'W drugiej z nich jest strażnik i stara młocarnia.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_INFO_Info_05_04', 'Gdzieś niedaleko znajdziesz napój uzdrawiający, tylko uważaj na pełzacze!', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_INFO_Info_05_05', 'Gdybyś potrzebował najświeższych informacji zgłoś się do mnie. Na pewno będę mógł ci pomóc.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_ANGRY_Info_05_01', 'Doniosłeś na mnie Brandickowi? Spadaj stąd!', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_KEY_Info_15_01', 'Masz dla mnie jeszcze jakieś pożyteczne informacje?', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_KEY_Info_05_02', 'Jasne, a masz 10 bryłek rudy?', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_GLEN_Info_15_01', 'Za taką cenę oczekuję czegoś naprawdę dobrego!', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_GLEN_Info_05_02', 'W kopalni można znaleźć mnóstwo zamkniętych skrzyń. Glen, jeden z Kopaczy na górze, może ci dostarczyć parę wytrychów.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_Info_15_01', 'Wiesz może coś o kluczu do skrzyni ze składowiska?', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_Info_05_02', 'Cóż... To zależy...', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_Info_15_03', 'Od ilości bryłek rudy, które jestem gotów zapłacić?', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_Info_05_04', 'Szybko się uczysz.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_50_15_01', '50 bryłek to chyba uczciwa cena!', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_50_05_02', 'Jesteś bardzo hojny! Oto klucz. Weź też ten pierścień. Zawsze przynosił mi szczęście.', 1, 168, 50, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_50_05_03', 'Nie masz tyle przy sobie!', 1, 168, 50, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_30_15_01', '30 bryłek powinno wystarczyć.', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_30_05_02', 'W porządku. Tak się składa, że mam ten klucz przy sobie.', 1, 168, 30, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_30_05_03', 'Nie masz tyle przy sobie!', 1, 168, 30, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_15_15_01', '15 bryłek wystarczy?', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_SCHUPPEN_15_05_02', '15 bryłek? Za 15 bryłek nie mam pojęcia o jakim kluczu mówisz!', 1, 168, 15, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_Info_15_01', 'Wiesz może coś o kluczu do skrzyni ze składowiska?', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_Info_05_02', 'Cóż, to zależy...', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_Info_15_03', 'Od ilości bryłek rudy, które jestem gotów zapłacić?', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_Info_05_04', 'Szybko się uczysz. To cię będzie kosztować 100 bryłek.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_100_Info_15_01', 'Niech będzie, ty zdzierco. Masz tu swoje 100 bryłek.', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_100_Info_05_02', 'Trzeba było ze mną nie zadzierać. Oto twój klucz.', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_100_Info_05_03', 'Masz mnie za głupca?! 100 bryłek, to moje ostatnie słowo!', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_NO_Info_15_01', 'Nie będę wyrzucał w błoto takiej ilości rudy!', 1, 168, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_585_Aleph_DIRTY_NO_Info_05_02', 'To po co mnie w ogóle zaczepiasz?', 1, 168, 5, null, 585, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_Exit_Info_15_01', 'Powodzenia!', 1, 125, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_Exit_Info_04_02', 'Nawzajem, chłopcze. Nawzajem.', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_STORY_Info_15_01', 'Od dawna tu jesteś?', 1, 125, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_STORY_Info_04_02', 'Od całych 10 lat. Uwierz mi, dużo już tu widziałem.', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_STORY_Info_04_03', 'Stawiłem czoła wielu niebezpieczeństwom, ale jakoś udało mi się z nich wybrnąć.', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_STORY_Info_04_04', 'Pamiętam jak pracowaliśmy jeszcze w pierwszej kopalni, tej, która teraz stoi pusta. Pewnego dnia nie wytrzymały podpory...', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_STORY_Info_04_05', 'Ale to stare dzieje...', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_KNOW_Info_15_01', 'Zapewne słyszałeś też o wielu planach ucieczki.', 1, 125, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_KNOW_Info_04_02', 'Posłuchaj, chłopcze. Wiem, że chciałbyś się stąd wydostać, ale zapomnij o tym.', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_KNOW_Info_04_03', 'Stąd nie ma ucieczki! Widziałem twarze tych, którzy próbowali sforsować Barierę.', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_KNOW_Info_04_04', 'Nie popełniaj tego samego błędu. Bariera powstrzyma każdego.', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_KNOW_Info_15_05', 'Nie chcę spędzić następnych 10 lat mojego życia wydobywając rudę!', 1, 125, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_KNOW_Info_04_06', 'Wcale nie musisz. Może zostaniesz wielką szychą, kto wie?', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_KNOW_Info_04_07', 'Możesz piąć się do góry, ale nieważne jak wysokie stanowisko uda ci się osiągnąć - Bariera wreszcie cię zatrzyma.', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('VLK_586_Grimes_FIRST_Info_04_02', 'Oho! Nowa twarz! Pracowałeś kiedyś jako górnik, chłopcze?', 1, 125, 4, null, 586, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Vlk_587_Garp_ORK_Info_15_01', 'To tu robi ten Ork?', 1, 17, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Vlk_587_Garp_ORK_Info_01_02', 'Złapali go nasi strażnicy. Od tej pory pracuje dla nas.', 1, 17, 1, null, 587, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Vlk_587_Garp_ORK_Info_15_03', 'Przecież nie jest nawet skuty łańcuchami. Czemu po prostu nie ucieknie?', 1, 17, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Vlk_587_Garp_ORK_Info_01_04', 'Raz spróbował. Strażnicy tak go urządzili, że nie mógł się ruszyć przez parę tygodni. Od tej pory nigdy więcej się nie buntował.', 1, 17, 1, null, 587, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_Saturas_EXIT_15_01', 'Śmiertelny?... Kto, ja?... Dobrze, już idę!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_INTRO_15_01', 'Zaraz... Kto... Kto to powiedział?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_INTRO_15_02', 'To TY?! Jak... Jak się dostałeś do mojej głowy?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_INTRO_15_03', 'CZYM jesteś? Sługą swego pana?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_INTRO_15_04', 'Wyglądasz mi raczej na stwora z piekła rodem!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_INTRO_15_05', 'Mam być cicho?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_MASTERWHO_15_01', 'Czy imię twego pana nie brzmi przypadkiem XARDAS?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_MASTERWHO_15_02', 'Aha... Więc imiona nie są istotne... W porządku.', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_MASTERWHO_15_03', 'Załóżmy, że to JEST wieża Xardasa.', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_MASTERHOW_15_01', 'Domagam się widzenia z twoim panem!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_MASTERHOW_15_02', '...Ja? Niegodny?? ...Jaki znowu sprawdzian?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_MASTERHOW_15_03', 'Ach! Rozumiem... Ktokolwiek zechce rozmawiać z twoim panem, musi najpierw udowodnić, że jest tego godzien!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_MASTERHOW_15_04', '...Zaraz, co mówiłeś? Dowód? Zwycięstwa nad czym?... Zwycięstwa nad żywiołami?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_MASTERHOW_15_05', '...Kamień? ...Lód? ...Ogień?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_NOHEART_15_01', 'Mówisz zagadkami!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_NOHEART_15_02', '... Już to słyszałem. Powtarzasz się!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_NOHEART_15_03', '... Domagasz się dowodu mojego zwycięstwa nad żywiołami ognia, lodu i ziemi!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_GIVEHEART_15_01', 'Co? A, tak!... Godnego dowodu!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_GIVEHEART_15_02', '... Brakuje? Brakuje jeszcze dwóch?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_GIVEHEART_15_03', '... Podwójny? ... Drugi dowód?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_GIVEHEART_15_04', '... Potrzeba jeszcze jednego?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('DIA_BaalCadar_NoTalk_Hi_02_01', '', 1, 148, 2, null, -1, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_GIVEHEART_15_05', '...Perfekcja?... Jestem godny?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_GIVEHEART_15_06', 'W takim razie domagam się widzenia z twoim panem!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_GIVEHEART_15_07', '...Kolejny dowód?... Jaki znowu dowód?... Runa?... Runa DLA mnie?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_GIVEHEART_15_08', 'Cóż, w takim razie przyjmuję tę runę teleportacji, jako dowód tego, że okazałem się godny!', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_STONEHEART_15_01', 'Oto serce kamiennego golema.', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_ICEHEART_15_01', 'Czy to serce lodowego golema jest wystarczającym dowodem?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('Info_XardasDemon_FIREHEART_15_01', 'Może być to serce ognistego golema?', 1, 148, 15, null, 0, null);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_StopMagic', 'Hej! Żadnej magii!', 1, 1, 1, null, 0, StopMagic);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_ISaidStopMagic', 'Chcesz dostać w ucho? Natychmiast przestań!', 1, 1, 1, null, 0, ISaidStopMagic);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_WeaponDown', 'Schowaj broń!', 1, 1, 1, null, 0, WeaponDown);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_ISaidWeaponDown', 'Schowaj natychmiast tę cholerną broń!', 1, 1, 1, null, 0, ISaidWeaponDown);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_WatchYourAim', 'Odłóż to!', 1, 1, 1, null, 0, WatchYourAim);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_WatchYourAimAngry', 'Chcesz dostać w łeb? To wyceluj we mnie jeszcze raz!', 1, 1, 1, null, 0, WatchYourAimAngry);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_WhatAreYouDoing', 'Uważaj! Spróbuj tego jeszcze raz, a rozwalę ci łeb!', 1, 1, 1, null, 0, WhatAreYouDoing);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_LetsForgetOurLittleFight', 'Zapomnijmy o całej sprawie, dobra?', 1, 1, 1, null, 0, LetsForgetOurLittleFight);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_Strange', 'Wyłaź stąd, sukinsynu!', 1, 1, 1, null, 0, Strange);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_DieMonster', 'Psia twoja mać!', 1, 1, 1, null, 0, DieMonster);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_DieMortalEnemy', 'Już po tobie!', 1, 1, 1, null, 0, DieMOrtalEnemy);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_NowWait', 'Zaraz dostaniesz...', 1, 1, 1, null, 0, NowWait);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_YouStillNotHaveEnough', 'Widzę, że chcesz oberwać, co?', 1, 1, 1, null, 0, YouStillNotHaveEnough);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_YouAskedForIt', 'Sam się o to prosiłeś!', 1, 1, 1, null, 0, YouAskedForIt);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_NowWaitIntruder', 'Jak z tobą skończę, nie będzie co zbierać!', 1, 1, 1, null, 0, NowWaitIntruder);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_IWillTeachYouRespectForForeignProperty', 'Ostrzegałem cię, żebyś trzymał łapy z dala od moich rzeczy!', 1, 1, 1, null, 0, IWillTeachYouRespectForForeignProperty);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_DirtyThief', 'Zapłacisz mi za to, złodzieju!', 1, 1, 1, null, 0, DirtyThief);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_YouAttackedMyCharge', 'Nikt nie będzie podskakiwał moim kumplom!', 1, 1, 1, null, 0, YouAttackedMyCharge);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_YouKilledOneOfUs', 'Powaliłeś jednego z naszych. Teraz ja ROZWALĘ ciebie!', 1, 1, 1, null, 0, YouKilledOneOfUs);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_Dead', 'Aaaaarg!', 1, 1, 1, null, 0, Dead);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_Aargh_1', 'Aaargh', 1, 1, 1, null, 0, Aargh_1);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_Aargh_2', 'Aaargh', 1, 1, 1, null, 0, Aargh_2);
