INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_Berzerk', 'UUAAARRGGGHHH!!!', 1, 1, 1, null, 0, Berzerk);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_YoullBeSorryForThis', 'Jeszcze pożałujesz!', 1, 1, 1, null, 0, YoullBeSorryForThis);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_YesYes', 'Bez paniki! Wygrałeś!', 1, 1, 1, null, 0, YesYes);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_ShitWhatAMonster', 'Cholera! W nogi!', 1, 1, 1, null, 0, ShitWhatAMonster);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_Help', 'Szlag by to...!', 1, 1, 1, null, 0, Help);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_WeWillMeetAgain', 'Jeszcze się spotkamy!', 1, 1, 1, null, 0, WeWillMeetAgain);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_NeverTryThatAgain', 'Spróbuj tego jeszcze raz, a pożałujesz!', 1, 1, 1, null, 0, NeverTryThatAgain);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_ITakeYourWeapon', 'Niezła broń! Dawaj ją!', 1, 1, 1, null, 0, ITakeYourWeapon);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_ITookYourOre', 'Dzięki za rudę, BOHATERZE!', 1, 1, 1, null, 0, ITookYourOre);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_ShitNoOre', 'Biedny głupcze, nawet nie masz przy sobie rudy!', 1, 1, 1, null, 0, ShitNoOre);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_HandsOff', 'Łapy precz!', 1, 1, 1, null, 0, HandsOff);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_GetOutOfHere', 'Spadaj stąd!', 1, 1, 1, null, 0, GetOutOfHere);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_YouViolatedForbiddenTerritory', 'Hej! Jak tu wlazłeś?!', 1, 1, 1, null, 0, YouViolatedForbiddenTerritory);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_YouWannaFoolMe', 'Myślisz, że jestem taki głupi?', 1, 1, 1, null, 0, YouWannaFoolMe);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_WhatsThisSupposedToBe', 'Hej, ty? Co się tak skradasz?!', 1, 1, 1, null, 0, WhatsThisSupposedToBe);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_WhyYouAreInHere', 'Won z mojej chaty, albo wezwę straże!', 1, 1, 1, null, 0, WhyAreYouInHere);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_1_WhatDidYouInThere', 'Nie masz tu czego szukać! Spadaj!', 1, 1, 1, null, 0, WhatDidYouInThere);
