INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_4_Smalltalk06', '... od razu wiedziałem, że będą kłopoty ...', 1, 1, 4, null, 0, Smalltalk06);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_4_Smalltalk07', '... tylko zachowaj to dla siebie. Inni nie powinni wiedzieć ...', 1, 1, 4, null, 0, Smalltalk07);
