INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_4_Smalltalk10', '... musisz uważać na to, co mówisz przy obcych ...', 1, 1, 4, null, 0, Smalltalk10);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_4_Smalltalk11', '... tak długo, jak mnie to nie dotyczy ...', 1, 1, 4, null, 0, Smalltalk11);
