INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_4_Smalltalk17', '... ludzie zawsze gadają ...', 1, 1, 4, null, 0, Smalltalk17);
