INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouDefeatedNOV_Guard', 'Spróbuj jeszcze raz zaczepić Nowicjusza, a pożałujesz!', 1, 1, 9, null, 0, YouDefeatedNOV_Guard);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouDefeatedVLK_Guard', 'Jesteś taki odważny czy taki głupi? Zadzieranie z moimi protegowanymi nie wyjdzie ci na zdrowie.', 1, 1, 9, null, 0, YouDefeatedVLK_Guard);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouStoleFromMe', 'Śmiesz się tu pokazywać? Czekaj ty...', 1, 1, 9, null, 0, YouStoleFromMe);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouStoleFromUs', 'Nie ma nic gorszego od okradania naszych ludzi. Jeszcze tego pożałujesz!', 1, 1, 9, null, 0, YouStoleFromUs);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouStoleFromEBr', 'Stary! Okradłeś Magnatów? Ale się wściekną!', 1, 1, 9, null, 0, YouStoleFromEBr);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouStoleFromGur', 'Pożyczyłeś sobie kilka rzeczy Guru, prawda?', 1, 1, 9, null, 0, YouStoleFromGur);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_StoleFromMage', 'Pożyczyłeś sobie kilka rzeczy należących do magów, prawda?', 1, 1, 9, null, 0, StoleFromMage);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouKilledMyFriend', 'Masz na sumieniu jednego z naszych! Jeszcze jeden taki wybryk i będziesz gryzł ziemię!', 1, 1, 9, null, 0, YouKilledMyFriend);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouKilledEBr', 'Zabiłeś Magnata! Stary, odbiło ci?!', 1, 1, 9, null, 0, YouKilledEBr);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouKilledGur', 'Zabiłeś Guru! Nie mogę w to uwierzyć!', 1, 1, 9, null, 0, YouKilledGur);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouKilledMage', 'Zabiłeś maga! Jak zamierzasz się z tego wytłumaczyć?!', 1, 1, 9, null, 0, YouKilledMage);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouKilledOCfolk', 'Zginął członek Starego Obozu i twoje imię padło w związku z tą sprawą...', 1, 1, 9, null, 0, YouKilledOCfolk);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouKilledNCfolk', 'Nowy Obóz poniósł niepowetowaną stratę, i wygląda na to, że maczałeś w tym palce!', 1, 1, 9, null, 0, YouKilledNCfolk);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_YouKilledPSIfolk', 'Bractwo utraciło jednego z wiernych, i to ty masz go na sumieniu!', 1, 1, 9, null, 0, YouKilledPSIfolk);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_GetThingsRight', 'Nie łatwo będzie to teraz odkręcić!', 1, 1, 9, null, 0, GetThingsRight);
