INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk01', '... cóż, jeśli tak uważasz ...', 1, 1, 9, null, 0, Smalltalk01);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk02', '... może ...', 1, 1, 9, null, 0, Smalltalk02);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk03', '... to nie było zbyt mądre ...', 1, 1, 9, null, 0, Smalltalk03);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk04', '... lepiej się do tego nie mieszać ...', 1, 1, 9, null, 0, Smalltalk04);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk05', '... to nie mój problem ...', 1, 1, 9, null, 0, Smalltalk05);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk06', '... od razu wiedziałem, że będą kłopoty ...', 1, 1, 9, null, 0, Smalltalk06);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk07', '... tylko zachowaj to dla siebie. Inni nie powinni wiedzieć ...', 1, 1, 9, null, 0, Smalltalk07);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk08', '... to się już więcej nie powtórzy ...', 1, 1, 9, null, 0, Smalltalk08);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk09', '... w tej historii musi być jednak ziarno prawdy ...', 1, 1, 9, null, 0, Smalltalk09);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk10', '... musisz uważać na to, co mówisz przy obcych ...', 1, 1, 9, null, 0, Smalltalk10);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk11', '... tak długo, jak mnie to nie dotyczy ...', 1, 1, 9, null, 0, Smalltalk11);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk12', '... nie powinieneś wierzyć we wszystko ...', 1, 1, 9, null, 0, Smalltalk12);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk13', '... nie chciałbym być teraz w jego skórze ...', 1, 1, 9, null, 0, Smalltalk13);
