INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk15', '... niektórzy nigdy się nie nauczą ...', 1, 1, 9, null, 0, Smalltalk15);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk16', '... kiedyś takie sprawy załatwiało się inaczej ...', 1, 1, 9, null, 0, Smalltalk16);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk17', '... ludzie zawsze gadają ...', 1, 1, 9, null, 0, Smalltalk17);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk18', '... mam już dość tej paplaniny ...', 1, 1, 9, null, 0, Smalltalk18);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk19', '... w dzisiejszych czasach na nikim nie można polegać, ot co! ...', 1, 1, 9, null, 0, Smalltalk19);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk20', '... to się chyba nigdy nie skończy ...', 1, 1, 9, null, 0, Smalltalk20);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk21', '... tak, pewnie masz rację ...', 1, 1, 9, null, 0, Smalltalk21);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk22', '... czekaj. Lepiej się w nic nie pakować ...', 1, 1, 9, null, 0, Smalltalk22);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk23', '... myślałem, że to się skończyło już dawno temu ...', 1, 1, 9, null, 0, Smalltalk23);
INSERT INTO recordings (wave, transcipt, game_id, source_file_id, voice_id, guild_id, npc_id, title) VALUES ('SVM_9_Smalltalk24', '... pogadajmy lepiej o czymś innym ...', 1, 1, 9, null, 0, Smalltalk24);
